INSERT INTO `t_han_nga` VALUES (1, '黨;曉;哲;知', '昌', '黨[昌]、曉、哲，知也。楚謂之黨，1或曰曉，齊宋之閒謂之哲。', '[郭注-1]：黨朗也，解寤貌。', '卷一', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2, '虔;𠐛;慧;謾;貍;倢;隋;黠;鬼', '丯;疌;詑', '虔[丯]、𠐛，1慧也。2秦謂之謾，34晉謂之㦟{貍}，5宋楚之閒謂之倢[疌]，6楚或謂之䜏{隋}[詑]。78自關而東趙魏之閒謂之黠，或謂之鬼。9', '[音義-1]：音翾。\n[郭注-2]：謂慧了[憭]，\n[郭注-3]：言謾詑。\n[音義-4]：謾，莫錢反，又亡山反。𧦧，大和反。\n[音義-5]：音悝，或莫佳反。\n[郭注-6]：言便倢也。\n[郭注-7]：亦今通語。\n[音義-8]：他和反。\n[郭注-9]：言鬼衇也。', '卷一', '方言', '1;6;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (3, '娥;嬴;好;媌;姣;姝;丰;妍', '', '娥、㜲{嬴}，好也。秦曰娥，1宋衞之閒謂之㜲，23秦晉之閒凡好而輕者謂之娥。自關而東河濟之閒謂之媌，45或謂之姣。67趙魏燕代之閒曰姝，89或曰妦{丰}。1011自關而西秦晉之故都曰妍。1213好，其通語也。', '[郭注-1]：言娥娥也。\n[郭注-2]：言㜲㜲也。\n[音義-3]：㜲音盈。\n[郭注-4]：今關西人呼好爲媌。\n[音義-5]：莫交反。\n[郭注-6]：言姣潔也。\n[音義-7]：音狡。\n[郭注-8]：亦四方通語。\n[音義-9]：姝，昌朱反，又音株。\n[郭注-10]：言妦容也。\n[音義-11]：音蜂。\n[郭注-12]：秦舊都，今扶風雍丘也。晉舊都，今太原晉陽縣也。其俗通呼好爲妍。\n[音義-13]：五千反。一作忓。', '卷一', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (4, '烈;𣡌;餘;肄', '', '烈、枿{𣡌}，餘也。1陳鄭之閒曰枿，2晉衞之閒曰烈，秦晉之閒曰肄，34或曰烈。', '[郭注-1]：謂遺餘也。\n[音義-2]：五割反。\n[郭注-3]：傳曰：「夏肄是屏。」\n[音義-4]：音謚。', '卷一', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (5, '台;胎;陶;鞠;養;艾', '宧;匋;𡫬', '台[宧]、胎、陶[匋]、鞠[𡫬]，養也。晉衞燕魏曰台，12陳楚韓鄭之閒曰鞠，秦或曰陶，汝潁梁宋之閒曰胎，或曰艾。3', '[郭注-1]：台猶頤也。\n[音義-2]：音怡。\n[郭注-3]：爾雅云：「艾，養也。」。', '卷一', '方言', '1;3;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (6, '憮;奄;憐;牟;愛', '𢜮;㤅', '憮、㤿{奄}、憐、牟[𢜮]，愛[㤅]也。韓鄭曰憮，1晉衞曰㤿，23汝潁之閒曰憐，宋魯之閒曰牟，或曰憐。憐，通語也。', '[音義-1]：亡輔反。\n[郭注-2]：㤿憸，多意氣也。\n[音義-3]：音淹。', '卷一', '方言', '4;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (7, '夌;憮;矜;悼;憐;哀', '憐;憐', '㥄{夌}[憐]、憮、矜[憐]、悼、憐，哀也。齊魯之閒曰矜，陳楚之閒曰悼，趙魏燕代之閒曰㥄，12自楚之北郊曰憮，秦晉之閒或曰矜，或曰悼。', '[郭注-1]：㥄亦憐耳。\n[音義-2]：音陵。', '卷一', '方言', '1;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (8, '咺;唏;勺;怛;痛;唴良;噭咷;喑;惄', '咷', '咺、唏、㣿{勺}[咷]、1怛，痛也。凡哀泣而不止曰咺，哀而不泣曰唏。於方：則楚言哀曰唏，2燕之外鄙朝鮮洌水之閒少兒泣而不止曰咺。3456自關而西秦晉之閒凡大人少兒泣而不止謂之唴。哭極音絶亦謂之唴。平原謂啼極無聲謂之唴哴{唴良}。78楚謂之噭咷。9齊宋之閒謂之喑，10或謂之惄。11', '[音義-1]：音的，一音灼。\n[音義-2]：虛几反。\n[郭注-3]：鄙，邊邑名。朝鮮，今樂浪郡是也。洌水，在遼東，\n[音義-4]：音烈。\n[郭注-5]：少兒，猶言小兒。\n[音義-6]：咺，香遠反。\n[郭注-7]：今關西語亦然。\n[音義-8]：唴，丘尙反。哴，音亮。\n[音義-9]：叫逃兩音。字或作叴，音求。\n[音義-10]：音蔭。\n[音義-11]：惄，奴歴反。', '卷一', '方言', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (9, '悼;惄;悴;憖;傷', '', '悼、惄、悴、憖，傷也。自關而東汝潁陳楚之閒通語也。汝謂之惄，秦謂之悼，宋謂之悴，楚潁之閒謂之憖。12', '[郭注-1]：詩曰：「不憖遺一老。」亦恨傷之言也。\n[音義-2]：魚吝反。', '卷一', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (10, '愼;濟;憯;惄;溼;桓;憂', '疾;咺', '愼、濟[疾]、䁮{憯}、惄、溼、桓[咺]，憂也。宋衞或謂之愼，或曰䁮。12陳楚或曰溼，或曰濟。自關而西秦晉之閒或曰惄，或曰溼。自關而西秦晉之閒凡志而不得、欲而不獲、高而有墜、得而中亡謂之溼，34或謂之惄。', '[郭注-1]：䁮者，憂而不動也。\n[音義-2]：作念反。\n[郭注-3]：溼者，失意潛沮之名。\n[音義-4]：沮，一作阻。', '卷一', '方言', '2;6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (11, '鬱悠;懷;惄;惟;慮;願;念;靖;愼;思', '愿', '鬱悠、懷、惄、惟、慮、願[愿]、念、靖、愼，思也。晉宋衞魯之閒謂之鬱悠。1惟，凡思也。慮，謀思也。願，欲思也。念，常思也。東齊海岱之閒曰靖，2秦晉或曰愼。凡思之貌亦曰愼，3或曰惄。', '[郭注-1]：鬱悠，猶鬱陶也。\n[郭注-2]：岱，太山。\n[郭注-3]：謂感思者之容。', '卷一', '方言', '6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (12, '敦;豐;厖;𡗦;幠;般;嘏;奕;戎;京;奘;將;大;夏', '惇;𣞤;鞶;濃;壯;嘏', '敦[惇]、豐、厖、𡗦、幠[𣞤]、般[鞶]、1嘏、奕、戎[濃]、京、奘、將[壯]，大也。凡物之大貌曰豐。厖，2深之大也。東齊海岱之閒曰𡗦，3或曰幠。4宋魯陳衞之閒謂之嘏，5或曰戎。秦晉之閒凡物壯大謂之嘏，或曰夏[嘏]。秦晉之閒凡人之大謂之奘，6或謂之壯。燕之北鄙齊楚之郊或曰京，或曰將。皆古今語也。7初別國不相往來之言也，今或同，而舊書雅記故俗語不失其方，8而後人不知，故爲之作釋也。9', '[音義-1]：音般桓。\n[音義-2]：音鴟𪁪。\n[音義-3]：音介。\n[音義-4]：海狐反。\n[音義-5]：音賈。\n[音義-6]：在朗反。\n[郭注-7]：語聲轉耳。\n[郭注-8]：皆本其言之所出也。雅，爾雅也。\n[郭注-9]：釋詁、釋言之屬。', '卷一', '方言', '1;5;6;9;12;14', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (13, '假;格;懷;摧;詹;戾;艐;至', '徦;瞻', '假[徦]、𢓜{格}、懷、摧、詹[瞻]、戾、艐，至也。邠唐冀兗之閒曰假，12或曰𢓜。3齊楚之會郊或曰懷。4摧、詹、戾，楚語也。5艐，6宋語也。皆古雅之别語也，7今則或同。', '[郭注-1]：邠，今在始平漆縣。唐，今在太原晉陽縣。\n[音義-2]：假，音駕。\n[郭注-3]：古格字。\n[郭注-4]：兩境之閒。\n[郭注-5]：詩曰：「先祖于摧」「六日不詹」「魯侯戾止」之謂也。此亦方國之語，不專在楚也。\n[郭注-6]：古屆字。\n[郭注-7]：雅，謂風雅。', '卷一', '方言', '1;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (14, '嫁;逝;徂;適;往', '', '嫁、逝、徂、適，往也。自家而出謂之嫁，由女而出爲嫁也。逝，秦晉語也。徂，齊語也。適，宋魯語也。往，凡語也。', '', '卷一', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (15, '謾台;脅鬩;懼;嘽咺', '憚吅', '謾台、脅鬩，懼也。燕代之閒曰謾台，1齊楚之閒曰脅鬩。宋衞之閒凡怒而噎噫，23謂之脅鬩。45南楚江湘之閒謂之嘽咺[憚吅]。67', '[音義-1]：蠻怡二音。\n[郭注-2]：噎噫謂憂也。\n[音義-3]：噫，央媚反。\n[郭注-4]：脅鬩猶𤄎沭也。\n[音義-5]：鬩，呼鬲反。\n[郭注-6]：湘，水名，今在零陵。\n[音義-7]：咺，音香遠反。', '卷一', '方言', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (16, '虔;劉;慘;惏;殺;殘;貪;歁', '丯', '虔[丯]、劉、慘、㨆{惏}，12殺也。秦晉宋衞之閒謂殺曰劉，晉之北鄙亦曰劉。秦晉之北鄙、燕之北郊、翟縣之郊謂賊爲虔。3晉魏河内之北謂㨆曰殘，楚謂之貪，南楚江湘之閒謂之歁。4', '[郭注-1]：今關西人呼打爲㨆。\n[音義-2]：音廩，或洛感反。\n[郭注-3]：今上黨潞縣卽古翟國。\n[郭注-4]：言歁㨆難猒也。', '卷一', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (17, '亟;憐;憮;奄;愛', '㥛;㤅', '亟[㥛]、憐、憮、㤿{奄}，愛[㤅]也。東齊海岱之閒曰亟。自關而西秦晉之閒凡相敬愛謂之亟，1陳楚江淮之閒曰憐，宋衞邠陶之閒曰憮，或曰㤿。2', '[音義-1]：欺革反。\n[郭注-2]：陶唐，晉都處。', '卷一', '方言', '1;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (18, '眉;棃;耋;老;耉鮐', '', '眉、棃、耋、鮐，老也。東齊曰眉，1燕代之北鄙曰棃，2宋衞兗豫之内曰耋，34秦晉之郊陳兗之會曰耉鮐。56', '[郭注-1]：言秀眉也。\n[郭注-2]：言面色似凍棃。\n[郭注-3]：八十爲耋。\n[音義-4]：音絰。\n[郭注-5]：言背皮如鮐魚。\n[音義-6]：耉，音垢。', '卷一', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (19, '脩;駿;融;繹;尋;延;長;充;永', '攸;峻', '脩[攸]、駿[峻]、融、繹、尋、延，長也。陳楚之閒曰脩，海岱大野之閒曰尋，1宋衞荆吳之閒曰融。自關而西秦晉梁益之閒凡物長謂之尋。周官之法，度廣爲尋，2幅廣爲充。3延、永，長也。凡施于年者謂之延，施于衆長謂之永。4', '[郭注-1]：大野，今高平鉅野。\n[郭注-2]：度，謂絹帛橫廣。\n[郭注-3]：爾雅曰：「緇廣充幅。」\n[郭注-4]：各隨事爲義。', '卷一', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (20, '允;訦;恂;展;諒;穆;信', '眞;睦', '允、訦、恂、展[眞]、諒、穆[睦]，信也。齊魯之閒曰允，燕代東齊曰訦，1宋衞汝潁之閒曰恂，2荆吳淮汭之閒曰展，34西甌毒屋黃石野之閒曰穆。567衆信曰諒，8周南召南衞之語也。', '[音義-1]：音諶。\n[音義-2]：音荀。\n[郭注-3]：汭，水口也。\n[音義-4]：音芮。\n[郭注-5]：西甌，駱越别種也，\n[音義-6]：音嘔。\n[郭注-7]：其餘皆未詳所在。\n[音義-8]：諒，音亮。', '卷一', '方言', '4;6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (21, '碩;沈;巨;濯;訏;敦;夏;于;大;寇;夥;過;僉;劒;弩;郴', '甚;鉅;卓;惇;嘏;僉;怒;闖', '碩、沈[甚]、巨[鉅]、濯[卓]、訏、敦[惇]、夏[嘏]、于，大也。齊宋之閒曰巨，曰碩。凡物盛多謂之寇。1齊宋之郊、楚魏之際曰夥。2自關而西秦晉之閒凡人語而過謂之𨘌{過}，3或曰僉。東齊謂之劒[僉]，或謂之弩[怒]。弩猶怒也。陳鄭之閒曰敦，荆吳揚甌之郊曰濯，中齊西楚之閒曰訏。45自關而西秦晉之閒凡物之壯大者而愛偉之謂之夏，周鄭之閒謂之假。6郴[闖]，齊語也。7于，通語也。', '[郭注-1]：今江東有小鳬，其多無數，俗謂之寇鳧。\n[音義-2]：音禍。\n[音義-3]：于果反。\n[郭注-4]：西楚，謂今汝南彭城。\n[音義-5]：訏亦作芋，音義同耳，香于反。\n[音義-6]：音賈。\n[音義-7]：洛含反。', '卷一', '方言', '2;3;4;6;7;14;15;16', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (22, '抵;致;會', '', '抵、𠊷{致}，會也。雍梁之閒曰抵，秦晉亦曰抵。1凡會物謂之𠊷。2', '[音義-1]：音觸牴。\n[音義-2]：𠊷，音致。', '卷一', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (23, '華;𠌶;盛', '', '華、荂{𠌶}，晠{盛}也。齊楚之閒或謂之華，或謂之荂。12', '[郭注-1]：荂亦華别名。\n[音義-2]：音誇。', '卷一', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (24, '墳;大', '歕', '墳[歕]，地大也。青幽之閒凡土而高且大者謂之墳。1', '[郭注-1]：卽大陵也。', '卷一', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (25, '𩫖;幕', '', '張小使大謂之廓{𩫖}，陳楚之閒謂之摸{幕}。1', '[音義-1]：音莫。', '卷一', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (26, '嬛;蟬;臽;撚;未;續', '繯;嬗', '𡣱{嬛}[繯]、蟬[嬗]、䌪{臽}、1撚、2未，續也。楚曰𡣱。3蟬，出也。4楚曰蟬，或曰未及也。', '[音義-1]：音剡。\n[音義-2]：諾典反。\n[音義-3]：火全反。\n[郭注-4]：別異義。', '卷一', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (27, '𨃚;䠛;𧿳;跳;折;蹠', '𧼪', '𨃚、䠛、𧿳，1跳也。楚曰䟷{折}[𧼪]。23陳鄭之閒曰䠛，4楚曰蹠。自關而西秦晉之閒曰跳，或曰𨃚。56', '[音義-1]：音拂。\n[郭注-2]：亦中州語。\n[音義-3]：勑厲反。\n[音義-4]：音逍遙。\n[郭注-5]：古塌字。\n[音義-6]：他匣切。', '卷一', '方言', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (28, '躡;郅;跂;格;躋;䟑;登', '陟', '躡、郅[陟]、跂、𢓜{格}、躋、䠯{䟑}，1登也。自關而西秦晉之閒曰躡，東齊海岱之閒謂之躋，2魯衞曰郅，3梁益之閒曰𢓜，4或曰跂。5', '[音義-1]：音踊躍。\n[音義-2]：音濟渡。\n[音義-3]：音質。\n[郭注-4]：𢓜亦訓來。\n[音義-5]：跂，音企。', '卷一', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (29, '逢;逆;迎', '', '逢、逆，迎也。自關而東曰逆，自關而西或曰迎，或曰逢。', '', '卷一', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (30, '尋;搴;摭;挻;取;篡', '', '撏{尋}、攓{搴}、摭、挻，取也。南楚曰攓，1陳宋之閒曰摭，2衞魯揚徐荆衡之郊曰撏。34自關而西秦晉之閒凡取物而逆謂之篡，5楚部或謂之挻。6', '[音義-1]：音蹇。\n[音義-2]：音盜蹠。\n[郭注-3]：衡，衡山，南岳名，今在長沙。\n[音義-4]：撏，常含反。\n[音義-5]：音饌。\n[音義-6]：羊羶反。', '卷一', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (31, '餥;飵;食;䬯;䭡䭓', '', '餥、飵，食也。陳楚之内相謁而食麥饘謂之餥，12楚曰飵。3凡陳楚之郊南楚之外相謁而飧或曰飵，4或曰䬯。5秦晉之際河陰之閒曰䭡䭓。67此秦語也。8', '[郭注-1]：謁，請也。饘，糜也，\n[音義-2]：音旃。餥，音非。\n[音義-3]：音昨。\n[郭注-4]：晝飯爲飧。\n[音義-5]：音黏。\n[郭注-6]：今馮翊郃陽河東龍門是其處也。\n[音義-7]：䭡，惡恨反。䭓，五恨反。\n[郭注-8]：今關西人呼食欲飽爲䭡䭓。', '卷一', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (32, '勉;薄努;勉努;愐釗;勖茲', '迫努;愐劭;勖孜', '釗、薄，勉也。1秦晉曰釗，或曰薄。故其鄙語曰薄努，猶勉努也。2南楚之外曰薄努[迫努]，自關而東周鄭之閒曰勔釗{愐釗}[愐劭]，3齊魯曰勖茲[勖孜]。4', '[郭注-1]：相勸勉也。\n[郭注-2]：如今人言努力也。\n[音義-3]：勔，音沈湎。釗，居遼反。\n[郭注-4]：勖勔，亦訓勉也。', '卷一', '方言', '2;4;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (33, '陗;嫽;好', '', '釥{陗}、嫽，好也。靑徐海岱之閒曰釥，1或謂之嫽。23好，凡通語也。', '[音義-1]：錯眇反。\n[郭注-2]：今通呼小姣潔喜好者爲嫽釥。\n[音義-3]：洛夭反。', '卷二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (34, '朦;厖;豐;伃;杼', '厖;眝;眝', '朦[厖]、厖，豐也。自關而西秦晉之閒凡大貌謂之朦，1或謂之厖；2豐，其通語也。趙魏之郊、燕之北鄙凡大人謂之豐人。燕記曰：豐人杼首。杼首，長首也。楚謂之伃[眝]，燕謂之杼[眝]。3燕趙之閒言圍大謂之豐。4', '[音義-1]：忙紅反；\n[音義-2]：音鴟𪁪；\n[音義-3]：音序；\n[郭注-4]：謂度圍物也。', '卷二', '方言', '1;4;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (35, '娃;嫷;窕;豔;美;好;娥', '', '娃、嫷、窕、豔，美也。吳楚衡淮之閒曰娃，1南楚之外曰嫷，23宋衞晉鄭之閒曰豔，陳楚周南之閒曰窕。4自關而西秦晉之閒凡美色或謂之好，或謂之窕。故吳有館娃之宮，秦有㯃娥之臺。56秦晉之閒美貌謂之娥，7美狀爲窕，8美色爲豔，9美心爲窈。10', '[音義-1]：烏佳反；\n[郭注-2]：言婑嫷也；\n[音義-3]：諾過反；\n[音義-4]：徒了反；\n[郭注-5]：皆戰國時諸侯所立也。\n[音義-6]：㯃，音七；\n[郭注-7]：言娥娥也；\n[郭注-8]：言閑都也；\n[郭注-9]：言光豔也；\n[郭注-10]：言幽靜也。', '卷二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (36, '奕;僷;容', '僷', '奕[僷]、僷，容也。1自關而西凡美容謂之奕，或謂之僷。2宋衞曰僷，陳楚汝潁之閒謂之奕。', '[郭注-1]：皆輕麗之貌。\n[音義-2]：音葉。', '卷二', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (37, '𥌗;鑠;盱;揚;𠈪;雙;順;𥌭', '繚;𠈪;訓', '䫵{𥌗}、鑠[繚]、盱、揚[𠈪]、𥉋{𠈪}、雙也。南楚江淮之閒曰䫵，1或曰𥉋。2好目謂之順[訓]，3黸瞳之子謂之𥌣{𥌭}。4宋衞韓鄭之閒曰鑠。56燕代朝鮮洌水之閒曰盱，78或謂之揚。9', '[音義-1]：音緜。下作𥌣，音字同耳；\n[音義-2]：音滕；\n[郭注-3]：言流澤也；\n[郭注-4]：黸，黑也；言𥌣邈也；\n[郭注-5]：言光明也；\n[音義-6]：舒灼反；\n[郭注-7]：謂舉眼也；\n[音義-8]：香于反；\n[郭注-9]：詩曰：「美目揚兮」是也。此本論雙耦，因廣其訓，復言目耳。', '卷二', '方言', '2;4;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (38, '嫢;笙;揫;摻;細;徥', '', '嫢、笙、揫、摻，細也。自關而西秦晉之閒凡細而有容謂之嫢，12或曰徥。34凡細貌謂之笙，斂物而細謂之揫，5或曰摻。6', '[郭注-1]：嫢嫢，小成貌；\n[音義-2]：羌箠反；\n[郭注-3]：言徥𢔡也。\n[音義-4]：度指反。\n[音義-5]：揫，音遒；\n[音義-6]：摻，素㩜反；', '卷二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (39, '傀;渾;濞;䑋;廫;泡;盛', '咆', '𠐤{傀}、渾、12䑄{濞}、34䑋、𠐋{廫}、泡[咆]，盛也。𠐤，5自關而西秦晉之閒語也。陳宋之閒曰𠐋，67江淮之閒曰泡，89秦晉或曰䑋，梁益之閒凡人言盛及其所愛，偉其肥晠謂之䑋。1011', '[郭注-1]：們渾，肥滿也。\n[音義-2]：狐本反；\n[郭注-3]：䑄呬，充壯也。\n[音義-4]：匹四反；\n[郭注-5]：言瓌瑋也；\n[郭注-6]：𠐋𠈭，麤大貌；\n[音義-7]：恪膠反；\n[郭注-8]：泡肥，洪張貌；\n[音義-9]：音庖；\n[郭注-10]：肥䑋多肉。\n[音義-11]：音壤；', '卷二', '方言', '6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (40, '私;策;纖;兌;稺;杪;小;綾;靡;蔑;葼', '厶;朿;𦺶;糜', '私[厶]、策[朿]、纖、䓲{兌}[𦺶]、稺、杪，小也。自關而西秦晉之郊梁益之閒凡物小者謂之私，或曰纖，繒帛之細者謂之纖。東齊言布帛之細者曰綾，1秦晉曰靡[糜]。2凡草生而初達謂之䓲。34稺，5年小也。木細枝謂之杪，67江淮陳楚之内謂之蔑，8青齊兗冀之閒謂之葼，9燕之北鄙朝鮮洌水之間謂之策。故傳曰：慈母之怒子也，雖折葼笞之，其惠存焉。10', '[音義-1]：音凌；\n[郭注-2]：靡，細好也；\n[郭注-3]：鋒萌始出；\n[音義-4]：音銳；\n[郭注-5]：古稚字；\n[郭注-6]：言杪梢也；\n[音義-7]：莫召反；\n[郭注-8]：蔑，小貌也；\n[音義-9]：音馬𩭤；\n[郭注-10]：言敎在其中也。', '卷二', '方言', '1;2;4;9', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (41, '奄;枼;微', '', '殗{奄}、殜{枼}，微也。宋衞之閒曰殗。自關而西秦晉之閒凡病而不甚曰殗殜。12', '[郭注-1]：病半臥半起也。\n[音義-2]：殗，於怯反；殜，音葉；', '卷二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (42, '臺;敵;匹', '持', '臺[持]、敵，匹也。1東齊海岱之閒曰臺，自關而西秦晉之閒物力同者謂之臺敵。', '[音義-1]：匹，一作疋。', '卷二', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (43, '捊嬎;耦', '勽嬎', '抱㛯{捊嬎}[勽嬎]，耦也。1荆吳江湖之閒曰抱㛯，2宋潁之閒或曰㛯。', '[郭注-1]：耦亦匹，互見其義耳。\n[音義-2]：抱，音赴；㛯，孚萬反，一作婏；', '卷二', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (44, '倚;踦;奇', '奇', '倚[奇]、踦，奇也。1自關而西秦晉之閒凡全物而體不具謂之倚，2梁楚之閒謂之踦，雍梁之西郊凡嘼支體不具者謂之踦。3', '[音義-1]：音奇耦。\n[音義-2]：於寄反；\n[音義-3]：卻奇反。', '卷二', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (45, '逴;𤡯;透;驚', '倏', '逴、𤡯、透[倏]，驚也。1自關而西秦晉之閒凡蹇者或謂之逴，23體而偏長短亦謂之逴。宋衞南楚凡相驚曰𤡯，4或曰透。5', '[郭注-1]：皆驚貌也。\n[郭注-2]：行略逴也；\n[音義-3]：勑略反；\n[音義-4]：音鑠；\n[音義-5]：式六反；', '卷二', '方言', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (46, '儀;格;來;懷', '', '儀、𢓜{格}，來也。陳潁之閒曰儀，自關而東周鄭之郊齊魯之閒或謂之𢓜，或曰懷。', '', '卷二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (47, '䵒;𡫽;黏', '', '䵑{䵒}、𪏮{𡫽}，黏也。齊魯靑徐自關而東或曰䵑，12或曰𪏮。3', '[郭注-1]：言黏䵑也。\n[音義-2]：音昵；\n[音義-3]：音汝；', '卷二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (48, '餬;託;庇;寓;𠈪;寄', '', '餬、託、庇、寓、媵{𠈪}，寄也。齊衞宋魯陳晉汝潁荆州江淮之閒曰庇，1或曰寓。寄食爲餬。23凡寄爲託，寄物爲媵。4', '[郭注-1]：庇蔭；\n[郭注-2]：傳曰：「餬其口于四方。」是也。\n[音義-3]：音胡；\n[音義-4]：音孕；', '卷二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (49, '逞;苦;了;快', '憭', '逞、苦、了[憭]，快也。自山而東或曰逞，楚曰苦，1秦曰了。23', '[郭注-1]：苦而爲快者，猶以臭爲香、治爲亂、徂爲存，此訓義之反覆用之是也；\n[郭注-2]：今江東呼快爲愃，\n[音義-3]：相緣反。', '卷二', '方言', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (50, '每;匿;赧;愧', '瞢;𢘋', '挴{每}[瞢]、㥾{匿}[𢘋]、赧，愧也。晉曰挴，或曰㥾。秦晉之閒凡愧而見上謂之赧，1梁宋曰㥾。23', '[郭注-1]：小雅曰：「面赤愧曰赧。」；\n[郭注-2]：敕㥾，亦慙貌也。\n[音義-3]：音匿。', '卷二', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (51, '叨;惏;殘', '', '叨、1惏，2殘也。陳楚曰惏。', '[音義-1]：託高反；\n[音義-2]：洛含反。', '卷二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (52, '馮;齘;苛;怒', '訶', '馮、齘、苛[訶]，怒也。楚曰馮，1小怒曰齘。2陳謂之苛。3', '[郭注-1]：馮，恚盛貌。楚辭曰：「康回馮怒。」；\n[郭注-2]：言噤齘也；\n[郭注-3]：相苛責也。', '卷二', '方言', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (53, '朿;剌;痛', '', '憡{朿}、剌，痛也。自關而西秦晉之閒或曰憡。12', '[郭注-1]：㦧憡，小痛也。\n[音義-2]：音策。', '卷二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (54, '撟捎;選', '', '撟捎，選也。1自關而西秦晉之閒凡取物之上謂之撟捎。2', '[郭注-1]：此妙擇積聚者也。\n[音義-2]：矯騷兩音。', '卷二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (55, '僩;梗;爽;猛', '更/庚', '撊{僩}、梗[更/庚]、爽，猛也。晉魏之閒曰撊，12韓趙之閒曰梗，3齊晉曰爽。', '[郭注-1]：傳曰：「撊然登埤。」\n[音義-2]：呼旱反；\n[音義-3]：音魚鯁；', '卷二', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (56, '瞯;睇;睎;䀩;眄', '', '瞯、睇、睎、䀩，眄也。陳楚之閒南楚之外曰睇，1東齊靑徐之閒曰睎，吳揚江淮之閒或曰瞯，2或曰䀩，3自關而西秦晉之閒曰眄。', '[音義-1]：音悌；\n[音義-2]：音閑；\n[音義-3]：音略。', '卷二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (57, '息;喙;呬;息', '喟', '䭒{息}、喙[喟]、呬，息也。周鄭宋沛之閒曰䭒，自關而西秦晉之閒或曰喙，1或曰䭒，2東齊曰呬。3', '[音義-1]：音口喙；\n[音義-2]：音消息；\n[音義-3]：呬，許四反。', '卷二', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (58, '𠂢;規;裁;斲', '撝', '䤨{𠂢}、摫{規}[撝]，裁也。1梁益之閒裁木爲器曰䤨，2裂帛爲衣曰摫。3䤨又斲也，晉趙之閒謂之䤨。', '[郭注-1]：皆析破之名也。\n[音義-2]：音劈歷；\n[音義-3]：摫，音規；', '卷二', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (59, '鐫;椓', '', '鐫，㧻{椓}也。晉趙謂之鐫。12', '[郭注-1]：謂鏨鐫也。\n[音義-2]：鐫，子旋反。', '卷二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (60, '鍇;稽;堅', '', '鍇、𨯀{稽}，堅也。自關而西秦晉之閒曰鍇，1吳揚江淮之閒曰𨯀。2', '[郭注-1]：音楷；\n[音義-2]：音啓。', '卷二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (61, '揄鋪;𢅡巫;帗縷;葉褕;毳', '𢅡幠', '揄鋪、𢅡𢃀{𢅡巫}[𢅡幠]、帗縷、葉褕，毳也。12荆揚江湖之閒曰揄鋪，3楚曰𢅡𢃀，4陳宋鄭衞之閒謂之帗縷，5燕之北郊朝鮮洌水之閒曰葉褕。67', '[郭注-1]：皆謂物之扞蔽也；\n[音義-2]：音脆。\n[音義-3]：音敷；\n[音義-4]：音藍；\n[音義-5]：音拂；\n[郭注-6]：今名短度絹爲葉褕也。\n[音義-7]：音臾；', '卷二', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (62, '孑;㶳;餘;俊;遵', '尊', '孑、藎{㶳}，餘也。1周鄭之閒曰藎，或曰孑。靑徐楚之閒曰孑。自關而西秦晉之閒炊薪不盡曰藎。2孑，俊也。遵[尊]，俊也。3', '[郭注-1]：謂遺餘；\n[音義-2]：昨吝反；\n[郭注-3]：廣異語耳。', '卷二', '方言', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (63, '翿;幢;翳', '橦', '翿、幢[橦]，翳也。楚曰翿，12關西關東皆曰幢。3', '[郭注-1]：舞者所以自蔽翳也。\n[音義-2]：音濤；\n[音義-3]：徒江反；', '卷二', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (64, '𢯱;略;求;攈;拓', '', '𢯱、略，求也。秦晉之閒曰𢯱，就室曰𢯱，於道曰略。略，强取也。攈、1摭{拓}，2取也。此通語也。', '[郭注-1]：古捃字；\n[音義-2]：音盜蹠。', '卷二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (65, '朚;矜;奄;遽', '拮;弇', '茫{朚}、矜[拮]、奄[弇]，遽也。1吳揚曰茫，23陳潁之閒曰奄，秦晉或曰矜，或曰遽。', '[郭注-1]：謂遽矜也；\n[郭注-2]：今北方通然也。\n[音義-3]：莫光反。', '卷二', '方言', '2;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (66, '速;逞;搖扇;疾', '', '速、逞、搖扇，疾也。東齊海岱之閒曰速，燕之外鄙朝鮮洌水之閒曰搖扇，楚曰逞。', '', '卷二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (67, '予;賴;讎', '讕', '予、賴[讕]，讎也。南楚之外曰賴，1秦晉曰讎。', '[郭注-1]：賴亦惡名。', '卷二', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (68, '恒慨;蓡綏;羞繹;紛毋;廣大', '', '恒慨、蔘綏{蓡綏}、羞繹、紛毋，言既廣又大也。荆揚之閒凡言廣大者謂之恒慨，東甌之閒謂之蔘綏，12或謂之羞繹、3紛毋。', '[郭注-1]：東甌亦越地，今臨海永寧是也。\n[音義-2]：蔘，索含反；\n[音義-3]：繹，音奕；', '卷二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (69, '劋;蹶;獪;蔿;姡', '訬;獪;僞;獪', '劋[訬]、蹶[獪]，獪也。秦晉之閒曰獪；1楚謂之劋，2或曰蹶；3楚鄭曰蔿[僞]，45或曰姡[獪]。67', '[郭注-1]：古狡㹟字；\n[音義-2]：劋，雀燎反，又子了反；\n[音義-3]：音踣蹶；\n[郭注-4]：亦獪聲之轉也；\n[音義-5]：音指撝。\n[郭注-6]：言黠姡也，今建平郡人呼狡爲姡。\n[音義-7]：胡刮切。', '卷二', '方言', '1;2;4;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (70, '釐孶;連子;孿生;嫁子', '𠩺孳', '陳楚之閒凡人嘼乳而雙產謂之釐孶[𠩺孳]，1秦晉之間謂之僆子{連子}，2自關而東趙魏之間謂之孿生。3女謂之嫁子。4', '[音義-1]：音茲；\n[音義-2]：音輦；\n[音義-3]：蘇官反；\n[郭注-4]：言往適人。', '卷三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (71, '壻;倩', '', '東齊之間聟{壻}謂之倩。12', '[郭注-1]：言可借倩也。\n[音義-2]：今俗呼女壻爲卒便是也。', '卷三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (72, '娠', '', '燕齊之閒養馬者謂之娠，1官婢女廝謂之娠。23', '[郭注-1]：今之温厚也。\n[郭注-2]：女廝，婦人給使者，亦名娠。\n[音義-3]：音振。', '卷三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (73, '亭父;亭公;卒;弩父;褚', '', '楚東海之間亭父謂之亭公。1卒謂之弩父，2或謂之褚。34', '[郭注-1]：亭民；\n[郭注-2]：主擔幔弩導幨，因名云；\n[郭注-3]：言衣赤也。\n[音義-4]：音赭。', '卷三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (74, '臧;甬;侮;獲', '庸', '臧、甬[庸]、侮、獲，奴婢賤稱也。1荆淮海岱雜齊之閒，2罵奴曰臧，罵婢曰獲。齊之北鄙燕之北郊凡民男而聟婢謂之臧，女而婦奴謂之獲；亡奴謂之臧，亡婢謂之獲。皆異方罵奴婢之醜稱也。自關而東陳魏宋楚之閒保庸謂之甬。34秦晉之閒罵奴婢曰侮。', '[郭注-1]：皆爲人所輕弄。\n[郭注-2]：俗不純爲雜；\n[郭注-3]：保，言可保信也；\n[音義-4]：音勇；', '卷三', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (75, '蔿;譌;譁;涅;化', '化;化', '蔿[化]、1譌[化]、2譁、34涅，化也。燕朝鮮洌水之閒曰涅，或曰譁。雞伏卵而未孚、始化之時謂之涅。5', '[音義-1]：音花；\n[音義-2]：音訛言；\n[郭注-3]：皆化聲之轉也；\n[音義-4]：五瓜反；\n[音義-5]：音赴。', '卷三', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (76, '斟;協;汁', '汁', '斟、協[汁]，汁也。1北燕朝鮮洌水之閒曰斟，自關而東曰協，關西曰汁。', '[郭注-1]：謂和協也，或曰潘汁，所未能詳。', '卷三', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (77, '蘇;芥;草;莽;荏;公蕡;害;䖆柔', '丯;艸;茻;丯', '蘇、芥[丯]，草[艸]也。江淮南楚之閒曰蘇，1自關而西或曰草，或曰芥。2南楚江湘之閒謂之莽[茻]。3蘇亦荏也。4關之東西或謂之蘇，或謂之荏。56周鄭之閒謂之公蕡。7沅湘之南或謂之𦵯{害}[丯]，8910其小者謂之䖆葇{䖆柔}。11', '[郭注-1]：漢書曰：「樵蘇而爨。」蘇猶蘆，語轉也；\n[郭注-2]：或言菜也；\n[音義-3]：嫫母反。\n[郭注-4]：荏屬也。爾雅曰：「蘇，桂荏也。」；\n[郭注-5]：今江東人呼荏爲䓊。\n[音義-6]：音魚；\n[音義-7]：蕡，音翡翠。\n[郭注-8]：今長沙人呼野蘇爲𦵯。\n[音義-9]：音車轄。\n[郭注-10]：沅，水名，在武陵；\n[郭注-11]：荲葇也，亦蘇之種類，因名云。', '卷三', '方言', '2;3;4;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (78, '豐;蕘;蕪菁;大芥;辛芥;幽芥;蘆菔;拉遝', '葑', '蘴{豐}[葑]、蕘，蕪菁也。1陳楚之郊謂之蘴；2魯齊之郊謂之蕘；3關之東西謂之蕪菁；趙魏之郊謂之大芥，其小者謂之辛芥，或謂之幽芥，其紫華者謂之蘆菔。4東魯謂之菈𦿚{拉遝}。5', '[郭注-1]：今江東名爲温菘，實如小豆。\n[音義-2]：蘴，舊音蜂，今江東音嵩，字作菘也；\n[音義-3]：音鈐鐃；\n[音義-4]：羅匐二音；\n[音義-5]：洛荅、徒合兩反。', '卷三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (79, '役;芡;雞頭;鴈頭;烏頭', '', '䓈{役}、芡，雞頭也。北燕謂之䓈，1青徐淮泗之閒謂之芡，2南楚江湘之閒謂之雞頭，或謂之鴈頭，或謂之烏頭。3', '[郭注-1]：今江東亦呼䓈耳；\n[音義-2]：音儉；\n[郭注-3]：狀似烏頭，故轉以名之。', '卷三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (80, '茦;壯;梗;劌;刺;棘', '戕', '凡草木刺人，北燕朝鮮之閒謂之茦。1或謂之壯[戕]。2自關而東或謂之梗，3或謂之劌，45自關而西謂之刺。江湘之閒謂之棘。67', '[郭注-1]：爾雅曰：「茦，刺也。」；\n[郭注-2]：今淮南人亦呼壯。壯，傷也。山海經謂刺爲傷也；\n[郭注-3]：今之梗榆；\n[郭注-4]：劌者，傷割人名。\n[音義-5]：音鱥魚也；\n[郭注-6]：楚辭曰：「曾枝剡棘。」亦通語耳。\n[音義-7]：音己力反。', '卷三', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (81, '瘌;癆;瞑;眩', '', '凡飲藥傅藥而毒，南楚之外謂之瘌，1北燕朝鮮之閒謂之癆，23東齊海岱之閒謂之瞑，或謂之眩。4自關而西謂之毒。瘌，痛也。', '[音義-1]：音乖瘌；\n[郭注-2]：癆、瘌皆辛螫也。\n[音義-3]：音澇；\n[郭注-4]：瞑眩，亦今通語耳。', '卷三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (82, '逞;曉;恔;苦;快', '', '逞、曉、恔、苦，快也。自關而東或曰曉，或曰逞。江淮陳楚之閒曰逞，宋鄭周洛韓魏之閒曰苦，東齊海岱之閒曰恔，1自關而西曰快。', '[郭注-1]：恔卽狡，狡戲亦快事也。', '卷三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (83, '膠;譎;謬;詐', '', '謬、譎，詐也。涼州西南之閒曰膠，自關而東西或曰譎，或曰謬。詐，通語也。12', '[郭注-1]：汝南人呼欺爲讉[囮]，亦曰詒。\n[音義-2]：讉，託回反。詒，音殆。', '卷三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (84, '揠;擢;拂;戎;拔', '拔', '揠、擢、拂[拔]、戎，拔也。自關而西或曰拔，或曰擢。自關而東江淮南楚之閒或曰戎。東齊海岱之閒曰揠。12', '[郭注-1]：今呼拔草心爲揠。\n[音義-2]：烏拔反。', '卷三', '方言', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (85, '慰;廛;度;凥;踐', '宅', '慰、廛、度[宅]，凥也。江淮靑徐之閒曰慰，東齊海岱之閒或曰度，或曰廛，12或曰踐。', '[郭注-1]：周官云：「夫一廛。」宅也。\n[音義-2]：音纏約。', '卷三', '方言', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (86, '萃;雜;集', '', '萃、雜，集也。東齊曰聚。', '', '卷三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (87, '𨽿;遝;及', '', '迨{𨽿}、遝，及也。東齊曰迨，1關之東西曰遝，或曰及。', '[音義-1]：音殆。', '卷三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (88, '荄;杜;根;茇', '土', '荄、12杜[土]，根也。東齊曰杜，3或曰茇。4', '[郭注-1]：今俗名韭根爲荄。\n[音義-2]：音陔。\n[郭注-3]：詩曰：「徹彼桑杜。」是也；\n[音義-4]：音撥。', '卷三', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (89, '班;徹;列', '', '班、徹，列也。北燕曰班，東齊曰徹。', '', '卷三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (90, '瘼;復;病;湛', '', '瘼、癁{復}，病也。東齊海岱之閒曰瘼，1或曰癁，2秦曰瘎{湛}。3', '[音義-1]：音莫；\n[郭注-2]：謂勞復也；\n[音義-3]：音諶。', '卷三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (91, '掩;醜;掍;𪓌;同', '雔', '掩、醜[雔]、掍、綷{𪓌}，同也。江淮南楚之閒曰掩；宋衞之閒曰綷，1或曰掍；2東齊曰醜。', '[音義-1]：作㥽反。\n[音義-2]：音衮衣；', '卷三', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (92, '裕;猷;道', '邎;邎', '裕[邎]、猷[邎]，道也。東齊曰裕，或曰猷。', '', '卷三', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (93, '虔;散;殺', '丯', '虔[丯]、散，殺也。東齊曰散，靑徐淮楚之閒曰虔。', '', '卷三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (94, '氾;浼;㶄;洼;洿;潢', '㶄', '氾[㶄]、浼、㶄、洼，洿也，1潢2自關而東或曰洼，3或曰氾；4東齊海岱之閒或曰浼，5或曰㶄。6', '[郭注-1]：皆洿池也；荆州呼\n[郭注-2]：也。\n[音義-3]：烏蛙反；\n[音義-4]：音汎；\n[音義-5]：音漫；\n[音義-6]：音湯㶄；', '卷三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (95, '庸;恣;侹;更;佚;遞;代', '佽;迭', '庸、恣[佽]、1比、2侹、更、佚[迭]、遞，代也。齊曰佚，3江淮陳楚之閒曰侹，4餘四方之通語也。', '[郭注-1]：今俗亦名更代作爲恣作也。\n[音義-2]：音比次；\n[音義-3]：音蹉跌；\n[音義-4]：音挺直；', '卷三', '方言', '2;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (96, '氓;民', '', '氓，民也。12', '[郭注-1]：民之總名。\n[音義-2]：氓，音萌；', '卷三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (97, '仇;仇', '', '㐜{仇}，仇也。12', '[郭注-1]：謂怨仇也。\n[音義-2]：朹，音舊；', '卷三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (98, '寓;寄', '', '寓，寄也。', '', '卷三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (99, '露;敗', '', '露，敗也。', '', '卷三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (100, '别;治', '', '别，治也。', '', '卷三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (101, '棖;法', '', '棖，法也。1', '[郭注-1]：救傾之法。', '卷三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (102, '謫;怒', '', '謫，怒也。12', '[郭注-1]：相責怒也。\n[音義-2]：謫，音責；', '卷三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (103, '閒;非', '', '閒，非也。', '', '卷三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (104, '格;正', '', '格，正也。', '', '卷三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (105, '𣀷;數', '', '𣀷，數也。1', '[郭注-1]：偶物爲麗，故云數也。', '卷三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (106, '軫;戾', '紾', '軫[紾]，戾也。12', '[郭注-1]：相了戾也。\n[音義-2]：軫，江東音善。', '卷三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (107, '㞕;潔', '絜', '㞕，潔[絜]也。12', '[郭注-1]：謂潔淸也。\n[音義-2]：㞕，音薛；', '卷三', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (108, '諄;罪', '敦', '諄[敦]，罪也。12', '[郭注-1]：謂罪惡也。\n[音義-2]：諄，章順反；', '卷三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (109, '俚;聊', '僇', '俚，聊[僇]也。12', '[郭注-1]：謂苟且也。\n[音義-2]：俚，音吏；', '卷三', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (110, '梱;就', '稛', '梱[稛]，就也。12', '[郭注-1]：梱梱，成就貌。\n[音義-2]：梱，恪本反；', '卷三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (111, '笠;圂', '', '苙{笠}，圂也。12', '[郭注-1]：謂蘭圂也。\n[音義-2]：苙，音立；', '卷三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (112, '叜;隱', '縮', '廋{叜}[縮]，隱也。12', '[郭注-1]：謂隱匿也。\n[音義-2]：廋，音捜索也；', '卷三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (113, '銛;取', '', '銛，取也。12', '[郭注-1]：謂挑取物。\n[音義-2]：銛，音忝；', '卷三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (114, '棖;隨', '', '棖，隨也。1', '[郭注-1]：棖柱令相隨也。', '卷三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (115, '嬯;服;辟', '僰', '儓{嬯}、𧟵{服}[僰]，農夫之醜稱也。南楚凡罵傭賤謂之田儓，12或謂之𧟵，34或謂之辟。辟，商人醜稱也。56', '[郭注-1]：㑣儓，駑鈍貌。或曰「僕臣儓」，亦至賤之號也；\n[音義-2]：音臺；\n[郭注-3]：𧟵，丁健貌也。\n[音義-4]：音僰，廣雅以爲奴，字作僰，音同；\n[郭注-5]：辟辟，便黠貌也。\n[音義-6]：音擘。', '卷三', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (116, '庸;松', '庸', '庸謂之倯{松}[庸]，轉語也。12', '[郭注-1]：倯，猶保倯也。今隴右人名孏爲倯。\n[音義-2]：相容反。', '卷三', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (117, '敗;須捷;褸裂;襤褸;挾斯', '須𧚨;挾澌', '褸裂、須捷、挾斯，敗也。南楚凡人貧衣被醜敝謂之須捷[須𧚨]。1或謂之褸裂，23或謂之襤褸，故左傳曰：「篳路襤褸，以启山林。」殆謂此也。4或謂之挾斯[挾澌]。器物敝亦謂之挾斯。5', '[郭注-1]：須捷，狎翣也；\n[郭注-2]：衣壞貌；\n[音義-3]：音縷；\n[郭注-4]：篳路，柴車；\n[郭注-5]：挾斯，猶挾變也。', '卷三', '方言', '2;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (118, '㯷;鋌;澌;盡;賜', '澌', '𢷏{㯷}、鋌、澌，盡也。南楚凡物盡生者曰𢷏生。12物空盡者曰鋌；3鋌、賜[澌]、4𢷏、澌皆盡也。賜、澌，語之轉也。', '[郭注-1]：今種物皆生云𢷏地生也；\n[音義-2]：音打𢷏；\n[音義-3]：音挺；\n[郭注-4]：亦中國之通語也。', '卷三', '方言', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (119, '㯷;翕;葉;聚', '吸;疊', '𢷏{㯷}、翕[吸]、葉[疊]，聚也。楚謂之𢷏，1或謂之翕。葉，楚通語也。', '[郭注-1]：𢷏屬，藂相著貌。', '卷三', '方言', '2;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (120, '斟;益', '', '斟，益也。1南楚凡相益而又少謂之不斟。凡病少愈而加劇亦謂之不斟，或謂之何斟。2', '[郭注-1]：言斟酌益之；\n[郭注-2]：言雖少損無所益也。', '卷三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (121, '瘥;閒;知;瘉;慧;憭;瘳;蠲;除', '', '差{瘥}、閒、知，愈{瘉}也。南楚病愈者謂之差，或謂之閒，1或謂之知。知，通語也。或謂之慧，或謂之憭，2或謂之瘳，或謂之蠲，34或謂之除。', '[郭注-1]：言有閒隙；\n[郭注-2]：慧、憭，皆意精明；\n[郭注-3]：蠲，亦除也。\n[音義-4]：音涓，一音圭。', '卷三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (122, '襌衣;褋;左衣;裎衣;深衣', '', '襌衣，江淮南楚之閒謂之褋，12關之東西謂之襌衣。有袌者，34趙魏之閒謂之袏衣{左衣}；無袌者謂之裎衣。5古謂之深衣。6', '[郭注-1]：楚辭曰：「遺余褋兮澧浦。」\n[音義-2]：音簡牒；\n[郭注-3]：前施袌囊也。\n[音義-4]：房報反；\n[音義-5]：音逞；\n[郭注-6]：制見禮記。', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (123, '襜褕;童容;裋褕;襤褸;充屈;緻', '𧝉', '襜褕，江淮南楚謂之𧝎褣{童容}，1自關而西謂之襜褕，其短者謂之裋褕，2以布而無緣、敝而紩之謂之襤褸。自關而西謂之䘪䘿{充屈}，34其敝者謂之緻[𧝉]。56', '[音義-1]：𧝎，裳凶反；\n[音義-2]：裋，音豎；\n[郭注-3]：俗名䘿掖。\n[音義-4]：音倔；\n[郭注-5]：緻，縫納敝，故名之也。\n[音義-6]：丁履反。', '卷四', '方言', '6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (124, '汗襦;曾;袛裯;甲襦;襜襦;襌襦', '', '汗襦，12江淮南楚之閒謂之䙢{曾}；3自關而西或謂之袛裯；4自關而東謂之甲襦；陳魏宋楚之閒謂之襜襦，或謂之襌襦。5', '[郭注-1]：亦呼爲掩汗也；\n[音義-2]：襦，廣雅作褕；\n[音義-3]：音甑；\n[音義-4]：袛，音氐。裯，丁牢反。\n[郭注-5]：今或呼衫爲襌襦。', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (125, '帬;帔;罷', '帔', '帬，陳魏之閒謂之帔，1自關而東或謂之襬{罷}[帔]。23', '[音義-1]：音披；\n[郭注-2]：今關西語然也。\n[音義-3]：音碑。', '卷四', '方言', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (126, '蔽厀;褘;袚;大巾;冉', '襜', '蔽厀，江淮之閒謂之褘，1或謂之袚，2魏宋南楚之閒謂之大巾，自關東西謂之蔽厀，齊魯之郊謂之袡{冉}[襜]。3', '[音義-1]：音葦，或暉；\n[音義-2]：音沸；\n[音義-3]：袡，昌詹反。', '卷四', '方言', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (127, '襦;曲領', '', '襦，1西南蜀漢謂之曲領，或謂之襦。', '[郭注-1]：字亦作褕，又襦無右也。', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (128, '㡓;𢃓', '', '褌{㡓}，陳楚江淮之閒謂之䘴{𢃓}。1', '[音義-1]：䘴，息勇反。', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (129, '絝;褰', '', '袴{絝}，齊魯之閒謂之䙭{褰}，12或謂之襱。34關西謂之袴。', '[郭注-1]：傳曰：「徵䙭與襦。」\n[音義-2]：音騫；\n[郭注-3]：今俗呼袴踦爲襱。\n[音義-4]：音鮦魚。', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (130, '褕;袖', '', '褕謂之袖。1', '[郭注-1]：襦䙭有袖者，因名云。', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (131, '及;褗', '襋', '衱{及}[襋]謂之褗。12', '[郭注-1]：卽衣領也。\n[音義-2]：衱褗，劫偃兩音。', '卷四', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (132, '圭;裾', '', '袿{圭}謂之裾。12', '[郭注-1]：衣後裾也。\n[音義-2]：或作袪，廣雅云「衣袖」。', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (133, '褸;衽', '', '褸謂之衽。1', '[郭注-1]：衣襟也。或曰裳際也。', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (134, '褸;緻', '𧝉', '褸謂之緻[𧝉]。1', '[郭注-1]：襤褸，綴結也。', '卷四', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (135, '裯;襤', '', '裯謂之襤。1', '[郭注-1]：袛裯，敝衣，亦謂襤褸；', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (136, '襤;䙃;鼻', '', '無緣之衣謂之襤。無袂之衣謂之䙃。12無𧙥之袴謂之襣{鼻}。3', '[郭注-1]：袂，衣袖也，\n[音義-2]：音藝。䙃，音慢惰；\n[郭注-3]：袴無踦者，卽今犢鼻褌也。𧙥亦襱，字異耳。', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (137, '綃;占', '㡇', '䘯{綃}謂之袩{占}[㡇]。12', '[郭注-1]：未詳其義。\n[音義-2]：所交、丁俠兩反。', '卷四', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (138, '䘳;交', '', '衿{䘳}謂之交。1', '[郭注-1]：衣交領也。', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (139, '裺;襦', '', '裺謂之襦。1', '[音義-1]：裺，尖劍反。', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (140, '襜;掖', '', '襜謂之䘸{掖}。1', '[郭注-1]：衣掖下也。', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (141, '佩紟;裎', '綎', '佩紟謂之裎[綎]。12', '[郭注-1]：所以系玉佩帶也。\n[音義-2]：紟，音禁。', '卷四', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (142, '褸;占', '㡇', '褸謂之袩{占}[㡇]。1', '[郭注-1]：卽衣衽也。', '卷四', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (143, '覆卒;襌衣;偏襌;襌襦', '', '覆䘹{覆卒}謂之襌衣。1偏襌謂之襌襦。2', '[音義-1]：䘹，作憒反；\n[郭注-2]：卽衫也。', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (144, '約纏;襌', '', '𧘑繵{約纏}謂之襌。12', '[郭注-1]：今又呼爲涼衣也。\n[音義-2]：𧘑襌，灼纏兩音。', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (145, '袒飾;直領', '', '袒飾謂之直袊{直領}。12', '[郭注-1]：婦人初嫁，所著上衣直袊也。\n[音義-2]：袒音但。', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (146, '襃明;袍', '', '襃明謂之袍。1', '[郭注-1]：廣雅云：「襃明，長襦也。」。', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (147, '繞領;帬', '', '繞袊{繞領}謂之帬。1', '[郭注-1]：俗人呼接下，江東通言下裳。', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (148, '縣裺;緣', '', '懸裺{縣裺}謂之緣。12', '[郭注-1]：衣縫緣也。\n[音義-2]：裺，音掩。', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (149, '絜襦;蔽厀', '', '絜襦謂之蔽厀。1', '[郭注-1]：廣異名也。', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (150, '陶矞;袖', '', '裪𥛯{陶矞}謂之袖。12', '[郭注-1]：衣褾。江東呼䘼，\n[音義-2]：音婉。𥛯音橘；', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (151, '扈表;被巾', '扈襮', '帍裱{扈表}[扈襮]謂之被巾。12', '[郭注-1]：婦人領巾也。\n[音義-2]：裱，方廟反；', '卷四', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (152, '繞盾;𧛔裺', '', '繞䋸{繞盾}謂之𧞶裺{𧛔裺}。12', '[郭注-1]：衣督脊也。\n[音義-2]：䋸，音循。', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (153, '厲;帶', '烈', '厲[烈]謂之帶。1', '[郭注-1]：小爾雅曰：「帶之垂者爲厲。」', '卷四', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (154, '幡卷;幭', '幡㠾', '襎裷{幡卷}[幡㠾]謂之幭。12', '[郭注-1]：卽帊幞也。\n[音義-2]：襎裷，煩冤兩音；幭，亡别反。', '卷四', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (155, '繄絡;䙔', '', '繄袼{繄絡}謂之䙔。12', '[郭注-1]：卽小兒㳄衣也。\n[音義-2]：翳、洛、漚三音。', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (156, '襤;褸;緻;充屈', '𧝉', '楚謂無緣之衣曰襤，紩衣謂之褸，秦謂之緻[𧝉]。自關而西秦晉之閒無緣之衣謂之䘪䘿{充屈}。1', '[郭注-1]：嫌上說有未了，故復分明之。', '卷四', '方言', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (157, '複襦;裋;桶褺', '', '複襦，江湘之閒謂之𧞀{裋}，1或謂之筩褹{桶褺}。2', '[音義-1]：音豎；\n[郭注-2]：今筩袖之襦也。褹卽袂字耳。', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (158, '絝;到頓;交尞', '', '{絝}大袴謂之倒頓{到頓}，1小袴謂之䘨𧘈{交尞}。23楚通語也。', '[郭注-1]：今雹袴也；\n[郭注-2]：今𧝜袴也。\n[音義-3]：皎了兩音。', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (159, '𢄐;巾;𢁥;帤', '', '𢄐，巾也。1大巾謂之𢁥。23嵩嶽之南，4陳潁之閒謂之帤，5亦謂之𢄐。', '[郭注-1]：巾，主覆者，故名𢄐也；\n[郭注-2]：江東通呼巾𢁥耳。\n[音義-3]：音芬；\n[郭注-4]：嵩高，中岳山也，今在河南陽城縣；\n[音義-5]：奴豬反；', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (160, '絡頭;佰頭;鈔繢;䰎帶;采帶;𣦼;奄;幧頭', '帴;裛', '絡頭，帞頭{佰頭}也。紗繢{鈔繢}、䰎帶、䰂帶{采帶}、𢂺{𣦼}[帴]、㡋{奄}[裛]，幧頭也。1自關而西秦晉之郊曰絡頭，南楚江湘之閒曰帞頭，2自河以北趙魏之閒曰幧頭，或謂之𢂺，3或謂之㡋。4其偏者謂之䰎帶。5或謂之䰂帶。67', '[郭注-1]：今之偏疊幧頭也；\n[音義-2]：音貊；\n[音義-3]：音綪，亦千；\n[音義-4]：于怯反；\n[音義-5]：羌位反；\n[郭注-6]：䰂亦結也。\n[音義-7]：音菜；', '卷四', '方言', '6;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (161, '覆結;幘巾;承露;覆采', '覆䯰', '覆結[覆䯰]謂之幘巾，或謂之承露，或謂之覆䰂{覆采}。皆趙魏之閒通語也。1', '[郭注-1]：今結籠是也。', '卷四', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (162, '屝;屨;𧆓;履;複舄;夗下;鞮;不借;䩕角;妥;䋀', '', '屝、屨、麤{𧆓}，履也。徐兗之郊謂之屝，1自關而西謂之屨。中有木者謂之複舄，自關而東謂之複履。其庳者謂之𩊁下{夗下}，2襌者謂之鞮，3絲作之者謂之履，麻作之者謂之不借，麤者謂之屨，東北朝鮮洌水之閒謂之䩕角。4南楚江沔之閒總謂之麤。5西南梁益之閒或謂之㞜{妥}，6或謂之䋀。7履，其通語也。徐土邳圻之閒，89大麤謂之䩕角。10', '[音義-1]：音翡；\n[音義-2]：音婉；\n[郭注-3]：今韋鞮也；\n[音義-4]：音卭；\n[郭注-5]：沔水，今在襄陽；\n[音義-6]：他囘反，字或作「𡲾」，音同；\n[音義-7]：乎瓦反，一音畫；\n[郭注-8]：今下邳也。\n[音義-9]：圻，音祈；\n[郭注-10]：今漆履有齒者。', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (163, '緉;爽;絞', '雙', '緉、𦄍{爽}[雙]，絞也。關之東西或謂之緉，1或謂之𦄍。2絞，通語也。34', '[音義-1]：緉，音兩；\n[音義-2]：音爽；\n[郭注-3]：謂履中絞也。\n[音義-4]：音校。', '卷四', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (164, '纑;鬒', '', '纑謂之縝{鬒}。12', '[郭注-1]：謂纑縷也。\n[音義-2]：縝，音振。', '卷四', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (165, '鍑;鑊;錪;餅;錡;鏤;鬲;釜', '', '鍑，12或謂之鑊。北燕朝鮮洌水之閒或謂之錪，3或謂之鉼{餅}。4江淮陳楚之閒謂之錡，56或謂之鏤。吳揚之閒謂之鬲。7釜，自關而西或謂之釜，或謂之鍑。8', '[郭注-1]：釜屬也。\n[音義-2]：音富；\n[音義-3]：音腆；\n[音義-4]：音餅；\n[郭注-5]：或曰三腳釜也。\n[音義-6]：音技；\n[音義-7]：音歴。\n[郭注-8]：鍑亦釜之總名。', '卷五', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (166, '甑;甗;鬵;酢餾', '飵餾', '甑，自關而東謂之甗，1或謂之鬵，23或謂之酢餾[飵餾]。4', '[音義-1]：音言；\n[郭注-2]：涼州呼鉹；\n[音義-3]：𩱕音岑。\n[音義-4]：音屋霤。', '卷五', '方言', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (167, '盂;盌;銚銳;櫂;柯;卷', '銚;閜', '盂，1宋楚魏之閒或謂之盌。2盌謂之盂，或謂之銚銳。3盌謂之櫂[銚]，盂謂之柯[閜]。4海岱東齊北燕之閒或謂之𥁠{卷}。5', '[音義-1]：音于；\n[音義-2]：烏管反；\n[音義-3]：銚，謠音；\n[郭注-4]：轉相釋者，廣異語也；\n[音義-5]：音書卷。', '卷五', '方言', '4;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (168, '疋;椷;醆;氾;閜;楊;麻;桮', '雅;㔶', '㿿{疋}[雅]、椷[㔶]、盞{醆}、䀀{氾}、閜、𥂸{楊}、𥂓{麻}，桮也。秦晉之郊謂之㿿；12自關而東趙魏之閒曰椷，3或曰盞，45或曰䀀。6其大者謂之閜，7吳越之閒曰𥂸，8齊右平原以東或謂之𥂓。9桮，其通語也。', '[郭注-1]：所謂伯㿿者也；\n[音義-2]：音雅；\n[音義-3]：音封緘；\n[郭注-4]：最小桮也。\n[音義-5]：音酒醆；\n[音義-6]：薄淹反；\n[音義-7]：呼雅反；\n[音義-8]：又章反；\n[音義-9]：音摩；', '卷五', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (169, '蠡;簞;戲;瓢', '', '㼖{蠡}，12陳楚宋魏之閒或謂之簞，或謂之𣟵{戲}，或謂之瓢。34', '[郭注-1]：瓠勺也。\n[音義-2]：音麗；\n[郭注-3]：今江東通呼勺爲𣟵。\n[音義-4]：音羲。', '卷五', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (170, '案;寫', '', '案，陳楚宋魏之閒謂之𣞐{寫}，自關東西謂之案。', '', '卷五', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (171, '桮笿;豆筥', '', '桮𥯛{桮笿}，1陳楚宋衞之閒謂之桮𥯛，又謂之豆筥；自關東西謂之桮𥯛。', '[郭注-1]：盛桮器籠也。', '卷五', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (172, '箸筩;䈰;籯;桶蔥', '箸籠', '箸筩[箸籠]，1陳楚宋魏之閒謂之筲{䈰}，2或謂之籯；34自關而西謂之桶𣞷{桶蔥}。56', '[郭注-1]：盛朼箸籫也；\n[音義-2]：音鞭鞘；\n[郭注-3]：漢書曰：「遺子黃金滿籯。」\n[音義-4]：音盈也；\n[郭注-5]：今俗亦通呼小籠爲桶𣞷。\n[音義-6]：桶，或作筩，音籠冠。𣞷，蘇勇反。', '卷五', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (173, '亢;冘;廡;䍃;奠;從;𦉈;瓮;瓿婁;瓨;疑;罌', '䍌婁', '㼚{亢}、瓭{冘}、𤮢{廡}、䍃、㽀{奠}、㼻{從}、甀{𦉈}、瓮、瓿甊{瓿婁}[䍌婁]、瓨、㽈{疑}，甖{罌}也。靈桂之郊謂之㼚，12其小者謂之瓭；3周魏之閒謂之𤮢；45秦之舊都謂之㽀；6淮汝之閒謂之䍃；7江湘之閒謂之㼻。8自關而西晉之舊都河汾之閒，9其大者謂之甀，10其中者謂之瓿甊；11自關而東趙魏之郊謂之瓮，或謂之甖；東齊海岱之閒謂之㽈。12甖，其通語也。13', '[郭注-1]：今江東通呼大瓮爲㼚；\n[音義-2]：㼚，音岡；\n[音義-3]：瓭，都感反，亦音沈；\n[郭注-4]：今江東亦呼甖爲𤮢子；\n[音義-5]：𤮢，音舞；\n[音義-6]：㽀音鄭；\n[音義-7]：䍃音由；\n[音義-8]：㼻，胙江反；\n[郭注-9]：汾水出太原，經絳北，西南入河。\n[音義-10]：甀，度睡反；\n[音義-11]：瓿，音部。甊，洛口反；\n[音義-12]：㽈，牛志反；\n[音義-13]：甖，于庚反；', '卷五', '方言', '9', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (174, '罃;俞;朱;長;詹;𦉈', '臾;臾', '罃，陳魏宋楚之閒曰㼶{俞}[臾]，1或曰㼡{朱}[臾]；2燕之東北朝鮮洌水之閒謂之瓺{長}；3齊之東北海岱之閒謂之儋{詹}；45周洛韓鄭之閒謂之甀{𦉈}，或謂之罃。', '[音義-1]：音臾；\n[音義-2]：音殊；\n[音義-3]：音暢，亦腸；\n[郭注-4]：所謂家無儋石之儲者也。\n[音義-5]：音儋荷，字或作甔。', '卷五', '方言', '2;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (175, '罃;㼰', '', '罃謂之㼰。1', '[音義-1]：音鼓鼙。', '卷五', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (176, '𦉥;斯', '', '𦉨{𦉥}謂之㽄{斯}。', '', '卷五', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (177, '缶;瓿禺;缾', '䍌禺', '缶謂之瓿㼴{瓿禺}[䍌禺]，12其小者謂之瓶{缾}。', '[郭注-1]：卽盆也。\n[音義-2]：音偶。', '卷五', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (178, '罃甈;盎;盆;升甌;甂;是', '榹', '罃甈謂之盎。12自關而西或謂之盆，或謂之盎；其小者謂之升甌。3甂，4陳魏宋楚之閒謂之㼵{是}[榹]；5自關而西謂之甂，其大者謂之甌。', '[郭注-1]：案爾雅甈，康瓠，而方言以爲盆，未詳也。\n[音義-2]：甈，卻罽反。盎，烏浪反。\n[音義-3]：惡牟反，亦音憂。\n[音義-4]：音邊；\n[郭注-5]：今河北人呼小盆爲㼵子。㼵，杜啓反。', '卷五', '方言', '6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (179, '注斛;鬲;注箕;羅', '', '所以注斛，1陳魏宋楚之閒謂之䈪{鬲}，234自關而西謂之注箕，陳魏宋楚之閒謂之籮{羅}。5', '[郭注-1]：盛米穀寫斛中者也；\n[郭注-2]：今江東亦呼爲䈪，\n[音義-3]：音巫覡\n[郭注-4]：；\n[郭注-5]：䈪亦籮屬也，形小而高，無耳。', '卷五', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (180, '炊䉛;縮;叜;㕣', '籔;籔;匴', '炊䉛謂之縮[籔]，1或謂之𥰞{叜}[籔]，2或謂之㔯{㕣}[匴]。34', '[郭注-1]：漉米䉛也；\n[音義-2]：音藪；\n[郭注-3]：江東呼淅籖。\n[音義-4]：音旋。', '卷五', '方言', '2;3;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (181, '篝;牆居', '', '篝，1陳楚宋魏之閒謂之牆居。', '[郭注-1]：今薰籠也。', '卷五', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (182, '扇;箑', '', '扇，自關而東謂之箑，12自關而西謂之扇。', '[郭注-1]：今江東亦通名扇爲箑。\n[音義-2]：音䈉。', '卷五', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (183, '碓機;梴;磑;妻', '碓磑', '碓機[碓磑]，1陳魏宋楚自關而東謂之梴。2磑或謂之䃀{妻}。34', '[郭注-1]：碓梢也；\n[音義-2]：音𢌛；\n[郭注-3]：卽磨也。\n[音義-4]：錯碓反。', '卷五', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (184, '繘;綆;絡', '', '繘，1自關而東周洛韓魏之閒謂之綆，或謂之絡。2關西謂之繘。3', '[郭注-1]：汲水索也。\n[音義-2]：音洛。\n[音義-3]：音橘。', '卷五', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (185, '歷;宿;草', '槽', '櫪{歷}，1梁宋齊楚北燕之閒或謂之樎{宿}，2或謂之皁{草}[槽]。3', '[郭注-1]：養馬器也；\n[音義-2]：音縮；\n[郭注-3]：皁隸之名，於此乎出？', '卷五', '方言', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (186, '飤馬槖;裺囊;裺篼;婁篼;振', '裛囊;裛篼', '飤馬槖，自關而西謂之裺囊[裛囊]，1或謂之裺篼[裛篼]；或謂之㡞篼{婁篼}；2燕齊之間謂之帪{振}。3', '[音義-1]：音䳺；\n[音義-2]：音樓；\n[郭注-3]：廣雅作「振」，字音同耳。', '卷五', '方言', '2;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (187, '鉤;鹿觡;鉤格;微', '', '鉤，1宋楚陳魏之閒謂之鹿觡，2或謂之鉤格；自關而西謂之鉤，或謂之䥩{微}。3', '[郭注-1]：懸物者；\n[郭注-2]：或呼鹿角；\n[音義-3]：音微。', '卷五', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (188, '臿;𣂀;華;韋;畚;喿;㭒', '㭉;䤥;銚', '臿，燕之東北朝鮮洌水之閒謂之𣂀；12宋魏之閒謂之鏵{華}[㭉]，或謂之鍏{韋}[䤥]；3江淮南楚之閒謂之臿；沅湘之閒謂之畚；趙魏之閒謂之喿[銚]；45東齊謂之梩{㭒}。6', '[郭注-1]：此亦鍫聲轉也。\n[音義-2]：湯料反；\n[音義-3]：音韋；\n[郭注-4]：字亦作鍫也；江東又呼鍫刃爲鐅，\n[音義-5]：普蔑反。\n[音義-6]：音駭。', '卷五', '方言', '3;4;6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (189, '杷;渠挐;渠疏', '𣚏挐;𣚏挐', '杷，12宋魏之閒謂之渠挐[𣚏挐]，34或謂之渠疏[𣚏挐]。5', '[郭注-1]：有齒曰杷，無齒爲朳；\n[音義-2]：朳音八。\n[郭注-3]：今江東名亦然。\n[音義-4]：挐，諾豬反；\n[郭注-5]：語轉也。', '卷五', '方言', '2;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (190, '僉;𣠞殳;度;棓;柫;柍;孛', '柫', '僉，1宋魏之閒謂之欇殳{𣠞殳}，23或謂之度，45自關而西謂之棓，6或謂之柫；7齊楚江淮之閒謂之柍，89或謂之桲{孛}[柫]。10', '[郭注-1]：今連枷，所以打穀者；\n[郭注-2]：亦杖名也；\n[音義-3]：音殊。\n[郭注-4]：今江東呼打爲度。\n[音義-5]：音量度也；\n[郭注-6]：蒲項反；\n[音義-7]：音拂；\n[郭注-8]：此皆打之別名也；\n[音義-9]：音悵怏，亦音車鞅。\n[音義-10]：音勃。', '卷五', '方言', '7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (191, '乂鉤;鉊;過;鎌;鍥', '戈', '刈鉤{乂鉤}，江淮陳楚之閒謂之鉊，1或謂之鐹{過}[戈]；2自關而西或謂之鉤，或謂之鎌，或謂之鍥。3', '[音義-1]：音昭；\n[音義-2]：音果；\n[音義-3]：音結。', '卷五', '方言', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (192, '薄;䒼;匊;蓬薄', '䒼', '薄，宋魏陳楚江淮之閒謂之䒼，或謂之麴{匊}[䒼]；1自關而西謂之薄，南楚謂之蓬薄。', '[郭注-1]：此直語楚聲轉耳。', '卷五', '方言', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (193, '橜;段', '', '橛{橜}，燕之東北朝鮮洌水之閒謂之椴{段}。12', '[郭注-1]：揭杙也。江東呼都。\n[音義-2]：音段。', '卷五', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (194, '槌;植;羊;栚;帶;㭙;僉;巽;𦇏;𤪹', '㭙;鐉;𦇏', '槌，1宋魏陳楚江淮之閒謂之植[㭙]，2自關而西謂之槌，3齊謂之样{羊}。4其橫，關西曰㮳{栚}，56宋魏陳楚江淮之閒謂之㯂{帶}，7齊部謂之㭙。8所以縣㯂，關西謂之䌞{僉}，9東齊海岱之閒謂之繏{巽}[鐉]，10宋魏陳楚江淮之閒謂之𦇏，11或謂之𤪹[𦇏]。12', '[郭注-1]：縣蠶薄柱也。\n[音義-2]：音值；\n[音義-3]：度畏反；\n[音義-4]：音陽；\n[郭注-5]：亦名校，\n[音義-6]：音交。㮳，音朕。\n[音義-7]：音帶；\n[音義-8]：丁革反；\n[音義-9]：力冉反；\n[音義-10]：相卞反；\n[音義-11]：音𢸃甲；\n[音義-12]：音𣞲。', '卷五', '方言', '2;8;10', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (195, '簟;笙;籧䒼;㪿;籧篨;盇炎', '盇簟', '簟，宋魏之閒謂之笙，1或謂之籧䒼；自關而西或謂之簟，或謂之䇽{㪿}。2其粗者謂之籧篨，34自關而東或謂之篕掞{盇炎}[盇簟]。5', '[郭注-1]：今江東通言笙；\n[郭注-2]：今云䇽，篾篷也；\n[郭注-3]：江東呼籧篨爲䉬。\n[音義-4]：音廢。\n[音義-5]：音剡。', '卷五', '方言', '6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (196, '行唐;倚羊', '', '筕篖{行唐}，123自關而東周洛楚魏之閒謂之倚佯{倚羊}，4自關而西謂之筕篖，南楚之外謂之篖。', '[郭注-1]：似籧篨，直文而粗。江東呼笪，\n[音義-2]：音靼\n[郭注-3]：；\n[音義-4]：音羊。', '卷五', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (197, '牀;簀;笫;杠;樹;趙;𣓀;版;牒;牑', '桃;䡊', '牀，1齊魯之閒謂之簀，2陳楚之閒或謂之笫。3其杠，北燕朝鮮之閒謂之樹，自關而西秦晉之閒謂之杠，南楚之閒謂之趙{桃}，4東齊海岱之閒謂之𣘘{𣓀}。5其上版[䡊]，衞之北郊趙魏之閒謂之牒，6或曰牑。7', '[郭注-1]：牀版也。\n[音義-2]：音迮；\n[音義-3]：音滓，又音姊；\n[郭注-4]：趙，當作桃，聲之轉也。中國亦呼杠爲桃牀，皆通語也；\n[音義-5]：音詵；\n[音義-6]：簡牒；\n[音義-7]：履屬。', '卷五', '方言', '6;8', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (198, '俎;几;止;桯;椸;𧇽', '㮐;㮐', '俎，几也。西南蜀漢之郊曰杫{止}{㮐}。1榻前几，江沔之閒曰桯，23趙魏之閒謂之椸[㮐]。4几，其高者謂之虡{𧇽}。56', '[音義-1]：音賜；\n[郭注-2]：今江東呼爲承。\n[音義-3]：音刑；\n[音義-4]：音易；\n[郭注-5]：卽筍虡也。\n[音義-6]：音巨。', '卷五', '方言', '3;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (199, '籆;袁;格', '爰;檷', '籆，榬{袁}[爰]也。12兗豫河濟之閒謂之榬。絡謂之格[檷]。3', '[郭注-1]：所以絡絲者也。\n[音義-2]：音爰；\n[郭注-3]：所以轉籆絡車也。', '卷五', '方言', '2;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (200, '繀車;歷鹿車;道軌', '歷録車', '繀車，1趙魏之閒謂之轣轆車{歷鹿車}[歷録車]，東齊海岱之閒謂之道軌。', '[音義-1]：蘇對反。', '卷五', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (201, '鍵;𨷲', '', '戸鑰，自關而東陳楚之閒謂之鍵，1自關而西謂之鑰{𨷲}。', '[音義-1]：巨蹇反。', '卷五', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (202, '簙;蔽;箘;箭裏;簙毒;夗專;尊旋;棊;枰;廣平;局;曲道;弈', '簙筑', '簙謂之蔽，或謂之箘。1秦晉之閒謂之簙；吳楚之閒或謂之蔽，或謂之箭裏，或謂之簙毒[簙筑]，2或謂之夗專，3或謂之𠥙璇{尊旋}，45或謂之棊。所以投簙謂之枰。6或謂之廣平。所以行棊謂之局，或謂之曲道。圍棊謂之弈，自關而東齊魯之閒皆謂之弈。', '[音義-1]：音囷；\n[郭注-2]：簙箸，一名箭，廣雅云。\n[音義-3]：夗，于辯反。專，音轉；\n[郭注-4]：或曰竹器，所以整頓簙者。\n[音義-5]：銓旋兩音；\n[音義-6]：音評論。', '卷五', '方言', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (203, '𢕈;𤟌;欲', '', '聳{𢕈}、奬{𤟌}，欲也。1荊吳之閒曰聳，2晉趙曰奬。自關而西秦晉之閒相勸曰聳，或曰奬。中心不欲而由旁人之勸語亦曰聳。凡相被飾亦曰奬。', '[郭注-1]：皆强欲也。\n[音義-2]：山頂反；', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (204, '𢕈;䏁;聾;𦘍;隓;䎳', '', '聳{𢕈}、䏁，聾也。半聾，梁益之閒謂之䏁；12秦晉之閒聽而不聰、聞而不達謂之䏁。生而聾，陳楚江淮之閒謂之聳。3荆揚之閒及山之東西雙聾者謂之聳。聾之甚者，秦晉之閒謂之𦘍。45吳楚之外郊凡無耳者亦謂之𦘍。其言𦘍者，若秦晉中土謂𡐦{隓}耳者䎳也。6', '[郭注-1]：言胎䏁煩憒也。\n[音義-2]：音宰；\n[郭注-3]：言無所聞，常聳耳也；\n[郭注-4]：言朏無所聞知也，外傳：「聾聩司火」，\n[音義-5]：音蒯聵。𦘍，五刮反，\n[音義-6]：䎳，五刮反。', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (205, '陂;㑾;衺', '', '陂、傜{㑾}，衺也。陳楚荆揚曰陂，1自山而西凡物細大不純者謂之傜。23', '[音義-1]：音偏頗；\n[郭注-2]：言俄傜也。\n[音義-3]：音逍遙；', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (206, '邎迪;正', '', '由迪{邎迪}，正也。東齊青徐之閒相正謂之由迪。', '', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (207, '㥏;恧;慙;䀣', '', '㥏、恧，慙也。荆揚青徐之閒曰㥏，1若梁益秦晉之閒言心内慙矣；山之東西自愧曰恧；23趙巍之閒謂之䀣。4', '[音義-1]：音腆；\n[郭注-2]：小雅曰：「心愧爲恧」；\n[音義-3]：人力反，又女六反；\n[音義-4]：音密，亦祕。', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (208, '蹇;展;難;憚;燀', '蹇;憚', '謇{蹇}、展[蹇]，難也。齊晉曰謇。1山之東西凡難貌曰展。荆吳之人相難謂之展，若秦晉之言相憚矣。齊魯曰燀[憚]。23', '[音義-1]：音蹇；\n[郭注-2]：難而雄也。\n[音義-3]：昌羨反。', '卷六', '方言', '2;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (209, '胥;邎;輔', '', '胥、由{邎}，輔也。1吳越曰胥，2燕之北鄙曰由。3', '[郭注-1]：皆謂輔持也。\n[郭注-2]：相也；\n[郭注-3]：正也。', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (210, '蛩㤨;戰栗;恐', '', '蛩㤨，戰慄{戰栗}也。荆吳曰蛩㤨。蛩㤨，又恐也。1', '[音義-1]：鞏恭兩音。', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (211, '錪;錘;重', '', '錪、錘，重也。東齊之閒曰錪，1宋魯曰錘。2', '[音義-1]：吐本反；\n[音義-2]：直睡反。', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (212, '含;龕;受;盛', '堪', '鋡{含}、龕[堪]，受也。1齊楚曰鋡，2揚越曰龕。受，盛也，猶秦晉言容盛也。', '[郭注-1]：今云龕囊，依此名也。\n[音義-2]：音含；', '卷六', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (213, '矔;眮', '', '矔、眮，轉目也。梁益之閒瞋目曰矔，轉目顧視亦曰矔，1吳楚曰眮。2', '[音義-1]：音慣習；\n[音義-2]：音侹侗。', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (214, '逴;騷;逴;蹇', '簫', '逴、騷[簫]、𡯴{逴}，蹇也。1吳楚偏蹇曰騷，2齊楚晉曰逴。34', '[郭注-1]：跛者行𧿒踔也；\n[音義-2]：先牢反；\n[郭注-3]：行略逴也。\n[音義-4]：勑略反。', '卷六', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (215, '𤺊;嗌;噎', '', '𤺊、嗌，噎也。12楚曰𤺊；3秦晉或曰嗌，4又曰噎。', '[郭注-1]：皆謂咽痛也。\n[音義-2]：音翳。\n[音義-3]：音斯；\n[音義-4]：惡介反；', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (216, '怠;阤;壞', '殆', '怠[殆]、阤，壞也。12', '[郭注-1]：謂壞落也。\n[音義-2]：阤，音蟲豸；', '卷六', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (217, '涅;墊;下', '墊', '㘿{涅}[墊]、墊，下也。凡柱而下曰㘿，1屋而下曰墊。2', '[郭注-1]：音涅；\n[音義-2]：丁念反。', '卷六', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (218, '勿;邈;離;越;遠', '', '伆{勿}、邈，離也。1楚謂之越，或謂之遠；吳越曰伆。2', '[郭注-1]：謂乖離也。\n[音義-2]：音刎；', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (219, '顚;頂;上', '', '顚、頂，上也。', '', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (220, '誣;㛪与;阿与', '', '誣、䛳，与也。吳越曰誣；荆齊曰䛳与{㛪与}，1猶秦晉言阿与。2', '[音義-1]：於劍反；\n[郭注-2]：相阿与者，所以致誣䛳。', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (221, '掩;𡩡;取;狙', '揜;抯', '掩[揜]、𡩡，取也。自關而東曰掩，自關而西曰𡩡，或曰狙[抯]。1', '[郭注-1]：狙伺也。', '卷六', '方言', '1;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (222, '䁙;䀩;視', '', '䁙、䀩，視也。東齊曰䁙，吳揚曰䀩。12凡以目相戲曰䁙。3', '[郭注-1]：今中國亦云目䀩也。\n[音義-2]：音略；\n[音義-3]：烏拔反；', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (223, '遙;廣;遠', '繇', '遙[繇]、廣，遠也。梁楚曰遙。', '', '卷六', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (224, '汩;遙;疾行', '𡿯;搖', '汩[𡿯]、遙[搖]，疾行也。南楚之外曰汩，12或曰遙。', '[郭注-1]：汩汩，急貌也。\n[音義-2]：汩，于筆反；', '卷六', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (225, '蹇;妯;𢺕', '怞', '蹇、妯[怞]，𢺕也。1人不靜曰妯，秦晉曰蹇，齊宋曰妯。2', '[郭注-1]：謂躁夒也；\n[音義-2]：音迪。', '卷六', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (226, '絓;挈;煢;介;特;雙;乘', '佳/閨;赹', '絓[佳/閨]、挈、𠎽{煢}[赹]、介，特也。楚曰𠎽，1晉曰絓，2秦曰挈，3物無耦曰特，獸無耦曰介。4飛鳥曰雙，鴈曰乘。', '[郭注-1]：𠎽，古煢字；\n[郭注-2]：音乖；\n[郭注-3]：口八反；\n[郭注-4]：傳曰：「逢澤有介麋」。', '卷六', '方言', '1;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (227, '台;旣;失', '駘', '台[駘]、旣，失也。宋魯之閒曰台。', '', '卷六', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (228, '旣;隱;據;定', '𤔌', '旣、隱[𤔌]、據，定也。', '', '卷六', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (229, '稟;浚;敬', '凜;夋', '稟[凜]、浚[夋]，敬也。秦晉之閒曰稟，齊曰浚。吳楚之閒自敬曰稟。', '', '卷六', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (230, '悛;懌;改', '譯', '悛、懌[譯]，改也。自山而東或曰悛，1或曰懌。23', '[音義-1]：音銓；\n[郭注-2]：論語曰：「悅而不懌」。\n[音義-3]：音奕；', '卷六', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (231, '坻;坥;場', '', '坻、坥，場也。梁宋之閒蚍蜉䵓鼠之場謂之坻。12螾場謂之坥。34', '[郭注-1]：䵓鼠，蚡鼠也；\n[音義-2]：音水汦；\n[郭注-3]：螾，蛐蟮也，其糞名坥。\n[音義-4]：螾音引。場，音傷；音癰疽；', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (232, '徥;用;行', '', '徥、用，行也。朝鮮洌水之閒或曰徥。12', '[郭注-1]：徥徥，行貌。\n[音義-2]：度揩反。', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (233, '鋪頒;索;斗藪', '布班;𡩡', '鋪頒[布班]，索[𡩡]也。東齊曰鋪頒，1猶秦晉言抖藪{斗藪}也。2', '[音義-1]：鋪音敷。\n[郭注-2]：謂斗藪舉索物也。', '卷六', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (234, '參;蠡;分;離', '', '參、蠡，分也。1齊曰參，楚曰蠡，2秦晉曰離。', '[郭注-1]：謂分割也。\n[音義-2]：音麗；', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (235, '𤺊;披;散;釁;㠲', '柀', '𤺊、披[柀]，散也。東齊聲散曰𤺊，器破曰披，秦晉聲變曰𤺊，器破而不殊其音亦謂之𤺊。器破而未離謂之璺{釁}，1南楚之閒謂之𢻹{㠲}。2', '[音義-1]：音問；\n[音義-2]：妨美反,一音圯塞。', '卷六', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (236, '緍;緜;施', '', '緍、緜，施也。秦曰緍，趙曰緜，吳越之閒脫衣相被謂之緍緜。12', '[郭注-1]：相覆及之名也。\n[音義-2]：緍音旻；', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (237, '涌;畐;滿', '', '悀{涌}、愊{畐}，滿也。凡以器盛而滿謂之悀，12腹滿曰偪。34', '[郭注-1]：言涌出也；\n[音義-2]：音踊；\n[郭注-3]：言勅偪也。\n[音義-4]：妨逼反；', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (238, '徯醯;冉鎌;危', '', '徯醯、冉鐮{冉鎌}，危也。東齊㨳物而危謂之徯醯，1僞物謂之冉鐮。2', '[音義-1]：㨳，居枝反。醯音醢酢；\n[音義-2]：音髯；', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (239, '紕;繹;督;雉;理', '比;夷', '紕[比]、繹、督、雉[夷]，理也。秦晉之閒曰纰，1凡物曰督之，2絲曰繹之。34', '[音義-1]：音毗；\n[郭注-2]：言正理也；\n[郭注-3]：言解繹也。\n[音義-4]：音亦；', '卷六', '方言', '1;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (240, '矤;呂;長', '', '矤、呂，長也。東齊曰矤，1宋魯曰呂。', '[郭注-1]：古矧字。', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (241, '屈;呂;力', '𠢤', '䠇{屈}[𠢤]、膐{呂}，力也。東齊曰䠇，1宋魯曰膐。膐，田力也。2', '[郭注-1]：律䠇，多力貌；\n[郭注-2]：謂耕墾也。', '卷六', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (242, '瘱;帶;審', '諟', '瘱、𧫚{帶}[諟]，審也。齊楚曰瘱，1秦晉曰𧫚。2', '[音義-1]：音瘞埋，又翳；\n[音義-2]：音瓜蔕。', '卷六', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (243, '壹帶;諟', '瘱諟', '𧬇𧫚{壹帶}[瘱諟]，諟也。12吳越曰𧬇𧫚。3', '[郭注-1]：諟亦審，互見其義耳。\n[音義-2]：音帝。\n[音義-3]：𧬇音翳；𧫚亦音蔕；', '卷六', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (244, '音;揜;錯;摩;藏', '揜;臧', '揞{音}[揜]、揜、錯、摩，藏[臧]也。荆楚曰揞，1吳揚曰揜，周秦曰錯，2陳之東鄙曰摩。', '[音義-1]：烏感反；\n[音義-2]：音酢。', '卷六', '方言', '1;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (245, '去莫;去', '', '袪摸{去莫}，去也。齊趙之總語也，袪摸猶言持去也。', '', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (246, '舒勃;展', '', '舒勃，展也。東齊之閒凡展物謂之舒勃。', '', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (247, '摳揄;旋', '', '摳揄，旋也。秦晉凡物樹稼早成熟謂之旋，燕齊之閒謂之摳揄。', '', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (248, '絙;筳;竟', '', '絙、筳，竟也。秦晉或曰絙，1或曰竟，楚曰筳。2', '[音義-1]：岡鄧反；\n[音義-2]：湯丁反。', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (249, '閻;業;續', '接', '𢸴{閻}、𠟪{業}[接]，續也。秦晉續折謂之𢸴，1繩索謂之𠟪。2', '[音義-1]：音剡；\n[音義-2]：音妾。', '卷六', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (250, '擘;紉', '襞', '擘[襞]，1楚謂之紉。23', '[音義-1]：音檗；\n[郭注-2]：今亦以綫貫針爲紉。\n[音義-3]：音刃。', '卷六', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (251, '閻苫;開;闓', '', '閻苫，開也。東齊開戸謂之閻苫，楚謂之闓。1', '[郭注-1]：亦開字也。', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (252, '杼;柚;作', '軸', '杼、柚[軸]，作也。東齊土作謂之杼，水作謂之柚。', '', '卷六', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (253, '厲;卬;爲', '', '厲、卬，爲也。1甌越曰卬，吳曰厲。', '[郭注-1]：爾雅曰：「俶、厲，作。」作，亦爲也。', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (254, '戲;憚;怒', '', '戲、憚，怒也。齊曰戲，楚曰憚。', '', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (255, '爰;爰;恚', '咺;咺', '爰[咺]、喛{爰}[咺]，恚也。1楚曰爰，秦晉曰喛，皆不欲譍而强畣[荅]之意也。', '[郭注-1]：謂悲恚也。', '卷六', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (256, '叜;艾;長;老;公;翁;父;父老;皇;母姼;父姼', '母媞;父媞', '𠋢{叜}、艾，長，老也。東齊魯衞之閒凡尊老謂之𠋢，或謂之艾；1周晉秦隴謂之公，或謂之翁；南楚謂之父，或謂之父老。南楚𤄗洭之閒，23母謂之媓{皇}，謂婦妣曰母姼[母媞]，稱婦考曰父姼[父媞]。45', '[郭注-1]：禮記曰：「五十曰艾」；\n[郭注-2]：洭水在桂陽。\n[音義-3]：㬥匡兩音。\n[郭注-4]：古者通以考妣爲生存之稱。\n[音義-5]：音多。', '卷六', '方言', '10;11', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (257, '巍;嶢;崝;險;高', '', '巍、嶢、崝、嶮{險}，高也。1', '[郭注-1]：嶕嶢、崝嵤，皆高峻之貌也。', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (258, '猒;塞;安', '懕;㥶', '猒[懕]、塞[㥶]，安也。1', '[郭注-1]：物足則定。', '卷六', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (259, '夌;𢜮;憐', '憐', '㥄{夌}[憐]、𢜮，憐也。12', '[郭注-1]：㥄音夌；\n[音義-2]：𢜮，亡主反。', '卷六', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (260, '掩;翳;𥴨', '', '掩、翳，薆{𥴨}也。12', '[郭注-1]：謂蔽薆也，詩曰：「薆而不見」。\n[音義-2]：音愛。', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (261, '佚愓;緩', '', '佚愓，緩也。1', '[音義-1]：跌唐兩音。', '卷六', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (262, '諄憎;疾;可惡', '敦憎', '諄憎[敦憎]，所疾也。宋魯凡相惡謂之諄憎，1若秦晉言可惡矣。', '[音義-1]：諄，之潤反。', '卷七', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (263, '杜;蹻;歰', '', '杜、蹻，歰也。趙曰杜，1山之東西或曰蹻。23', '[郭注-1]：今俗語通言歰如杜，杜棃子歰，因名之；\n[郭注-2]：卻蹻，燥歰貌。\n[音義-3]：蹻，音笑噱。', '卷七', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (264, '佻;抗;縣', '䄪/到', '𠄏[䄪/到]、抗，縣也。趙魏之閒曰𠄏，自山之東西曰抗；燕趙之郊縣物于臺之上謂之𠄏。12', '[郭注-1]：了𠄏，縣物貌。\n[音義-2]：丁小反。', '卷七', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (265, '發;稅;舍車', '挽', '發、稅[挽]，舍車也。1東齊海岱之閒謂之發，2宋趙陳魏之閒謂之稅。3', '[音義-1]：舍，宜音寫；\n[郭注-2]：今通言發寫也；\n[郭注-3]：稅猶脫也。', '卷七', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (266, '肖;類;法;哨', '嗾', '肖、類，法也。齊曰類，西楚梁益之閒曰肖。秦晉之西鄙自冀隴而西使犬曰哨[嗾]，12西南梁益之閒凡言相類者亦謂之肖。3', '[郭注-1]：冀縣，今在天水；\n[音義-2]：音騷；\n[郭注-3]：肖者，似也。', '卷七', '方言', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (267, '憎;讓;憚', '', '憎、懹{讓}，憚也。1陳曰懹。', '[郭注-1]：相畏憚也。', '卷七', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (268, '譙;讙;讓', '', '譙、讙，讓也。齊楚宋衞荆陳之閒曰譙，1自關而西秦晉之閒凡言相責讓曰譙讓，北燕曰讙。2', '[郭注-1]：字或作誚；\n[音義-2]：火袁反。', '卷七', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (269, '僉;胥;皆', '', '僉、胥，皆也。自山而東五國之郊曰僉，1東齊曰胥。', '[郭注-1]：六國惟秦在山西。', '卷七', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (270, '侔莫;强', '勖;彊', '侔莫[勖慔]，强[彊]也。北燕之外郊凡勞而相勉若言努力者謂之侔莫。', '', '卷七', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (271, '巩松;罵', '巩庸', '𠌖倯{巩松}[巩庸]，罵也。1燕之北郊曰𠌖倯。2', '[郭注-1]：羸小可憎之名也。\n[音義-2]：𠌖，音邛竹。', '卷七', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (272, '展;惇;信', '眞', '展[眞]、惇，信也。東齊海岱之閒曰展，燕曰惇。1', '[郭注-1]：惇亦誠信貌。', '卷七', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (273, '斯;播;離', '', '斯、𨤏{播}，離也。齊陳曰斯，燕之外郊朝鮮洌水之閒曰𨤏。', '', '卷七', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (274, '蝎;噬;逮', '逮;逮', '蝎[逮]、噬[逮]，逮也。東齊曰蝎，1北燕曰噬。2逮，通語也。', '[音義-1]：音曷；\n[音義-2]：音卜筮。', '卷七', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (275, '皮傅;彈憸;强', '彊', '皮傅、彈憸，强[彊]也。1秦晉言非其事謂之皮傅，東齊陳宋江淮之閒曰彈憸。2', '[郭注-1]：謂强語也。\n[音義-2]：音僉；', '卷七', '方言', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (276, '膊;曬;晞;㬥', '', '膊、曬、晞，㬥也。東齊及秦之西鄙言相㬥僇爲膊。12燕之外郊朝鮮洌水之閒凡㬥肉發人之私、披牛羊之五藏謂之膊。㬥五穀之類，秦晉之閒謂之曬，3東齊北燕海岱之郊謂之晞。', '[郭注-1]：㬥僇，謂相㬥𣩊惡事。\n[音義-2]：音膊脯；\n[音義-3]：霜智反；', '卷七', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (277, '熬;取;煎;備;鞏', '𩱦;𤐸;烘', '熬、㷅{取}[𩱦]、煎、㷶{備}[𤐸]、鞏[烘]，火乾也。凡以火而乾五穀之類，自山而東、齊楚以往謂之熬，關西隴冀以往謂之㷶，1秦晉之閒或謂之㷅；23凡有汁而乾謂之煎，東齊謂之鞏。4', '[音義-1]：皮力反；\n[郭注-2]：卽𩱈字也。\n[音義-3]：創眇反；\n[音義-4]：音拱手。', '卷七', '方言', '2;4;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (278, '胹;飪;亨;爛;糦;酋;酷;熟', '秋;焅', '胹、飪、亨、爛、糦、酋[秋]、酷[焅]，熟也。自關而西秦晉之郊曰胹，1徐揚之閒曰飪，2嵩嶽以南陳潁之閒曰亨。自河以北趙魏之閒火熟曰爛，氣熟曰糦，3久熟曰酋，4穀熟曰酷。熟，其通語也。', '[音義-1]：音而；\n[音義-2]：音荏；\n[音義-3]：音熾；\n[音義-4]：音囚。', '卷七', '方言', '6;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (279, '嫢盈;怒', '', '嫢盈，怒也。燕之外郊朝鮮洌水之閒，凡言呵叱者謂之嫢盈。', '', '卷七', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (280, '長敄;豈企;立', '', '䠆𨂣{長敄}、隑企{豈企}，立也。東齊海岱北燕之郊跪謂之䠆𨂣，12委痿謂之隑企。34', '[郭注-1]：今東郡人亦呼長跽爲䠆𨂣；\n[音義-2]：𨂣，音務；\n[郭注-3]：腳躄不能行也。\n[音義-4]：企，欺豉反；', '卷七', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (281, '瀧涿;霑漬', '', '瀧涿謂之霑漬。12', '[郭注-1]：瀧涿猶瀨滯也。\n[音義-2]：音籠。', '卷七', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (282, '晞;鑠;摩;呂', '鑢', '希{晞}、鑠，摩也。燕齊摩鋁{呂}[鑢]謂之希。1', '[音義-1]：鋁音慮。', '卷七', '方言', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (283, '平均;賦', '', '平均，賦也。燕之北鄙、東齊北郊凡相賦斂謂之平均。', '', '卷七', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (284, '羅;離', '', '羅謂之離，離謂之羅。1', '[郭注-1]：皆行列物也。', '卷七', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (285, '釗;超;遠', '迢;迢', '釗[迢]、超[迢]，遠也。燕之北郊曰釗，東齊曰超。', '', '卷七', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (286, '漢漫;辰眩;懣', '熯懣', '漢漫[熯懣]、䀼眩{辰眩}，懣也。朝鮮洌水之閒煩懣謂之漢漫，顚眴謂之䀼眩。1', '[音義-1]：䀼，音瞋恚，眩，音懸。', '卷七', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (287, '憐職;愛', '㤅', '憐職，愛[㤅]也，言相愛憐者吳越之閒謂之憐職。', '', '卷七', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (288, '茹;食', '', '茹，食也。吳越之閒凡貪飲食者謂之茹。12', '[郭注-1]：今俗呼能粗食者爲茹。\n[音義-2]：音勝如。', '卷七', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (289, '竘;貌;治', '', '竘、貌，治也。1吳越飾貌爲竘，2或謂之巧。3', '[郭注-1]：謂治作也。\n[音義-2]：恪垢反。\n[郭注-3]：語楚聲轉耳。', '卷七', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (290, '煦;叚;熱;乾', '煦', '煦、煆{叚}[煦]，熱也，乾也。1吳越曰煦煆。2', '[郭注-1]：熱則乾燥。\n[音義-2]：煦，音州吁；煆，呼夏反；', '卷七', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (291, '嬴;膂;賀;幐;儋;負佗', '何', '攍{嬴}、膂、賀[何]、幐，儋也。12齊楚陳宋之閒曰攍；34燕之外郊、越之垂甌、吳之外鄙謂之膂；5南楚或謂之攍；自關而西、隴冀以往謂之賀，6凡以驢馬馲駝載物者謂之負佗，7亦謂之賀。', '[郭注-1]：今江東呼儋兩頭有物爲幐。\n[音義-2]：音鄧；\n[郭注-3]：莊子曰：攍糧而赴之；\n[音義-4]：音盈；\n[郭注-5]：儋者用膂力，因名云；\n[郭注-6]：今江東語亦然；\n[音義-7]：音大。', '卷七', '方言', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (292, '樹植;立', '', '樹植，立也。燕之外郊朝鮮洌水之閒凡言置立者謂之樹植。', '', '卷七', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (293, '過度;涉濟', '', '過度謂之涉濟。1', '[郭注-1]：猶今云濟度。', '卷七', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (294, '福祿;祓戩', '', '福祿謂之祓戩。1', '[音義-1]：廢箭兩音。', '卷七', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (295, '祭;眙;逗', '刹', '傺{祭}[刹]、眙，逗也。南楚謂之傺，1西秦謂之眙。23逗，其通語也。4', '[音義-1]：音際；\n[郭注-2]：西秦，酒泉、敦煌、張掖是也。眙，謂住視也。\n[音義-3]：敕吏反；\n[郭注-4]：逗，卽今住字也；', '卷七', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (296, '虎;李父;李耳;於䖘;伯都', '', '虎，陳魏宋楚之閒或謂之李父；江淮南楚之閒謂之李耳，1或謂之於䖘；2345自關東西或謂之伯都。6', '[郭注-1]：虎食物值耳卽止，以觸其諱故；\n[郭注-2]：今江南山夷呼虎爲䖘，\n[音義-3]：音狗竇\n[郭注-4]：；\n[音義-5]：於，音烏。\n[郭注-6]：俗曰伯都事神虎說。', '卷八', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (297, '貔;來;否;貍', '', '貔，12陳楚江淮之閒謂之𧳟{來}，3北燕朝鮮之閒謂之𧳏{否}，45關西謂之狸{貍}。6', '[郭注-1]：狸别名也，未聞語所出。\n[音義-2]：音毗。\n[音義-3]：音來；\n[郭注-4]：今江南呼爲𧳏狸。\n[音義-5]：音丕；\n[郭注-6]：此通名耳。', '卷八', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (298, '貛;貒', '', '貛，12關西謂之貒。3', '[郭注-1]：貛，豚也。\n[音義-2]：音歡；\n[音義-3]：音波湍。', '卷八', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (299, '雞;鸊氏;割雞;從;抱;鷇;涅', '鸊鷉', '雞，陳楚宋魏之閒謂之鸊䲬{鸊氏}[鸊鷉]；1桂林之中謂之割雞，或曰𩀨{從}。2北燕朝鮮洌水之閒謂伏雞曰抱。34爵子及雞雛皆謂之鷇。56其卵伏而未孚始化謂之涅。', '[音義-1]：僻祇兩音；\n[音義-2]：音從；\n[郭注-3]：江東呼蓲，\n[音義-4]：央富反；抱，房奧反。\n[郭注-5]：關西曰鷇，\n[音義-6]：音狗竇。鷇，恪遘反。', '卷八', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (300, '豬;豭;彘;豕;豨;豚;豯;豬子;竲', '', '豬，北燕朝鮮之閒謂之豭；1關東西或謂之彘，或謂之豕；南楚謂之豨。2其子或謂之豚，或謂之豯。吳揚之閒謂之豬子。其檻及蓐曰橧{竲}。34', '[郭注-1]：猶云豭斗也；\n[音義-2]：音奚；\n[郭注-3]：爾雅曰：「所寢，橧。」\n[音義-4]：音繒。', '卷八', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (301, '布穀;結誥;擊穀', '秸𪈓', '布穀，1自關東西梁楚之閒謂之結誥[秸𪈓]，周魏之閒謂之擊穀，自關而西或謂之布穀。', '[郭注-1]：今江東呼爲穫穀。', '卷八', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (302, '旱鴠;定甲;獨舂;城旦;倒縣;渴鴠', '', '䳚鴠{旱鴠}，12周魏齊宋楚之閒謂之定甲，或謂之獨舂；3自關而東謂之城旦，4或謂之倒縣，5或謂之䳚鴠；自關而西秦隴之内謂之鶡鴠{渴鴠}。', '[郭注-1]：鳥似雞，五色，冬無毛，赤倮，晝夜鳴。\n[音義-2]：侃旦兩音；\n[郭注-3]：好自低仰；\n[郭注-4]：言其辛苦有似于罪謫者；\n[郭注-5]：好自縣于樹也。', '卷八', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (303, '鳩;良皋;鸊皋;匊鳩;鳻鳩;役鳩;癸鳩;孚鳩;鶻鳩;鷦', '頒鳩', '鳩，自關而東周鄭之郊、韓魏之都謂之𪁜鷎{良皋}，1其𪁛鳩謂之鸊鷎{鸊皋}；自關而西秦漢之閒謂之鵴鳩{匊鳩}，2其大者謂之鳻鳩[頒鳩]，3其小者謂之𪁛鳩{役鳩}、4或謂之䳫鳩{癸鳩}、5或謂之䳕鳩{孚鳩}、6或謂之鶻鳩；梁宋之閒謂之鷦。', '[音義-1]：郎皋。\n[音義-2]：音菊花；\n[音義-3]：鳻音斑；\n[郭注-4]：今荆鳩也；\n[音義-5]：䳫音葵；\n[音義-6]：䳕音浮。', '卷八', '方言', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (304, '尸鳩;畐丕;戴任;戴南;鶭澤;戴鳻;戴勝;任;服畐;复畐', '戴任;𪀐鵖', '䲩鳩{尸鳩}，12燕之東北朝鮮洌水之閒謂之鶝䲹{畐丕}。3自關而東謂之戴鵀{戴任}。東齊海岱之閒謂之戴南[戴任]，南猶鵀也；4或謂之鶭鸅{鶭澤}；5或謂之戴鳻；或謂之戴勝。6東齊吳揚之閒謂之鵀{任}。自關而西謂之服鶝{服畐}，或謂之𪃃鶝{复畐}[𪀐鵖]。燕之東北朝鮮洌水之閒謂之𪂉。7', '[郭注-1]：按爾雅卽布穀，非戴勝也，或云鸇，皆失之也；\n[音義-2]：音尸；\n[音義-3]：福丕兩音；\n[郭注-4]：此亦語楚聲轉也；\n[郭注-5]：按爾雅說戴鵀，下鶭鸅自別一鳥名，方言似依此義，又失也；\n[郭注-6]：勝所以纏絍；\n[音義-7]：音域。', '卷八', '方言', '4;10', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (305, '蝙蝠;服翼;飛鼠;老鼠;㒨鼠;戠墨', '', '蝙蝠，1自關而東謂之服翼，或謂之飛鼠，或謂之老鼠，或謂之㒨鼠；自關而西秦隴之閒謂之蝙蝠；北燕謂之蟙䘃{戠墨}。2', '[音義-1]：邊福兩音；\n[音義-2]：職墨兩音。', '卷八', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (306, '鴈;鴚䳘;䳘;倉鴚', '', '鴈，自關而東謂之鴚䳘；南楚之外謂之䳘，或謂之倉鴚。12', '[郭注-1]：今江東通呼爲鴚。\n[音義-2]：音加；', '卷八', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (307, '桑飛;工爵;過𦟀;女匠;寧鴂;懱爵', '', '桑飛，1自關而東謂之工爵，或謂之過鸁{過𦟀}，2或謂之女𪀘{女匠}。3自關而東謂之鸋鴂{寧鴂}；4自關而西謂之桑飛，或謂之懱爵。56', '[郭注-1]：卽鷦鷯也，又名鷦鸎；\n[音義-2]：音螺；\n[郭注-3]：今亦名爲巧婦，江東呼布母；\n[郭注-4]：按爾雅云：「鸋鴃，鴟鴞。鴟屬。」非此小雀明矣。\n[郭注-5]：言懱𢧵也。\n[音義-6]：甯玦兩音；', '卷八', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (308, '麗黃;倉庚;黃鳥;楚雀', '離黃', '𪈳黃{麗黃}[離黃]，自關而東謂之鶬鶊{倉庚}；1自關而西謂之𪈳黃，2或謂之黃鳥，或謂之楚雀。', '[郭注-1]：又名商庚；\n[郭注-2]：其色黧黑而黃，因名之。', '卷八', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (309, '守宮;盧廛;蜥易;易易;蛇醫;榮蚖;虒侯;祝延;蛤解', '', '守宮，秦晉西夏謂之守宮，或謂之蠦𧔊{盧廛}，1或謂之蜥易；23其在澤中者謂之易蜴{易易}。南楚謂之蛇醫，或謂之蠑螈{榮蚖}。4東齊海岱謂之螔䗔{虒侯}。56北燕謂之祝蜒{祝延}。7桂林之中守宮大者而能鳴謂之蛤解。8910', '[音義-1]：盧纏兩音；\n[郭注-2]：南陽人又呼蝘蜓；\n[音義-3]：蜴，音析；\n[音義-4]：榮元兩音；\n[郭注-5]：似蜤易大而有鱗，今所在通言蛇醫耳。\n[音義-6]：斯侯兩音；\n[音義-7]：音延；\n[郭注-8]：似蛇醫而短，身有鱗采，江東人呼爲蛤蚧，\n[音義-9]：音頜頷\n[郭注-10]：，汝潁人直名爲蛤，解音懈，誤聲也。', '卷八', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (310, '鼠;隹', '', '宛野謂鼠爲𪕪{隹}。12', '[郭注-1]：宛、新野，今皆在南陽。\n[音義-2]：音錐。', '卷八', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (311, '雞雛;秋子', '', '雞雛，徐魯之閒謂之䨂子{秋子}。12', '[郭注-1]：徐，今下邳僮縣東南大徐城是也。\n[音義-2]：䨂，子幽反。', '卷八', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (312, '戟;孑;戭;戈;鏝胡;鉤孑鏝胡', '', '戟，楚謂之孑。1凡戟而無刃秦晉之閒謂之孑，或謂之鏔{戭}；2吳揚之閒謂之戈。東齊秦晉之閒謂其大者曰鏝胡，其曲者謂之鉤孑鏝胡。34', '[郭注-1]：取名于鉤孑也；\n[音義-2]：音寅；\n[郭注-3]：卽今雞鳴，鉤孑戟也。\n[音義-4]：音泥鏝；', '卷九', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (313, '三刃枝;匽戟;柲;殳', '', '三刃枝，1南楚宛郢謂之匽戟。2345其柄自關而西謂之柲，6或謂之殳。7', '[郭注-1]：今戟中有小孑刺者，所謂雄戟也；\n[郭注-2]：郢，今江陵也，\n[音義-3]：余整反\n[郭注-4]：；\n[音義-5]：匽，音偃。\n[音義-6]：音祕；\n[音義-7]：音殊。', '卷九', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (314, '矛;鉈;鋋;鏦;矜', '', '矛，吳揚江淮南楚五湖之閒謂之鍦{鉈}，12或謂之鋋，3或謂之鏦。45其柄謂之矜。6', '[郭注-1]：五湖，今吳興大湖也。先儒處之多亦不了，所未能詳者；\n[音義-2]：嘗蛇反。\n[音義-3]：音蝉；\n[郭注-4]：漢書曰：「鏦殺吳王。」\n[音義-5]：錯工反；\n[音義-6]：矜，今字作𥎊，巨巾反。', '卷九', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (315, '箭;矢;鍭', '', '箭，自關而東謂之矢，江淮之閒謂之鍭，1關西曰箭。2', '[音義-1]：音侯；\n[郭注-2]：箭者竹名，因以爲號。', '卷九', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (316, '鑽;耑', '䤸;䤸', '鑽[䤸]謂之鍴{耑}[䤸]。1', '[音義-1]：音端。', '卷九', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (317, '矜;杖', '', '矜謂之杖。1', '[郭注-1]：矛戟𥎊，卽杖也。', '卷九', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (318, '室;郭;削;鞞', '', '劍削，自河而北燕趙之閒謂之室；自關而東或謂之廓{郭}，或謂之削；自關而西謂之𩏂{鞞}。1', '[音義-1]：方婢反。', '卷九', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (319, '盾;瞂;干', '𢧀', '盾，自關而東或謂之瞂，1或謂之干[𢧀]；2關西謂之盾。', '[音義-1]：音伐；\n[郭注-2]：干者，扞也。', '卷九', '方言', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (320, '失;畢;綦', '紩;䩛', '車下鉄{失}[紩]，陳宋淮楚之閒謂之畢[䩛]，大者謂之綦。12', '[郭注-1]：鹿車也。\n[音義-2]：音忌。', '卷九', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (321, '轊;龍', '', '車轊，12齊謂之𨏠{龍}。3', '[郭注-1]：車軸頭也。\n[音義-2]：于厲反；\n[郭注-3]：又名𨎬。', '卷九', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (322, '枸簍;恢;蛩籠;灼;冥;畚;逢;隆屈', '槶;穹隆;糸;轒', '車枸簍，12宋魏陳楚之閒謂之䈐{恢}[槶]，34或謂之𥳎籠{蛩籠}[穹隆]。5其上約謂之𥭓{灼}，67或謂之䈿{冥}[糸]。8秦晉之閒自關而西謂之枸簍；西隴謂之㮥{畚}[轒]；910南楚之外謂之篷{逢}，11或謂之隆屈。12', '[郭注-1]：卽車弓也。\n[音義-2]：音縷；\n[郭注-3]：今呼車子弓爲䈐。\n[音義-4]：音巾幗；\n[郭注-5]：穹隆兩音；\n[郭注-6]：卽軬帶也。\n[音義-7]：音瓜瓝；\n[音義-8]：音覛；\n[郭注-9]：卽軬字。\n[音義-10]：薄晩反；\n[郭注-11]：今亦通呼篷；\n[郭注-12]：尾屈。', '卷九', '方言', '2;3;5;6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (323, '輪;軑;軝;㚇', '鏓', '輪，1韓楚之閒謂之軑，2或謂之軝。34關西謂之𨍈{㚇}[鏓]。5', '[郭注-1]：車輅也；\n[音義-2]：音大；\n[郭注-3]：詩曰：「約軝錯衡。」\n[音義-4]：音祇；\n[音義-5]：音總。', '卷九', '方言', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (324, '輑;軸', '', '輑謂之軸。1', '[音義-1]：輑，牛忿反。', '卷九', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (325, '轅;輈', '', '轅，楚衞之閒謂之輈。1', '[音義-1]：張由反。', '卷九', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (326, '箱;篚', '', '箱謂之輫{篚}。1', '[音義-1]：音俳。', '卷九', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (327, '軫;枕', '', '軫謂之枕。1', '[郭注-1]：車後橫木。', '卷九', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (328, '紂;秋;曲匋;曲綸', '緧', '車紂，自關而東周洛韓鄭汝潁而東謂之䋺{秋}[緧]，1或謂之曲綯{曲匋}，2或謂之曲綸；34自關而西謂之紂。', '[音義-1]：音秋；\n[郭注-2]：綯亦䋲名，詩曰：「宵爾索綯。」；\n[郭注-3]：今江東通呼索綸。\n[音義-4]：音倫。', '卷九', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (329, '輨;軑;鍊𨬍', '輨軑', '輨、軑，鍊𨬍[輨軑]也。關之東西曰輨，1南楚曰軑，2趙魏之閒曰鍊𨬍。3', '[音義-1]：音管；\n[音義-2]：音大；\n[音義-3]：鍊音柬，𨬍音度果反。', '卷九', '方言', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (330, '釭;楇;昆', '', '車釭，齊燕海岱之閒謂之鍋{楇}，1或謂之錕{昆}；2自關而西謂之釭，盛膏者乃謂之鍋。', '[音義-1]：音戈；\n[音義-2]：音衮衣。', '卷九', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (331, '鉤腸;羊頭;錍;鈀;甲鑪;飛䖟;平題;箙;鞬;韇丸', '', '凡箭鏃胡合嬴者，1四鐮，2或曰鉤腸，三鐮者謂之羊頭，其廣長而薄鐮謂之錍，3或謂之鈀。4箭，其小而長中穿二孔者謂之鉀鑪{甲鑪}。56其三鐮長六尺者謂之飛䖟，7禸者謂之平題。8所以藏箭弩謂之箙。9弓謂之鞬，10或謂之𥀲丸{韇丸}。11', '[郭注-1]：胡鏑在于喉下，嬴，邊也；\n[郭注-2]：稜也。\n[音義-3]：普蹄反；\n[音義-4]：音葩；\n[郭注-5]：今箭錍鑿空兩邊者也。\n[音義-6]：㗐嚧兩音；\n[郭注-7]：此謂今射箭也；\n[郭注-8]：今戲射箭頭題猶羊頭也。\n[郭注-9]：盛弩箭器也。外傳曰：「檿弧箕箙。」\n[音義-10]：音犍牛；\n[音義-11]：音牛犢。', '卷九', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (332, '鶴厀;鉤孑;矛;孑;錟;鈹;骹;銎;鐏;釬', '', '矛骹細如鴈脛者謂之鶴厀。1有小枝刃者謂之鉤𨥂{鉤孑}。矛或謂之𨥂{孑}。錟謂之鈹。23骹謂之銎。45鐏謂之釬。67', '[郭注-1]：今江東呼爲鈐釘；\n[郭注-2]：今江東呼大矛爲鈹，\n[音義-3]：音彼。錟，音𦕃；\n[郭注-4]：卽矛刃下口。\n[音義-5]：音凶；\n[郭注-6]：或名爲鐓，\n[音義-7]：音頓。釬，音扞。', '卷九', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (333, '舟;船;𣃚;舸;差;冒宿;艇;帶;符;巩;欚', '', '舟，自關而西謂之船；自關而東或謂之舟，或謂之航{𣃚}。1南楚江湘凡船大者謂之舸，2小舸謂之艖{差}。34艖謂之艒䑿{冒宿}，5小艒䑿謂之艇。6艇長而薄者謂之艜{帶}，7短而深者謂之䒀{符}，89小而深者謂之㮪{巩}。1011東南丹陽會稽之閒謂艖爲欚。12', '[音義-1]：音行伍；\n[音義-2]：姑可反；\n[郭注-3]：今江東呼艖小底者也。\n[音義-4]：音叉；\n[音義-5]：目宿二音；\n[郭注-6]：𦨴也；\n[音義-7]：音衣帶；\n[郭注-8]：今江東呼艖䒀者。\n[音義-9]：音步；\n[郭注-10]：卽長舼也。\n[音義-11]：音卭竹；\n[音義-12]：音禮。', '卷九', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (334, '泭;椑;伐;薦', '橃', '泭謂之𥴖{椑}，1𥴖謂之筏{伐}[橃]。2筏，秦晉之通語也。江淮家居𥴖中謂之薦。3', '[音義-1]：泭音敷；\n[音義-2]：音伐；\n[音義-3]：音箭。', '卷九', '方言', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (335, '方舟;㶇;艁舟;浮梁', '', '方舟謂之㶇，12艁舟謂之浮梁。3', '[郭注-1]：揚州人呼渡津舫爲杭，荆州人呼㶇。\n[音義-2]：音橫；\n[郭注-3]：卽今浮橋。', '卷九', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (336, '楫;橈;櫂;䉃;緝;篙;維;鼎;首;閤閭;益首;舳;僞;扤', '鶃首;𦨉', '楫謂之橈，1或謂之櫂。2所以隱櫂謂之𥷃{䉃}，34所以縣櫂謂之緝，5所以刺船謂之㰏{篙}。6維之謂之鼎，7首謂之閤閭，8或謂之艗艏{益首}[鶃首]。910後曰舳，舳，制水也。1112儰{僞}謂之扤[𦨉]，扤，不安也。1314', '[音義-1]：如寮反；\n[郭注-2]：今云櫂歌，依此名也；\n[郭注-3]：摇樐小橛也。江東又名爲胡人。\n[音義-4]：音奬；\n[郭注-5]：繫櫂頭索也；\n[音義-6]：音高；\n[郭注-7]：繫船爲維；\n[郭注-8]：今江東呼船頭屋謂之飛間是也；\n[郭注-9]：鷁，鳥名也。今江東貴人船前作靑雀，是其像也。\n[音義-10]：音亦；\n[郭注-11]：舳，今江東呼柁爲舳。\n[音義-12]：音軸；\n[郭注-13]：船動摇之貌也。\n[音義-14]：扤，吾㪍反。儰音訛。', '卷九', '方言', '11;14', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (337, '媱;愓;遊;僖', '', '媱、愓，遊也。江沅之閒謂戲爲媱，或謂之愓，1或謂之嬉{僖}。2', '[音義-1]：音羊；\n[音義-2]：香其反。', '卷十', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (338, '曾;訾;何', '', '曾、訾，何也。湘潭之原荆之南鄙謂何爲曾，123或謂之訾，4若中夏言何爲也。', '[郭注-1]：潭，水名，出武陵，\n[音義-2]：音譚，亦音淫\n[郭注-3]：；\n[郭注-4]：今江東人語亦云訾，爲聲如斯。', '卷十', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (339, '央亡;墨杘;𡜶;獪;無賴;㺒;娗;滑', '獪;謬', '央亡、嚜杘{墨杘}、𡜶[獪]，獪也。江湘之閒或謂之無賴，或謂之㺒[謬]。1凡小兒多詐而獪謂之央亡，或謂之嚜杘，23或謂之𡜶。45𡜶，娗也。6或謂之猾{滑}。7皆通語也。', '[郭注-1]：㤍𢙘，多智也。恪交反；\n[郭注-2]：潛潛狡也；\n[音義-3]：嚜，音目；杘，丑夷反；\n[郭注-4]：言黠𡜶也；\n[音義-5]：胡𠜜反；\n[郭注-6]：言恫娗也；\n[音義-7]：音滑。', '卷十', '方言', '3;6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (340, '子;子', '', '崽{子}者，子也。湘沅之會，12凡言是子者謂之崽，若東齊言子矣。3', '[郭注-1]：两水合處也。\n[音義-2]：音獪。\n[音義-3]：崽音枲，聲之轉也；聲如宰。', '卷十', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (341, '來;亡;秕', '', '誺{來}，不知也。沅澧之閒，12凡相問而不知答曰誺，3使之而不肯答曰吂{亡}。45粃{秕}，不知也。6', '[郭注-1]：澧水，今在長沙。\n[音義-2]：音禮。\n[音義-3]：江東曰咨，此亦知聲之轉也；音癡眩。\n[郭注-4]：今中國語亦然；\n[音義-5]：音茫。\n[郭注-6]：今淮楚閒語呼聲如非也。', '卷十', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (342, '果;火;𤈦', '火', '㷄{果}[火]，1火也。楚轉語也，猶齊言𤈦，2火也。', '[音義-1]：呼隗反；\n[音義-2]：音毁。', '卷十', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (343, '嘳;無寫;憐;思;人兮', '', '嘳、無寫，憐也。1沅澧之原凡言相憐哀謂之嘳，2或謂之無寫，江濱謂之思。3皆相見驩喜有得亡之意也。九疑湘潭之閒謂之人兮。4', '[郭注-1]：皆南鄙之代語也；\n[音義-2]：音蒯；\n[郭注-3]：濱，水邊也；\n[郭注-4]：九疑，山名，今在零陵營道縣。', '卷十', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (344, '岸;嫧;鮮;好', '妍;鱻', '婩{岸}[妍]、1嫧、2鮮[鱻]，好也。南楚之外通語也。', '[音義-1]：魚踐反；\n[音義-2]：音策。', '卷十', '方言', '1;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (345, '闌牢;謰謱;拏;支主;占謕;惹;㛪', '支主', '㘓哰{闌牢}、謰謱，拏也。東齊周晉之鄙曰㘓哰，㘓哰亦通語也；12南楚曰謰謱，3或謂之支註{支主}，4或謂之詀謕{占謕}[支主]，轉語也；5拏，揚州會稽之語也，67或謂之惹，89或謂之䛳{㛪}。10', '[郭注-1]：平原人好㘓哰也；\n[音義-2]：闌牢二音；\n[音義-3]：上音連，下力口反；\n[音義-4]：支，之䜴反。註，音注；\n[音義-5]：上託兼反，下音蹄；\n[郭注-6]：言譇拏也。\n[音義-7]：奴加反；\n[郭注-8]：言情惹也。\n[音義-9]：汝邪反，一音若；\n[郭注-10]：言誣䛳也。', '卷十', '方言', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (346, '𠄌;𠻮;貪;吝', '', '亄{𠄌}、𠻮，貪也。1荆汝江湘之郊凡貪而不施謂之亄，23或謂之𠻮，或謂之悋{吝}。悋，恨也。4', '[郭注-1]：謂慳貪也；\n[郭注-2]：亦中國之通語；\n[音義-3]：音懿；\n[郭注-4]：慳者多惜恨也。', '卷十', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (347, '遙;窕;淫', '媱;姚;婬', '遙[媱]、窕[姚]，淫[婬]也。九疑荆郊之鄙謂淫曰遙，1沅湘之閒謂之窕。2', '[郭注-1]：言心遙蕩也；\n[郭注-2]：窈窕冶容。', '卷十', '方言', '1;2;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (348, '潛;涵;沈;游', '湛', '潛、涵，沈[湛]也。楚郢以南曰涵，1或曰潛。潛又游也。2', '[音義-1]：音含，或古南反；\n[郭注-2]：潛行水中亦爲游也。', '卷十', '方言', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (349, '𡧯;安;靜', '', '𡧘{𡧯}、安，靜也。江湘九疑之郊謂之𡧘。1', '[音義-1]：音寂。', '卷十', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (350, '半;棄;敲;投', '播', '拌{半}[播]，棄也。楚凡揮棄物謂之拌，1或謂之敲；23淮汝之閒謂之投。45', '[音義-1]：音伴，又普槃反；\n[郭注-2]：今汝潁間語亦然。或云撅也；\n[音義-3]：恪校反。\n[郭注-4]：江東又呼擫。\n[音義-5]：音黶，又音揞。', '卷十', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (351, '椓;愬', '', '諑{椓}，愬也。楚以南謂之諑。1', '[郭注-1]：諑、譖亦通語也。', '卷十', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (352, '戲;泄;歇;奄', '羲', '戲[羲]、泄，歇也。楚謂之戲泄。1奄，息也。楚揚謂之泄。', '[音義-1]：戲，音羲。', '卷十', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (353, '弗;曬', '', '昲{弗}、1曬，乾物也。揚楚通語也。2', '[音義-1]：音費。\n[郭注-2]：亦皆北方常語耳。或云㬓。', '卷十', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (354, '匪;卒', '猝', '䕁{匪}，卒[猝]也。1江湘之閒凡卒相見謂之䕁，2相見或曰突。3', '[郭注-1]：謂倉卒也；\n[音義-2]：音斐；\n[音義-3]：他骨反。', '卷十', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (355, '迹迹;㞕㞕;塞塞;省省', '', '迹迹、㞕㞕，不安也。1江沅之閒謂之迹迹；秦晉謂之㞕㞕，或謂之塞塞，或謂之省省，不安之語也。', '[郭注-1]：皆往來之貌也。', '卷十', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (356, '鬩沭;正伀;遑遽', '鬩怵;䋫㤨', '𤄎沭{鬩沭}[鬩怵]、佂伀{正伀}[䋫㤨]，遑遽也。江湘之閒凡窘猝怖遽謂之𤄎沭，12或謂之佂伀。', '[郭注-1]：喘𠴲貌也。\n[音義-2]：𤄎，音鬩；', '卷十', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (357, '翥;舉', '', '翥，舉也。1楚謂之翥。', '[郭注-1]：謂軒翥也。', '卷十', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (358, '衂怩;慙歰;蹙咨', '恧怩', '忸怩{衂怩}[恧怩]，慙歰也。1楚郢江湘之閒謂之忸怩，或謂之㗤咨{蹙咨}。2', '[郭注-1]：歰猶苦者；\n[音義-2]：子六、莊伊二反。', '卷十', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (359, '垤;封;場', '', '垤、封，場也。楚郢以南蟻土謂之封。垤，中齊語也。', '', '卷十', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (360, '謫;過;衇;慧', '', '讁{謫}，過也。1南楚以南凡相非議人謂之讁，2或謂之衇。衇，又慧也。34', '[郭注-1]：謂罪過也。\n[音義-2]：音賾，亦音適，罪罰也；\n[郭注-3]：今名黠爲鬼衇。\n[音義-4]：音血脈；', '卷十', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (361, '膊;兄;蠡', '䨣;剺', '膊[䨣]，兄也。荆揚之鄙謂之膊。桂林之中謂之⿰彖孟{劙}{蠡}[剺]。1', '[郭注-1]：此音義所未詳。', '卷十', '方言', '1;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (362, '蹇;極;吃;軋;歰', '㥛;乙', '𧮈{蹇}、極[㥛]，吃也。楚語也。1或謂之軋[乙]，23或謂之歰。45', '[郭注-1]：亦北方通語也；\n[郭注-2]：鞅軋，氣不利也。\n[音義-3]：烏八反；\n[郭注-4]：語歰難也。今江南又名吃爲𠿚，\n[音義-5]：若葉反。', '卷十', '方言', '2;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (363, '啙;罷;短;齊;㾈', '䇑', '啙、矲{罷}[䇑]，短也。江湘之會謂之啙。1凡物生而不長大亦謂之啙，又曰癠{齊}。23桂林之中謂短矲。4矲，通語也。5東陽之閒謂之㾈。6', '[音義-1]：昨啓反；\n[郭注-2]：今俗呼小爲癠。\n[音義-3]：音薺菜；\n[郭注-4]：言矲雉也。\n[音義-5]：蒲楷反；\n[郭注-6]：言俯視之，因名。', '卷十', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (364, '鉗;反;敝;惡', '', '鉗、㽹{反}、憋{敝}，1惡也。南楚凡人殘罵謂之鉗，2又謂之㽹。34', '[郭注-1]：憋怤，急性也，妨滅反；\n[郭注-2]：殘猶惡也。鉗害，又惡也；\n[郭注-3]：㽹恎，惡腹也。\n[音義-4]：妨反反；', '卷十', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (365, '癡;騃;耳;斫', '譺懝;佁', '癡[譺懝]，騃[佁]也。1揚越之郊凡人相侮以爲無知謂之眲{耳}，眲，耳目不相信也。23或謂之斫。45', '[音義-1]：吾駭反；\n[郭注-2]：因字名也；\n[音義-3]：諾革反；\n[郭注-4]：斫，頑直之貌，今關西語亦皆然。\n[音義-5]：音斫卻。', '卷十', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (366, '混;誖;頓愍;惛;氐惆;眠眩', '溷', '惃{混}[溷]、𢠜{誖}、頓愍，惛也。1楚揚謂之惃，2或謂之𢠜；3江湘之閒謂之頓愍，4或謂之氐惆。56南楚飲毒藥懣謂之氐惆，亦謂之頓愍，猶中齊言眠眩也。愁恚憒憒、毒而不發謂之氐惆。', '[郭注-1]：謂迷惛也；\n[音義-2]：音衮衣；\n[音義-3]：音㪍；\n[郭注-4]：頓愍猶頓悶也；\n[郭注-5]：氐惆，猶懊憹也。\n[音義-6]：丁弟、丁牢二反；', '卷十', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (367, '挩;舒;蘓', '', '悅{挩}、舒，蘓也。1楚通語也。', '[郭注-1]：謂蘇息也。', '卷十', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (368, '眠娗;脈痬;賜施;茭媞;亶謾;詈詑;欺謾', '', '眠娗、1脈蜴{脈痬}、2賜施、3茭媞、4譠謾{亶謾}、5㦒忚{詈詑}，6皆欺謾之語也。楚郢以南東揚之郊通語也。7', '[音義-1]：莫典、塗殄二反；\n[音義-2]：蜴，音析；\n[音義-3]：音輕易；\n[音義-4]：恪校、得懈二反；\n[音義-5]：託蘭、莫蘭二反；\n[音義-6]：麗、醯二音；\n[郭注-7]：六者亦中國相輕易蚩弄之言也。', '卷十', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (369, '旃;頟;顔;顙', '', '𩔣{旃}、頟、顔，顙也。湘江之閒謂之𩔣，12中夏謂之頟，東齊謂之顙，汝潁淮泗之閒謂之顔。', '[郭注-1]：今建平人呼頟爲𩔣。\n[音義-2]：音旃裘；', '卷十', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (370, '頷;頤;頜', '顄', '頷[顄]、頤，頜也。1南楚謂之頷，2秦晉謂之頜。頤，其通語也。', '[郭注-1]：謂頷車也；\n[郭注-2]：亦今通語耳。', '卷十', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (371, '紛怡;喜;巸巳', '媐饎巳', '紛怡，喜也。湘潭之閒曰紛怡，或曰巸巳[媐饎巳]。1', '[音義-1]：嬉怡二音。', '卷十', '方言', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (372, '邯;或', '', '𣵷{邯}，或也。沅澧之閒凡言或如此者曰𣵷如是。12', '[郭注-1]：此亦憨聲之轉耳。\n[音義-2]：音酒酣；', '卷十', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (373, '䍃;療;治;憂', '', '愮{䍃}、療，治也。江湘郊會謂醫治之曰愮。12愮又憂也。3或曰療。', '[郭注-1]：俗云厭愮病。\n[音義-2]：音曜；\n[郭注-3]：博異義也。', '卷十', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (374, '芔;莽;草', '茻;艸', '芔、莽[茻]，草[艸]也。東越揚州之閒曰芔，1南楚曰莽。2', '[音義-1]：凶位反；\n[音義-2]：音嫫母。', '卷十', '方言', '2;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (375, '悈;思;乾;都;耇;革;老', '', '悈、1鰓{思}、2乾、3都、耇、4革，老也。5皆南楚江湘之閒代語也。6', '[音義-1]：音良愅；\n[音義-2]：音魚鰓；\n[音義-3]：音干；\n[音義-4]：音垢；\n[郭注-5]：皆老者皮色枯瘁之形也；\n[郭注-6]：凡以異語相易謂之代也。', '卷十', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (376, '柲;抌;椎;忽;攩', '', '㧙{柲}、抌，1椎也。南楚凡相椎搏曰㧙，2或曰㧾{忽}；3沅涌𣿆幽之語或曰攩。4567', '[音義-1]：都感反，亦音甚；\n[音義-2]：音神祕；\n[音義-3]：苦骨反；\n[郭注-4]：𣿆水，今在桂陽。\n[音義-5]：音扶。\n[郭注-6]：涌水，今在南郡華容縣也；今江東人亦名推爲攩，\n[音義-7]：音晃。', '卷十', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (377, '食閻;慫涌;勸', '', '食閻、慫慂{慫涌}，勸也。南楚凡己不欲喜而㫄人說之、不欲怒而㫄人怒之謂之食閻，1或謂之慫慂。2', '[音義-1]：音鹽；\n[音義-2]：上子竦反，下音涌。', '卷十', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (378, '欸;殹;然', '唉', '欸[唉]、𧫦{殹}，然也。南楚凡言然者曰欸，1或曰𧫦。2', '[音義-1]：音醫，或音塵埃；\n[音義-2]：音鳧鷖。', '卷十', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (379, '緤;末;紀;緒;端', '', '緤、末、紀，緒也。南楚皆曰緤，1或曰端、或曰紀、或曰末，皆楚轉語也。', '[音義-1]：音薛。', '卷十', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (380, '葼;𠭥;闚;占;占;伺;視;司;瞻', '䚕;窺;覘;覘;司', '䁓{葼}、𣛒{𠭥}[䚕]、闚[窺]、䀡{占}[覘]、占[覘]、伺[司]，視也。凡相竊視南楚謂之闚、或謂之䁓、1或謂之䀡、2或謂之占、或謂之𣛒。𣛒，中夏語也。34闚，其通語也。自江而北謂之䀡、或謂之覗{司}。凡相候謂之占，占猶瞻也。', '[音義-1]：音總；\n[音義-2]：敕纖反；\n[郭注-3]：亦言𥉹也。\n[音義-4]：音麗；', '卷十', '方言', '2;3;4;5;6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (381, '邕;濃;盛;多', '', '郺{邕}、𨑊{濃}、晠{盛}，多也。南楚凡大而多謂之郺，1或謂之𨑊。2凡人語言過度及妄施行亦謂之𨑊。', '[音義-1]：惡孔反；\n[音義-2]：奴動反。', '卷十', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (382, '抯;𠭯;取', '', '抯、摣{𠭯}，取也。南楚之閒凡取物溝泥中謂之抯，1或謂之摣。2', '[音義-1]：音柤棃；\n[音義-2]：仄加反。', '卷十', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (383, '汎;僄;輕', '', '𠆩{汎}、僄，輕也。楚凡相輕薄謂之相𠆩，1或謂之僄。2', '[音義-1]：音汎；\n[音義-2]：音飄零。', '卷十', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (384, '多蚗;螇鹿;蟪蛄;蛉蛄;蛁勞;是勞;蜓木', '𧉅蚗;蛁尞', '蛥蚗{多蚗}[𧉅蚗]，1齊謂之螇螰{螇鹿}；2楚謂之蟪蛄，3或謂之蛉蛄；4秦謂之蛥蚗；自關而東謂之虭蟧{蛁勞}[蛁尞]，56或謂之蝭蟧{是勞}，7或謂之蜓蚞{蜓木}，8西楚與秦通名也。', '[音義-1]：蛥，音折。蚗，于列反，一音玦；\n[音義-2]：奚鹿二音；\n[郭注-3]：莊子曰：「蟪蛅不知春秋也」；\n[音義-4]：音零；\n[郭注-5]：江東人呼嘄蟧。\n[音義-6]：貂料二音；\n[音義-7]：音啼；\n[音義-8]：廷木二音；', '卷十一', '方言', '1;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (385, '蟬;蜩;唐蜩;蜋蜩;奇;勞;蝒馬;麥札;蜻蜻;尐;戔;蜺;蟊蜩;應;寒蜩;瘖蜩', '𧉄馬;麥蠽', '蟬，楚謂之蜩，1宋衞之閒謂之螗蜩{唐蜩}，2陳鄭之閒謂之蜋蜩，3秦晉之閒謂之蟬，海岱之閒謂之䗁{奇}。45其大者謂之蟧{勞}，或謂之蝒馬{𧉄馬}；6其小者謂之麥蚻{麥札}[麥蠽]，789有文者謂之蜻蜻，10其雌蜻謂之尐，11大而黑者謂之䗃[戔]，12黑而赤者謂之蜺。13蜩蟧謂之𧓿蜩{蟊蜩}。14𧕄{應}謂之寒蜩，寒蜩，瘖蜩也。1516', '[音義-1]：音調；\n[郭注-2]：今胡蟬也，似蟬而小，鳴聲淸亮，江南呼螗蛦；\n[音義-3]：音良；\n[郭注-4]：齊人呼爲巨䗁。\n[音義-5]：音技；\n[郭注-6]：案爾雅：「蝒者，馬蜩。」非別名蝒馬也，此方言誤耳；\n[郭注-7]：如蟬而小，靑色。今關西呼麥蠽，\n[音義-8]：音癰𤻵之𤻵\n[郭注-9]：；\n[郭注-10]：卽蚻也，爾雅云耳；\n[音義-11]：祖一反；\n[音義-12]：音棧；\n[音義-13]：音雲霓。\n[郭注-14]：江東呼爲𧓿蠽也。\n[郭注-15]：案爾雅以蜺爲寒蜩，月令亦曰「寒蜩鳴」，知寒蜩非瘖者也。此諸蜩名，通出爾雅而多駮雜，未可詳據也。寒蜩，螿也，似小蟬而色靑。\n[音義-16]：𧕄，音應。', '卷十一', '方言', '7;8', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (386, '蛄諸;杜各;螻室;螻蛄;象蛉;杜狗;𠯑螻', '', '蛄諸謂之杜蛒{杜各}。1螻𧍱{螻室}謂之螻蛄，2或謂之蟓蛉{象蛉}。3南楚謂之杜狗，或謂之𧋣螻{𠯑螻}。', '[音義-1]：音格；\n[音義-2]：螻𧍱，音窒塞；\n[音義-3]：象鈴二音。', '卷十一', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (387, '蜻蛚;蟋率;共;王孫', '悉𧍓', '蜻蛚，12楚謂之蟋蟀{蟋率}[悉𧍓]，或謂之蛬{共}；34南楚之閒謂之蚟孫{王孫}。5', '[郭注-1]：卽趨織也。\n[音義-2]：精列二音；\n[郭注-3]：梁國呼蛬。\n[音義-4]：音鞏；\n[音義-5]：孫，一作𠬆。', '卷十一', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (388, '堂蜋;髦;丁;芈芈', '', '螳螂{堂蜋}謂之髦，1或謂之虰{丁}，2或謂之蝆蝆{芈芈}。', '[郭注-1]：有斧蟲也。江東呼爲石蜋，又名齕肬；\n[郭注-2]：案爾雅云：「螳蜋，蛑。」「虰」義自應下屬。方言依此說，失其指也。', '卷十一', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (389, '蛄䗐;強羊', '', '姑䗐{蛄䗐}謂之強蛘{強羊}。123', '[郭注-1]：米中小黑甲蟲也。江東謂之𧉪，\n[音義-2]：音加。\n[郭注-3]：建平人呼羊子，羊卽蛘也。', '卷十一', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (390, '莽;𧎢;蟅莽;螣', '蜢;虴蜢', '蟒{莽}[蜢]，12宋魏之閒謂之𧊇{𧎢}，3南楚之外謂之蟅蟒{蟅莽}[虴蜢]，4或謂之蟒，或謂之螣。5', '[郭注-1]：卽蝗也。\n[音義-2]：莫鯁反；\n[音義-3]：音貸；\n[音義-4]：蟅音近詐，亦呼虴蛨；\n[音義-5]：音滕。', '卷十一', '方言', '1;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (391, '蜻蛉;即蛉', '', '蜻蛉謂之蝍蛉{即蛉}。12', '[郭注-1]：六足四翼蟲也。江東名爲狐黎，淮南人呼䗧𧉅。\n[音義-2]：蛉音靈。䗧，音康。𧉅，音伊。', '卷十一', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (392, '舂黍;從蝑', '蜙蝑', '舂黍謂之𧐱蝑{從蝑}[蜙蝑]。12', '[郭注-1]：又名蚣𧐱，江東呼虴蛨。\n[音義-2]：𧐱音葼，蝑音思沮反。', '卷十一', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (393, '資就;尺蠖', '', '蠀𧑙{資就}謂之蚇蠖{尺蠖}。12', '[郭注-1]：又呼步屈。\n[音義-2]：卽踧二音。蠖，烏郭反。', '卷十一', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (394, '蠭;蠓螉;翳螉;幼蛻;壺蠭', '', '蠭，燕趙之閒謂之蠓螉。1其小者謂之蠮螉{翳螉}，23或謂之蚴蛻{幼蛻}；4其大而蜜謂之壺蠭。5', '[音義-1]：蒙翁二音；\n[郭注-2]：小細腰蠭也。\n[音義-3]：蠮螉，音鯁噎；\n[音義-4]：幽悅二音；\n[郭注-5]：今黑蠭穿竹木作孔亦有蜜者，或呼笛師。', '卷十一', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (395, '蠅;羊', '', '蠅，東齊謂之羊，1陳楚之閒謂之蠅，自關而西秦晉之閒謂之羊。', '[郭注-1]：此亦語轉耳。今江東人呼羊聲如蠅，凡此之類，皆不宜別立名也。', '卷十一', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (396, '蚍蜉;蚼象;玄蚼;蛾蛘;坻;垤', '', '蚍蜉，12齊魯之閒謂之蚼蟓{蚼象}，3西南梁益之閒謂之玄蚼，4燕謂之蛾蛘。56其場謂之坻，7或謂之垤。8', '[郭注-1]：亦呼蟞蜉。\n[音義-2]：𣬈浮二音。\n[音義-3]：駒養二音；\n[郭注-4]：法言云：「玄駒之步」是。\n[郭注-5]：建平人呼蚳，\n[音義-6]：音侈。蟻養二音。\n[音義-7]：直尸反；\n[郭注-8]：亦名冢也。', '卷十一', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (397, '資𧖤;賁;蝤資;卷屬;宣㱿;各;蝎;蛭各;蠹;天螻', '𧓉𧕐;蝤𧓉', '蠀螬{資𧖤}[𧓉𧕐]謂之蟦{賁}。1自關而東謂之蝤蠀{蝤資}[蝤𧓉]，2或謂之䖭蠾{卷屬}，3或謂之蝖𧏚{宣㱿}；45梁益之閒謂之蛒{各}，或謂之蝎，或謂之蛭蛒{蛭各}；6秦晉之閒謂之蠹，或謂之天螻。7四方異語而通者也。', '[音義-1]：音翡翠；\n[音義-2]：酋餈兩音；\n[音義-3]：音書卷；\n[郭注-4]：亦呼當齊，或呼地蠶，或呼蟦蝖。\n[音義-5]：喧斛兩音；\n[音義-6]：蛭，音質；蛒，音格；\n[郭注-7]：按爾雅云：「𧏚，天螻。」謂螻蛄耳，而方言以爲蝎，未詳其義也。', '卷十一', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (398, '由延;螾衍;入耳;長麗;蚨于;衂怩', '恧怩', '蚰蜒{由延}，12自關而東謂之螾𧍢{螾衍}，3或謂之入耳，或謂之䗅𧕯{長麗}；4趙魏之閒或謂蚨虶{蚨于}；5北燕謂之䖡蚭{衂怩}[恧怩]。6', '[郭注-1]：江東又呼蛩。\n[音義-2]：音鞏。由延二音；\n[音義-3]：螾，音引；\n[音義-4]：𧕯，音麗；\n[音義-5]：扶于二音；\n[音義-6]：䖡，奴六反。蚭，音尼。', '卷十一', '方言', '6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (399, '䵹鼄;鼄蝥;屬蝓;毒余', '', '䵹鼄，1鼄蝥也。2自關而西秦晉之閒謂之鼄蝥；34自關而東趙魏之郊謂之鼅鼄，或謂之蠾蝓{屬蝓}。5蠾蝓者，侏儒語之轉也。北燕朝鮮洌水之閒謂之蝳蜍{毒余}。67', '[音義-1]：知株二音；\n[音義-2]：蝥，音無；\n[郭注-3]：今江東呼蝃蝥。\n[音義-4]：音掇；\n[音義-5]：燭臾二音；\n[郭注-6]：齊人又呼社公，亦言罔工。\n[音義-7]：音毒餘。', '卷十一', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (400, '蜉流;渠略', '浮游;螶𧎾', '蜉䖻{蜉流}[浮游]，12秦晉之閒謂之蟝𧐯{渠略}[螶𧎾]。', '[郭注-1]：似天牛而小，有甲角，出糞土中，朝生夕死。\n[音義-2]：浮由二音；', '卷十一', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (401, '馬玄;且渠;馬由', '馬蠲', '馬蚿{馬玄}[馬蠲]，1北燕謂之蛆蟝{且渠}，2其大者謂之馬蚰{馬由}。34', '[音義-1]：音弦；\n[音義-2]：音蝍蛆；\n[郭注-3]：今關西云。\n[音義-4]：蚰，音逐。', '卷十一', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (402, '爰;爰;哀', '咺;咺', '爰[咺]、喛{爰}[咺]，12哀也。', '[郭注-1]：喛，哀而恚也。\n[音義-2]：音段。', '卷十二', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (403, '儒輸;愚', '孺輸', '儒輸[孺輸]，愚也。1', '[郭注-1]：儒輸猶懦撰也。', '卷十二', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (404, '爰;諒;知', '', '愋{爰}、諒，知也。', '', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (405, '拊;撫;疾', '駙', '拊[駙]、1撫，疾也。2', '[郭注-1]：音府；\n[郭注-2]：謂急疾也。', '卷十二', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (406, '悲;惄;悵', '', '蕜{悲}、1惄，悵也。2', '[郭注-1]：音翡；\n[郭注-2]：謂惋惆也。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (407, '鬱;熙;長', '巸', '鬱、熙[巸]，1長也。2', '[音義-1]：音怡；\n[郭注-2]：謂壯大也。', '卷十二', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (408, '娋;孟;姊', '嬃', '娋[嬃]、1孟，2姊也。', '[郭注-1]：音義未詳。\n[郭注-2]：外傳曰：「孟啖我。」是也。今江東山越閒呼姊聲如市，此因字誤遂俗也。', '卷十二', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (409, '築里;匹;耦', '妯里/𠩺', '築娌{築里}[妯里[𠩺]]，12匹也。娌，耦也。', '[郭注-1]：今關西兄弟婦相呼爲築娌。\n[音義-2]：築，度六反，廣雅作「妯」。', '卷十二', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (410, '嬴;裔;習', '習', '䃷{嬴}、1裔[習]，習也。2', '[音義-1]：音盈；\n[郭注-2]：謂玩習也。', '卷十二', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (411, '躔;逡;循;歴;行', '', '躔、1逡，2循也。躔、歴，行也。日運爲躔，3月運爲逡。4', '[音義-1]：度展反；\n[音義-2]：音逡巡。\n[郭注-3]：躔猶踐也；\n[郭注-4]：運猶行也。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (412, '逭;育;轉;步', '', '逭、逳{育}，轉也。逭、1逳，2步也。3', '[音義-1]：音換，亦管；\n[音義-2]：陽六反；\n[郭注-3]：轉相訓耳。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (413, '㷭;虞;望', '', '㷭，1虞，望也。', '[郭注-1]：今云烽火是也。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (414, '俞;隋;脫', '輸;挩', '揄{俞}[輸]，撱{隋}，脫[挩]也。', '', '卷十二', '方言', '1;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (415, '解;輸;梲', '挩', '解、輸，梲[挩]也。1', '[郭注-1]：梲猶脫耳。', '卷十二', '方言', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (416, '賦;與;操', '', '賦、與，操也。1', '[郭注-1]：謂操持也。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (417, '漉;歇;涸', '', '𣿍{漉}、1歇，2涸也。34', '[音義-1]：音鹿；\n[音義-2]：音泄气；\n[郭注-3]：謂渴也。\n[音義-4]：音鶴。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (418, '潎;澂;淸', '', '潎、1澂，2淸也。', '[郭注-1]：妨計反；\n[郭注-2]：音澄。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (419, '逯;遡;行', '', '逯、1遡，2行也。', '[音義-1]：音鹿，亦録；\n[音義-2]：音素。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (420, '墾;牧;司;力;飤;監;督;察', '', '墾、牧，司也。墾，力也。1牧，飤也。2監、牧、督，察也。', '[郭注-1]：耕墾用力。\n[郭注-2]：謂放飤牛馬也。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (421, '雚;始;化', '幻', '𡚊{雚}[幻]，始也。𡚊，化也。12', '[郭注-1]：別異訓也。\n[音義-2]：𡚊音歡；', '卷十二', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (422, '鋪;脾;止', '罷', '鋪、脾[罷]，止也。12', '[郭注-1]：義有不同，故異訓之。\n[音義-2]：鋪，妨孤反。', '卷十二', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (423, '攘;掩;止', '', '攘、掩，止也。', '', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (424, '幕;覆', '', '幕，覆也。', '', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (425, '侗;同;狀', '', '侗、1胴{同}，2狀也。3', '[音義-1]：他動反；\n[音義-2]：音挺挏；\n[郭注-3]：謂形狀也。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (426, '尐;杪;小', '', '尐、杪，小也。1', '[郭注-1]：樹細枝爲杪也。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (427, '㞕;往;勞', '', '㞕、往，勞也。1', '[郭注-1]：㞕㞕、往來，皆劬勞也。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (428, '㞕;往;獪', '泆;誑', '㞕[泆]、𢛛{往}[誑]，1獪也。2', '[音義-1]：音王相；\n[音義-2]：巿獪。', '卷十二', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (429, '皦;烓;明', '炯', '皦、1烓[炯]，2明也。', '[音義-1]：音皎；\n[音義-2]：口類反。', '卷十二', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (430, '湊;將;威', '', '湊、將，威也。', '', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (431, '嬀;娗;謾', '僞', '嬀[僞]、1娗，2僈{謾}也。3', '[音義-1]：居僞反；\n[音義-2]：音挻；\n[郭注-3]：爛僈，健狡也。', '卷十二', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (432, '𠐛;虔;謾', '丯', '𠐛、虔[丯]，謾也。1', '[郭注-1]：謂惠黠也，莫錢反。', '卷十二', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (433, '𠐛;佻;疾', '𧾎;跳', '𠐛[𧾎]、佻[跳]，1疾也。2', '[音義-1]：音糶。\n[郭注-2]：謂輕疾也。', '卷十二', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (434, '鞅;勃;强;鞅;勃;懟', '怏;怏;乀;乀', '鞅[怏]、侼{勃}[乀]，1强也。2鞅[怏]、3侼{勃}[乀]，懟也。4', '[音義-1]：音勃；\n[郭注-2]：謂强戾也。\n[郭注-3]：鞅猶怏也。\n[郭注-4]：亦爲怨懟。', '卷十二', '方言', '1;2;3;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (435, '追;末;隨', '', '追、末，隨也。', '', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (436, '僉;怚;劇;夥', '勮', '僉、怚，劇[勮]也。12僉，夥也。34', '[郭注-1]：謂勤劇。\n[音義-2]：音驕怚。\n[郭注-3]：僉者同，故爲多。\n[音義-4]：音禍。', '卷十二', '方言', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (437, '夸;烝;婬', '', '夸、烝，婬也。1', '[郭注-1]：上婬爲烝。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (438, '𣬈;賓;懣', '𤼤;𤼤', '𣬈[𤼤]、顮{賓}[𤼤]，1懣也。2', '[音義-1]：音頻；\n[郭注-2]：謂憤懣也。', '卷十二', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (439, '煢;激;淸', '瀅', '煢[瀅]、激，淸也。', '', '卷十二', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (440, '紓;退;緩', '', '紓、1退，緩也。2', '[音義-1]：音舒；\n[郭注-2]：謂寛緩也。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (441, '淸;躡;急', '䋫;㛼', '淸[䋫]、躡[㛼]，急也。', '', '卷十二', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (442, '抒;瘛;豸;解', '𤸪', '抒、1瘛[𤸪]、2豸，解也。', '[音義-1]：音抒井；\n[音義-2]：胡計反。', '卷十二', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (443, '蕆;逞;解', '', '蕆、1逞，解也。2', '[音義-1]：音展；\n[郭注-2]：蕆訓勑，復言解，錯用其義。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (444, '柢;柲;刺', '', '柢、1柲，刺也。2', '[音義-1]：音觸牴；\n[郭注-2]：皆矛戟之𥎊，所以刺物者也。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (445, '倩;荼;借', '賖', '倩、荼[賖]，1借也。', '[郭注-1]：荼猶徒也。', '卷十二', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (446, '辟朴;猝', '', '憵朴{辟朴}，1猝也。2', '[音義-1]：劈歴、打撲二音。\n[郭注-2]：謂急速也。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (447, '麋;黎;老', '眉;棃', '麋[眉]、1黎[棃]，老也。', '[郭注-1]：麋猶眉也。', '卷十二', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (448, '萃;離;時', '卒;待', '萃[卒]、離，時[待]也。', '', '卷十二', '方言', '1;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (449, '漢;赫;怒;發', '熯', '漢[熯]、䓇{赫}，怒也。䓇，發也。', '', '卷十二', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (450, '𧪮;吁;然', '嘫', '𧪮、1吁，2然[嘫]也。3', '[音義-1]：呼瓜反。\n[音義-2]：音于；\n[郭注-3]：皆應聲也。', '卷十二', '方言', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (451, '猜;忦;恨', '', '猜、忦，恨也。', '', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (452, '艮;磑;堅', '艮', '艮、磑[艮]，1堅也。2', '[音義-1]：五碓反；\n[郭注-2]：艮、磑皆名石物也。', '卷十二', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (453, '𤇇;䀶;明', '朗', '𤇇、12䀶[朗]，明也。', '[郭注-1]：𤇇，光也。\n[音義-2]：音淫；', '卷十二', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (454, '怤愉;說', '', '怤愉，12悅{說}也。', '[郭注-1]：怤愉猶呴愉也。\n[音義-2]：音敷。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (455, '卽;圍;就;半', '', '卽、圍，就也。卽，半也。1', '[音義-1]：卽，一作助。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (456, '惙;出;中', '惙;忡', '惙、㤕{出}[惙]，中[忡]也。1', '[郭注-1]：中宜爲忡；忡，惱[㛴]怖意也。', '卷十二', '方言', '2;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (457, '燾;蒙;覆;戴', '冡', '薵{燾}、蒙[冡]，覆也。薵，戴也。12', '[郭注-1]：此義之反覆兩通者。\n[音義-2]：字或作燾，音俱波濤也。', '卷十二', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (458, '堪;輂;載', '', '堪、輂，1載也。', '[郭注-1]：輂、輿，亦載物者也。音釘鋦；', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (459, '搖;祖;上;轉', '邎;𧇿', '搖[邎]、祖[𧇿]，上也。祖，搖也。祖，轉也。1', '[郭注-1]：互相釋也，動搖則轉矣。', '卷十二', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (460, '括;關;閉', '', '括、12關，閉也。', '[郭注-1]：易曰「括囊无咎」。\n[音義-2]：音适；', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (461, '𧘂;俶;動', '', '衝{𧘂}、俶，動也。', '', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (462, '羞;厲;熟', '', '羞、厲，熟也。1', '[郭注-1]：熟食爲羞。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (463, '厲;今', '', '厲，今也。', '', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (464, '僃;該;咸', '𤰈', '僃[𤰈]、該，咸也。1', '[郭注-1]：咸猶皆也。', '卷十二', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (465, '噬;食;憂', '', '噬，食也。噬，憂也。', '', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (466, '癸;悸', '悸', '𢜽{癸}[悸]，悸也。1', '[郭注-1]：謂悚悸也。', '卷十二', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (467, '虜;鈔;强;鹵;奪', '虜', '虜、鈔，强也。1鹵[虜]，奪也。', '[郭注-1]：皆强取物也。', '卷十二', '方言', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (468, '籋;正', '', '鑈{籋}，正也。12', '[郭注-1]：謂堅正也。\n[音義-2]：鑈，奴俠反。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (469, '蒔;殖;立;更', '植', '蒔、殖[植]，立也。蒔，更也。12', '[郭注-1]：謂更種也。\n[音義-2]：蒔音侍。', '卷十二', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (470, '鬌;尾;梢;盡', '稍', '鬌、12尾、梢[稍]，盡也。尾，梢也。', '[郭注-1]：毛物漸落去之名。\r\n[音義-2]：除爲反。', '卷十二', '方言', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (471, '喙;𢜭;倦', '喟', '𣨶{喙}[喟]、1𠌋{𢜭}，𠉮{倦}也。', '[郭注-1]：今江東呼極爲𣨶，音喙。外傳曰：「余病𣨶矣」。', '卷十二', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (472, '鼃;律;始', '䢦', '鼃、1律[䢦]，始也。', '[音義-1]：音蛙。', '卷十二', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (473, '蓐;臧;厚', '壯', '蓐、臧[壯]，厚也。', '', '卷十二', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (474, '遵;彥;行', '', '遵、遃{彥}，12行也。', '[郭注-1]：遃遃，行貌也。\n[音義-2]：魚晩反。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (475, '巂;餟;餽', '䬽', '䭨{巂}[䬽]、1餟，2餽也。3', '[音義-1]：音攜；\n[音義-2]：音祭醊；\n[音義-3]：音愧。', '卷十二', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (476, '餼;景;飽', '嬰', '餼、1䭘{景}[嬰]，2飽也。', '[音義-1]：香既反；\n[音義-2]：音映。', '卷十二', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (477, '枼;耈;嬴', '𠣿;贏', '惵{枼}、1耈[𠣿]，2嬴[贏]也。3', '[音義-1]：度協反；\n[音義-2]：音垢；\n[音義-3]：音盈。', '卷十二', '方言', '2;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (478, '趙;肖;小', '小;小', '趙[小]、肖[小]，小也。', '', '卷十二', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (479, '蚩;䍃;悖', '', '蚩、愮{䍃}，1悖也。2', '[音義-1]：音遙；\n[郭注-2]：謂悖惑也。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (480, '吹;扇;助', '推', '吹[推]、扇，助也。1', '[郭注-1]：吹噓、扇拂，相佐助也。', '卷十二', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (481, '焜;𣋓;盛', '', '焜、𣋓，晠{盛}也。1', '[郭注-1]：韡𣋓、焜燿，晠貌也。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (482, '苦;翕;熾', '', '苦、翕，熾也。', '', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (483, '薀;崇;薀;𠾂;積;嗇;镾;合', '轖', '蘊{薀}，崇也。蘊{薀}、𠾂，積也。1嗇[轖]、𢏏{镾}，合也。', '[郭注-1]：嗇者貪，故爲積。', '卷十二', '方言', '6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (484, '翬;喬;飛', '', '翬、12䎗{喬}，飛也。', '[郭注-1]：翬翬，飛貌也。\n[音義-2]：音揮；', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (485, '憤;自;盈', '詯', '憤、自[詯]，盈也。', '', '卷十二', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (486, '譟;瑝;音', '', '譟、1諻{瑝}，2音也。', '[音義-1]：音喚譟；\n[音義-2]：音從橫。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (487, '攎;敕;張', '', '攎、1遫{敕}，2張也。', '[音義-1]：音盧；\n[音義-2]：音敕。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (488, '岑;夤;大;高', '演', '岑、夤[演]，大也。岑，高也。1', '[郭注-1]：岑崟，峻貌也。', '卷十二', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (489, '效;昈;文', '交', '效[交]、昈，12文也。', '[郭注-1]：昈𥄅，文采貌也。\n[音義-2]：音戸；', '卷十二', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (490, '丙;重;錮', '', '鈵{丙}、1董{重}，錮也。2', '[音義-1]：音柄；\n[郭注-2]：謂堅固也。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (491, '扝;眞;揚', '', '扝、搷{眞}，1揚也。2', '[音義-1]：音塡；\n[郭注-2]：謂播揚也。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (492, '洲;淤;辟', '', '水中可居爲洲，三輔謂之淤，1蜀漢謂之㵨{辟}。2', '[郭注-1]：上林賦曰：「行乎洲淤之浦也。」淤音血淤；\n[音義-2]：音手臂。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (493, '殹;幕', '翳', '殹[翳]，1幕也。2', '[音義-1]：音醫；\n[郭注-2]：謂蒙幕也。', '卷十二', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (494, '刳;狄', '𩮜', '刳，1狄[𩮜]也。2', '[音義-1]：音古；\n[音義-2]：宜音剔。', '卷十二', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (495, '揣', '', '度高爲揣。1', '[音義-1]：常絹反。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (496, '䞨', '', '半步爲跬{䞨}。1', '[音義-1]：羌箠反。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (497, '侯', '', '半盲爲睺{侯}。1', '[音義-1]：呼鉤反，一音猴。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (498, '蟠龍', '', '未陞天龍，謂之蟠龍。', '', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (499, '裔', '', '裔，夷狄之總名。1', '[郭注-1]：邊地爲裔，亦四夷通以爲號也。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (500, '考;引', '', '考，引也。', '', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (501, '弻;高', '', '弻，高也。', '', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (502, '上;重', '', '上，重也。', '', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (503, '箇;枚', '', '箇，1枚也。2', '[音義-1]：古餓反；\n[郭注-2]：謂枚數也。', '卷十二', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (504, '一;蜀', '獨', '一，蜀[獨]也。南楚謂之蜀。1', '[郭注-1]：蜀猶獨耳。', '卷十二', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (505, '裔;歴;相;裔;旅;末', '', '裔、歴，相也。裔、旅，末也。', '', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (506, '𣬈;緣;廢', '秕', '𣬈[秕]、緣，廢也。', '', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (507, '純;毛;好', '𢤧', '純、毣{毛}[𢤧]，12好也。', '[郭注-1]：毣毣，小好貌也。\n[音義-2]：音沐；', '卷十三', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (508, '藐;素;廣;漸', '𨘷', '藐[𨘷]、12素，廣也。藐，漸也。', '[郭注-1]：藐藐，曠遠貌。\n[音義-2]：音邈；', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (509, '爚;抍;拔', '躍', '𨈅{爚}[躍]、1抍，2拔也。出㲻爲抍，出火爲𨈅也。', '[音義-1]：音踊躍，一作䠯。\n[音義-2]：音拯拔，一作椒；', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (510, '屯;赤;耑;赫', '𦎫;𦎫', '炖{屯}[𦎫]、1焃{赤}、2煓{耑}[𦎫]、3赫也。4', '[音義-1]：託孫反；\n[音義-2]：音鬩；\n[音義-3]：音波湍；\n[郭注-4]：皆火盛熾之貌。', '卷十三', '方言', '1;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (511, '憤;竅;阨', '', '憤、竅，1阨也。23', '[音義-1]：音孔竅；\n[郭注-2]：謂迫阨；\n[音義-3]：烏革反。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (512, '杪;眇;小', '', '杪、眇，小也。', '', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (513, '讟;咎;謗', '', '讟、1咎，謗也。2', '[音義-1]：音沓。\n[郭注-2]：謗言噂讟也；', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (514, '蕆;敕;戒;僃', '', '蕆、敕、1戒，僃也。', '[郭注-1]：蕆亦訓敕。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (515, '摵;㨖;到', '𣥹', '摵[𣥹]、1㨖，2到也。', '[音義-1]：音縮；\n[音義-2]：音致。', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (516, '𪒠;腆;忘', '詄', '𪒠、腆[詄]，忘也。', '', '卷十三', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (517, '黮;尨;私', '', '黮、1䵨{尨}，2私也。3', '[音義-1]：度感反；\n[音義-2]：莫江反；\n[郭注-3]：皆冥闇，故爲陰私也。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (518, '龕;咸;㰲;唏;聲', '', '龕、1喊{咸}、2㖪{㰲}、3唏，4聲也。', '[音義-1]：音堪；\n[音義-2]：音減；\n[音義-3]：荒麥反，亦音郁；\n[音義-4]：虛几反。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (519, '筡;箄;析', '𠕩', '筡、1箄[𠕩]，2析也。析竹謂之筡。3', '[音義-1]：音涂；\n[音義-2]：方婢反；\n[郭注-3]：今江東呼篾竹裹爲筡，亦名爲笢也。', '卷十三', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (520, '歸;哨', '嗾', '𠐽{歸}、1宵{哨}[嗾]，2使也。', '[音義-1]：音逵；\n[音義-2]：音蕭。', '卷十三', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (521, '蠢;作', '', '蠢，作也。1', '[郭注-1]：謂動作也。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (522, '忽;達;芒', '欻', '忽[欻]、達，芒也。1', '[郭注-1]：謂草杪芒䠶出；', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (523, '芒;濟;滅', '亡;擠', '芒[亡]、濟[擠]，滅也。1', '[郭注-1]：外傳曰：「二帝用師以相濟也」。', '卷十三', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (524, '廣;𧰲;解', '靃;離', '𠠎{廣}[靃]、1劙{𧰲}[離]，2解也。', '[音義-1]：音廓；\n[音義-2]：音儷。', '卷十三', '方言', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (525, '魏;能', '', '魏，能也。', '', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (526, '折;刻', '', '㑜{折}，刻也。', '', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (527, '聳;竦', '慫', '聳[慫]，悚{竦}也。12', '[郭注-1]：謂警聳也。\n[音義-2]：聳，山頂反。', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (528, '跌;蹷', '', '跌，蹷也。12', '[郭注-1]：偃地也，江東言跢。\n[音義-2]：丁賀反。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (529, '蘪;蕪', '', '蘪，蕪也。12', '[郭注-1]：謂草穢蕪也。\n[音義-2]：音務。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (530, '漫;淹;敗', '', '漫、淹，敗也。溼敝爲漫，水敝爲淹。1', '[郭注-1]：皆謂水潦漫澇壞物也。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (531, '釐;每;貪', NULL, '釐、1挴{每}，2貪也。', '[音義-1]：音狸；\n[音義-2]：亡改反。', '卷十三', '方言', NULL, 'null', 'null');
INSERT INTO `t_han_nga` VALUES (532, '潁;挻;竟', '', '㩩{潁}、1挻，2竟也。', '[音義-1]：恪潁反；\n[音義-2]：音延。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (533, '譴喘;轉', '', '譴喘，轉也。1', '[郭注-1]：譴喘，猶宛轉也。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (534, '困;胎;達;逃', '逭;佚;佚', '困[逭]、胎[佚]、㒓{達}[佚]，1逃也。2', '[音義-1]：音鞭撻。\n[郭注-2]：皆謂逃叛也。', '卷十三', '方言', '1;2;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (535, '隋;隋;易', '', '隋、毻{隋}，12易也。', '[郭注-1]：謂解毻也。\n[音義-2]：他臥反。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (536, '姚娧;好', '', '姚娧，好也。12', '[郭注-1]：謂妦娧也。\n[音義-2]：姚音遙。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (537, '憚;怛;惡', '', '憚、怛，惡也。1', '[郭注-1]：心怛懷，亦惡難也。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (538, '吳;大', '', '吳，大也。', '', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (539, '灼;驚', '悼', '灼[悼]，驚也。1', '[郭注-1]：猶云恐灼也。', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (540, '賦;動', '', '賦，動也。1', '[郭注-1]：賦斂，所以擾動民也。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (541, '喙;極', '喟', '𤸁{喙}[喟]，極也。12', '[郭注-1]：江東呼極爲𤸁，倦聲之轉也。\n[音義-2]：𤸁，巨畏反。', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (542, '煎;盡', '', '煎，盡也。', '', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (543, '爽;過', '', '爽，過也。1', '[郭注-1]：謂過差也。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (544, '蟬;毒', '慘', '蟬[慘]，毒也。', '', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (545, '傪;𡞜;惡', '慘', '傪[慘]，㥢{𡞜}也。㥢，惡也。1', '[郭注-1]：慘悴，惡事也。㥢音酋。', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (546, '還;積', '環', '還[環]，積也。', '', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (547, '宛;蓄', '', '宛，蓄也。12', '[郭注-1]：謂宛樂也。\n[音義-2]：宛音婉。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (548, '類;法', '', '類，法也。', '', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (549, '𦑚;素;本', '', '𦑚、素，本也。12', '[郭注-1]：今以鳥羽本爲𦑚。\n[音義-2]：𦑚音矦。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (550, '懼;病;驚', '', '懼，病也；懼，驚也。', '', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (551, '約;薄', '縛', '葯{約}，12薄[縛]也。3', '[郭注-1]：葯猶纏也。\n[音義-2]：音決的。\n[郭注-3]：謂纏裹物也。', '卷十三', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (552, '旋;短', '跧', '𣎓{旋}[跧]，短也。1', '[郭注-1]：便旋，庳[䇑]小貌也。', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (553, '掊;深', '', '掊，深也。1', '[郭注-1]：掊尅深能。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (554, '涅;㲻', '', '涅，㲻也。', '', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (555, '勞;取', '', '撈{勞}，取也。12', '[郭注-1]：謂鉤撈也。\n[音義-2]：撈音料。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (556, '莫;撫', '撫', '摸{莫}[撫]，撫也。1', '[郭注-1]：謂撫順也。摸音莫。', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (557, '由;式', '', '由，式也。', '', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (558, '猷;詐', '', '猷，詐也。1', '[郭注-1]：猷者，言故爲詐。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (559, '枉;隨', '', '䒰{枉}，隨也。', '', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (560, '揣;試', '', '揣，試也。1', '[郭注-1]：揣度試之。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (561, '禁;怒', '', '䫴{禁}，怒也。12', '[郭注-1]：䫴䫴，恚貌也。\n[音義-2]：䫴，巨廩反。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (562, '念;下', '墊', '埝{念}[墊]，下也。12', '[郭注-1]：謂陷下也。\n[音義-2]：音坫肆。', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (563, '贊;解', '選', '讚{贊}[選]，解也。1', '[郭注-1]：讚訟，所以解釋理物也。', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (564, '賴;取', '', '賴，取也。', '', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (565, '鈐;業', '', '扲{鈐}，業也。12', '[郭注-1]：謂基業也。\n[音義-2]：音鉗。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (566, '帶;行', '遰', '帶[遰]，行也。1', '[郭注-1]：隨人行也。', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (567, '漮;空', '', '漮，空也。12', '[郭注-1]：漮䆡，空貌。\n[音義-2]：漮，或作㱂虛字也。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (568, '湛;安', '', '湛，安也。1', '[郭注-1]：湛然，安貌。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (569, '虔;樂', '衎', '㗔{虔}[衎]，樂也。12', '[郭注-1]：㗔㗔，歡貌。\n[音義-2]：㗔音諐。', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (570, '宛;歡', '', '倇{宛}，歡也。12', '[郭注-1]：歡樂也。\n[音義-2]：倇音婉。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (571, '衎;定', '刊', '衎[刊]，定也。12', '[郭注-1]：衎然，安定貌也。\n[音義-2]：衎音看。', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (572, '鼻;息', '', '䑄{鼻}，𦞜{息}也。12', '[郭注-1]：謂息肉也。\n[音義-2]：䑄，魚自反。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (573, '讟;痛', '', '讟，痛也。12', '[郭注-1]：謗誣怨痛也。\n[音義-2]：亦音讀。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (574, '鼻;始;首;初;祖;居', '', '鼻，始也，嘼之初生謂之鼻，人之初生謂之首。梁益之閒謂鼻爲初，或謂之祖；祖，居也。1', '[郭注-1]：鼻、祖皆始之别名也，轉復訓以爲居，所謂代語者也。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (575, '充;養', '', '充，養也。', '', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (576, '翳;掩', '', '翳，掩也。1', '[郭注-1]：謂掩覆也。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (577, '臺;支', '', '臺，支也。', '', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (578, '純;文', '', '純，文也。', '', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (579, '祐;亂', '', '祐，亂也。1', '[郭注-1]：亂宜訓治。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (580, '兆;理', '䍃', '恌{兆}[䍃]，理也。12', '[郭注-1]：謂情理也。\n[音義-2]：桃音遙。', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (581, '薀;盛', '', '蘊{薀}，晠{盛}也。1', '[郭注-1]：蘊藹，茂貌。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (582, '唐;張', '', '搪{唐}，張也。12', '[郭注-1]：謂彀張也。\n[音義-2]：搪音堂。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (583, '惲;謀', '', '惲，謀也。12', '[郭注-1]：謂議也。\n[音義-2]：惲，嘔憤反。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (584, '陶;養', '匋', '陶[匋]，養也。', '', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (585, '禁;格', '𠲱', '㯲{禁}，格[𠲱]也。12', '[郭注-1]：今之竹木格是也。\n[音義-2]：音禁惡。', '卷十三', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (586, '𣬈;曉;明', '', '𣬈、曉，明也。', '', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (587, '扱;擭', '獲', '扱，擭[獲]也。1', '[郭注-1]：扱猶汲也。', '卷十三', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (588, '挾;護', '', '挾，護也。1', '[郭注-1]：扶挾將護。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (589, '淬;寒', '濢', '淬[濢]，寒也。12', '[郭注-1]：淬猶净也。\n[音義-2]：作憒反。', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (590, '爽;爭', '凊', '漺{爽}，凈{爭}[凊]也。12', '[郭注-1]：皆冷貌也。\n[音義-2]：初兩、禁耕二反。', '卷十三', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (591, '漉;極', '', '漉，極也。1', '[郭注-1]：滲漉，極盡也。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (592, '枚;凡', '', '枚，凡也。', '', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (593, '易;始', '', '易，始也。1', '[郭注-1]：易代更始也。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (594, '逭;周', '', '逭，周也。1', '[郭注-1]：謂周轉也。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (595, '喜;色', '奭', '䵱{喜}[奭]，色也。12', '[郭注-1]：䵱然，赤黑貌也；\n[音義-2]：音奭。', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (596, '恬;靜', '', '恬，靜也。1', '[郭注-1]：恬淡，安靜。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (597, '禔;福;喜', '', '禔，福也。12禔，喜也。3', '[郭注-1]：謂福祚也。\n[音義-2]：禔音衹。\n[郭注-3]：有福卽喜。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (598, '嬾;隓;壞', '', '攋{嬾}、1隓，2壞也。', '[音義-1]：洛旱反；\n[音義-2]：許規反。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (599, '息;歸', '', '息，歸也。', '', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (600, '抑;安', '', '抑，安也。', '', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (601, '潛;亡', '', '潛，亡也。', '', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (602, '曉;過;嬴', '贏', '曉，過也。曉，嬴[贏]也。', '', '卷十三', '方言', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (603, '䆯;短', '', '𠭴{䆯}，短也。12', '[郭注-1]：蹶𠭴，短小貌；\n[音義-2]：音疣贅。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (604, '豈;陭', '', '隑{豈}，陭也。12', '[郭注-1]：江南人呼梯爲隑，所以隑物而登者也；\n[音義-2]：隑，音剴切也。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (605, '迒;長;迹', '', '迒，長也。12迒，迹也。3', '[郭注-1]：謂長短也。\n[音義-2]：迒，胡郎反。\n[郭注-3]：爾雅以爲兔迹。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (606, '賦;臧', '', '賦，臧也。', '', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (607, '薀;饒', '', '蘊{薀}，饒也。1', '[音義-1]：蘊音温。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (608, '芬;和', '', '芬，和也。1', '[郭注-1]：芬香和調。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (609, '擣;依', '㠀', '擣[㠀]，依也。1依祿也。2', '[郭注-1]：謂可依倚之也；\n[郭注-2]：祿位可依憑也。', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (610, '盛;腯', '', '𦛙{盛}，腯也。12', '[郭注-1]：腯腯，肥充也；\n[音義-2]：腯音腞，亦突。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (611, '盬;雜;猝', '疌', '盬、1雜[疌]，猝也。2', '[郭注-1]：音古；\n[郭注-2]：皆倉卒也。', '卷十三', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (612, '蘥;行', '躍', '𨈅{蘥}[躍]，行也。12', '[郭注-1]：言跳𨈅也。\n[音義-2]：音藥。', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (613, '盬;且', '', '盬，且也。1', '[郭注-1]：盬猶𧇡也。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (614, '抽;讀', '籒', '抽[籒]，讀也。', '', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (615, '𠈪;託', '', '媵{𠈪}，託也。', '', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (616, '適;啎', '', '適，啎也。1', '[郭注-1]：相觸迕也。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (617, '埤;予', '', '埤，予也。12', '[郭注-1]：予猶與也。\n[音義-2]：埤音畀。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (618, '镾;縫', '', '彌{镾}，縫也。', '', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (619, '譯;傳;見', '', '譯，傳也。譯，見也。1', '[郭注-1]：傳宣語，卽相見。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (620, '梗;略', '', '梗，略也。1', '[郭注-1]：梗槪，大略也。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (621, '臆;滿', '𢡃', '臆[𢡃]，滿也。1', '[郭注-1]：愊臆，氣滿之也。', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (622, '罵;益', '', '䧞{罵}，益也。12', '[郭注-1]：謂增益也。\n[音義-2]：䧞音罵。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (623, '空;待', '控', '空[控]，待也。1', '[郭注-1]：來則實也。', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (624, '珇;好;美', '袓', '珇[袓]，好也。珇，美也。12', '[郭注-1]：美好等互見義耳。\n[音義-2]：珇音祖。', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (625, '嫗;色', '煦', '嫗[煦]，色也。1', '[郭注-1]：嫗煦[姁]，好色貌。', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (626, '閻;開', '', '閻，開也。1', '[郭注-1]：謂開門也。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (627, '摩;滅', '', '摩，滅也。1', '[音義-1]：或作攠滅字，音麋。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (628, '菲;薄', '', '菲，薄也。12', '[郭注-1]：謂微薄也。\n[音義-2]：菲音翡。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (629, '腆;厚', '', '腆，厚也。', '', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (630, '媟;狎', '', '媟，狎也。1', '[郭注-1]：相親狎也。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (631, '芋;大', '', '芋，大也。12', '[郭注-1]：芋猶訏耳。\n[音義-2]：芋，香于反；', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (632, '煬;翕;炙;烈;暴', '', '煬、12翕，炙也。煬、烈，暴也。', '[郭注-1]：今江東呼火熾猛爲煬。\n[音義-2]：音恙；', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (633, '馺;馳', '𢕬', '馺[𢕬]，馬馳也。12', '[郭注-1]：馺馺，疾貌也。\n[音義-2]：馺，索荅反。', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (634, '選;延;徧', '宣', '選[宣]、延，徧也。', '', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (635, '澌;索', '', '澌，索也。1', '[郭注-1]：盡也。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (636, '晞;燥', '', '晞，燥也。', '', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (637, '梗;覺', '亢', '梗[亢]，覺也。1', '[郭注-1]：謂直也。', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (638, '萃;集', '', '萃，集也。', '', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (639, '睨;澤;明', '', '睨、1𥋭{澤}，2明也。', '[音義-1]：音俾倪。\n[音義-2]：音亦。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (640, '闓;臨;照;美', '', '暟{闓}、臨，照也。暟，美也。12', '[郭注-1]：暟暟，美德也；\n[音義-2]：暟，呼凱反。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (641, '箄;簍;與;舀;𥴧;筐', '', '箄、簍、籅{與}、䈱{舀}，𥴧也。1江沔之閒謂之籅，2趙代之間謂之䈱，3淇衞之閒謂之牛筐。4𥴧，其通語也。𥴧小者，南楚謂之簍，5自關而西秦晉之閒謂之箄。67', '[郭注-1]：古筥字；\n[音義-2]：音餘；\n[音義-3]：音弓弢；\n[郭注-4]：淇，水名也；\n[音義-5]：音縷；\n[郭注-6]：今江南亦名籠爲箄。\n[音義-7]：方氏反。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (642, '籠;旁;笯', '', '籠，南楚江沔之閒謂之篣{旁}，12或謂之笯。34', '[郭注-1]：今零陵人呼籠爲篣。\n[音義-2]：音彭。\n[郭注-3]：亦呼籃。\n[音義-4]：那墓反。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (643, '䈰;𥬔旅', '𥬔盧', '𥰠，1南楚謂之筲{䈰}，23趙魏之郊謂之𥬔𥰠{𥬔旅}[𥬔盧]。4', '[郭注-1]：盛餅筥也；\n[郭注-2]：今建平人呼筲。\n[音義-3]：音鞭鞘；\n[郭注-4]：今通語也。', '卷十三', '方言', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (644, '錐;苕', '', '錐謂之鍣{苕}。1', '[郭注-1]：廣雅作鉊字。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (645, '刀斗', '鐎斗', '無[緣之]升[斗]謂之刁斗{刀斗}[鐎斗]。12', '[郭注-1]：謂小鈴也。\n[音義-2]：音貂。見漢書。', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (646, '匕;匙', '', '匕謂之匙。1', '[郭注-1]：匙音祇。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (647, '盂;盡;安殘;盌;喬;銚銳;肙夬', '', '盂謂之㯸{盡}。1河濟之閒謂之䀂𥂫{安殘}。椀{盌}謂之䀉{喬}，盂謂之銚銳，2椀謂之梋㭈{肙夬}。34', '[音義-1]：子殄反；\n[音義-2]：銚，音謠；\n[郭注-3]：椀亦盂屬，江東名盂爲凱，亦曰甌也。\n[音義-4]：蠲決兩音。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (648, '餌;餻;餈;令;奄;元', '', '餌謂之糕{餻}，或謂之餈，或謂之𩚹{令}，1或謂之餣{奄}，2或謂之䬧{元}。3', '[音義-1]：音鈴；\n[音義-2]：央怯反；\n[音義-3]：音元。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (649, '餅;屯;長昆', '', '餅謂之飥{飩}[屯]，1或謂之餦餛{長昆}。2', '[音義-1]：音託；\n[音義-2]：餦餛，長渾兩音。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (650, '餳;長皇;飴;亥;𧯡;隓;鎕', '', '𩛿{餳}謂之餦餭{張皇}。1飴謂之䬵{亥}。2𩜌{𧯡}謂之䭉{隓}。34𩛿謂之餹{鎕}。56凡飴謂之𩛿，自關而東陳楚宋衞之閒通語也。', '[郭注-1]：卽乾飴也；\n[音義-2]：音該；\n[郭注-3]：以豆屑雜𩛿也。\n[音義-4]：音髓；\n[郭注-5]：江東皆言餹。\n[音義-6]：音唐。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (651, '𪍠;䴭;䴳;麰;卑;𨢊;果;𥶶', '', '𪍠、䴭、䴳、麰、䴽{卑}、䵆{𨢊}、12䴹{果}，34麴{𥶶}也。自關而西秦豳之閒曰𪍠，5678晉之舊都曰䴭，910齊右河濟曰䴳，11或曰麰，1213北鄙曰䴽。1415麴，其通語也。', '[郭注-1]：有衣麴。\n[音義-2]：音蒙。\n[郭注-3]：小麥麴爲䴹，卽䴷也；\n[音義-4]：音𩸄。\n[郭注-5]：豳卽邠，\n[音義-6]：音斌\n[郭注-7]：；\n[音義-8]：𪍠音哭；\n[郭注-9]：今江東人呼麴爲䴭。\n[音義-10]：䴭音才；\n[音義-11]：于八反；\n[郭注-12]：大麥麴。\n[音義-13]：音牟。\n[郭注-14]：細餅麴。\n[音義-15]：音脾。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (652, '梠;櫺', '', '屋梠謂之欞{櫺}。12', '[郭注-1]：雀梠卽屋檐也，亦呼爲連綿。\n[音義-2]：音鈴。', '卷十三', '方言', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (653, '每;霤', '甍', '𤭐{每}[甍]謂之㽌{霤}。12', '[郭注-1]：卽屋檼也，今字作甍。\n[音義-2]：音萌；㽌音霤。', '卷十三', '方言', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (654, '冢;墳;培;俞;采;良;壠;丘;塿;墓;無', '宰;摹', '冢，秦晉之閒謂之墳，1或謂之培，2或謂之堬{俞}，3或謂之埰{采}[宰]，4或謂之埌{良}，5或謂之壠。6自關而東謂之丘，小者謂之塿，78大者謂之丘，9凡葬而無墳謂之墓，10所以墓謂之墲{無}[摹]。11', '[郭注-1]：取名於大防也；\n[音義-2]：音部；\n[音義-3]：音臾；\n[郭注-4]：古者卿大夫有采地，死葬之，因名也；\n[音義-5]：音波浪；\n[郭注-6]：有界埓似耕壠，以名之；\n[郭注-7]：培塿，亦堆高之貌。\n[音義-8]：洛口反；\n[郭注-9]：又呼冢爲墳也；\n[郭注-10]：言不封也，墓猶慕也；\n[郭注-11]：墲謂規度墓地也，漢書曰：「初陵之墲」是也。', '卷十三', '方言', '5;11', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (655, '古;昔;先;創;方;作;造;朔;萌;芽;本;根;櫱;鼃;䢦;昌;孟;鼻;業;始', '刱;糱;律;唱', '古、昔、先、創[刱]、方、作、造、朔、萌、芽、本、根、櫱[糱]、鼃1、䔞{䢦}[律]2、昌[唱]、孟、鼻、業，始也。', '[音義-1]：戸瓜反\n[音義-2]：律', '釋詁', '廣雅', '4;13;15;16', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (656, '乾;官;元;首;主;上;伯;子;男;卿;大夫;令;長;龍;嫡;郎;將;日;正;君', '適', '乾、官、元、首、主、上、伯、子、男、卿、大夫、令、長、龍、嫡[適]、郎、將、日、正，君也。', '', '釋詁', '廣雅', '15', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (657, '道;天;地;王;皇;寷;恢;博;殷;粗;兄;巟;沛;袥;矜;衍;臨;巨;佳;方;夸;匯;愷;般;張;覺;封;𡘉;大;賢;胡;㢋;廣;旁;奄;并;𣬉;朴;魁;訏;沈;岑;夤;誧;奲;高;顝;䫥;麤;敦;芋;稠;袞;䫞;萬;觰;䮯;都;浩;䫞;大', '碩;林;鉅;滂;崔;鎧;鞶;嶨;丰;滂;顝;甚;演;顝;粗;惇;混', '道、天、地、王、皇、寷1、㷇{恢}2、博、殷、粗3、兄、巟、沛4、袥[碩]5、鹶{矜}6、衍、臨[林]、巨[鉅]、佳、方[滂]、夸7、匯[崔]8、凱{愷}[鎧]、般[鞶]、張、覺[嶨]、封[丰]、𡘉9、太{大}、賢、胡、㢋10、廣、旁[滂]、奄、㔙{并}11、㔡{𣬉}12、朴13、魁[顝]、訏14、沈[甚]、岑、夤[演]15、誧16、奲17、䯪{高}18、顝19、䫥[顝]20、麤[粗]、敦[惇]、芋21、㚋{稠}22、袞[混]、䫞23、萬、觰24、䮯25、都、〔浩〕、〔溔{䫞}〕，大也。', '[音義-1]：豐\n[音義-2]：苦雷反\n[音義-3]：在戸反\n[音義-4]：浦㑹反\n[音義-5]：音託\n[音義-6]：矜\n[音義-7]：苦瓜\n[音義-8]：乎對反、胡磊反、胡罪反\n[音義-9]：扶弗反\n[音義-10]：赤以反\n[音義-11]：布萌反\n[音義-12]：布蔑\n[音義-13]：普木\n[音義-14]：吁\n[音義-15]：以真反\n[音義-16]：鋪\n[音義-17]：昌者反\n[音義-18]：考\n[音義-19]：苦骨反\n[音義-20]：苦磊反\n[音義-21]：吁\n[音義-22]：彫\n[音義-23]：許堯反\n[音義-24]：竹家反\n[音義-25]：五高反', '釋詁', '廣雅', '14;17;18;20;22;23;24;26;27;34;39;41;43;48;49;50;53', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (658, '仁;龓;或;員;虞;方;云;撫;有', '云', '仁、龓1、或、員[云]2、虞、方、云、撫，有也。', '[音義-1]：音籠\n[音義-2]：貟', '釋詁', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (659, '假;及;䡔;礙;艾;括;致;悃;㨖;歫;摵;會;抵;薄;察;往;薦;周;望;腆;繄;至', '徦;𣥹;刹;瀳;往', '假[徦]1、及、䡔2、礙、〔艾〕3、括、致、悃、㨖4、歫5、摵[𣥹]6、會、抵7、薄、察[刹]、往、薦[瀳]、周、望[往]、腆、繄8，至也。', '[音義-1]：格\n[音義-2]：苦禮\n[音義-3]：五害反，又刈\n[音義-4]：陟履反\n[音義-5]：巨\n[音義-6]：就夙反，又子六，又似育\n[音義-7]：多禮反\n[音義-8]：於兮反', '釋詁', '廣雅', '1;11;15;17;19', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (660, '乃;昔;遂;邁;行;俇;歸;迋;往', '𠧟', '乃[𠧟]、昔、遂、邁、行、𢓯{俇}1、歸、迋2，往也。', '[音義-1]：歸往反\n[音義-2]：于放反', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (661, '休;祥;衷;佳;忓;祿;吉;慶;良;謹;時;竫;黨;適;賴;惢;愿;㱿;溫;長;嫧;娕;㹛;馴;孎;睩;戾;靈;善', '好;妍;昌;愨;𥁕;令', '休[好]、祥、衷、佳、忓[妍]1、祿、吉、慶、良、㹏{謹}、時、竫、黨[昌]、適、賴、惢2、愿、㱿[愨]、溫[𥁕]、長、嫧3、娕4、㹛5、馴6、孎7、睩8、戾、靈[令]，善也。', '[音義-1]：汗\n[音義-2]：素果反，又才累反\n[音義-3]：側革反\n[音義-4]：測角反\n[音義-5]：如小\n[音義-6]：旬音，說文字巛反\n[音義-7]：竹緑反\n[音義-8]：禄', '釋詁', '廣雅', '1;5;13;18;19;28', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (662, '虔;養;娛;悰;歡;酣;樂', '衎;陽', '㗔{虔}[衎]1、養[陽]、娛、悰2、歡、酣、比3，樂也。', '[音義-1]：去焉\n[音義-2]：在宗反\n[音義-3]：鼻。政宇謹䅁：稚讓誤採', '釋詁', '廣雅', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (663, '聆;聽;自;言;仍;循;從', '', '聆1、聽、自、言、仍、〔循〕，從也。', '[音義-1]：禮丁', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (664, '巛;巽;娓;隨;理;猷;訓;悌;婉;㨉;勑;倫;揗;摩;順', '愻;順', '巛、巽[愻]、娓1、隨、理、猷、訓、悌、婉、㨉、勑、倫[順]、揗2、摩，順也。', '[音義-1]：媚\n[音義-2]：循', '釋詁', '廣雅', '2;12', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (665, '閑;埻;楷;模;品;式;祖;棖;肖;容;拱;捄;術;臬;井;括;廌;類;楥;略;灋', '鎔;鎔;賕', '閑、埻、楷、〔模〕、〔品〕、式、祖、棖、肖、容[鎔]、拱[鎔]、捄[賕]、1、術、臬2、井、括、廌、類、楥、略，灋也3。', '[音義-1]：巨菊、巨牛反，又俱\n[音義-2]：魚列\n[音義-3]：法', '釋詁', '廣雅', '10;11;12', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (666, '商;甬;經;長;常', '常;庸', '商[常]、甬[庸]1、經、長，常也。', '[音義-1]：勇', '釋詁', '廣雅', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (667, '眉;棃;傁;艾;耆;長;壽;𦒻;期頤;老', '', '眉、棃1、傁2、艾、耆、長、𦒺{壽}3、𦒻4、期頤，老也。', '[音義-1]：離\n[音義-2]：蘇苟\n[音義-3]：大到反\n[音義-4]：點', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (668, '苟;歀;實;信;誠', '', '苟、歀1、實、信，誠也。', '[音義-1]：款', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (669, '軫;域;榘;隒;厓;厲;方', '埒', '軫1、㚜{域}2、榘3、隒4、厓、厲[埒]，方也。', '[音義-1]：𨋏\n[音義-2]：火逼反\n[音義-3]：俱雨反\n[音義-4]：苦檢、居歛、語險三反', '釋詁', '廣雅', '6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (670, '端;直;籋;危;質;敵;公;方;閑;諫;刑;政;貞;榦;凖;殷;矢;正', '適;匚;嫺;檼', '端、直、鑈{籋}1、危、質、敵[適]、公、方[匚]、閑[嫺]、諫、刑、政、貞、榦、凖、殷[檼]、矢，正也。', '[音義-1]：乃頰', '釋詁', '廣雅', '6;8;9;16', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (671, '弸;愾;馮;甬;充;牣;匡;愊;窒;塞;盈;屯;飽;景;英', '弸;畐;嬰;嬰', '弸1、愾2、憑{馮}[弸]、悀{甬}3、充、牣4、匡、愊[畐]5、窒6、塞、盈、屯7、飽、䭘{景}[嬰]8、䭊{英}[嬰]9、（', '[音義-1]：冰\n[音義-2]：苦賴\n[音義-3]：勇\n[音義-4]：刃\n[音義-5]：皮逼\n[音義-6]：丁一\n[音義-7]：大村。政宇謹案：念孫謂當張倫反\n[音義-8]：於敬\n[音義-9]：乙丈', '釋詁', '廣雅', '3;8;14;15', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (672, '邈;逷;勿;離;釗;曠;云;極;遼;遥;迂;夐;超;踰;逴;越;祖;毖;征;筮;高;荒;裔;務;遠', '迢;迢', '邈、逷、𨑥{勿}1、離、釗[迢]2、曠、云、極、遼、遥、迂3、夐4、超[迢]、踰、逴5、越、祖、毖、征、遾{筮}6、高、荒、裔、〔務〕，遠也。', '[音義-1]：勿\n[音義-2]：昭音。世人以「釓」、「釗」失爲一字\n[音義-3]：紆\n[音義-4]：吁性\n[音義-5]：丑卓\n[音義-6]：逝', '釋詁', '廣雅', '5;13', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (673, '虞;宴;鎭;撫;慰;帖;懕;㥶;宓;毒;嗼;湛;抑;倓;便;𡬍;眯;侎;榦;焉;媞;尼;靖;澹;隱;集;息;安', '娛;聑;䈞;侎;妟;昵;倓;穩', '虞[娛]、宴、鎭、撫、慰、㥈{帖}[聑]1、懕2、㥶3、宓4、毒[䈞]5、嗼6、湛7、抑、倓8、便9、𡬍10、眯[侎]11、侎12、幹{榦}、焉[妟]、媞13、尼[昵]14、靖、澹[倓]15、隱[穩]、集、息，安也。', '[音義-1]：牒音，又齒廉反\n[音義-2]：一占\n[音義-3]：細則反\n[音義-4]：眉筆反。世人以「山如堂者，密」作「秘宓」字，失之矣\n[音義-5]：毒\n[音義-6]：莫，又亡白\n[音義-7]：丈減\n[音義-8]：達濫反\n[音義-9]：房連\n[音義-10]：亡彼反\n[音義-11]：米\n[音義-12]：亡是\n[音義-13]：狄卟反，又之移、上支二反\n[音義-14]：女一\n[音義-15]：大闞', '釋詁', '廣雅', '1;6;10;17;20;22;24;25', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (674, '賓;陳;佾;布;併;羅;列', '儐;敶', '賓[儐]、陳[敶]、佾1、布、併2、羅，列也。', '[音義-1]：逸\n[音義-2]：步憐', '釋詁', '廣雅', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (675, '昶;達;聖;明;泰;亯;疏;亨;徹;通', '𧀄', '昶[𧀄]1、達、聖、明、泰、𦴒[亯]、疏、亨2、徹，通也。', '[音義-1]：丑丈\n[音義-2]：呼行', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (676, '虔;畏;賓;齋;亟;憼;𠘡;浚;悛;誠;信;高;尊;敬', '恮;恮', '虔、畏、賓、齋、亟、憼1、懍{𠘡}2、浚[恮]3、悛[恮]4、誠、信、高、尊，敬也。', '[音義-1]：景\n[音義-2]：力甚反\n[音義-3]：三閏\n[音義-4]：此緣反', '釋詁', '廣雅', '8;9', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (677, '半;墽;捐;振;覂;投;委;隋;潑;棄', '播;敲;貶', '拌{半}[播]1、墽[敲]2、捐3、振、覂[貶]4、投、委、㨊{隋}5、〔撥{潑}〕，棄也。', '[音義-1]：普干，又音伴\n[音義-2]：苦孝，又苦交\n[音義-3]：音沿\n[音義-4]：甫奉，又方犯\n[音義-5]：緣蘂反', '釋詁', '廣雅', '1;2;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (678, '抗;弙;幠;磔;彀;彉;披;慮;敕;瞋;張', '舒', '抗1、弙2、幠3、磔4、彀5、彉6、披、攄{慮}[舒]7、遫{敕}8、瞋9，張也。', '[音義-1]：口葬\n[音義-2]：於娛反，又口孤反\n[音義-3]：呼\n[音義-4]：竹戹反\n[音義-5]：古候反\n[音義-6]：廓郭\n[音義-7]：丑於反\n[音義-8]：丑力\n[音義-9]：嗔', '釋詁', '廣雅', '8', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (679, '躔;歷;逝;去;趨;徥;流;步;遵;彥;蹠;遂;服;從;逯;轉;隨;巡;略;將;進;由;駕;帶;貫;䠶;逭;育;䟑;遡;吉;赴;蹈;行', '遰;𧾯', '躔1、歷、逝、去、趨2、徥3、流、步、遵、遃{彥}4、蹠5、遂、服、從、逯6、轉、隨、巡、充、略、將、進、由、駕、帶[遰]、貫、䠶7、逭8、逳{育}9、䠯{䟑}10、遡、吉[𧾯]、〔䞯{赴}〕、〔蹈〕，行也。', '[音義-1]：直然\n[音義-2]：七于\n[音義-3]：直駭，又仕紙\n[音義-4]：魚輦\n[音義-5]：只石\n[音義-6]：鹿\n[音義-7]：示亦\n[音義-8]：乎館反。尙書曰「逭，逃也」\n[音義-9]：育\n[音義-10]：倫音，方言爲藥。政宇謹案：䠯，本作踚，今依方言正', '釋詁', '廣雅', '24;31', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (680, '齡;齒;稔;稘;年', '', '齡、齒、稔、稘1，年也。', '[音義-1]：基', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (681, '𣣌;㱻;責;列;㱪;殟;枼奄;𢖳;疥;疫;梗;邛;暱;危;𣨙;寎;叕;痵;庮;癭;疛;疝;齲;㾅;既;痬;癇;痳;虒;痿;瘚;痔;瘀;𤻲;乃;疴;尼;消㵣;皯;皰;肒;瘤;痒;鼽;疢;注;張;㾈;病', '骴;癘;哽;訌;怩;疦', '𣧸{𣣌}1、㱻2、㱴{責}[骴]3、𣧿{列}[癘]4、㱪5、殟6、殜殗{枼奄}7、㽳{𢖳}8、疥9、𤶣{疫}10、梗[哽]、邛[訌]11、暱[怩]12、𣧼{危}、𣨙13、寎14、䍳{叕}[疦]15、痵16、㾞{庮}17、癭18、疛19、疝20、齲21、㾅22、䐴{既}23、痬24、癇25、痳26、㾷{虒}27、痿28、瘚29、痔30、瘀31、𤻲32、疓{乃}33、痾{疴}34、痆{尼}35、痟𤸎{消㵣}36、皯37、皰38、㿪{肒}39、瘤40、痒41、鼽42、疢43、疰{注}44、痮{張}、〔㾈〕，病也。', '[音義-1]：死二反，又資利反\n[音義-2]：羅外反，又力臥\n[音義-3]：才賜\n[音義-4]：例\n[音義-5]：昏\n[音義-6]：溫\n[音義-7]：葉。於業反\n[音義-8]：吁\n[音義-9]：介\n[音義-10]：役\n[音義-11]：巨恭\n[音義-12]：女乙\n[音義-13]：委媚、於爲\n[音義-14]：符命，又補命\n[音義-15]：九劣、苦悦\n[音義-16]：揆季\n[音義-17]：猶，又夷狩\n[音義-18]：於整\n[音義-19]：冑\n[音義-20]：所澗\n[音義-21]：區禹\n[音義-22]：仄已\n[音義-23]：古內\n[音義-24]：亦\n[音義-25]：閑\n[音義-26]：林\n[音義-27]：斯\n[音義-28]：於危\n[音義-29]：巨月，又厥\n[音義-30]：跱\n[音義-31]：於去\n[音義-32]：始藥、以灼\n[音義-33]：女駭、而亥\n[音義-34]：阿\n[音義-35]：尼八\n[音義-36]：消。於發，又渴\n[音義-37]：居滿\n[音義-38]：白教\n[音義-39]：丸\n[音義-40]：留\n[音義-41]：羊\n[音義-42]：求\n[音義-43]：勑鎮。今疹字\n[音義-44]：注', '釋詁', '廣雅', '3;4;11;12;13;17', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (682, '痂;瘃;疥;搔;帶;瘍;癬;喿;閻;傷;㾜;胗;咅;㾺;創', '慅;衃', '痂1、瘃2、疥、瘙{搔}3、㿃{帶}4、瘍5、癬6、㿋{喿}[慅]7、㿕{閻}8、傷、㿓{㾜}9、胗10、㾦{咅}[衃]11、㾺12，創也13。', '[音義-1]：加\n[音義-2]：陟録\n[音義-3]：素刀\n[音義-4]：丁世\n[音義-5]：陽\n[音義-6]：四淺\n[音義-7]：三到\n[音義-8]：鹽\n[音義-9]：苦夾、工洽\n[音義-10]：軫\n[音義-11]：普迴\n[音義-12]：馬嫁\n[音義-13]：初良', '釋詁', '廣雅', '8;13', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (683, '椉;蜀;壹;弌', '獨', '椉1、蜀[獨]、壹，弌也。', '[音義-1]：乘', '釋詁', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (684, '高;亯;庠;將;牧;穀;頤;陶;畜;旅;充;養', '槀;𢪇;宧;匋;𠣊', '高[槀]、亯1、庠、將[𢪇]、牧、穀、頤[宧]2、陶[匋]、畜、旅[𠣊]、充，養也。', '[音義-1]：響\n[音義-2]：夷', '釋詁', '廣雅', '1;4;7;8;10', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (685, '蕰;崇;委;冣;嗇;茨;壘;䆅;寖;殖;葉;秭;甫;垂;貯;積', '巍;䆅;絫;𦯈;疊;朵', '蕰、崇、委[巍]1、冣2、嗇3、茨[䆅]4、壘[絫]5、䆅6、寖[𦯈]7、殖、揲{葉}[疊]8、秭9、秿{甫}10、䅜{垂}[朵]11、貯，積也12。', '[音義-1]：一僞\n[音義-2]：在遇\n[音義-3]：色\n[音義-4]：材咨\n[音義-5]：力水\n[音義-6]：在兹，又子私\n[音義-7]：子鴆\n[音義-8]：臣熱\n[音義-9]：咨履\n[音義-10]：父\n[音義-11]：垂毁、丁禾\n[音義-12]：子賜、子亦', '釋詁', '廣雅', '3;6;7;9;11;14', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (686, '愍;惜;翳;㥛;憮;奄;款;牟;震;愛', '𢜮;嗜;㤅', '愍、惜、翳、㥛1、憮2、㤿{奄}3、歀{款}、牟[𢜮]、震[嗜]，愛[㤅]也。', '[音義-1]：欺革、九力\n[音義-2]：武\n[音義-3]：於檢、於劒', '釋詁', '廣雅', '8;9;10', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (687, '夌;憮;矜;悼;憐;㥯;哀', '憐;憐', '㥄{夌}[憐]1、憮、鹶{矜}[憐]、悼、憐、㥯2，哀也。', '[音義-1]：陵\n[音義-2]：隱', '釋詁', '廣雅', '1;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (688, '龕;岑;資;敓;采;掇;搴;摭;芼;集;摡;扱;㧖;摘;府;㩜;𡩡;勞;撟;穌;賴;𠭯;摷;撩;探;抯;收;斂;捕;摕;汲;有;勶;挻;摻;銛;抍;攈;掩;竊;略;剥;巢;尋;捊;取', '戡;覒;亼;劋', '龕[戡]、岑、資、敓1、采、掇2、搴3、摭4、芼[覒]5、集[亼]、摡6、扱7、㧖8、摘9、府、㩜10、𡩡11、撈{勞}12、撟13、穌、賴、摣{𠭯}14、摷15、撩16、探17、抯18、收、斂、捕19、摕20、汲21、有、撤{勶}22、挻23、摻24、銛25、抍26、攟{攈}27、掩、竊、略、剥、剿{巢}[劋]28、撏{尋}29、捊30，取也。', '[音義-1]：徒活\n[音義-2]：知劣，又丁活\n[音義-3]：九件\n[音義-4]：之亦\n[音義-5]：亡報\n[音義-6]：許既\n[音義-7]：初洽\n[音義-8]：烏革\n[音義-9]：陟革\n[音義-10]：力甘、力敢\n[音義-11]：所白\n[音義-12]：牢，又力幺\n[音義-13]：几小、几消\n[音義-14]：仄加\n[音義-15]：力刀\n[音義-16]：力幺\n[音義-17]：天含\n[音義-18]：莊加、子冶\n[音義-19]：步\n[音義-20]：帝\n[音義-21]：九及\n[音義-22]：徹\n[音義-23]：式延、丑延\n[音義-24]：所減\n[音義-25]：他點\n[音義-26]：之丞\n[音義-27]：舉蘊\n[音義-28]：策交、初孝\n[音義-29]：才含\n[音義-30]：皮侯', '釋詁', '廣雅', '1;9;10;43', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (689, '慸;喙;困;𢢞;夬;大;辟;析;昏;殟;歺;亢;疲;羸;劵;𠊬;亞;竆;卒;終;𢟡;極', '喟;慸;𣨛', '殢{慸}、𣨶{喙}[喟]1、困、𢢞2、𣧎{夬}3、𣧂{大}[慸]4、㱸{辟}5、㱤{析}6、㱪{昏}7、殟8、歺9、亢10、疲、羸11、劵12、𠊬13、㰳{亞}14、窮{竆}、卒[𣨛]、終、𢟡15，極也。', '[音義-1]：凶穢\n[音義-2]：苦計\n[音義-3]：桂\n[音義-4]：他計\n[音義-5]：甓\n[音義-6]：晳，三歴\n[音義-7]：昏\n[音義-8]：温\n[音義-9]：五達\n[音義-10]：乎郎\n[音義-11]：力追\n[音義-12]：去願。政宇謹案：念孫謂當音巨眷反\n[音義-13]：巨略、去逆\n[音義-14]：烏嫁\n[音義-15]：皮怪', '釋詁', '廣雅', '2;6;19', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (690, '愍;摧;噬;䩌;悴;愁;患;慼;桓;慎;怛;惴;怮;悹;忦;𢣑;慯;惂;慁;憖;憯;濟;惄;溼;憂', '顇;咺;疾;𢝊', '愍、師1、慛{摧}、噬2、䩌3、悴[顇]4、愁、〔患〕、慼、桓[咺]、慎、怛5、惴6、怮7、𢞏{悹}8、忦9、𢣑10、慯11、惂12、慁13、憖14、䁮{憯}15、濟[疾]、惄16、溼17，憂[𢝊]也。', '[音義-1]：政宇謹䅁：稚讓誤採\n[音義-2]：上世\n[音義-3]：在焦\n[音義-4]：才遂\n[音義-5]：丁達\n[音義-6]：拙瑞\n[音義-7]：於聊、於流\n[音義-8]：貫\n[音義-9]：公拜\n[音義-10]：辨，婢典\n[音義-11]：傷\n[音義-12]：坎\n[音義-13]：呼困\n[音義-14]：牛覲\n[音義-15]：才念\n[音義-16]：泥歴\n[音義-17]：濕', '釋詁', '廣雅', '5;9;22;25', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (691, '剖;判;嚳;劈;擘;裂;參;離;墳;析;斯;坼;筡;𠛰;異;剫;攽;坼;刻;班;分', '觷', '剖、判、嚳[觷]1、劈2、〔擘3〕、裂、參、離、墳、析4、斯、坼、筡5、𠛰6、異、剫7、𠚼{攽}8、〔坼〕、刻、斑{班}，分也。', '[音義-1]：口沃\n[音義-2]：普狄\n[音義-3]：補革\n[音義-4]：三亦\n[音義-5]：塗\n[音義-6]：彼列\n[音義-7]：徒各\n[音義-8]：布仁、普真反', '釋詁', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (692, '隓;敗;屠;破;碎;崩;隤;它;阤;陊;殆;爢;𩀼;壞', '陊', '隓1、敗、屠、破、碎、崩、隤2、陁{它}[陊]3、阤4、陊5、殆、爢6、𩀼7，壞也。', '[音義-1]：許規\n[音義-2]：穨\n[音義-3]：大何、大可反\n[音義-4]：直紙\n[音義-5]：達可\n[音義-6]：莫知\n[音義-7]：散音', '釋詁', '廣雅', '8', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (693, '朾;撞;鈌;挃;撞;䂇;蟲;𢶈;刏;抌;築;疊;㨖;抵;柲;爭;鍼;刺', '挏;朾', '揨{朾}1、撞2、鈌3、挃4、𠝤{撞}5、䂇6、䂈{蟲}[挏]7、𢶈8、刏9、抌10、築、𠠯{疊}11、〔㨖〕12、抵13、㧙{柲}14、掙{爭}[朾]15、鍼16，刺也17。', '[音義-1]：宅耕\n[音義-2]：直江\n[音義-3]：決\n[音義-4]：知帙\n[音義-5]：衝\n[音義-6]：女六\n[音義-7]：大鴻\n[音義-8]：禱\n[音義-9]：居祈，又公內\n[音義-10]：丁感\n[音義-11]：牒\n[音義-12]：丁几\n[音義-13]：底\n[音義-14]：邲，普必、白必\n[音義-15]：楚耕\n[音義-16]：針\n[音義-17]：七亦', '釋詁', '廣雅', '7;16', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (694, '刵;劊;刓;𠟃;割;率;刌;切;殊;絕;刜;斮;𢧵;剸;刖;祝;斬;算;釗;刎;聚;栗;剬;銽;焦;㕟;𩠹;刈;劖;邋;㓷;斷', '殊;芻;劋;撝', '刵1、劊2、刓3、𠟃4、割、𠞩{率}5、刌6、切、殊、絕、刜7、斮8、𢧵9、剸10、刖、祝[殊]、斬、㔍{算}11、𠚥{釗}12、刎13、㔌{聚}[芻]14、𠞉{栗}15、剬16、銛{銽}17、劁{焦}[劋]18、𠜐{㕟}[撝]19、𩠹20、刈21、劖22、𠠗{邋}23、㓷24，斷也。', '[音義-1]：耳志\n[音義-2]：古外\n[音義-3]：五丸\n[音義-4]：尊本\n[音義-5]：楚律\n[音義-6]：村本\n[音義-7]：拂\n[音義-8]：仄略\n[音義-9]：慈頡\n[音義-10]：拙兗、大丸\n[音義-11]：楚芮、楚刮\n[音義-12]：彫\n[音義-13]：亡粉\n[音義-14]：在侯\n[音義-15]：栗\n[音義-16]：拙兗\n[音義-17]：他點，又息廉反。政宇謹案：念孫謂當音古活反\n[音義-18]：才彫\n[音義-19]：苦拜\n[音義-20]：拙兗\n[音義-21]：乂\n[音義-22]：七咸\n[音義-23]：力涉\n[音義-24]：牛二', '釋詁', '廣雅', '16;21;25;26', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (695, '敏;逞;侚;儳;趨;頪;儵;跾;疌;朓;蹂;趮;𩢲;獧;挑;摇;扇;拊;舞;勮;䩯;汨', '毚;跾;跳;跳;駙;撫;𡿯', '敏、逞、侚、儳[毚]1、趨、頪2、儵[跾]3、跾4、𠌿{疌}5、朓[跳]6、蹂7、躁{趮}8、𩢲9、獧10、挑[跳]11、摇、扇、拊[駙]12、舞[撫]、勮13、〔䩯〕14、汨[𡿯]15、（', '[音義-1]：士緘\n[音義-2]：雷對\n[音義-3]：叔\n[音義-4]：叔\n[音義-5]：慈葉\n[音義-6]：天弔\n[音義-7]：爾帚\n[音義-8]：子到\n[音義-9]：山吏\n[音義-10]：絹\n[音義-11]：大了\n[音義-12]：方宇\n[音義-13]：其御\n[音義-14]：去力\n[音義-15]：于筆', '釋詁', '廣雅', '4;7;10;15;18;19;22', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (696, '腆;㜝;純;烈;韱;占;䤐;醰;䤐;皇;翼;滑;黨;賁;膚;熹;秀;甘;珍;旨;甛;蒸;將;英;闓;娥;媛;豔;珇;𦰚;美', '嬮;醇;昌;喜;烝;祥;袓', '腆1、㜝[嬮]2、䣩{純}[醇]3、姴{烈}4、䑎{韱}5、胋{占}6、䐶{䤐}7、䐺{醰}8、䤐、皇、翼、滑、黨[昌]、賁9、膚、熹[喜]、琇{秀}10、甘、珍、旨、甛11、蒸[烝]12、將[祥]、英、暟{闓}13、娥、媛、豔14、珇[袓]15、〔沃{𦰚}〕，美也。', '[音義-1]：土典\n[音義-2]：烏縑、烏檢\n[音義-3]：純\n[音義-4]：列\n[音義-5]：子冉\n[音義-6]：大念\n[音義-7]：子荏\n[音義-8]：代紺\n[音義-9]：布魂反。彼寄反，失之矣\n[音義-10]：秀\n[音義-11]：大嫌\n[音義-12]：旨升\n[音義-13]：凱\n[音義-14]：艷\n[音義-15]：祖', '釋詁', '廣雅', '2;3;13;16;22;23;29', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (697, '同;儕;等;番;比;倫;匹;臺;敵;讎;輩', '', '同、儕、等、〔𤳖{番}〕、比、倫、匹、臺、敵、讎，輩也。', '', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (698, '每;赧;怍;㥏;䪾;䀣;瞢;匿;衂怩;蹙咨;恧;慙', '瞢;𢘋', '挴{每}[瞢]1、赧2、怍3、㥏4、䪾5、䀣6、瞢7、㥾{匿}[𢘋]8、𢜷怩{衂怩}9、㗤咨{蹙咨}10、恧11，慙也。', '[音義-1]：每磊\n[音義-2]：女板\n[音義-3]：昨\n[音義-4]：土典\n[音義-5]：之忍\n[音義-6]：祕\n[音義-7]：莫贈\n[音義-8]：天徳反\n[音義-9]：女六反。尼\n[音義-10]：子六反\n[音義-11]：女六反', '釋詁', '廣雅', '1;8', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (699, '誕;𨽸;果;睦;懇;惇;信', '亶', '誕[亶]、𨽸、果、睦、懇1、惇，信也。', '[音義-1]：若恨，如上聲道之', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (700, '爲;已;知;瘥;蠲;除;慧;閒;瘳;瘉', '', '爲、已、知、瘥1、蠲、除、慧、閒、瘳，瘉也2。', '[音義-1]：楚嫁\n[音義-2]：移主', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (701, '食閻;慫涌;勱;勸', '', '食閻、慫慂{慫涌}1、勵{勱}2，勸也。', '[音義-1]：悚勇\n[音義-2]：厲', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (702, '有司;股肱;陪;嬯;草;隸;牧;圉;臣', '', '有司、股肱、陪、儓{嬯}1、皁{草}、隸、牧、圉，臣也。', '[音義-1]：臺', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (703, '卷;嬴;娃;嫷;孌;雚;姚;娧;純;珇;眊;婠;𡝩;窈窕;丰;忓;玩;媌;岸;嫧;鮮;由;㜅;麗;佳;雩;陗;嫽;姣;袾;䶒;渥;旖;瞴;嬮;姝;姽;㛂;嫿;㜺;綺;妍;叚;嬥;嫙;娙;蘳;糟;袓;戚;眇;媆;酋;姂;芻;嫈;嫢;覣;婥約;嫵媚;嬽;姗;好', '儇;儇;袓;𢤧;妍;攸;華;夏', '婘{卷}[儇]1、㜲{嬴}2、娃3、嫷4、孌5、孉{雚}[儇]6、姚7、娧8、純、珇[袓]9、眊[𢤧]10、婠11、穾{𡝩}、窈窕、妦{丰}12、忓13、妧{玩}14、媌15、婩{岸}[妍]16、嫧17、鮮18、頔{由}[攸]19、㜅20、麗、佳、嫮{雩}[華]21、釥{陗}22、嫽23、姣24、袾25、䶒26、媉{渥}27、𩕲{旖}、瞴28、嬮29、姝30、姽31、〔㛂〕32、嫿33、㜺34、婍{綺}35、妍、婽{叚}[夏]36、嬥37、嫙38、娙39、蘳40、褿{糟}41、袓42、䙘{戚}43、妙{眇}、媆44、媨{酋}45、姂46、媰{芻}47、嫈48、嫢49、覣50、婥約51、嫵媚52、嬽53、姗54，好也。', '[音義-1]：拳\n[音義-2]：盈\n[音義-3]：烏佳\n[音義-4]：大果\n[音義-5]：力兗\n[音義-6]：權\n[音義-7]：遥\n[音義-8]：通外\n[音義-9]：祖\n[音義-10]：莫對\n[音義-11]：一丸、一刮\n[音義-12]：丰\n[音義-13]：汗\n[音義-14]：玩\n[音義-15]：莫交、莫絞\n[音義-16]：魚件\n[音義-17]：楚革\n[音義-18]：思延\n[音義-19]：狄\n[音義-20]：休六\n[音義-21]：乎故\n[音義-22]：七小\n[音義-23]：了\n[音義-24]：古卯\n[音義-25]：充朱、竹瑜\n[音義-26]：側皆\n[音義-27]：握\n[音義-28]：亡宇\n[音義-29]：於鹽、烏頰\n[音義-30]：充朱、竹瑜\n[音義-31]：牛危\n[音義-32]：牛果\n[音義-33]：獲\n[音義-34]：贊、才旦\n[音義-35]：綺\n[音義-36]：古雅\n[音義-37]：徒聊、徒了\n[音義-38]：旋\n[音義-39]：五朾、乎丁\n[音義-40]：託陋\n[音義-41]：才牢\n[音義-42]：才呂\n[音義-43]：且六\n[音義-44]：而兗\n[音義-45]：子六，又才反\n[音義-46]：赴乏，又乞乏、芳乏\n[音義-47]：仄救\n[音義-48]：螢瑩\n[音義-49]：揆\n[音義-50]：於皮\n[音義-51]：綽\n[音義-52]：武\n[音義-53]：淵\n[音義-54]：素丹', '釋詁', '廣雅', '1;6;10;11;19;22;26;43', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (704, '鏠;耑;標;顚;杓;緒;杪;流;苗;裔;懱;末', '末', '桻{鏠}1、耑2、標3、顚、杓4、緒、杪、流、苗、裔、懱[末]5，末也。', '[音義-1]：峯\n[音義-2]：端\n[音義-3]：必沼\n[音義-4]：旳，又片幺\n[音義-5]：薎', '釋詁', '廣雅', '11', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (705, '聥;矆;寱;遻;逴;獡;灼;怛;透;趯;駭;憚;聒;驚', '悼;倏', '聥1、㦜{矆}2、寱3、愕{遻}4、逴5、獡6、㣿{灼}[悼]7、怛、透[倏]8、趯9、駭、憚10、〔聒〕，驚也。', '[音義-1]：已禹\n[音義-2]：乎郭\n[音義-3]：詣\n[音義-4]：吾各\n[音義-5]：勑略\n[音義-6]：式若\n[音義-7]：灼\n[音義-8]：音叔。世人以此爲「跳透」字，他候反，未是矣\n[音義-9]：他旳\n[音義-10]：大汗', '釋詁', '廣雅', '7;9', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (706, '紓;埶;蕆;呈;稀;屬;蛻;孚;隋', '𤸪;展;逞', '紓、摰{埶}[𤸪]1、蕆[展]2、呈[逞]、俙{稀}3、屬4、蛻5、㲗{孚}6、毻{隋}7', '[音義-1]：貞二，又至。政宇謹案：念孫謂當音充世反\n[音義-2]：勑輦\n[音義-3]：許皆\n[音義-4]：時欲\n[音義-5]：土會\n[音義-6]：孚\n[音義-7]：門悼反，冒字也。必無（', '釋詁', '廣雅', '2;3;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (707, '躡;蹬;跂;䟑;㐱;枼;展;蹈;蹂;蹋;此;蹠;履', '躔/撚;䠟;躔', '躡1、蹬2、跂3、䠯{䟑}4、跈{㐱}[躔/撚]5、蹀{枼}[䠟]6、蹍{展}[躔]7、蹈8、蹂9、蹋10、跐{此}11、蹠12，履也。', '[音義-1]：女涉\n[音義-2]：丁鄧\n[音義-3]：去豉\n[音義-4]：藥\n[音義-5]：才殄，又乃展反。今之踐字也\n[音義-6]：牒\n[音義-7]：女展\n[音義-8]：道\n[音義-9]：如酉\n[音義-10]：徒臘\n[音義-11]：側買\n[音義-12]：之石', '釋詁', '廣雅', '5;6;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (708, '馶;勁;堅;剛;耆;鞅;鬒;𠢤;牟;莫;憚憸;鹵;鈔;倞;悖;怏;强', '怏;紾;勖;慔;虜;勃;彊', '馶1、勁、堅、剛、耆、鞅[怏]2、鬒[紾]3、𠢤4、劺{牟}[勖]5、莫[慔]、憚憸6、𢲸{鹵}[虜]7、鈔、倞、悖[勃]、怏8，强[彊]也9。', '[音義-1]：支，又巨支反\n[音義-2]：巨媿\n[音義-3]：之忍\n[音義-4]：巨月\n[音義-5]：牟\n[音義-6]：七漸、四廉\n[音義-7]：魯\n[音義-8]：於亮\n[音義-9]：巨兩', '釋詁', '廣雅', '6;7;9;10;12;15;17', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (709, '幾;矜;隉;厲;阽;刖;立;徯醯;冉鎌;危', '丯;𦨉;岌', '幾、矜[丯]、隉1、厲、阽2、刖[𦨉]3、㱞{立}[岌]4、徯醯5、冉鎌6，危也。', '[音義-1]：五結\n[音義-2]：鹽\n[音義-3]：一刮，一音月，又五刮\n[音義-4]：宐及\n[音義-5]：兮\n[音義-6]：力霑', '釋詁', '廣雅', '2;6;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (710, '漻;淑;湜;洌;澂;濘;潎;僉;潚;溓;葛;清', '', '漻1、淑2、湜3、洌4、澂5、濘6、潎7、澰{僉}8、潚9、〔溓〕10、㵧{葛}11，清也。', '[音義-1]：力彫、兮巧\n[音義-2]：孰\n[音義-3]：音寔\n[音義-4]：列\n[音義-5]：直陵\n[音義-6]：那定\n[音義-7]：匹妙\n[音義-8]：力感\n[音義-9]：肅\n[音義-10]：廉\n[音義-11]：乙罽', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (711, '穌;秳;字;乳;腹;㝅;孺;興;育;孚;生', '活;覆', '穌1、秳[活]2、字、乳、腹[覆]、𣫌{㝅}3、孺、興、育、孚，生也。', '[音義-1]：蘇\n[音義-2]：乎括\n[音義-3]：奴候。春秋之𣫌烏菟', '釋詁', '廣雅', '2;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (712, '貳;畐;造;倅;憤;盈', '', '貳、褔{畐}、䔏{造}1、倅2、憤，盈也。', '[音義-1]：楚驟\n[音義-2]：寸對', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (713, '營;量;商;揣;銓;擬;泚;測;圖;謜;稱;校;揆;彠;隱;度', '訾;原;斠;櫽', '營、量、商、揣1、硂{銓}2、擬、泚[訾]3、測、圖、謜[原]4、稱、挍{校}[斠]、揆、彠5、隱[櫽]，度也。', '[音義-1]：初毁，又丁果、尺兗\n[音義-2]：七全\n[音義-3]：且禮\n[音義-4]：元\n[音義-5]：於縛、於虢、居縛', '釋詁', '廣雅', '7;10;12;15', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (714, '叢;湊;朚;趣;務;矜;遽', '', '叢1、〔湊〕、朚2、趣3、〔務〕4、矜，遽也。', '[音義-1]：七候\n[音義-2]：莫郎\n[音義-3]：趨娶\n[音義-4]：無住', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (715, '仄;陋;褊;䪥;迫;隘;笮;陜', '穊', '仄、陋、褊1、㒠{䪥}[穊]2、迫、隘3、窄{笮}4，陿{陜}也5。', '[音義-1]：必善\n[音義-2]：械\n[音義-3]：烏賣\n[音義-4]：側白\n[音義-5]：匣', '釋詁', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (716, '教;導;指;帝;敕;告;復;白;奧;眡;語', '', '教、導、指、揥{帝}1、敕2、告、復、白、䜒{奧}3、眡4，語也。', '[音義-1]：帝\n[音義-2]：勑\n[音義-3]：鳥報\n[音義-4]：示', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (717, '蔚;薈;扆;隱;翳', '', '蔚1、薈2、庡{扆}3、隱，翳也。', '[音義-1]：慰\n[音義-2]：烏外\n[音義-3]：於幾', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (718, '頑;嚚;句敄;儒輸;𡛟;戇;憃;庸;愚', '㝅瞀;孺輸;誜', '頑、嚚1、怐愗{句敄}[㝅瞀]2、儒輸[孺輸]、𡛟[誜]3、戇4、憃5、〔庸〕，愚也。', '[音義-1]：彥陳\n[音義-2]：苦候。茂\n[音義-3]：越\n[音義-4]：竹降\n[音義-5]：式鍾', '釋詁', '廣雅', '3;4;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (719, '罷;劵;煩;𠊬;賢;槀;勦;㞕;祕;往;勞', '疲;毖', '罷{疲}、劵1、煩、𠊬2、賢、犒{槀}3、勦4、屑{㞕}、祕[毖]、往，勞也。', '[音義-1]：去卷\n[音義-2]：巨腳\n[音義-3]：苦告\n[音義-4]：子小反，又楚交反，疑誤也。禮記曰：「毋勦說」，鄭注云：「勦，由擥也，謂取人之說」，春秋左傳：「無及於鄭而勦民，焉用之」，杜訓爲勞。是則𠞰從刀而勦從力明矣', '釋詁', '廣雅', '1;9', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (720, '潛;丞;沈;溺;涅;湮;渨;淪;沒', '湛;㲻', '潛、丞、沈[湛]、溺[㲻]、涅1、湮2、渨3、淪，沒也。', '[音義-1]：乃結\n[音義-2]：因\n[音義-3]：烏回', '釋詁', '廣雅', '3;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (721, '數;𢽚;謫;怒;詰;讓;爽;譴;誅;過;訟;責', '', '數、諑{𢽚}1、謫2、怒、詰、讓、爽、譴、誅、過、訟，責也。', '[音義-1]：卓\n[音義-2]：徒革', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (722, '𧡨;睎;望;目;䀩;𢦒;𥉻;窺;覘;詣;覒;闞;盻;觀;竀;閒;眽;睍;睌;窺;司;看;眽;絫;責;卑睨;眄;睞;闞;睇;䁍;眂;瞗;矕;葼;䁙;矍;夐;䁈;䀣;占;省;覰;𥆊;診;厓;眝;盼;視', '眇;䁔', '𧡨1、睎、望、目、䀩、𥅰{𢦒}2、𥉻3、窺4、覘5、𧡺{詣}6、覒[眇]7、闞8、盻9、觀、竀10、覵{閒}11、眽12、睍13、睌14、瞡{窺}15、覗{司}16、看、𧠨{眽}17、𥊻{絫}18、䚍{責}19、睥睨{卑睨}20、眄21、睞22、瞰{闞}23、睇24、䁍25、眂26、瞗27、矕28、䁓{葼}29、䁙30、䂄{矍}31、矎{夐}[䁔]32、䁈33、䀣34、占、省、覰35、䀽{𥆊}36、診37、𧡋{厓}38、〔眝〕、〔盼〕，視也。', '[音義-1]：大兮\n[音義-2]：子才\n[音義-3]：七祭、楚札\n[音義-4]：苦垂\n[音義-5]：恥淹\n[音義-6]：時\n[音義-7]：耄\n[音義-8]：苦暫\n[音義-9]：乎計\n[音義-10]：恥敬\n[音義-11]：古莧\n[音義-12]：麥\n[音義-13]：乎典\n[音義-14]：亡限\n[音義-15]：居恚\n[音義-16]：司\n[音義-17]：麥\n[音義-18]：力惟\n[音義-19]：狄。政宇謹案：念孫謂當音七亦反\n[音義-20]：普計。五計\n[音義-21]：亡見\n[音義-22]：來代\n[音義-23]：苦蹔\n[音義-24]：弟\n[音義-25]：堪\n[音義-26]：支\n[音義-27]：彫\n[音義-28]：馬板\n[音義-29]：走公\n[音義-30]：烏見\n[音義-31]：虎縛\n[音義-32]：呼懸\n[音義-33]：口計\n[音義-34]：祕\n[音義-35]：且居、七絮\n[音義-36]：以戰\n[音義-37]：真敏，又陣\n[音義-38]：五買', '釋詁', '廣雅', '11;38', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (723, '枉;橈;折;盭;蟠;冤;觠;骫;傴;僂;韏;結;詰;詘;𨒅;曲', '般;觠', '枉1、橈2、折、盭3、蟠[般]4、冤5、觠6、骫7、傴8、僂9、韏[觠]10、結、詰、詘、𨒅11，曲也。', '[音義-1]：於往\n[音義-2]：女孝\n[音義-3]：戾\n[音義-4]：步干\n[音義-5]：烏園\n[音義-6]：古免\n[音義-7]：委\n[音義-8]：依矩反\n[音義-9]：力雨\n[音義-10]：古萬\n[音義-11]：隙', '釋詁', '廣雅', '5;11', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (724, '蠡;鉻;鬀;剔', '', '剶{蠡}1、㓢{鉻}2、剃{鬀}3，剔也4。', '[音義-1]：勑傳\n[音義-2]：落\n[音義-3]：他帝\n[音義-4]：他覓', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (725, '緶;習;𪗋;緁', '緁', '緶1、䌌{習}[緁]2、䄢{𪗋}3，緁4也。', '[音義-1]：婢延\n[音義-2]：七立\n[音義-3]：資\n[音義-4]：且立', '釋詁', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (726, '高;厲;竦;踊;騰;躍;升;跳;揺;祖;潛;貢;顚;頂;弼;尙;營;上', '𡿋;登', '高、厲[𡿋]、竦、踊1、騰、躍、陞{升}[登]2、跳、揺、祖、潛、貢、顚、頂、弼3、尙、營，上也。', '[音義-1]：勇\n[音義-2]：升\n[音義-3]：備筆', '釋詁', '廣雅', '2;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (727, '邕;障;陘;否;拘;隔', '', '壅{邕}、障、𩰹{陘}1、否、拘，隔也。', '[音義-1]：逕', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (728, '誂;餌;訹;叜;誘', '', '誂1、誀{餌}2、訹3、謏{叜}4，誘也。', '[音義-1]：大鳥\n[音義-2]：如志\n[音義-3]：戍\n[音義-4]：素了、三六、三酉、所六', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (729, '嬹;說;怤愉;气;欯;謳;娎;歡;欣;休;禔;紛怡;喜', '愷;好', '嬹1、悅{說}、怤愉2、忔{气}[愷]3、欯4、謳、娎5、歡、欣、休[好]、禔、紛怡，喜也。', '[音義-1]：虛譍\n[音義-2]：敷\n[音義-3]：許乞\n[音義-4]：虚一\n[音義-5]：丈例', '釋詁', '廣雅', '4;10', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (730, '𧪮;吁;欸;殹;唯;諾;然;兮;譍', '唉;嘫', '𧪮1、吁2、欸[唉]3、𧫦{殹}4、唯、諾、然[嘫]、䚷{兮}5，譍也。', '[音義-1]：呼瓜\n[音義-2]：虛于，又于\n[音義-3]：哀\n[音義-4]：於兮\n[音義-5]：於麗', '釋詁', '廣雅', '3;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (731, '睎;隺;㷭;虞;闞;候;望', '', '睎1、𥉑{隺}2、㷭3、虞、闞、候，望也。', '[音義-1]：希\n[音義-2]：鶴\n[音義-3]：峯。今之烽火字，宜作此㷭', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (732, '柔;𤕦;樂;殽;雜', '粈;犖', '糅{柔}[粈]1、𥽬{𤕦}2、𥽗{樂}[犖]3、殽，雜也。', '[音義-1]：女又\n[音義-2]：女亮\n[音義-3]：力旳', '釋詁', '廣雅', '1;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (733, '媮;約;𣄴;緜;險;粦;襌;搹;菲;移;沾;薄', '愉;檢;吝;㚲', '媮[愉]1、約、𣄴2、緜、險[檢]、磷{粦}[吝]3、襌4、䙐{搹}5、菲6、移、沾[㚲]7，䙏{薄}也8。', '[音義-1]：他候\n[音義-2]：良音。世人作「𣄴䙏」之𣄴，水傍著京，失之矣\n[音義-3]：吝\n[音義-4]：丹\n[音義-5]：口革\n[音義-6]：彿匪反。世人以此爲「芳馡」之馡，失之矣\n[音義-7]：他縑反。世人水傍著忝，失之；又以此沾字爲霑，亦失之也。霑字宜然\n[音義-8]：步各反。世人作「襌䙏」之䙏，艸下著溥，亦失之矣', '釋詁', '廣雅', '1;5;6;11', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (734, '絅;獧;慓;疾;陖;陗;抨;窘;促;迫;逎;蹙;矜;苦;搄;亟;緊;清;躡;糾;急', '䋫;𩣘', '絅1、獧2、慓3、疾、陖4、陗5、怦{抨}6、窘7、𧻻{促}8、迫、逎9、蹙10、矜、苦、搄11、亟12、緊13、清[䋫]、躡[𩣘]、〔糾〕，急也。', '[音義-1]：古熒反\n[音義-2]：俱面反，又俱眄反\n[音義-3]：匹昭\n[音義-4]：先訙\n[音義-5]：且肖\n[音義-6]：普衡、普耕\n[音義-7]：逵殞\n[音義-8]：祖迴反。字書、聲類音爲局、促，促長\n[音義-9]：徐留\n[音義-10]：子六\n[音義-11]：公鄧\n[音義-12]：幾憶\n[音義-13]：居忍', '釋詁', '廣雅', '18;19', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (735, '程;掄;撟;捎;𢧵;虞;焦;柬;選;擇', '𢧵', '挰{程}1、掄2、撟3、捎4、㩱{𢧵}5、虞、撨{焦}[𢧵]、揀{柬}6、選，擇也。', '[音義-1]：呈\n[音義-2]：崘\n[音義-3]：矯\n[音義-4]：所交\n[音義-5]：雀\n[音義-6]：柬', '釋詁', '廣雅', '7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (736, '摳;掀;抗;揚;敬;㧬;增;翥;翹;仰;卬;發;扛;偁;搴;㮂;糾;抍;勝;檐;輿;揭;尙;興;舁;舁;扣;舉', '儋;舁;上;摳', '摳1、掀2、抗、揚、擎{敬}3、㧬4、䎖{增}5、翥6、翹、仰、卬、發、扛7、偁8、搴9、㮂10、糾、抍11、勝、檐[儋]、輿[舁]、揭12、尙[上]、興、轝{舁}13、舁14、〔扣[摳]〕，舉也。', '[音義-1]：苦侯\n[音義-2]：虚言反。出春秋，亦訓爲舉\n[音義-3]：渠迎\n[音義-4]：拱\n[音義-5]：子恒\n[音義-6]：之預反。方言爲署音\n[音義-7]：江\n[音義-8]：齒升\n[音義-9]：騫\n[音義-10]：俱錄\n[音義-11]：蒸之上聲。四聲蒸、抍、證、職\n[音義-12]：竭\n[音義-13]：悆\n[音義-14]：餘', '釋詁', '廣雅', '20;21;23;27', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (737, '句;降;窪;窆;窊;涅;念;㝪;㙷;隤;折;按;下', '墊;㙷', '句、降、窪1、窆2、窊3、㘿{涅}、埝{念}[墊]4、㝪5、𡏀{㙷}6、隤7、折[㙷]、按，下也。', '[音義-1]：烏瓜\n[音義-2]：碑豔\n[音義-3]：烏瓜\n[音義-4]：乃頰\n[音義-5]：都念\n[音義-6]：除立\n[音義-7]：穨', '釋詁', '廣雅', '7;11', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (738, '駢;貤;附;助;坿;埤;陪;貱;翳;睿;饒;贏;罵;貳;斟;酌;俞;潤;沾;潼;益', '輸;踵', '賆{駢}1、貤2、附、助、坿3、埤4、陪、貱5、贀{翳}6、𧸩{睿}7、饒、贏、䧞{罵}8、貳、斟、酌、俞[輸]、潤、沾、潼[踵]9，益也。', '[音義-1]：步田\n[音義-2]：弋豉\n[音義-3]：拊，又附\n[音義-4]：符彌\n[音義-5]：方寄\n[音義-6]：以瑞\n[音義-7]：思俊\n[音義-8]：罵\n[音義-9]：童', '釋詁', '廣雅', '17;20', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (739, '沮;潤;湆;浥;漸;𣹤;溽;淖;𦰚;溼', '', '沮1、潤、湆2、浥、漸、洳{𣹤}3、溽、淖4、〔沃{𦰚}〕，溼也。', '[音義-1]：子悆\n[音義-2]：泣\n[音義-3]：如悆\n[音義-4]：女孝。莊子亦以此字爲淖', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (740, '顉;參;振;訊;揺;扤;湯;涌;奮;勨;㨔;駭;臺思;掉捎;分;揮;揣;摷;𡴞;搈;𧘂;俶;賦;蝡;東;風;動', '卂;勨;奮;喘;沖', '顉1、𢕕{參}、振、訊[卂]、揺、扤、𧑘{湯}[勨]、慂{涌}2、奮、勨3、撼{㨔}4、㧡{駭}5、擡揌{臺思}6、掉捎、扮{分}[奮]7、揮8、揣[喘]9、摷10、抁{𡴞}11、搈12、𧘂[沖]、㑐{俶}、賦、蝡13、東、風，動也。', '[音義-1]：五感\n[音義-2]：勇\n[音義-3]：蕩\n[音義-4]：乎感\n[音義-5]：謂\n[音義-6]：臺。素來\n[音義-7]：伏粉\n[音義-8]：暉\n[音義-9]：初委\n[音義-10]：力刁\n[音義-11]：弋選、弋芮\n[音義-12]：容\n[音義-13]：如兗', '釋詁', '廣雅', '4;7;15;17;21', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (741, '摧;挫;摺;踒;擸;抈;詘;曲;罰;拹;制;夭;折', '邋;尉;折', '摧、挫、摺1、踒2、擸[邋]、抈3、詘、曲、罰[尉]、搚{拹}4、制[折]、夭，折也。', '[音義-1]：力合\n[音義-2]：於皮\n[音義-3]：月\n[音義-4]：呂闔', '釋詁', '廣雅', '5;9;11', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (742, '虔;辯;謾;黠;儇;憭;隋;貍;鬲;詖;曉;捷;鬼;慧', '丯;詑', '虔[丯]、辯、謾、黠、儇1、憭2、䜏{隋}[詑]3、㦟{貍}4、䛿{鬲}5、詖6、曉、捷、鬼，慧也。', '[音義-1]：許綿\n[音義-2]：了\n[音義-3]：他和\n[音義-4]：莫佳、莫諧\n[音義-5]：革\n[音義-6]：彼寄', '釋詁', '廣雅', '1;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (743, '𣢇;咍;唏;𠊬;𧮫;听;嗞;西;莞;於;寅;𥁕;閜;咦;引;𧥣;啞;殹;彥;笑', '噱;噱;齗;齗;啞;齗', '𣢇1、咍2、唏3、𠊬[噱]、𧮫[噱]4、听5、嗞6、哂{西}[齗]、莞、唹{於}7、𠻤{寅}[齗]8、嗢{𥁕}9、㗿{閜}[啞]10、咦11、吲{引}[齗]12、𧥣、啞13、〔㗨{殹}〕、〔齴{彥}〕，笑也。', '[音義-1]：呵苔\n[音義-2]：同上\n[音義-3]：許几、許冀\n[音義-4]：巨略\n[音義-5]：魚隐\n[音義-6]：子慈\n[音義-7]：乙餘\n[音義-8]：引\n[音義-9]：乙滑\n[音義-10]：火雅\n[音義-11]：火尸\n[音義-12]：與哂同\n[音義-13]：烏格', '釋詁', '廣雅', '4;5;8;11;13;15', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (744, '誅;罰;戮;虔;伐;𨽸;刈;殺', '丯', '誅、罰、戮、虔[丯]、伐、𨽸、刈，殺也。', '', '釋詁', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (745, '斯;徒;牧;圉;侍;御;僕;從;扈;養;任;甬;辯;令;保;庸;童;役;謂;命;使', '雇/故;庸', '廝{斯}1、徒、牧、圉、侍、御、僕、從、扈[雇/故]、養、任2、甬[庸]、辯、令、保、庸、童、伇{役}、謂、命、使也。', '[音義-1]：斯音\n[音義-2]：平聲', '釋詁', '廣雅', '9;12', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (746, '㜅;嫉;嫪;虖;妎;媢;妬', '婟', '㜅1、嫉、嫪2、嫭{虖}[婟]3、妎4、媢5，妬也。', '[音義-1]：休六\n[音義-2]：力高、力報\n[音義-3]：乎故\n[音義-4]：械\n[音義-5]：亡篤', '釋詁', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (747, '夸;蒸;通;媱;窕;泆愓;報;婬', '烝', '夸、蒸[烝]、通、媱、窕、劮婸{泆愓}1、報，婬也。', '[音義-1]：逸。大朗', '釋詁', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (748, '襲;馺;逮;纍;及', '', '襲、馺1、逮、纍，及也。', '[音義-1]：素迊', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (749, '貞;臤;緻;固;攻;霍;賢;艮;磑;鍇;稽;更;臣;牢;臤;堅', '䡰;鞏;塙;臤;庚;臤', '䡠{貞}[䡰]1、藖{臤}2、侄{緻}3、固、攻[鞏]、礭{霍}[塙]4、賢[臤]、艮、磑5、鍇6、𨯀{稽}7、鞕{更}[庚]、臣[臤]、牢、𩋆{臤}，〔堅〕也。', '[音義-1]：苦耕\n[音義-2]：乎間\n[音義-3]：質\n[音義-4]：口卓\n[音義-5]：牛衣、牛哀\n[音義-6]：楷，又公諧\n[音義-7]：啟', '釋詁', '廣雅', '1;5;6;7;12;13', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (750, '挺;秀;弱;拔;揠;擢;涌;溢;蠢;率;茁;矞;生;鬱;出', '', '挺、秀、䚥{弱}、拔、揠、擢、涌、溢、𢧨{蠢}1、䔞{率}、茁2、矞、生、〔鬱〕，出也。', '[音義-1]：出允\n[音義-2]：側劣', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (751, '殫;索;旣;渴;滲;漉;涸;急;汔;竆;湫;澌;位;釂;烕;糞;寫;鬌;稍;煎;鋌;央;盡', '𡩡;逎;䇐', '殫1、索[𡩡]、旣、渴、滲2、𥂖{漉}、涸3、急、汔4、焪{竆}5、湫[逎]、澌6、涖{位}[䇐]7、釂8、𣧵{烕}、糞9、寫、鬌10、稍、煎11、鋌12、央，盡也。', '[音義-1]：丹\n[音義-2]：所蔭\n[音義-3]：鶴\n[音義-4]：許乞\n[音義-5]：去鳳\n[音義-6]：斯\n[音義-7]：力二反\n[音義-8]：子曜\n[音義-9]：方問\n[音義-10]：都果、徒果\n[音義-11]：子延\n[音義-12]：達鼎', '釋詁', '廣雅', '2;11;13', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (752, '軥;皃;牽;輓;攀;援;埶;春;拕;艮;攎;扔;扱;據;摍;搄;捈;揄;擢;控;瓜;彎;神;翕;曳;引', '𤸪;引;乃;弙;吸', '軥1、䡚{皃}2、牽、輓3、攀、援、摰{埶}[𤸪]4、扽{春}5、拕6、拫{艮}[引]7、攎8、扔[乃]9、扱10、據、摍11、搄、捈12、揄、擢、控13、㧓{瓜}[弙]14、彎15、〔神〕、〔翕[吸]〕、〔曳〕，引也。', '[音義-1]：衢\n[音義-2]：皃\n[音義-3]：晚\n[音義-4]：至。政宇謹案：念孫謂當音充世反\n[音義-5]：頓\n[音義-6]：達可\n[音義-7]：乎根\n[音義-8]：盧\n[音義-9]：仍\n[音義-10]：楚洽\n[音義-11]：縮\n[音義-12]：途音\n[音義-13]：苦貢\n[音義-14]：烏麻\n[音義-15]：闗，又烏還', '釋詁', '廣雅', '7;10;12;21;24', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (753, '柔;耎;羊;𡰫;𩰞;劣;懦;恁;媆;嬈;脆;栠;栠;愞;偄;納;弱', '偄;栠;偄;橈', '柔、耎[偄]、佯{羊}、𡰫1、𩰞2、劣、懦3、恁[栠]4、媆[偄]5、嬈[橈]6、脆7、栠8、〔銋{栠}〕9、愞10、偄11、䪏{納}，弱也12。', '[音義-1]：而兗反。呂靜音碾\n[音義-2]：乃弟\n[音義-3]：奴玩、奴卧\n[音義-4]：而審反，疑之\n[音義-5]：女寸、而兗\n[音義-6]：女孝\n[音義-7]：七嵗\n[音義-8]：又荏、如甚\n[音義-9]：如深\n[音義-10]：乃卧\n[音義-11]：乃翫\n[音義-12]：納', '釋詁', '廣雅', '2;8;9;10', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (754, '欿;羨;𩕾;貪;斂;今;將;闓;欲', '願;斂;豈', '欿1、羨、𩕾[願]、貪、歛{斂}2、欦{今}[斂]3、將、闓[豈]，欲也。', '[音義-1]：口感\n[音義-2]：呼濫、呼甘\n[音義-3]：呼縑', '釋詁', '廣雅', '3;6;8', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (755, '槾;援;每;忨;懆;饕飻;𠄌;嗇;歁;欿;欲;婪;利;遴;茹;嗜;釐;慘;冤;貪', '忨;鈔;吝;㜗;宛', '槾1、㩊{援}[忨]2、挴{每}3、忨4、懆[鈔]5、饕飻6、亄{𠄌}7、嗇、歁8、欿9、欲、婪10、利、遴[吝]11、茹12、嗜、釐、慘[㜗]13、𩝸{冤}[宛]14，貪也。', '[音義-1]：亡旦、亡丸\n[音義-2]：宣\n[音義-3]：母磊\n[音義-4]：翫\n[音義-5]：操\n[音義-6]：他高。鑯\n[音義-7]：阿帙、於既\n[音義-8]：苦感\n[音義-9]：口感\n[音義-10]：來南\n[音義-11]：力晉\n[音義-12]：如與\n[音義-13]：七感\n[音義-14]：苑袁', '釋詁', '廣雅', '2;5;14;18;19', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (756, '屈;膂;墾;靳;威;力', '蹶;筋', '䠇{屈}[蹶]1、膂、墾、劤{靳}[筋]2、威，力也。', '[音義-1]：巨勿\n[音義-2]：靳', '釋詁', '廣雅', '1;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (757, '何;詰;譏;資;偵;質;言;詇;詵;稽;考;訊;請;問', '慰;咨;攷', '何、詰、譏[慰]、資[咨]、偵1、質、言、詇2、詵3、稽、考[攷]、〔訊〕、〔請〕，問也。', '[音義-1]：勑驚。政宇謹案：念孫謂當音貞\n[音義-2]：映，又於兩\n[音義-3]：史巾', '釋詁', '廣雅', '3;4;11', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (758, '何;服;能;任', '', '何、服、能，任也。', '', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (759, '超;越;踰;𧼪;杭;絕;騰;過;跨;涉;渡', '𣃚', '超、越、踰、𨂰{𧼪}[1、杭[𣃚]、絶{絕}、騰、過、跨、涉，渡也。', '[音義-1]：丑世', '釋詁', '廣雅', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (760, '招;命;靚;召;呼', '𧦝', '招、命、靚1、召，呼[𧦝]也。', '[音義-1]：才性反', '釋詁', '廣雅', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (761, '詾;鬩;譟;讙;譊;號咷;嗃;𡅽;訆;嗥;句;吠;雊;𧦝;噭;尞;鼓;嘑;咆;鳴', '喿;㖃', '詾、鬩、〔譟[喿]〕、讙、譊1、號咷、嗃2、𡅽3、訆4、獆{嗥}5、𤘽{句}[㖃]6、吠、雊、𧦝7、噭、嘹{尞}8、鼓、嘑、〔咆〕，鳴也。', '[音義-1]：女交\n[音義-2]：虎各\n[音義-3]：奐\n[音義-4]：叫\n[音義-5]：豪\n[音義-6]：虎苟\n[音義-7]：虎都\n[音義-8]：力弔', '釋詁', '廣雅', '3;11', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (762, '𧪰;嘆;呻;吟', '', '嗟{𧪰}、嘆、呻，吟也。', '', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (763, '㶣;𤇯;習;燿;枼;湯;爚', '𤏝', '𤍙{㶣}[𤏝]1、𤇯2、䐲{習}3、燿4、煠{枼}5、湯，爚也6。', '[音義-1]：辭廉\n[音義-2]：恩\n[音義-3]：丈入\n[音義-4]：曜\n[音義-5]：弋涉、土洽、丑涉\n[音義-6]：藥', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (764, '供;奉;獻;御;奏;晉;漸;躍;前;升;敕;奮;揖;籑;薦;許;進', '貢;登', '供[貢]1、奉、獻、御、奏、晉、漸、躍、前、陞{升}[登]、敕2、奮、揖、籑、薦、許，進也。', '[音義-1]：平\n[音義-2]：恥力反。䅁說文從攴束聲。今勑字，勞勑字，力代反', '釋詁', '廣雅', '1;10', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (765, '旁;闊;幎;衍;藐;素;慮;廣', '𨘷;芋', '旁、闊、幎1、衍、藐[𨘷]、素、慮[芋]，廣也。', '[音義-1]：亡狄反', '釋詁', '廣雅', '5;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (766, '𤈩;燥;熯;昔;晞;䵅;煎;𩱦;炕;暵;𤐸;熭;燥;敫;肖;焚;㱠;槁;燔;豦;豕;穹;刀;燎;乾', '爚;燥;枯;烘;槁', '㷢{𤈩}1、燥、熯2、焟{昔}3、晞、䵅4、煎、𤌉{𩱦}5、炕6、暵7、𤐸8、熭9、鐰{燥}10、燩{敫}[爚]11、焇{肖}[燥]12、焚、㱠13、𣩅{槁}14、燔、澽{豦}[枯]15、烼{豕}16、焪{穹}[烘]17、忉{刀}[槁]18、〔燎〕，乾也。', '[音義-1]：俎雅、才知反\n[音義-2]：而善反，又䍐\n[音義-3]：昔\n[音義-4]：五高\n[音義-5]：初絞\n[音義-6]：抗\n[音義-7]：漢，又呼但\n[音義-8]：貧力\n[音義-9]：衛\n[音義-10]：曹，才刀反\n[音義-11]：口擊\n[音義-12]：消\n[音義-13]：枯\n[音義-14]：苦老\n[音義-15]：巨\n[音義-16]：許勿\n[音義-17]：穹之去聲\n[音義-18]：火交', '釋詁', '廣雅', '14;15;20;22;23', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (767, '㬎;膊;弗;炕;煬;烈;恒;票;曬;㬥', '㬥', '㬤{㬎}1、膊2、昲{弗}3、炕、煬4、烈、暅{恒}5、㬓{票}[㬥]6、曬7，曝{㬥}也。', '[音義-1]：泣\n[音義-2]：普各\n[音義-3]：拂\n[音義-4]：恙\n[音義-5]：歌鄧\n[音義-6]：匹妙\n[音義-7]：所賣', '釋詁', '廣雅', '8', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (768, '閒;誣;多;益;增;被;匱;尙;加', '詑;遺', '閒、誣、拸{多}[詑]1、益、增、被、匱[遺]、尙，加也。', '[音義-1]：與紙、與支二音', '釋詁', '廣雅', '3;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (769, '甈;罅;瑕;釁;斯;坼;㗗;牾;𠂢;捇;睚眦;隙;斬;裁;豆;聝;曰;劈;彗;靃;𤼒;蒦;裂', '午;斸;搰;靃', '甈1、罅2、瑕、璺{釁}3、斯、坼、㗗4、牾[午]、挀{𠂢}5、捇6、睚眦、隙、斬、裁、剅{豆}[斸]7、掝{聝}8、抇{曰}[搰]9、劈10、㨹{彗}11、𠠛{靃}12、𤼒13、劐{蒦}[靃]14，裂也。', '[音義-1]：去滯\n[音義-2]：虎嫁\n[音義-3]：問\n[音義-4]：補買\n[音義-5]：必麥\n[音義-6]：呼虢反\n[音義-7]：多侯\n[音義-8]：呼麥\n[音義-9]：呼沒，又乎沒\n[音義-10]：普歷\n[音義-11]：衞\n[音義-12]：口穫\n[音義-13]：弋橤\n[音義-14]：呼獲，又口獲', '釋詁', '廣雅', '8;15;17;22', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (770, '鬜;契害;𩑔;𦺶;禿', '', '鬜1、𩮁𩮝{契害}2、𩑔3、〔𤺗{𦺶}〕，禿也。', '[音義-1]：揩瞎\n[音義-2]：口八。瞎\n[音義-3]：口本、口骨', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (771, '爰;爰;慍;愁;恚', '咺;咺', '爰[咺]、喛{爰}[咺]1、慍、愁，〔恚〕也。', '[音義-1]：呼館、虎元二反，方言音段', '釋詁', '廣雅', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (772, '馮;齘;苛;嫳;嫢盈;戲;憚;忿;慍;謓;㤄;漢;赫;禁;悸;恚;戾;娺;戍;訮;訶;䖔;曷;耆;穴;月;涅;喤;譴;謮;怒', '嘽;熯;𧧰', '馮、齘1、苛2、嫳3、嫢盈、戲、憚[嘽]、忿、慍、謓、㤄、漢[熯]、赫、䫴{禁}4、悸、恚、㑦{戾}5、娺6、㤜{戍}7、訮8、訶9、䖔10、𠿒{曷}11、𧪡{耆}[𧧰]12、䛎{穴}13、䚴{月}14、㖏{涅}15、喤16、譴、謮，怒也。', '[音義-1]：械\n[音義-2]：何\n[音義-3]：篇悦，又普列\n[音義-4]：巨錦、渠領\n[音義-5]：戾\n[音義-6]：陟衞\n[音義-7]：呼述\n[音義-8]：虛妍\n[音義-9]：火哥\n[音義-10]：苦暫\n[音義-11]：虛葛\n[音義-12]：時\n[音義-13]：血\n[音義-14]：魚刮\n[音義-15]：涅\n[音義-16]：戸盲', '釋詁', '廣雅', '7;12;24', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (773, '惜;恫;勺;怛;哀;慯;癆;荼;毒;憯;恒;朿;瘌;𧊝;𧊝;冬;𢝔;悲;愍;殷;惄;酸;讟;桐;惆悵;㤥;痛', '咷;痋;慇;恫', '惜、恫1、㣿{勺}[咷]2、怛、哀、慯、癆3、〔荼〕、毒、憯4、䖧{恒}5、憡{朿}6、瘌7、蠚{𧊝}8、𧍷{𧊝}9、疼{冬}[痋]10、𢝔、悲、愍、殷[慇]、惄、痠{酸}11、讟、桐[恫]、〔惆悵〕、〔㤥〕，痛也。', '[音義-1]：勑公\n[音義-2]：灼\n[音義-3]：老到，又力彫\n[音義-4]：七點\n[音義-5]：那達\n[音義-6]：策\n[音義-7]：羅達\n[音義-8]：丑略，又呼各\n[音義-9]：案此𧍷字，張揖出重耳\n[音義-10]：彤\n[音義-11]：酸', '釋詁', '廣雅', '3;16;20;24', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (774, '喘;喙;𠯑;奄;息;息', '喟;啜', '喘、喙[喟]1、咶{𠯑}[啜]2、忥3、㰰㰨4、㰤5、奄、𧇡6、〔䭒{息}〕，息也。', '[音義-1]：凶穢\n[音義-2]：虎夬\n[音義-3]：虛氣\n[音義-4]：虎夾。漢佳\n[音義-5]：苦訝\n[音義-6]：姑', '釋詁', '廣雅', '2;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (775, '㶣;灼;同;焯;煦;昕;叚;矣;爆;煉;燒;芮;䕼;炙;煬;烈;翕;灸;爟;爇', '融;煦;熹;然', '㶣1、灼、烔{同}[融]2、焯3、煦4、炘{昕}5、煆{叚}[煦]6、㶼{矣}[熹]7、爆8、煉、燒、焫{芮}9、䕼[然]10、炙、煬、烈、熻{翕}、灸、爟11，爇也。', '[音義-1]：淫\n[音義-2]：同\n[音義-3]：之藥反\n[音義-4]：火遇\n[音義-5]：虛隱\n[音義-6]：呼嫁\n[音義-7]：哀\n[音義-8]：布角、普角、步角\n[音義-9]：而悦\n[音義-10]：然\n[音義-11]：古亂', '釋詁', '廣雅', '3;7;8;13', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (776, '周;帀;辨;接;選;延;徧', '宣', '周、帀、辨、接、選[宣]、延，徧也。', '', '釋詁', '廣雅', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (777, '里;巟;閭;衖;𡈋;閈;宇;慰;廛;在;於;処;所;邱;虛;宙;䣊;聚;落;凥;居', '丘;尙', '里、巟、閭、衖、𡈋、閈、𡉃1、宇、慰、廛、在、於、処、所、邱[丘]、墟{虛}、宙、䣊[尙]2、聚、落、凥，〔居〕也。3。', '[音義-1]：政宇謹䅁，当是閈之反切壊字\n[音義-2]：多朗\n[音義-3]：上古魚反。凥，案說文尸几聲。今居字乃「箕居」字也，古慮反', '釋詁', '廣雅', '14;17', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (778, '懈;慢;㥆;䋼;紿;遲;繟;亶曼;挺;𦆀;弛;退;甘;韜;緩', '衍漫;䋼;酣;𤘸', '懈、慢、㥆1、䋼2、紿3、遲、繟4、譠謾{亶曼}[衍漫]5、挺[䋼]、𦆀6、㢮{弛}、退、甘[酣]、韜[𤘸]，緩也。', '[音義-1]：退\n[音義-2]：他丁\n[音義-3]：待\n[音義-4]：闡\n[音義-5]：託山\n[音義-6]：昌善', '釋詁', '廣雅', '8;9;13;14', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (779, '儋;由;胥;輔;左;右;虞;護;勸;救;吹;扇;埤;役;賻;助', '迪;御;推;爲', '儋、由[迪]、胥、輔、佐{左}、佑{右}、虞[御]、護、勸、救、吹[推]、扇、埤、役[爲]、賻，助也。', '', '釋詁', '廣雅', '2;7;11;14', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (780, '妝;襐;賁;容;潤;養;文;字;飾', '妝', '娤{妝}1、襐2、賁3、容、潤、養[妝]、文、字，飾也。', '[音義-1]：莊\n[音義-2]：蕩\n[音義-3]：奔音。周易賁卦，今人多彼寄反，失之', '釋詁', '廣雅', '6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (781, '捈;搯;匋;舀;户;㪻;挹', '搯', '捈1、搯2、掏{匋}[搯]3、舀4、戽{户}5、㪻6、挹、（', '[音義-1]：塗\n[音義-2]：他刀\n[音義-3]：憲案：即上搯字\n[音義-4]：臾\n[音義-5]：虎\n[音義-6]：拘萬', '釋詁', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (782, '黜;闕;虧;缺;拂;發;桀;除;袪;離;朅', '去', '黜、闕、虧、缺、拂、發、桀、除、袪[去]、離、朅、（', '', '釋詁', '廣雅', '9', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (783, '斬;割;𠂢;裂;規;裁', '撝', '斬、割、䤨{𠂢}、裂、摫{規}[撝]1，裁也。', '[音義-1]：規', '釋詁', '廣雅', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (784, '搢;戢;箴;扱;插', '楫', '搢、戢[楫]、箴、扱，插也。', '', '釋詁', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (785, '腬;䑋;廫;泡;傀;濞;偉;爗;薀;茂;昆;渾;昌;𨸏;溢;腯;肥;旨;孛;盛', '咆;焜;奚', '腬1、䑋2、𠐋{廫}3、泡[咆]4、𠐤{傀}5、䑄{濞}6、𩏧{偉}、爗、薀、茂、昆[焜]、渾、昌、阜{𨸏}、溢、腯7、肥、㚛{旨}[奚]8、浡{孛}，盛也。', '[音義-1]：柔\n[音義-2]：攘\n[音義-3]：苦交\n[音義-4]：白交\n[音義-5]：古迴\n[音義-6]：孚二、扶四\n[音義-7]：突\n[音義-8]：火計', '釋詁', '廣雅', '4;11;18', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (786, '嫢;笙;揫;摻;精;糳;稗;細;纖;微;緜;幺;糜;懱;私;茦;葼;㡀;兌;杪;肖;尐;區;眇;藐;鄙;耑;小', '粺;厶;蔽;𦺶;稍;𨘷', '嫢1、笙、揫、摻2、精、糳、稗[粺]、細、纖3、微、緜、𢆷{幺}、麼{糜}4、懱、私[厶]、茦、葼、㡀[蔽]5、䓲{兌}[𦺶]6、杪7、肖[稍]、尐8、區、眇、藐[𨘷]、鄙、〔耑〕，小也。', '[音義-1]：具癸、聚惟\n[音義-2]：所艦\n[音義-3]：死簷\n[音義-4]：莫可\n[音義-5]：獘\n[音義-6]：悅\n[音義-7]：弥沼\n[音義-8]：子列', '釋詁', '廣雅', '7;15;18;19;21;25', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (787, '鬱;巸;夌;儠;檄;筩;橢;引;呂;僓;迒;畼;從;挻;𧈪;抒;豈;脩;夐;繹;覃;尋;將;枚;袤;曼;長', '甬;廴;𧀄;𢼸;攸;兀;羕', '鬱、巸、倰{夌}1、儠2、檄、筩[甬]、橢3、矧{引}[廴]、呂、僓4、迒、畼[𧀄]5、從、挻6、𨩪{𧈪}7、抒、隑{豈}[𢼸]8、脩[攸]、夐[兀]、繹、覃、尋、將[羕]、枚、袤、〔曼〕，長也。', '[音義-1]：來登\n[音義-2]：力葉\n[音義-3]：大果\n[音義-4]：潰\n[音義-5]：悵\n[音義-6]：恥延\n[音義-7]：耻輦\n[音義-8]：牛哀反', '釋詁', '廣雅', '6;8;12;17;18;19;23', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (788, '乾;倢;蹻;咎;犺;咸;䰫;猛;壯;獜;武;狡;楬;怒;驍;健', '疌;趫;晧', '乾、倢[疌]、蹻[趫]1、㹾{咎}[晧]2、犺3、𡞣{咸}4、䰫5、猛、壯、獜6、武、狡、偈{楬}、怒、驍，健也。', '[音義-1]：巨略\n[音義-2]：口堯\n[音義-3]：抗\n[音義-4]：戸湛\n[音義-5]：巢\n[音義-6]：力仁、力忍', '釋詁', '廣雅', '2;3;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (789, '庪;閣;堪;輂;加;輿;載', '', '攱{庪}1、閣、堪、輂2、加、輿，載也。', '[音義-1]：古委\n[音義-2]：恭録', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (790, '閻;業;接;撚;未;連;似;𥻆;屬;結;絣;續', '接;祀', '䌪{閻}1、𠟪{業}[接]2、接、撚3、未、連、似[祀]、𥻆4、屬、結、〔絣〕，續也。', '[音義-1]：弋冉\n[音義-2]：魚劫，又且葉\n[音義-3]：乃典\n[音義-4]：䅇', '釋詁', '廣雅', '2;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (791, '㿛;𢧵;痤;疽;癰', '', '㿛1、𤻛{𢧵}2、痤3、疽，癰也。', '[音義-1]：力記、力翅\n[音義-2]：節\n[音義-3]：坐戈反', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (792, '肬;夆工;猋嗥;胅;痕;𡰒;𡯣;尨;腫', '咆嗥;秩', '肬1、䏺肛{夆工}2、𦠎𦞵{猋嗥}[咆嗥]3、胅[秩]4、痕5、尰{𡰒}6、𡯣7、〔䏵{尨}〕，腫也。', '[音義-1]：音尤\n[音義-2]：扶江。虎江\n[音義-3]：匹聊。呼堯\n[音義-4]：大結\n[音義-5]：互根反\n[音義-6]：時勇\n[音義-7]：曜', '釋詁', '廣雅', '3;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (793, '料;亂;紕;督;雉;敕;伸;絫;撩;統;理', '比;夷;敒;纍', '料、亂、紕[比]1、督2、雉[夷]、敕、伸[敒]、𢴱{絫}[纍]3、撩、統，理也。', '[音義-1]：布寐、扶規\n[音義-2]：篤\n[音義-3]：力維', '釋詁', '廣雅', '3;5;7;8', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (794, '喜;赩;艴;艵;嫗煦;繻;色', '奭', '䵱{喜}[奭]、赩、〔艴〕1、艵2、嘔喣{嫗煦}3、繻4，色也。', '[音義-1]：勃\n[音義-2]：片鼎\n[音義-3]：於句。虛于\n[音義-4]：死俞', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (795, '讙;譙;譴;謮;詰;卻;諯;讓', '', '讙、譙1、譴、謮、詰、卻、諯2，讓也。', '[音義-1]：慈曜\n[音義-2]：釧，又至緣', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (796, '揚;讀;曉;謂;道;說', '', '揚、讀、曉、謂、道，說也。', '', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (797, '澇;汏;㶕;淅;滌;潒;蚤;澡;沐;浴;湔;濯;沬;洒', '婁', '澇1、汏、㶕2、淅3、滌、潒4、溞{蚤}[婁]5、澡6、沐、浴、湔7、濯、沬8，洒也。', '[音義-1]：老刀\n[音義-2]：簡\n[音義-3]：桑狄\n[音義-4]：蕩\n[音義-5]：素高\n[音義-6]：早\n[音義-7]：子堅\n[音義-8]：呼內', '釋詁', '廣雅', '7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (798, '魝;切;刌;膾;㓼;割', '', '魝1、切、刌2、膾、㓼3，割也。', '[音義-1]：結\n[音義-2]：寸本\n[音義-3]：初律', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (799, '闌;閑;亢;要;徼;迣;遮', '抗;徼', '闌、閑、亢[抗]、闄{要}[徼]1、徼、迣2，遮也。', '[音義-1]：要，又音也，正音計堯\n[音義-2]：制', '釋詁', '廣雅', '3;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (800, '賃;荼;差;且;假;貸;借', '賒;且;叚', '賃、荼[賒]1、差[且]、且、假[叚]、貸，借也。', '[音義-1]：塗', '釋詁', '廣雅', '2;3;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (801, '鍲;耤;耡;貢;租;賦;徹;冑;皮;征;賩;癹;稅', '勶', '鍲1、耤2、耡3、貢、租、賦、徹[勶]、䅢{冑}4、秛{皮}、征、賩5、𤼺{癹}6，稅也。', '[音義-1]：旻\n[音義-2]：似亦反\n[音義-3]：士魚反\n[音義-4]：酒冑\n[音義-5]：在宗\n[音義-6]：方乂', '釋詁', '廣雅', '7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (802, '劫業;䋎;轖;镾;畢;縫', '接', '𦀖䌜{劫業}[接]1、䋎2、繬[轖]3、彌{镾}、縪{畢}4，縫也。', '[音義-1]：於輒。魚劫\n[音義-2]：直莧\n[音義-3]：色\n[音義-4]：畢', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (803, '𤔌;絣;呂略;絣', '', '䌥{𤔌}1、𢆸{絣}2、絽䌎{呂略}3，絣也4。', '[音義-1]：隱靳\n[音義-2]：布耕\n[音義-3]：呂略\n[音義-4]：百猛、布耕', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (804, '胻;紕;純;緣', '珌', '絎{胻}1、紕[珌]2、純3，緣也。', '[音義-1]：下孟\n[音義-2]：符夷\n[音義-3]：□之、諸尹', '釋詁', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (805, '毗;賓;漢漫;閔;懣', '𤼤;𤼤;熯懣;悶', '毗[𤼤]、顮{賓}[𤼤]1、漢漫[熯懣]、憫{閔}[悶]，懣也2。', '[音義-1]：頻\n[音義-2]：亡本、滿', '釋詁', '廣雅', '1;2;3;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (806, '貶;損;削;黜;豤;勶;秏;退;𨽸;掊;扟;刮;攽;降;殺;𤸬;奭;爽;劣;減', '眊;喪', '貶、損、削、黜、豤1、撤{勶}、秏[眊]、退、𨽸、掊2、扟3、刮4、攽5、𡲣{降}6、殺、𤸬7、奭、爽[喪]、劣，減也。', '[音義-1]：苦昆\n[音義-2]：步侯\n[音義-3]：所斤\n[音義-4]：古滑\n[音義-5]：筆貧\n[音義-6]：古巷\n[音義-7]：衰', '釋詁', '廣雅', '7;18', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (807, '維;紲;縼;縻;紖;係', '', '維、紲、縼1、縻2、紖3，係也。', '[音義-1]：隨絹\n[音義-2]：目羈\n[音義-3]：直引', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (808, '切;直;方;義', '', '切、直、方，義也。', '', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (809, '懷;就;息;隋;罷;還;返;退;免;迋;歸', '綏', '懷、就、息、隋[綏]1、罷、還、返、退、免、迋，歸也。', '[音義-1]：大果反', '釋詁', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (810, '紾;盭;乖;違;舛;逪;偭;背', '', '抮{紾}1、盭2、乖、違、舛3、逪4、偭5，偝{背}也。', '[音義-1]：顯\n[音義-2]：戾\n[音義-3]：侈遠\n[音義-4]：採各\n[音義-5]：面', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (811, '𢄛;𢄐;幎;幔;屏;幕;茨;葺;𦯈;燾;幠;賵;弇;冒;覆', '', '𢄛1、𢄐2、幎3、幔4、帡{屏}5、幕、茨、葺6、𦯈7、𤎧{燾}8、幠9、賵、弇、冒，覆也。', '[音義-1]：逐由反\n[音義-2]：蒙\n[音義-3]：覓\n[音義-4]：莫汗\n[音義-5]：福郢\n[音義-6]：子立、且立二音\n[音義-7]：此寢去\n[音義-8]：悼\n[音義-9]：呼', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (812, '惶;怖;懝;㒤;猜;忦;嘽咺;謾台;脅鬩;怵;惕;蛩㤨;正伀;至冬;畏;恐;遽;懼', '䞗;憚吅;䋫㤨', '惶、怖、䰯{懝}1、㒤2、猜[䞗]、忦3、嘽咺[憚吅]4、謾台5、脅鬩、怵、惕、蛩㤨6、佂伀{正伀}[䋫㤨]7、恎㤏{至冬}8、畏、恐、遽9，懼也。', '[音義-1]：魚記\n[音義-2]：充涉\n[音義-3]：公八、公械\n[音義-4]：火袁\n[音義-5]：蠻夷\n[音義-6]：拱恭\n[音義-7]：征音。鍾\n[音義-8]：多結。冬\n[音義-9]：其去', '釋詁', '廣雅', '5;7;13', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (813, '蕪;𡕢;薄;荒;瑕;薉', '氾', '蕪、𦲯{𡕢}[氾]1、薄、荒、瑕，薉也。', '[音義-1]：亡咸', '釋詁', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (814, '匯;文;垷;堲;焦;式', '捪;飾', '擓{匯}1、抆{文}[捪]2、挸{垷}3、揤{堲}4、撨{焦}5，拭{式}[飾]也。', '[音義-1]：苦懐\n[音義-2]：吻\n[音義-3]：古典\n[音義-4]：子翼\n[音義-5]：嘯', '釋詁', '廣雅', '2;6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (815, '監;劌;籤;剡;銳;銛;利', '', '㔋{監}1、劌、籖{籤}2、剡3、銳4、銛5，利也。', '[音義-1]：鑑，又音檻\n[音義-2]：七廉\n[音義-3]：易歛\n[音義-4]：伇桂\n[音義-5]：纎', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (816, '抯;撅;擖;搳;擿;搔', '', '抓{抯}1、撅2、擖3、搳4、擿5，搔也。', '[音義-1]：壯孝\n[音義-2]：厥\n[音義-3]：落合。政宇謹案：念孫謂當音公八、口八二反\n[音義-4]：可瞎\n[音義-5]：恥革', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (817, '餥;飵;䬯;啖;噬;䭡䭓;湌;餔;啜;甞;餉;䉵;茹;嘰;食', '', '餥1、飵2、䬯3、啖4、噬、䭡䭓5、湌6、餔7、啜8、甞、餉、䉵9、茹、〔嘰〕，食也。', '[音義-1]：非音，又匪\n[音義-2]：昨，又似故\n[音義-3]：女霑，又如甘\n[音義-4]：噉\n[音義-5]：烏困，又於恨。五困\n[音義-6]：錯寒\n[音義-7]：逋\n[音義-8]：時月、褚苪\n[音義-9]：士眷', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (818, '㒍;疲;勞;懈;惰;怠;䭆;嬾', '', '㒍1、疲、勞、懈、惰、怠、䭆2，嬾也3。', '[音義-1]：六罪、力維\n[音義-2]：女革\n[音義-3]：洛滿', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (819, '晻;𥴨;翳;薈;邕;蔽;障', '', '晻1、𥴨2、翳、薈3、壅{邕}、蔽，障也。', '[音義-1]：烏感\n[音義-2]：愛\n[音義-3]：烏鱠', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (820, '轖;镾;厲;設;沓;縫;灋;際;接;稽;交;連;合', '烈;遝;棨', '繬{轖}、彌{镾}、厲[烈]、設、沓[遝]、縫、灋、際、接、稽[棨]、交、〔連〕，合也。', '', '釋詁', '廣雅', '3;5;10', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (821, '瀧涿;露;霑;濡;僉;溺;淪;氾;寖;潤;瀸;漸;溓;漚;澆;靃;淳;𦰚;淙;盆;淋;灌;灓;對;瀀;渥;浞;洽;瀨', '㲻;㴶', '瀧涿1、露、霑、濡、澰{僉}2、溺[㲻]、淪、氾、寖3、潤、瀸4、漸、溓5、漚6、澆7、瀖{靃}[㴶]8、淳9、沃{𦰚}10、淙11、湓{盆}12、淋13、灌14、灓15、濧{對}16、瀀17、渥、浞18、〔洽〕，瀨也。', '[音義-1]：籠。陟角\n[音義-2]：落感\n[音義-3]：子禁\n[音義-4]：作廉\n[音義-5]：廉\n[音義-6]：惡候反\n[音義-7]：計堯\n[音義-8]：口角\n[音義-9]：市倫\n[音義-10]：屋\n[音義-11]：土降\n[音義-12]：蒲悶\n[音義-13]：林\n[音義-14]：觀\n[音義-15]：鸞\n[音義-16]：徒內\n[音義-17]：憂\n[音義-18]：士角反', '釋詁', '廣雅', '6;16', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (822, '𨃚;蹠;䠛;𧿳;踊;躍;叕;蹶;竦;折;跳', '𧼪', '𨃚1、蹠2、䠛3、𧿳4、踊、躍、䟾{叕}5、蹶6、竦、䟷{折}[𧼪]7，跳也。', '[音義-1]：他帀\n[音義-2]：只易\n[音義-3]：遥，又曜\n[音義-4]：拂\n[音義-5]：陟劣\n[音義-6]：厥\n[音義-7]：勑例', '釋詁', '廣雅', '10', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (823, '祭;眙;止;待;立;逗', '刹', '傺{祭}[刹]1、眙2、止、待、立，逗也。', '[音義-1]：恥制\n[音義-2]：恥利', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (824, '嬴;裔;翫;肄;俗;習', '習', '䃷{嬴}1、裔[習]、翫、肄、俗，習也。', '[音義-1]：盈', '釋詁', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (825, '卒;離;空;稗;臺;待', '控;䟆;待', '㱖{卒}1、離、空[控]、稗[䟆]、臺[待]，待也。', '[音義-1]：萃', '釋詁', '廣雅', '3;4;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (826, '鬱悠;愼;靖;憯;覃;憮;恁;侖;思', '念', '鬱悠、愼、靖、䁮{憯}、憛{覃}1、憮、恁[念]2、侖3，思也。', '[音義-1]：他紺\n[音義-2]：稔，又如深\n[音義-3]：淪', '釋詁', '廣雅', '7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (827, '仳倠;娸;咅;嬯;服;爽;多爲;雚癸;頦;顝;䫏;醜', '僰', '仳倠1、娸2、婄{咅}3、儓{嬯}4、𧟵{服}[僰]5、䫪{爽}6、䫂噅{多爲}7、䑏𦝢{雚癸}8、頦9、顝10、䫏11，醜也。', '[音義-1]：鼻之。許惟\n[音義-2]：欺\n[音義-3]：陪\n[音義-4]：臺\n[音義-5]：蒲北\n[音義-6]：爽，又差丈反\n[音義-7]：丁可。欽危\n[音義-8]：權逵\n[音義-9]：該\n[音義-10]：苦沒\n[音義-11]：欺', '釋詁', '廣雅', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (828, '閒;椓;㪏;訾;誹;詆;傷;譖;謗;訴;辠;訕;𡢕', '呰', '閒、諑{椓}、諀{㪏}1、訾[呰]2、誹3、詆4、傷、譖、謗、訴、辠、訕，䛼{𡢕}也5。', '[音義-1]：匹爾\n[音義-2]：子移，又紫\n[音義-3]：福尾\n[音義-4]：嫡禮\n[音義-5]：毁音，即「䛼謗」之䛼。今毁乃訓壞', '釋詁', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (829, '䥍;番;奄;㪙;𢽚;鍛;椎', '', '䥍1、鐇{番}2、䤶{奄}3、㪙4、㧻{𢽚}5、鍛6，椎也7。', '[音義-1]：思列\n[音義-2]：甫袁\n[音義-3]：於檢\n[音義-4]：苦果，又口臥\n[音義-5]：卓\n[音義-6]：短館\n[音義-7]：直追', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (830, '台;旣;抎;墜;逸;失', '駘', '台[駘]1、旣、抎2、墜、逸，失也。', '[音義-1]：夷\n[音義-2]：云粉', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (831, '行;隊;矢/尸;棘;設;鋪;田;神;列;肆;陳', '𠂤;陳', '行、隊[𠂤]、𡱁{矢/尸}1、棘、設、鋪2、田、神[陳]、列、〔肆〕，陳也。', '[音義-1]：矢\n[音義-2]：判逋', '釋詁', '廣雅', '2;9', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (832, '嫽;誂;透;擿;嬈', '誘', '嫽1、誂2、透[誘]3、揥{擿}4，嬈也5。', '[音義-1]：了\n[音義-2]：大鳥\n[音義-3]：叔\n[音義-4]：帝。政宇謹案：念孫謂當讀爲擿\n[音義-5]：那烏', '釋詁', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (833, '戲;歇;漏;泄', '羲;渫', '戲[羲]1、歇2、漏，泄[渫]也。', '[音義-1]：憗一\n[音義-2]：許謁', '釋詁', '廣雅', '1;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (834, '蹇;極;軋;歰;吃', '㥛;乙', '𧬯{蹇}1、極[㥛]、軋[乙]2、歰、吃3也。', '[音義-1]：居免\n[音義-2]：於八\n[音義-3]：棘乞', '釋詁', '廣雅', '2;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (835, '悲;悠;悼;惄;悴;憖;愍;感;痛;嘆;殤;愴;慯', '', '悲、悠、悼、惄、悴、憖1、愍、感、痛、嘆、殤、〔愴〕，慯也。', '[音義-1]：魚靳', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (836, '逞;苦;憭;曉;恔;快', '', '逞1、苦、〔憭〕、曉、恔2，快3也。', '[音義-1]：勑領反\n[音義-2]：校\n[音義-3]：可怪反', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (837, '梗;劌;棘;傷;茦;刺;壯;箴', '戕', '梗、劌、棘、傷、茦、刺、壯[戕]，箴也。', '', '釋詁', '廣雅', '7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (838, '清;齊;湑;浚;滰;筆;笮;漦;𤃭;釃;漉', '勃/刜', '清、䍤{齊}1、湑2、浚、滰3、潷{筆}[勃/刜]4、笮5、漦6、𤃭7、𦌿{釃}8，𥂖{漉}也9。', '[音義-1]：耤禮\n[音義-2]：思呂\n[音義-3]：巨仰\n[音義-4]：筆\n[音義-5]：側白\n[音義-6]：士宜、士疑、勑之反\n[音義-7]：子紹、子肖\n[音義-8]：所佳、所飢\n[音義-9]：禄', '釋詁', '廣雅', '6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (839, '朱儒;卷彖;卑此;痤;齊;鮆;奇;㾈;旋;罷;䆯;召;孑孓;升;𡲬;短', '啙;矮;跧;䇑;𧜣;詘', '侏儒{朱儒}、𥏙䂕{卷彖}1、𥏠䂑{卑此}2、矬{痤}3、癠{齊}4、鮆[啙]5、㾨{奇}[矮]6、㾈7、𣎓{旋}[跧]8、矲{罷}[䇑]9、𠭴{䆯}10、䂏{召}[𧜣]11、孑孓12、升、〔𡲬[詘]〕，短也。', '[音義-1]：苦穢。喙\n[音義-2]：布兮。子兮\n[音義-3]：坐禾\n[音義-4]：在細\n[音義-5]：藉禮\n[音義-6]：於綺\n[音義-7]：附俱、付禹\n[音義-8]：旋\n[音義-9]：步楷\n[音義-10]：竹律、徵劣\n[音義-11]：彫\n[音義-12]：吉□。居闕', '釋詁', '廣雅', '6;7;9;10;12;15', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (840, '揫;拱;丙;重;固', '', '揫、拱1、鈵{丙}2、董{重}，固也。', '[音義-1]：俱隴\n[音義-2]：丙', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (841, '辟朴;盬;雜;趀;趀;造;匪;突;暴;暫;猝', '苦;疌;艸', '憵朴{辟朴}1、盬[苦]、雜[疌]、趀2、𡰾{趀}3、造{艸}4、䕁{匪}5、突、暴、暫，猝也6。', '[音義-1]：普旳。普卜、普角\n[音義-2]：七咨，又步末\n[音義-3]：即同上音\n[音義-4]：七到\n[音義-5]：棐\n[音義-6]：錯忽反', '釋詁', '廣雅', '2;3;6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (842, '甫;奊;䫌;倪;乖;陂;𢾝;陂它;傾;畸;戲;偏;俄;迆;阿;阪;哨;回;哇;差;剌;險;阻;頗;隤;徑;夕;蕭;俄;衺', '㾈;陂阤;陗;𢾝;奊;槎;巠', '陠{甫}[㾈]1、奊2、䫌3、倪、乖、佊{陂}4、𢾝5、陂陀{陂它}[陂阤]6、傾、畸、戲7、偏8、俄、迤{迆}9、阿、阪、哨[陗]10、回[𢾝]、哇[奊]11、差[槎]12、剌13、險、阻、頗、隤14、徑[巠]、夕、蕭、𩒰{俄}15，衺也。', '[音義-1]：布乎\n[音義-2]：胡結\n[音義-3]：卑啓\n[音義-4]：化佊草木\n[音義-5]：韋\n[音義-6]：必何。大哥\n[音義-7]：羲\n[音義-8]：匹緣\n[音義-9]：亦音陀\n[音義-10]：七笑\n[音義-11]：於家\n[音義-12]：策霞\n[音義-13]：落末\n[音義-14]：徒回\n[音義-15]：俄', '釋詁', '廣雅', '1;8;17;18;19;20;26', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (843, '匀;誑;詒;諼;謬;遁;墨杘;詈詑;亶謾;猶;譎;詐;僞;度;膠;誣;詿;詑;調;突;虞;詆;詭;欺', '謬;啁;啎', '𧥺{匀}1、誑、詒2、諼3、謬4、遁、嚜杘{墨杘}5、㦒忚{詈詑}6、謾譠{亶謾}7、猶、譎、詐、僞、𧩧{度}8、膠[謬]、誣、詿9、詑10、調[啁]、突、虞[啎]、〔詆〕、〔詭〕，欺也。', '[音義-1]：鈞儐\n[音義-2]：與之\n[音義-3]：許袁\n[音義-4]：靡㓜\n[音義-5]：眉北。恥棃\n[音義-6]：力兮。虎兮\n[音義-7]：莫千。託寒\n[音義-8]：達各\n[音義-9]：乖賣\n[音義-10]：湯陁', '釋詁', '廣雅', '15;19;21', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (844, '蕆;飭;戒;福;晐;具;僃', '𤰈', '蕆1、飭、戒、福、晐2、具，僃[𤰈]也。', '[音義-1]：恥輦\n[音義-2]：該', '釋詁', '廣雅', '7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (845, '戔;芮;肄;𣡌', '𣦵', '䏼{戔}[𣦵]1、枘{芮}、肄2，枿{𣡌}也。', '[音義-1]：殘\n[音義-2]：弋至', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (846, '俜;侹;遊;挑;俠', '䋼;佻', '俜1、侹[䋼]2、遊、挑[佻]3，俠也。', '[音義-1]：普經\n[音義-2]：他鼎\n[音義-3]：大了', '釋詁', '廣雅', '2;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (847, '豆;悍;婐;敢;武;㐹;勇', '', '䜴{豆}1、〔悍〕、惈{婐}2、敢、武、㐹3，勇也。', '[音義-1]：昌樹\n[音義-2]：果\n[音義-3]：魚乙', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (848, '蹵;躓;朁;此;䟫;氐;舂;踶;蹋', '', '蹵1、躓2、躦{朁}3、跐{此}4、䟫5、䟡{氐}6、蹖{舂}7、〔踶〕，蹋也8。', '[音義-1]：酒六\n[音義-2]：竹利\n[音義-3]：才他\n[音義-4]：𣅔買，又子爾\n[音義-5]：敞\n[音義-6]：丁戾\n[音義-7]：詩容\n[音義-8]：大臘反。今人蹹字如此，失之矣', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (849, '𪒠;奄;維;悆;忽;𧧢;腆;詄;隶;末;忘', '遺;詄', '𪒠1、㤿{奄}2、𢣘{維}[遺]3、悆4、忽、㤺{𧧢}5、腆[詄]、詄6、㥆{隶}7、𢗿{末}、忘也。', '[音義-1]：烏减\n[音義-2]：於劒\n[音義-3]：聿醉\n[音義-4]：以去\n[音義-5]：呼晃反\n[音義-6]：徒結\n[音義-7]：退', '釋詁', '廣雅', '3;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (850, '誦;說;精;講;論', '', '誦、說、精、講，論也。', '', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (851, '主;紀;疏;記;學;栞;志;識', '丶', '註{主}[丶]1、紀、疏、記、學、栞2、志，識也。', '[音義-1]：只屢\n[音義-2]：刊', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (852, '𦐇;㬪;鬌;𩂣;零;墜;遺;墮', '𡪐', '塌{𦐇}[𡪐]1、㬪2、鬌3、𩂣4、零、墜、遺，墮也。', '[音義-1]：徒盍\n[音義-2]：徒葉\n[音義-3]：都果\n[音義-4]：廣音音洛', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (853, '序;倢;㨻;佴;秩;班;坒;比;差;第;次', '𧽯;豑', '序、倢1、㨻[𧽯]、佴2、秩[豑]、斑{班}、坒3、笓{比}4、差5、第，次也。', '[音義-1]：字獵\n[音義-2]：如志\n[音義-3]：毗利、毗栗\n[音義-4]：毗利\n[音義-5]：初宜', '釋詁', '廣雅', '3;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (854, '惎;恉;意;志', '諅', '惎[諅]1、恉2、意，志也。', '[音義-1]：巨記\n[音義-2]：旨', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (855, '俞;㔎;㱚;烈;㶳;孑;贏;菆;㡜;遺;緖;餘', '宂;櫱', '䩱{俞}[宂]1、㔎[櫱]2、㱚3、㡂{烈}4、燼{㶳}、孑、贏、菆5、㡜、遺、〔緖〕，餘也。', '[音義-1]：臾\n[音義-2]：先列\n[音義-3]：在安\n[音義-4]：例\n[音義-5]：側流', '釋詁', '廣雅', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (856, '繾;䊎;啻;㨖;摶', '綣;冟;槸', '䭤{繾}1、䊎[綣]2、䊞{啻}[冟]3、㨖[槸]4，摶也5。', '[音義-1]：遣\n[音義-2]：去晚\n[音義-3]：摘，又竹戹\n[音義-4]：竹利\n[音義-5]：大丸', '釋詁', '廣雅', '2;3;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (857, '粲;爛;彪;辬;粦;虨;彬;㦽;昈;純;文', '', '粲1、𢒞{爛}2、彪3、辬4、璘{粦}5、𧇃{虨}6、彬7、彧{㦽}8、昈9、純，文也。', '[音義-1]：錯汗\n[音義-2]：落汗\n[音義-3]：必鄒\n[音義-4]：班\n[音義-5]：鄰\n[音義-6]：迫姦\n[音義-7]：福巾\n[音義-8]：於菊\n[音義-9]：戸', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (858, '困;胎;達;逃', '逭;佚;佚', '困[逭]、胎[佚]、㒓{達}[佚]1，逃也。', '[音義-1]：勑逹', '釋詁', '廣雅', '1;2;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (859, '穎;挻;挺;㮓;遂;畺;畍;㽘;畢;終;𣨛;竟', '㪤', '𢹃{穎}1、挻、挺、㮓、遂、畺、畍2、㽘3、畢[㪤]、𣧩{終}4、𣨛5，竟也。', '[音義-1]：頃\n[音義-2]：介\n[音義-3]：古朖\n[音義-4]：終\n[音義-5]：卒', '釋詁', '廣雅', '9', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (860, '傅;摧;卽;因;度;集;從;圍;酉;歸;孝;梱;就', '稛', '傅1、䜅{摧}2、卽、因、度、集、從、圍、酉、歸、孝、梱[稛]3，就也。', '[音義-1]：敷\n[音義-2]：子隹\n[音義-3]：苦本', '釋詁', '廣雅', '12', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (861, '狄;刲;刳;屠', '鬄', '𠜓{狄}[鬄]1、刲2、刳3，屠也。', '[音義-1]：託歷\n[音義-2]：苦圭\n[音義-3]：看姑', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (862, '翬;鶱;增;翥;亶;宣;粦;宏;煢;或;連;翾;翋眔;鴪;肅;矯;飛', '䙴;䙴;翋𦐇', '翬1、鶱、䎖{增}2、翥3、𦒜{亶}[䙴]4、翧{宣}[䙴]5、翷{粦}6、翃{宏}7、䎕{煢}8、〔𦑌{或}〕、翴{連}9、翾10、翋𦑶{翋眔}[翋𦐇]11、鴪12、䎘{肅}13、矯，飛也。', '[音義-1]：呼韋\n[音義-2]：即恒\n[音義-3]：諸悆。方言音曙\n[音義-4]：火仙\n[音義-5]：喧\n[音義-6]：鄰\n[音義-7]：宏\n[音義-8]：呼麥\n[音義-9]：連\n[音義-10]：吁緣\n[音義-11]：力合。大合\n[音義-12]：聿\n[音義-13]：三六', '釋詁', '廣雅', '5;6;13', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (863, '鑿;矞;欮;掘;曰;𣂁;抉;挑;竁;穿', '厥;搰', '鑿1、矞2、欮[厥]3、掘、抇{曰}[搰]4、𣂁5、抉6、挑、竁7，穿也。', '[音義-1]：昨\n[音義-2]：聿述，又市出\n[音義-3]：居月\n[音義-4]：呼沒\n[音義-5]：他聊\n[音義-6]：於穴\n[音義-7]：毳，又穿絹', '釋詁', '廣雅', '3;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (864, '搒;撅;𢦚', '', '搒1、撅2、𡛏{𢦚}3', '[音義-1]：彭\n[音義-2]：居月\n[音義-3]：本作（', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (865, '苦;翕;矣;煜;熺;亥;熾', '熹', '苦、翕1、㶼{矣}[熹]2、煜3、熺4、〔烗{亥}〕，熾也。', '[音義-1]：虚及\n[音義-2]：哀\n[音義-3]：夷六\n[音義-4]：睎', '釋詁', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (866, '悲;惄;良;惆;悵', '', '蕜{悲}1、惄、悢{良}、惆，悵也。', '[音義-1]：翡，又芳尾', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (867, '怤愉;兌;解;說', '', '怤愉1、兌2、解，說也。', '[音義-1]：孚。以珠\n[音義-2]：度外', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (868, '僄;毛;媥;𡛟;狎;㑥;蚩;侮;汎;懱;忽;傲;輕', '眇;𣢑', '僄1、毛[眇]、媥2、𡛟3、狎、㑥4、蚩[𣢑]、侮、𠆩{汎}5、懱、忽、〔傲〕，輕也。', '[音義-1]：匹妙\n[音義-2]：篇\n[音義-3]：曰\n[音義-4]：以豉\n[音義-5]：凡', '釋詁', '廣雅', '2;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (869, '窴;𨌅;關;括;𢾅;充;實;敜;閉;𠯑;䋈;㝮;䁊;垔;塞', '', '窴1、䡨{𨌅}2、關、括、𡍨{𢾅}3、充、實、敜4、閉、𠯑5、䋈、㝮6、䁊7、堙{垔}，塞也。', '[音義-1]：田\n[音義-2]：士佳，又七咨\n[音義-3]：杜\n[音義-4]：乃結、乃頰\n[音義-5]：下刮\n[音義-6]：千外\n[音義-7]：一活、女刮', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (870, '礲;礪;晞;鑠;妻㼽;剴;杚;差;揅;錯;鑢;皆;犀;同;匯;鎣;斯;切;砥;䴾;䃺', '䴾;摡;鏟', '礲1、礪、希{晞}、鑠、㼮㼽{妻㼽}2、剴3、扢{杚}4、差[䴾]、揅5、錯、鑢、揩{皆}[摡]6、〔摨{犀}〕、硐{同}7、擓{匯}8、鎣9、𥕶{斯}[鏟]10、𢪃{切}11、砥12、磋{䴾}，磨{䃺}也。', '[音義-1]：落東\n[音義-2]：叉佳。爽\n[音義-3]：五哀\n[音義-4]：古礙、古對\n[音義-5]：研\n[音義-6]：看皆\n[音義-7]：同\n[音義-8]：口淮\n[音義-9]：胡冥\n[音義-10]：斯\n[音義-11]：七結\n[音義-12]：止', '釋詁', '廣雅', '8;12;17', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (871, '勺;叉;殹;惹;㛪;而;拏', '', '訋{勺}1、訍{叉}2、贀{殹}3、惹4、䛳{㛪}5、䛔{而}6，拏也7。', '[音義-1]：弔\n[音義-2]：丑加\n[音義-3]：羊瑞\n[音義-4]：汝奢、汝灼\n[音義-5]：於劒\n[音義-6]：女家\n[音義-7]：女家', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (872, '媱;愓;僖;逸;遊;敖;𠜵;戲', '快', '媱1、愓2、嬉{僖}3、劮{逸}4、遊、敖、𠜵[快]5，戲也。', '[音義-1]：遥\n[音義-2]：陽\n[音義-3]：虚之\n[音義-4]：逸\n[音義-5]：孤八', '釋詁', '廣雅', '7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (873, '長敄;跪;𢱭', '', '䠆𨂣{長敄}1、跪，𢱭也2。', '[音義-1]：腸。務\n[音義-2]：布界反', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (874, '巩松;訽;剔;馬;詈;罵', '巩庸', '𠌖倯{巩松}[巩庸]1、訽2、剔3、馬、詈，罵也。', '[音義-1]：巨恭。舂\n[音義-2]：呼遘、乎遘、居候三反\n[音義-3]：天歷', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (875, '嬴;旅;何;揭;幐;儋', '膂', '攍{嬴}1、旅[膂]、何、〔揭〕、𢯭{幐}2，擔{儋}也3。', '[音義-1]：盈\n[音義-2]：鄧\n[音義-3]：帶甘', '釋詁', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (876, '爢;爤;𩱋;胹;飪;饎;酷;酋;羞;礪;研;熟', '', '爢1、爤、𩱋2、胹3、餁{飪}4、饎5、𥞴{酷}6、酋7、羞、礪、䊙{研}8，熟也9。', '[音義-1]：靡皮\n[音義-2]：普衡\n[音義-3]：而\n[音義-4]：而枕\n[音義-5]：充志\n[音義-6]：酷\n[音義-7]：似流\n[音義-8]：研\n[音義-9]：孰。憲案：說文解字從丮𦎧，即孰字也，與「孰誰」之孰無異。唯顧野王玉篇孰字加火，未知所出', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (877, '爰;諒;㥞;鞮;鬲;覺;叡;宁諝;黨;聞;曉;哲;𥏼', '啻;昌', '愋{爰}1、諒、㥞2、鞮[啻]3、𢡍{鬲}4、覺、叡、㤖諝{宁諝}5、黨[昌]、聞、曉、哲，𥏼也。', '[音義-1]：爰\n[音義-2]：邃\n[音義-3]：低\n[音義-4]：革\n[音義-5]：竹呂，又音佇。思與、思余', '釋詁', '廣雅', '4;9', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (878, '封;垤;坻;場', '', '封、垤1、坻2，塲{場}也3。', '[音義-1]：徒結\n[音義-2]：直尸\n[音義-3]：傷', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (879, '杜;蹻;遴;歰', '', '杜、蹻1、遴2，歰也3。', '[音義-1]：虛虐\n[音義-2]：良鎮\n[音義-3]：師急', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (880, '絓;挈;煢;介;孤;寡', '佳/閨;孑;赹', '絓[佳/閨]1、挈[孑]2、𠎽{煢}[赹]3、介、孤、寡4、𡩡[疏]、唯、特，獨也。', '[音義-1]：口乖\n[音義-2]：古八\n[音義-3]：瓊\n[音義-4]：（⿱宀臬）', '釋詁', '廣雅', '1;2;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (881, '混;誖;頓愍;眠眩;惑;蚩;䍃;嬰;撓;慁;攪;骨;紛𧶊;縕;惷;妄;怓;憒;叛;殽;逆;𢺕;亂', '溷;淈;𩰟𧶊', '惃{混}[溷]1、𢠜{誖}2、頓愍、眠眩3、惑、蚩、愮{䍃}4、攖{嬰}5、撓6、慁7、攪8、猾{骨}[淈]、紛□□{紛𧶊}[𩰟𧶊]、縕9、惷10、妄11、怓12、憒13、叛、殽、逆、〔𢺕〕，亂也。', '[音義-1]：袞、昆二音\n[音義-2]：勃\n[音義-3]：迷殿\n[音義-4]：遥\n[音義-5]：嬰\n[音義-6]：乃飽、乃孝\n[音義-7]：乎困\n[音義-8]：古巧\n[音義-9]：於昆、於粉\n[音義-10]：嗔允\n[音義-11]：望\n[音義-12]：女交\n[音義-13]：古每', '釋詁', '廣雅', '1;12;13', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (882, '蹇;妯;㺒;騷;獪;燥;煩;𢺕', '', '蹇1、妯2、㺒3、騷、獪4、躁{燥}5、煩，𢺕也。', '[音義-1]：寋\n[音義-2]：抽\n[音義-3]：奴絞、乎絞\n[音義-4]：柯邁\n[音義-5]：作誥，竈', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (883, '逴;綦;騷;輒;逴;㝿;踦;奄;蹇', '簫', '逴1、綦2、騷[簫]、踂{輒}、𡯴{逴}3、㝿4、踦5、㞄{奄}6，蹇也。', '[音義-1]：勑角，一音卓\n[音義-2]：巨基\n[音義-3]：勑角\n[音義-4]：布可\n[音義-5]：居綺\n[音義-6]：烏感、烏含、烏洽三反', '釋詁', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (884, '糶;酤;衒;𧶠;調;令;居;𧸖;𧷓', '', '糶、酤、衒1、𧶠、調2、詅{令}3、䝻{居}4、𧸖，𧷓也5。', '[音義-1]：乎麵\n[音義-2]：達弔\n[音義-3]：力政\n[音義-4]：居\n[音義-5]：麥嫁反', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (885, '薄;糴;市;買', '', '薄、糴、市，買也。', '', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (886, '彙;穜;方;朋;肖;似;醜;類', '會;雔', '彙[會]1、穜2、方、朋、肖、似、醜[雔]，類也。', '[音義-1]：謂\n[音義-2]：種', '釋詁', '廣雅', '1;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (887, '忥;騃;僮;昏;狂;誖;脀;甿;痬;癡', '氓', '疙{忥}1、騃2、僮、惽{昏}3、狂、誖4、脀5、甿[氓]6、痬7，癡也。', '[音義-1]：居乙、魚乙\n[音義-2]：魚駭\n[音義-3]：昏\n[音義-4]：蒲沒\n[音義-5]：旨升\n[音義-6]：莫鄧\n[音義-7]：易', '釋詁', '廣雅', '8', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (888, '伸;愓;矯;煣;展;侹;繩;矢;當;直', '', '伸、愓1、矯2、煣3、展、侹4、繩、矢、當，直也。', '[音義-1]：揚，一本作偒\n[音義-2]：居夭\n[音義-3]：而手\n[音義-4]：達鼎', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (889, '溫;煖;聶;內;曣;𣌖;暍;𣌖;燠;燂;煗', '𥁕;煗;涗;洝', '溫[𥁕]、煖1、㸎{聶}[煗]2、㶧{內}[涗]3、曣[洝]4、㬗{𣌖}5、暍6、𣌖7、燠8、燂9，煗也10。', '[音義-1]：暖\n[音義-2]：女涉\n[音義-3]：奴本\n[音義-4]：於見\n[音義-5]：乃見\n[音義-6]：於曷\n[音義-7]：乃旦、乃達\n[音義-8]：於菊\n[音義-9]：潛\n[音義-10]：奴管', '釋詁', '廣雅', '1;3;4;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (890, '庸;比;侹;佽;更;跲;遞;迭;代', '拾', '庸、比1、侹2、佽3、更、跲[拾]4、遞5、迭6，代也。', '[音義-1]：鼻\n[音義-2]：大鼎\n[音義-3]：次\n[音義-4]：劫\n[音義-5]：狄邐\n[音義-6]：狄頡', '釋詁', '廣雅', '6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (891, '含;堪;龕;受;盛', '堪', '鋡{含}1、堪、龕[堪]2、受、盛也3。', '[音義-1]：含\n[音義-2]：堪\n[音義-3]：平聲', '釋詁', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (892, '氾;浼;洼;染;㶄;濩;辱;點;塗;汙', '獲', '氾1、𩈦{浼}2、洼3、染、㶄4、濩[獲]5、辱、點、〔塗〕，汙也。', '[音義-1]：敷劒\n[音義-2]：滿\n[音義-3]：烏蛙、戹家反\n[音義-4]：剡\n[音義-5]：乎郭', '釋詁', '廣雅', '6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (893, '匋;質;流;雚;譁;蔿;涅;仙;卦;變;𠤎', '幻;化;僊;化', '匋1、質、流、𡚜{雚}[幻]2、譁3、蔿[化]4、涅、仙[僊]、卦[化]、變，𠤎也5。', '[音義-1]：桃\n[音義-2]：歡\n[音義-3]：五瓜\n[音義-4]：于彼\n[音義-5]：化', '釋詁', '廣雅', '4;6;8;9', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (894, '釐孳;連;𦤝;匹;耦;孿', '', '釐孳1、僆{連}2、䫵{𦤝}3、匹、耦，㝈{孿}也4。', '[音義-1]：力移。兹\n[音義-2]：輦\n[音義-3]：緜\n[音義-4]：上山患反', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (895, '撊;梗;爽;猛', '更/庚', '撊1、梗[更/庚]2、爽，猛也。', '[音義-1]：下板\n[音義-2]：介猛', '釋詁', '廣雅', '2;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (896, '𠈪;庇;寓;羈;餬;侂;寄', '', '媵{𠈪}1、庇2、寓3、羈、餬、侂4，寄也。', '[音義-1]：以證\n[音義-2]：不異\n[音義-3]：儀注\n[音義-4]：託', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (897, '害;曷;胡;盍;何', '曷', '害[曷]1、曷、胡、盍，何也。', '[音義-1]：乎割', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (898, '薄;怒;文;農;勉', '迫;忞', '薄[迫]、怒、文[忞]、農，勉也。', '', '釋詁', '廣雅', '1;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (899, '歸;餉;饋;遂;問;遺', '裞', '歸、餉、饋、襚{遂}[裞]、問，遺也。', '', '釋詁', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (900, '刊;剟;寽;剽;戔;巤;刷;削', '', '刊1、剟2、𠜖{寽}3、剽4、剗{戔}5、𠠗{巤}6、〔刷〕，削也。', '[音義-1]：可寒\n[音義-2]：竹劣\n[音義-3]：力活\n[音義-4]：匹妙\n[音義-5]：楚簡\n[音義-6]：獵', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (901, '炅;皋;𠊩;譯;覩;形;覢;儀;皃;較;見', '義;姣', '炅1、䚌{皋}2、僝{𠊩}3、譯、覩、形、覢4、儀[義]、皃、〔較[姣]〕，見也。', '[音義-1]：桂\n[音義-2]：古刀\n[音義-3]：士眷、士免\n[音義-4]：式冉', '釋詁', '廣雅', '8;10', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (902, '廫;內;穵;豂;崝嶸;淵;洿;镾;邃;幽;暗;窈;窱;藏;井;掊;穴;深', '䆷', '寥{廫}1、㘨{內}2、穵3、豂4、崝嵤{崝嶸}5、淵、洿6、彌{镾}、邃、幽、暗、窈、窱7、藏、井、掊8、〔坹{穴}[䆷]〕，深也。', '[音義-1]：聊\n[音義-2]：乃頰\n[音義-3]：乙八\n[音義-4]：力彫\n[音義-5]：士耕。宏\n[音義-6]：烏\n[音義-7]：天了\n[音義-8]：步侯', '釋詁', '廣雅', '17', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (903, '叔;季;幼;稚;孩;雡;少', '少', '叔[少]、季、幼、稚、孩、雡1，少也。', '[音義-1]：力救', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (904, '稀;秝;闊;遠;疏', '', '稀、秝1、闊、遠，疏也。', '[音義-1]：歷', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (905, '擐;䕻;壓;摶;飾;竊;箸', '結', '擐1、䕻2、壓3、摶4、飾、竊[結]，著{箸}也5。', '[音義-1]：乎慢、官患\n[音義-2]：麗\n[音義-3]：戹匣\n[音義-4]：團\n[音義-5]：丈略', '釋詁', '廣雅', '6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (906, '𩓠;圜;㘣;肙;篅;圓', '圓', '𩓠1、圜2、〔㘣〕3、梋{肙}[圓]4、圌{篅}5，〔圓〕也。', '[音義-1]：俱遺反\n[音義-2]：還\n[音義-3]：旋\n[音義-4]：沿\n[音義-5]：市宣', '釋詁', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (907, '壤;果;埃;㙠;坌;塺;𥽘;坺;孛;塵', '', '壤1、堁{果}2、埃、㙠3、坌4、塺5、𡊉{𥽘}6、坺7、〔𡋯{孛}〕，塵也。', '[音義-1]：而養\n[音義-2]：苦卧\n[音義-3]：於奚\n[音義-4]：普寸，又步頓\n[音義-5]：磨\n[音義-6]：末\n[音義-7]：步葛', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (908, '詇;奧;號;殸;誋;訴;風;諭;告', '寍', '詇1、䜒{奧}2、號、𣍆{殸}[寍]3、誋4、訴、風、諭，告也。', '[音義-1]：於敬、於兩\n[音義-2]：烏到\n[音義-3]：乃□、尼□。政宇謹案：玉篇乃經、乃定二反\n[音義-4]：忌', '釋詁', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (909, '𢴧;敵;匽;㒼;𧘂;稽;臺;配;亢;對;貞;當', '傿;芇;棨;持;妃;抗;汀', '𢴧1、敵、䞁{匽}[傿]、㒼[芇]2、𧘂、稽[棨]、儓{臺}[持]3、配[妃]、亢[抗]4、對、貞[汀]，當也。', '[音義-1]：直利，說文直二\n[音義-2]：亡殄、亡安\n[音義-3]：臺\n[音義-4]：抗', '釋詁', '廣雅', '3;4;6;7;8;9;11', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (910, '𢕈;䏁;𦘍;宖;聵;聾', '', '聳{𢕈}1、䏁2、𦘍3、耾{宖}4、聵5，聾也。', '[音義-1]：竦，方言雙講\n[音義-2]：宰\n[音義-3]：五八\n[音義-4]：宏\n[音義-5]：五怪', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (911, '約;縳;紐;緯;韣;稛;亶;繃;緷;絜;麕;摎;輹;紳;紘;帶;落;意;纏;該;𢆞;徽;束', '摶;囗;纏;㯻;結;稛;申', '約、縳[摶]1、紐、緯[囗]2、韣、稛3、䆄{亶}[纏]4、繃5、緷[㯻]6、𢴲{絜}[結]7、𡈳{麕}[稛]8、摎9、輹10、紳[申]、紘、帶、笿{落}11、繶{意}12、纏、絯{該}13、𢆞14、徽，束也。', '[音義-1]：篆\n[音義-2]：韋貴、韋鬼\n[音義-3]：苦本\n[音義-4]：之善\n[音義-5]：布耕\n[音義-6]：袞\n[音義-7]：下結\n[音義-8]：苦本\n[音義-9]：九流\n[音義-10]：福\n[音義-11]：落\n[音義-12]：憶\n[音義-13]：該\n[音義-14]：古典', '釋詁', '廣雅', '2;4;7;9;10;11;14', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (912, '鑑;鏡;光;景;闓;臨;燿;照', '', '鑑、鏡、光、景、暟{闓}1、臨、燿，照也。', '[音義-1]：凱', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (913, '帝;禘;祥;審;壹帶;地;諟', '瘱諟', '帝、禘、祥、審、𧬇𧫚{壹帶}[瘱諟]1、地，諟也2。', '[音義-1]：於計。狄麗\n[音義-2]：帝', '釋詁', '廣雅', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (914, '緡;緜;羲;麗;設;布;張;爲;戲;施', '𢻫', '緡1、緜、羲、麗、設、布、張、爲、戲2，施[𢻫]也。', '[音義-1]：亡巾\n[音義-2]：許寄', '釋詁', '廣雅', '10', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (915, '遲;晏;後;旰;稺;晚', '遲', '遲、晏、後、旰、稺[遲]，晚也。', '', '釋詁', '廣雅', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (916, '笪;笞;捶;卜;𥗁;扚;打;伐;尥;抪;抰;抶;撆;撻;𥗁;𢱧;摬;𢫦;忽;柲;摽;㬥;於;𢫦;𥴫;搒;挨;挌;𢱧;㨐;虛;䙷;旬;畐;㪙;敂;獻;甬;搏;戲;害;拊;撆;慼;捭;撻;蔑;攷;𢶡;攩;㢸;可;轢;摷;肅;掔;搉;應;剝;擊', '撲;摽;𧇭;挏;𢫦;㓞;拂;摼', '担{笪}1、笞、捶、扑{卜}[撲]、𢷷{𥗁}2、扚3、打4、伐、𱟶{尥}[摽]5、抪6、抰7、抶8、撆9、撻、㨋{𥗁}10、𢱧11、摬12、拍{𢫦}13、㧾{忽}14、㧙{柲}15、摽16、㩧{㬥}[𧇭]17、𢮁{於}、𢫦18、𥳨{𥴫}19、搒20、挨21、敋{挌}22、批{𢱧}23、㨐24、𢴮{虛}25、㧹{䙷}26、㧦{旬}27、揊{畐}28、㪙29、敂30、㩵{獻}31、㪌{甬}[挏]32、搏[𢫦]、𢹍{戲}33、㪡{害}[㓞]、拊34、撆、𢷾{慼}35、捭36、撻、㩢{蔑}、攷37、𢶡38、攩39、㢸[拂]40、㪃{可}41、擽{轢}42、摷43、㩋{肅}44、掔[摼]45、搉46、應、剝，擊也。', '[音義-1]：亶\n[音義-2]：竹略\n[音義-3]：竹歷\n[音義-4]：鼎\n[音義-5]：片交\n[音義-6]：布音，又普乎\n[音義-7]：於兩\n[音義-8]：恥栗\n[音義-9]：方舌、普結\n[音義-10]：者\n[音義-11]：步結、普奚\n[音義-12]：影\n[音義-13]：普柏\n[音義-14]：苦忽\n[音義-15]：步必\n[音義-16]：孚堯、怖交二反\n[音義-17]：普角、步角\n[音義-18]：忘革\n[音義-19]：臀\n[音義-20]：彭\n[音義-21]：烏駭\n[音義-22]：格\n[音義-23]：普迷\n[音義-24]：布后\n[音義-25]：墟\n[音義-26]：他得\n[音義-27]：吁縣\n[音義-28]：普力\n[音義-29]：口果\n[音義-30]：口\n[音義-31]：五葛\n[音義-32]：索董\n[音義-33]：許義\n[音義-34]：方主、芳主\n[音義-35]：所革\n[音義-36]：布蟹\n[音義-37]：考\n[音義-38]：口弔\n[音義-39]：幌\n[音義-40]：弼\n[音義-41]：口餓、火可\n[音義-42]：歷\n[音義-43]：勞\n[音義-44]：山育\n[音義-45]：卻閑、卻賢\n[音義-46]：苦學', '釋詁', '廣雅', '4;9;22;38;39;41;51;56', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (917, '典忍;鬼委;𧹳;汗;洿;淖;淈;奧;濊;淰;溷;濁', '沴㲽;渨渥;𤃬;渥', '淟涊{典忍}[沴㲽]1、溾涹{鬼委}[渨渥]2、𧹳[𤃬]3、汗、洿4、淖5、淈6、澳{奧}[渥]7、濊8、淰9、溷10，濁也。', '[音義-1]：他典。那典\n[音義-2]：烏回。烏禾\n[音義-3]：乎管\n[音義-4]：烏\n[音義-5]：孃教\n[音義-6]：古沒\n[音義-7]：於六\n[音義-8]：穢，火末\n[音義-9]：詠感\n[音義-10]：乎困反', '釋詁', '廣雅', '1;2;3;8', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (918, '匍;竣;跧;北;氐;伏', '', '匍1、竣2、跧3、北、𢼕{氐}，伏也。', '[音義-1]：蒲\n[音義-2]：七旬\n[音義-3]：壯拳', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (919, '材;寶;綸;理;牖;命;裕;道', '倫;邎;邎', '材、寶、綸[倫]、理、牖[邎]、命、裕[邎]，道也。', '', '釋詁', '廣雅', '3;5;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (920, '厭;㥦;諴;哿;娧;可', '猒;㛍', '厭[猒]1、㥦[㛍]2、喊{諴}3、哿4、侻{娧}5，可也。', '[音義-1]：於甲。政宇謹案：念孫謂當音厭足之厭\n[音義-2]：苦挾\n[音義-3]：呼感\n[音義-4]：可我\n[音義-5]：他括', '釋詁', '廣雅', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (921, '錭;拙;伹;拙;頑;銖;魯;鈍', '', '錭1、鈯{拙}2、伹、拙3、頑、銖、魯，鈍也。', '[音義-1]：桃\n[音義-2]：大兀\n[音義-3]：織厥', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (922, '歔;欷;唴亮;惻;愴;愁;慼;悲', '唴良', '歔、欷1、唴喨{唴亮}[唴良]2、惻、愴、愁、慼，悲也。', '[音義-1]：許記\n[音義-2]：去亮。亮', '釋詁', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (923, '剝;絕;鬌;落', '', '剝、絕、鬌，落也。', '', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (924, '安;餧;蹷;伐;黲;黴;露;漫;淹;墨;殃;咅;腐;㱙;㡀;俠斯;爛;殆;敗', '腐;俠澌', '胺{安}1、鯘{餧}2、蹷、伐、黲3、黴4、露、漫5、淹、䆀{墨}6、殃7、殕{咅}[腐]8、腐9、㱙10、㡀11、俠斯[俠澌]、㱫{爛}12、爽、〔殆〕，敗也。', '[音義-1]：烏葛\n[音義-2]：諾毎\n[音義-3]：七敢\n[音義-4]：眉\n[音義-5]：莫旦\n[音義-6]：每\n[音義-7]：央\n[音義-8]：敷九\n[音義-9]：父\n[音義-10]：朽\n[音義-11]：敝\n[音義-12]：来旦', '釋詁', '廣雅', '12;16', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (925, '詮;錄;贅;巽;比;𤕝;僃;饌;具', '彔;𤰈', '詮、錄[彔]、贅1、撰{巽}、䚹{比}2、𤕝3、僃[𤰈]、饌，具也。', '[音義-1]：只歲\n[音義-2]：匹夷\n[音義-3]：教', '釋詁', '廣雅', '2;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (926, '㹂;牭;狼;戾;至;復;鷙;忮;很', '四;鷙', '㹂1、牭[四]2、狼、戾、恎{至}[鷙]3、愎{復}4、鷙、忮，很也5。', '[音義-1]：邱殄\n[音義-2]：四\n[音義-3]：質，又多結反\n[音義-4]：符逼\n[音義-5]：乎懇', '釋詁', '廣雅', '2;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (927, '韜;含;裕;容;窕;摦;寛', '𢎙', '韜、含[𢎙]、裕、容、窕、𥧰{摦}1，寛也。', '[音義-1]：乎化', '釋詁', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (928, '親;戚;傍;附;切;摩;鄰;比;厲;局;次;遒;迫;促;近', '駙', '親、傶{戚}、傍、附[駙]、切、摩、鄰、比、厲、局、阿、侍、夾1、次、遒、迫、促，近也。', '[音義-1]：古匣', '釋詁', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (929, '排;擠;摧;攘;抵;戎;斥;舜;推', '軵', '排、擠1、摧、攘、抵2、𢫨{戎}[軵]3、斥、舜，推也。', '[音義-1]：子詣\n[音義-2]：丁禮\n[音義-3]：戎', '釋詁', '廣雅', '6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (930, '重;㬪;蓐;臧;醇;醲;渥;陸;頯;厚', '壯;馗', '𧝎{重}1、㬪、蓐、臧[壯]、醇、醲、渥、陸、頯[馗]2，厚也。', '[音義-1]：直龍\n[音義-2]：逵', '釋詁', '廣雅', '4;9', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (931, '龍;利;芬;尼;調;庸;和', '同;䵒;容', '龍[同]、利、芬、尼[䵒]、調、庸[容]，和也。', '', '釋詁', '廣雅', '1;4;6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (932, '䡣;亢;橋;印', '', '䡣1、䡉{亢}2、轎{橋}3，𨋕{印}也4。', '[音義-1]：魂\n[音義-2]：抗\n[音義-3]：奇廟、奇朝\n[音義-4]：五浪', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (933, '獲;戮;羞;恥;害;辱', '', '獲、戮、羞、恥、㲅{害}1，辱也。', '[音義-1]：苦大', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (934, '㞕;妌;圭;潔', '', '㞕、妌1、圭，潔也。', '[音義-1]：靜', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (935, '讒;嫉;殺;㺑;賊', '', '讒、嫉、殺、㺑1，賊也。', '[音義-1]：山减', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (936, '涂;娉;妨;妬;害', '荼;聘', '涂[荼]1、娉[聘]2、妨、〔妒{妬}〕，害也。', '[音義-1]：塗\n[音義-2]：聘', '釋詁', '廣雅', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (937, '伸;舒勃;展', '', '伸、舒勃，展也。', '', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (938, '禦;禁;掕;閣;坐;沈;宿;蹟;矣;竣;挂;礙;鋪;脾;綝;処;安;歭;棖;拘;亭;質;䟆;朁;尼;樊;至;䠧;劵;凝;懲;已;止', '罷;遏;𣥺;制;䵒;制;勸', '禦、禁、掕1、閣、坐、沈、宿、蹟、矣、竣2、挂、礙、鋪、脾[罷]、綝3、処4、咹{安}[遏]5、跱{歭}6、棖[𣥺]7、拘、渟{亭}8、懫{質}[制]9、䟆10、𨅔{朁}11、抳{尼}[䵒]12、𩧅{樊}13、駤{至}[制]14、䠧15、劵[勸]16、〔凝〕、〔懲〕、〔已〕，止也。', '[音義-1]：落登，又陵\n[音義-2]：此循\n[音義-3]：恥林\n[音義-4]：曷汝反。憲案：說文解字从攵几\n[音義-5]：遏，又音稱。案\n[音義-6]：直李\n[音義-7]：雉庚\n[音義-8]：亭\n[音義-9]：質\n[音義-10]：畢\n[音義-11]：蠶，又音所甘\n[音義-12]：女几、女禮\n[音義-13]：煩\n[音義-14]：致\n[音義-15]：徒加\n[音義-16]：羌萬', '釋詁', '廣雅', '14;17;19;22;25;27;29', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (939, '邕;濃;㚌;委;晐;吉;冉;辛;烰;支;冘;䋣;盛;饒;僉;怒;輿;植;句;其;多', '㚌;燊;多;舁;殖;𠣿', '郺{邕}1、𨑊{濃}2、㚌3、𥟿{委}[㚌]4、㚊{晐}5、夡{吉}6、𡖝{冉}7、𨐔{辛}[燊]8、𡦄{烰}9、㩼{支}[多]10、𡖓{冘}11、繁{䋣}、盛、饒、僉、怒、輿[舁]、植[殖]、〔夠{句}[𠣿]〕、〔𡖾{其}〕，多也。', '[音義-1]：烏孔\n[音義-2]：奴孔\n[音義-3]：乎果\n[音義-4]：委\n[音義-5]：口才\n[音義-6]：棄\n[音義-7]：那\n[音義-8]：莘\n[音義-9]：浮\n[音義-10]：之豉\n[音義-11]：丁含', '釋詁', '廣雅', '4;8;10;17;18;19', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (940, '䔿;繠;蓴;萃;欑;㚇;雋;湊;叢;蓄;都;薄;薀;崇;灌;雜;茨;贅;榛;林;屯;集;宗;族;洿;總;翕;葉;輸;會;積;府;聚', '籫;䆅;吸', '䔿1、橤{繠}、蓴2、萃、欑、㚇3、寯{雋}[籫]4、湊、叢、蓄、都、薄、蘊{薀}、崇、灌、雜、茨[䆅]、贅5、榛、林、屯、集、宗、族、洿6、總7、翕[吸]8、葉、輸9、會、積、〔府〕，聚也10。', '[音義-1]：祖本\n[音義-2]：大丸\n[音義-3]：走公\n[音義-4]：俊\n[音義-5]：織芮\n[音義-6]：烏\n[音義-7]：思\n[音義-8]：許及\n[音義-9]：始朱\n[音義-10]：慈愈', '釋詁', '廣雅', '7;17;27', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (941, '主;戍;門;獸;守', '', '主、戍、門、獸，守也。', '', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (942, '餘;凡;總;同;皆', '舁', '餘[舁]、凡、總、同，皆也。', '', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (943, '修;𥱩;略;道;旬;越;抑;𢧵;勶;撥;討;繕;傅;列;疏;竘;貌;攻;捲;㓝;揺;療;亂;理;澡;墾;治', '導;札;𢾭;厲', '修、𥱩、略、道[導]、旬、越、抑、䕙{𢧵}[札]1、撤{勶}、撥2、討、繕3、傅[𢾭]、列[厲]、疏、竘4、貌、攻、捲5、㓝、揺6、療、亂、理、澡、〔墾〕，治也。', '[音義-1]：慈頡\n[音義-2]：博葛\n[音義-3]：時扇\n[音義-4]：口\n[音義-5]：權\n[音義-6]：亦咲反', '釋詁', '廣雅', '4;8;13;14', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (944, '側匿;䠞', '', '側匿、䠞1、（', '[音義-1]：子六', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (945, '贅;受;入;獲;德;營;得', '', '贅1、受、入、獲、德、營，得也。', '[音義-1]：紙袂', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (946, '蠻;苗;驕;怚;倨;侮;慢;㑥', '慢;眇', '蠻[慢]、苗[眇]、憍{驕}1、怚2、倨、侮、慢3，㑥也4。', '[音義-1]：嬌\n[音義-2]：子絮\n[音義-3]：麥澗\n[音義-4]：余賜', '釋詁', '廣雅', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (947, '樹;莖;榦;宗;祖;匀;翭;吳;素;葆;科;原;樞;本', '錉;柎;裹', '樹、莖、榦、宗、祖、䝧{匀}[錉]1、翭2、吳、素、葆[柎]、科[裹]、〔原〕、〔樞〕，本也。', '[音義-1]：無巾\n[音義-2]：侯', '釋詁', '廣雅', '6;10;11', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (948, '𢯱;𡩡;略;祈;讂;詗;氣;匃;拊;藪;絿;請;募;柩;求', '敻;𢯱;求', '廋{𢯱}1、𡩡、略、祈、讂[敻]2、詗3、乞{氣}、匃4、拊5、藪[𢯱]、絿[求]6、請、募7、柩，求也。', '[音義-1]：素高、色鄒\n[音義-2]：呼縣\n[音義-3]：呼詺\n[音義-4]：各末\n[音義-5]：拂舞\n[音義-6]：求\n[音義-7]：暮', '釋詁', '廣雅', '5;10;11', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (949, '揣;蠲;陶;拂;糞;埽;寫;雪;搫;屏;箯;休;𦶮;撥;祓;辟;除', '椯;匋;卸;般;薅', '揣[椯]、蠲、陶[匋]1、拂、糞、埽2、寫[卸]、雪、搫[般]3、摒{屏}4、箯5、𢫩{休}[薅]6、耘{𦶮}、撥7、祓、〔辟〕，除也。', '[音義-1]：桃\n[音義-2]：素考\n[音義-3]：步干\n[音義-4]：必政\n[音義-5]：婢緜\n[音義-6]：呼高\n[音義-7]：博葛', '釋詁', '廣雅', '1;3;7;9;12', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (950, '蹲;夷;夷;啟;肆;踞', '跪', '蹲1、跠{夷}2、𡱐{夷}3、啟[跪]、肆，踞也。', '[音義-1]：存\n[音義-2]：夷\n[音義-3]：夷', '釋詁', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (951, '斂;𣢆;匃;貸;誣;㛪;授;施;裨;稟;付;載;埤;分;越;以;氣;遺;予;與', '氣;𢻫;戴;与', '歛{斂}1、𣢆[氣]2、匃3、貸、誣、䛳{㛪}4、授、施[𢻫]、裨5、禀{稟}、付、載[戴]、埤、分、越、以、乞{氣}6、遺、予，〔與[与]〕也。', '[音義-1]：呼濫、呼甘\n[音義-2]：居乙\n[音義-3]：葛\n[音義-4]：於劒\n[音義-5]：浮夷\n[音義-6]：去乙', '釋詁', '廣雅', '2;8;12;20', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (952, '㓞;霝;丁令;䆕;廫;廫;豁;內;邱;款;𩫏;虛;㽕;素;科;空', '渴;零;丘;窠;岫;窠', '𨴒{㓞}[渴]1、霝[零]2、𦉬𦊓{丁令}3、䆕4、竂{廫}、豂{廫}5、豁6、㘨{內}7、邱[丘]8、窾{款}[窠]9、廓{𩫏}、虛、㽕[岫]10、素、科[窠]，空也。', '[音義-1]：口決\n[音義-2]：零\n[音義-3]：天鼎。冷\n[音義-4]：呼穴\n[音義-5]：竂\n[音義-6]：火活\n[音義-7]：乃挾\n[音義-8]：丘\n[音義-9]：款\n[音義-10]：由', '釋詁', '廣雅', '1;2;9;10;13;15', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (953, '移;貿;恤;施;夷;交;狄;假;變;奪;敡', '𢻫;𢓡;㑥;㑥', '移、貿1、恤、施[𢻫]2、夷[𢓡]、詨{交}3、狄[㑥]、假、變、奪，敡[㑥]也4。', '[音義-1]：莫救\n[音義-2]：失異反\n[音義-3]：火教\n[音義-4]：亦豉', '釋詁', '廣雅', '4;5;7;11', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (954, '䋣;殷;員;宗;旅;搜;卉;林;苗;風;邱;諸;猥;衆', '都;隈', '繁{䋣}、殷、員、宗、旅、搜1、卉2、林、苗、風、邱、諸[都]、〔猥[隈]〕，衆也。', '[音義-1]：所鄒\n[音義-2]：呼尾', '釋詁', '廣雅', '12;13', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (955, '有;常;𣲡;沚;性;質', '垐', '有、常、𣲡[垐]1、沚2、性，質也。', '[音義-1]：堲\n[音義-2]：止', '釋詁', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (956, '司;典;尙;質;魁;敵;掌;摡;阼;主', '敟;掌;顝;適;槩', '司、典[敟]、尙[掌]、質、魁[顝]1、敵[適]、掌、摡[槩]2、阼，主也。', '[音義-1]：苦迴\n[音義-2]：計既', '釋詁', '廣雅', '2;3;5;6;8', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (957, '蹙;遒;薄;訄;迫', '', '蹙、遒、薄、訄1，迫也。', '[音義-1]：去牛', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (958, '齰;齺;齮;齕;𪗨;齦;其;可;來奴;𪘧;噬;𪗻;尭;啄;齧', '齩', '齰1、齺2、齮3、齕4、𪗨5、齦6、䶞{其}7、䶗{可}8、𪘨𪗭{來奴}9、𪘧10、噬、咥{𪗻}11、䶧{尭}[齩]12、啄13，齧也。', '[音義-1]：士白\n[音義-2]：士角\n[音義-3]：五綺\n[音義-4]：乎謁\n[音義-5]：土乙\n[音義-6]：苦限\n[音義-7]：欺\n[音義-8]：邱牙\n[音義-9]：丁皆、多來。竹加\n[音義-10]：士滑\n[音義-11]：狄頡\n[音義-12]：五巧\n[音義-13]：陟學', '釋詁', '廣雅', '13', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (959, '疆;埸;限;畔;界', '', '疆、埸、限1、畔，界也。', '[音義-1]：乎簡', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (960, '搴;夭;抽;孛;揠;擢;拂;戎;爚;抍;拔', '拔;拔;躍', '搴1、夭2、抽、挬{孛}[拔]3、揠4、擢5、拂[拔]、戎、䠯{爚}[躍]6、抍7，拔也。', '[音義-1]：蹇\n[音義-2]：於表\n[音義-3]：蒲滑\n[音義-4]：於八\n[音義-5]：濁\n[音義-6]：藥\n[音義-7]：蒸之上聲', '釋詁', '廣雅', '4;7;9', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (961, '鋪;𢿨;𣀷;抪;敶;列;播;莫;班;賦;布', '布;幕;𢾭', '鋪1、𢿨2、𣀷3、抪[布]4、敶、列、播、莫[幕]、班、賦[𢾭]，布也。', '[音義-1]：浦乎\n[音義-2]：散\n[音義-3]：麗，說文李衣\n[音義-4]：片乎', '釋詁', '廣雅', '4;8;10', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (962, '抑;捘;擪;攤;據;按', '', '抑、捘1、擪2、攤3、據4，按也5。', '[音義-1]：作爲，又子寸，又子迴\n[音義-2]：於涉、乙甲\n[音義-3]：乃旦\n[音義-4]：譏去\n[音義-5]：安去', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (963, '掫;質;已;然;集;爲;僃;㓝;立;平;構;名;玄;造;成', '𤰈;絢', '掫1、質、已、然、集、爲、僃[𤰈]、㓝、立、平、構、名、絃{玄}[絢]2、〔造〕，成也。', '[音義-1]：壯后\n[音義-2]：呼縣。今人以爲呼烟，失之矣。凡弓弩琴瑟弦皆从弓', '釋詁', '廣雅', '7;13', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (964, '歉;堇;儉;約;𡞞;減;㞚;㞏;頗;劣;虔;虧;匱;少', '僅;憐;潰', '歉1、堇[僅]2、儉、約、𡞞3、減、㞚4、㞏5、頗、劣、虔[憐]、虧、〔匱[潰]〕，少也。', '[音義-1]：苦簟\n[音義-2]：謹\n[音義-3]：生景\n[音義-4]：楚立\n[音義-5]：丈立，又音雉立', '釋詁', '廣雅', '2;11;13', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (965, '屯;驙;蹇;展;訒;赾;憎;讓;畏;憚;歰;遴;病;難', '蹇', '屯1、驙2、蹇3、展[蹇]、訒4、赾5、憎6、懹{讓}7、畏、憚、歰、遴8、病，難也。', '[音義-1]：陟倫\n[音義-2]：知焉\n[音義-3]：寋\n[音義-4]：刃\n[音義-5]：謹\n[音義-6]：增\n[音義-7]：人尙\n[音義-8]：閭慎', '釋詁', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (966, '畏;諄;訧;櫱;蹙;戮;辠', '敦;隉', '畏、諄[敦]1、訧2、櫱[隉]3、蹙4、戮，辠也。', '[音義-1]：之閏\n[音義-2]：尤\n[音義-3]：御別\n[音義-4]：子六', '釋詁', '廣雅', '2;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (967, '搑;救;斂;扱;抍;叢;會;收', '', '搑1、救、斂、扱2、抍3、叢、𢶒{會}4，收也。', '[音義-1]：而容\n[音義-2]：初匣\n[音義-3]：蒸之上聲\n[音義-4]：古會', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (968, '弁;餌;餧;食', '飯;萎;飤', '𩚳{弁}[飯]、餌1、餧[萎]，食[飤]也。', '[音義-1]：耳意', '釋詁', '廣雅', '1;3;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (969, '左;望;青;覹;候;閒;伺', '詗', '佐{左}、望、𩇜{青}[詗]1、覹2、候、閒3，覗{伺}也4。', '[音義-1]：恥敬\n[音義-2]：眉\n[音義-3]：孤限\n[音義-4]：司', '釋詁', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (970, '巩;耦;和;諧', '共', '𣑦{巩}[共]1、耦、和，諧也。', '[音義-1]：卭', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (971, '矇;瞍;瞽;盲', '', '矇1、瞍2、瞽、盲也。', '[音義-1]：蒙\n[音義-2]：蘇苟', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (972, '蔚;縟;劬;驟;數', '𧾱', '蔚1、縟2、劬[𧾱]3、驟4，數也。', '[音義-1]：慰\n[音義-2]：辱\n[音義-3]：其俱\n[音義-4]：仕究', '釋詁', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (973, '嫴;媮;聊;苟;且', '僇', '嫴1、媮2、聊[僇]、苟，且也。', '[音義-1]：姑\n[音義-2]：偷', '釋詁', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (974, '秉;握;擥;捉;把;撮;搤;擁;操;捦;搹;拈;抩;掫;蒦;扣;擸;接;撫;齎;奉;挈;持', '', '秉、握、攬{擥}、捉、把、撮1、搤2、擁、操3、捦4、搹5、拈6、抩7、掫8、蒦9、扣、擸10、接、撫、齎11、奉、〔挈〕，持也。', '[音義-1]：錯括\n[音義-2]：烏革\n[音義-3]：錯高\n[音義-4]：琴\n[音義-5]：戹\n[音義-6]：念甜\n[音義-7]：而鹽\n[音義-8]：鄒之上聲\n[音義-9]：於縛、居博、於虢\n[音義-10]：獵\n[音義-11]：子兮', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (975, '啜;嚌;啐;試;嚵;𠻜;歃;嘗', '', '啜1、嚌2、啐3、試、〔嚵〕、〔𠻜〕、〔𦦕{歃}〕，嘗也。', '[音義-1]：時月\n[音義-2]：在細\n[音義-3]：倉快', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (976, '㧗;岳;堯;搣;青;捽', '䋫', '㧗1、捳{岳}2、嶤{堯}3、搣4、掅{青}[䋫]5，捽也6。', '[音義-1]：子尔、子米\n[音義-2]：岳\n[音義-3]：堯\n[音義-4]：滅\n[音義-5]：且定\n[音義-6]：旬律', '釋詁', '廣雅', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (977, '某;命;鳴;名', '', '某、命、鳴，名也。', '', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (978, '㛊;斞;適;程;斠;槩;量', '揣', '挆{㛊}[揣]1、斞2、𣂉{適}3、程、斠4、〔槩〕，量也。', '[音義-1]：都果\n[音義-2]：臾甫\n[音義-3]：旳\n[音義-4]：角', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (979, '爻;象;放;視;敎;學;效', '𡥈;像', '爻[𡥈]、象[像]、放、視、敎、學，效也。', '', '釋詁', '廣雅', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (980, '蠱;縡;職;榦;故;士;事', '故', '蠱[故]、縡1、職、榦、故、士，事也。', '[音義-1]：子代', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (981, '棲;載;棚;閣;革;棧;庪', '', '棲、載、棚1、閣、㮖{革}2、碊{棧}3，攱{庪}也4。', '[音義-1]：步宏，又負萌\n[音義-2]：苟八\n[音義-3]：子田\n[音義-4]：古彼', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (982, '濘;涅;塗;泥', '𦺝;泥', '濘[𦺝]1、涅[泥]、塗，泥也。', '[音義-1]：寧定', '釋詁', '廣雅', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (983, '選;納;內;入', '內', '選、納[內]、妠{內}1，入也。', '[音義-1]：奴闇', '釋詁', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (984, '取;厲;役;靡;僞;印;方;爲', '', '取、厲、役、靡、僞、印1、方，爲也。', '[音義-1]：於信反', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (985, '朋;黨;毖;右;頻;比', '攩', '朋、黨[攩]、毖1、右、頻，比也2。', '[音義-1]：祕\n[音義-2]：比方之比、一鄰比之比', '釋詁', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (986, '賴;仰;己;依;負;恃', '', '賴、仰、忋{己}1、依、〔負〕，恃也。', '[音義-1]：古亥反，又改音', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (987, '嬖;婞;因;友;愛;親', '㤅', '嬖、婞1、因、友、愛[㤅]，親也。', '[音義-1]：幸', '釋詁', '廣雅', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (988, '爽;曉;牟;騰;軼;渡;贏;邐;徑;歷;更;咎;過', '冒;滕;誃', '爽、曉、牟[冒]、騰[滕]、軼1、渡、贏、邐[誃]、俓{徑}、歷、更、〔咎〕，過也。', '[音義-1]：逸', '釋詁', '廣雅', '3;4;8', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (989, '悛;懌;諽;延;改;庚;輸;更', '譯;嬗', '悛1、懌{譯}2、諽3、𣆴{延}[嬗]4、改、庚、輸，更也。', '[音義-1]：七緣\n[音義-2]：亦\n[音義-3]：革\n[音義-4]：失氈，又以戰', '釋詁', '廣雅', '2;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (990, '遁;兆;腓;眺;支;亡;移;徙;諱;避', '逃;厞;移', '遁、兆[逃]、腓[厞]、眺、𨑤{支}[移]1、亡、令、移、徙、諱，避也。', '[音義-1]：企', '釋詁', '廣雅', '2;3;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (991, '剝;脫;膳;亶;曼;微;膚;朴;皮;乖;違;畔;渙;𢥘;遺;離', '柀;叛', '剝、脫、膳、皽{亶}1、㿸{曼}2、微、膚、朴、皮[柀]、乖、違、畔[叛]、渙3、𢥘4、䧁5、遺，離也。', '[音義-1]：之善\n[音義-2]：晚\n[音義-3]：唤\n[音義-4]：乎圭\n[音義-5]：火甫', '釋詁', '廣雅', '9;12', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (992, '守;恆;镾;就;𨒈;餘;腒;腆;長;壽;曠;久', '徐;廣', '守、恆、彌{镾}1、就、𨒈2、餘[徐]、腒、腆3、長、壽、曠[廣]，久也。', '[音義-1]：弥\n[音義-2]：遲\n[音義-3]：土典', '釋詁', '廣雅', '6;11', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (993, '畏;仇;憝;患;匿;凶;𧆩;誹;謗;訧;辱;咎;敝;讟;𡞜;鉗;憚;反;至;羸;嫉;毒;貉;譖;爽;憎;嬒;孱;厲;惡', '𢘋;镻', '畏、仇、憝1、患、慝{匿}[𢘋]2、凶、𧆩3、誹、謗、訧4、辱、咎、憋{敝}5、讟6、㥢{𡞜}7、鉗8、憚9、㽹{反}10、痓{至}[镻]11、羸12、嫉、毒、貉13、㒎{譖}14、傸{爽}15、憎、懀{嬒}16、孱17、〔厲〕，惡也。', '[音義-1]：度會\n[音義-2]：土勒\n[音義-3]：虐\n[音義-4]：尤\n[音義-5]：俾列、芳列\n[音義-6]：讀\n[音義-7]：才周\n[音義-8]：奇炎\n[音義-9]：大汗\n[音義-10]：拂飯\n[音義-11]：叱至\n[音義-12]：力追\n[音義-13]：麥\n[音義-14]：三盍、索合\n[音義-15]：爽\n[音義-16]：烏外\n[音義-17]：士虔，又士簡', '釋詁', '廣雅', '5;19', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (994, '𣱓;𧢢;詄;挩;過;謬;來;坒;詿;迷;誤', '', '𣱓1、讑{𧢢}2、詄3、〔挩〕4、過、謬、誺{來}5、𧧺{坒}6、詿7、迷，誤也。', '[音義-1]：乎孝\n[音義-2]：曜\n[音義-3]：逸\n[音義-4]：奪\n[音義-5]：賚\n[音義-6]：布兮\n[音義-7]：卦', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (995, '平;訂;準;廷;枰;㮣;中;平', '呈', '評{平}、訂1、準2、廷[呈]、枰3、〔㮣〕、〔中〕，平也。', '[音義-1]：田鼎\n[音義-2]：准\n[音義-3]：平命', '釋詁', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (996, '捭;發;張;闡;袪;奢;坼;啓;闢;䦱;闓;磔;閻苫;閜;開', '', '捭1、發、張、闡、袪、撦{奢}2、坼3、啓、闢4、䦱5、闓6、磔、閻苫、閜，開也。', '[音義-1]：布買\n[音義-2]：充野\n[音義-3]：勑格。疑即□字也\n[音義-4]：辟\n[音義-5]：爲靡\n[音義-6]：苦每', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (997, '角束;辟析;㱪;賁;歺;死', '愨竦', '𣨍殐{角束}[愨竦]1、㱸㱤{辟析}2、㱪3、㱵{賁}4、歺5，〔死〕也。', '[音義-1]：谷速\n[音義-2]：甓析\n[音義-3]：昏\n[音義-4]：方問\n[音義-5]：五葛', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (998, '儐;贊;唱;引;道', '導', '儐1、贊、唱、引，道[導]也。', '[音義-1]：賓音', '釋詁', '廣雅', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (999, '貌;竘;𡝩;佞;工;媮;巧', '', '貌、竘1、妖{𡝩}2、佞、工、媮3，巧也。', '[音義-1]：口\n[音義-2]：倚嬌\n[音義-3]：偷', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1000, '躔;迹;解;迒;軌;行;徑;轍;迹', '', '躔1、䟱{迹}2、解、迒3、歱4、䡮5、軌、武、行、徑、轍，迹也。', '[音義-1]：馳輦\n[音義-2]：匹迹\n[音義-3]：乎郎\n[音義-4]：之隴\n[音義-5]：子龍', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1001, '追;馳;末;隨;逐', '', '追、馳、末、隨，逐也。', '', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1002, '權;錘;奠;錪;鎭;珍;韋;重', '', '權、錘1、㞟{奠}2、錪3、鎭、珍、瑋{韋}，重也。', '[音義-1]：直危\n[音義-2]：鼎\n[音義-3]：腆', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1003, '紉;紆;切;繩;索', '', '紉1、紆、𥾛{切}2、繩，索也。', '[音義-1]：女珍\n[音義-2]：切', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1004, '離;解;斯;披;碎;布;散', '柀', '離、解、廝{斯}、披[柀]、碎、布，散也。', '', '釋詁', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1005, '廢;措;弛;縱;寘;奠;𨽸;捨;蕩;逸;放;恣;攺;注;署;置', '𢻫;置', '廢、措1、㢮{弛}[𢻫]2、縱、寘3、奠、𨽸、捨、蕩、逸、放、恣、𦋲{攺}[置]4、鉒{注}5、署6，置也。', '[音義-1]：錯故\n[音義-2]：失旨反\n[音義-3]：摯\n[音義-4]：即古文置也\n[音義-5]：霔\n[音義-6]：辰豫', '釋詁', '廣雅', '3;13', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1006, '斡;斷;運;亶;逭;育;譴喘;移;敡;𢱧;轉', '轉;㑥', '斡1、𢷖{斷}[轉]2、運、邅{亶}、逭、逳{育}3、譴喘、移、敡[㑥]4、𢱧5，轉也。', '[音義-1]：意括\n[音義-2]：短\n[音義-3]：育\n[音義-4]：尹豉\n[音義-5]：毗', '釋詁', '廣雅', '2;9', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1007, '葘;鈐;專;職;端緒;紬;業', '嫥;抽', '甾{葘}1、扲{鈐}2、專[嫥]、職、端緒、紬[抽]3，業也。', '[音義-1]：𣅔儀\n[音義-2]：鉗\n[音義-3]：直留', '釋詁', '廣雅', '3;6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1008, '交;贅;凝;戾;巽;質;撫;嗼;保;隱;據;刊;定', '膠;制;𤔌', '交[膠]、贅1、凝、戾、撰{巽}、質[制]、撫、嗼2、保、隱[𤔌]、據、刊，定也。', '[音義-1]：旨歲\n[音義-2]：亡各', '釋詁', '廣雅', '1;6;10', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1009, '𩚬;餓;餒;飢', '', '𩚬1、餓、餒2，飢也。', '[音義-1]：烏革\n[音義-2]：奴罪', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1010, '戔;瘌;㓹;凋;爽;痍;壯;創;痒;傷', '刊;㼽;創', '戔1、瘌2、㓹[刊]3、凋4、爽[㼽]、痍5、壯[創]、創、痒，傷也。', '[音義-1]：殘\n[音義-2]：力達\n[音義-3]：寄衛反，字林音邱訐\n[音義-4]：多聊反。憲䅁：說文解字「凋落」凋字從仌，「彫刻」彫字從彡，「鷲雕」字從隹\n[音義-5]：夷', '釋詁', '廣雅', '3;5;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1011, '投;𢽴;石;追;𨫔;擿', '拓;捶', '投、𢽴1、石[拓]、搥{追}[捶]、𢲼{𨫔}2、擿也3。', '[音義-1]：卓\n[音義-2]：大結\n[音義-3]：池㦸反。今人以爲摘「竹革」字如此，失之', '釋詁', '廣雅', '3;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1012, '黔𩠐;氓;民', '', '黔𩠐、氓，民也。', '', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1013, '灰;啁;譀;話;諴;譺;奠;周;調', '悝;㦣;調', '詼{灰}[悝]1、啁2、譀3、話[㦣]、諴4、譺5、奠、周[調]，調也6。', '[音義-1]：苦迴\n[音義-2]：竹交\n[音義-3]：乎濫\n[音義-4]：咸\n[音義-5]：魚記\n[音義-6]：逹弔', '釋詁', '廣雅', '1;4;8', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1014, '縊;經;䰘;絞', '', '縊、經、䰘1，絞也。', '[音義-1]：流', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1015, '斤;朱;𡫽;啻;離;䵒;是;黏', '堇;濁;冟;䕻;坁', '𪏴{斤}[堇]1、𪏿{朱}[濁]2、𪏮{𡫽}3、𪐏{啻}[冟]4、黐{離}[䕻]5、䵒6、〔䊓{是}[坁]〕，黏也7。', '[音義-1]：謹\n[音義-2]：口音，無誅\n[音義-3]：汝\n[音義-4]：竹革\n[音義-5]：恥知\n[音義-6]：日\n[音義-7]：女霑', '釋詁', '廣雅', '1;2;4;5;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1016, '貲;產;資;財;龜;貝;貨', '', '貲1、產、資、財、龜、貝，貨也。', '[音義-1]：訾', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1017, '令;琴;敔;冘;制;禁', '琴', '令、琴、敔1、㱽{冘}[琴]2、制，禁也。', '[音義-1]：魚與\n[音義-2]：多感', '釋詁', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1018, '葉;㬪;襞;聶;枉;韏;結;詘', '𠂆;摺', '僷{葉}[𠂆]1、㬪、襞2、襵{聶}[摺]3、枉4、韏5、結，詘也。', '[音義-1]：葉\n[音義-2]：必益\n[音義-3]：之涉\n[音義-4]：於冈\n[音義-5]：俱萬', '釋詁', '廣雅', '1;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1019, '複;袷;增;多;積;壘;襲;成;仍;鄭;𠣾;重', '貤', '複、袷1、增、𥿫{多}[貤]2、積、壘、襲、成、仍、鄭、〔𠣾〕3，重也4。', '[音義-1]：古狹\n[音義-2]：以豉\n[音義-3]：復\n[音義-4]：直用', '釋詁', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1020, '𣍧;曙;昕;炳;較;發;卓;離;㶣;焯;照;燿;囧;烜;晝;光;顯;耿;晃;闡;皎;爛;𣬈;曉;澤;𢘽;視;晣;昱;曠;昭;晤;旳;旭;徵;焞;闓;陽;杲;粲;烓;堂;彰;箸;爽;明', '姣;焯;麗;奕;炯;昌', '𣍧1、曙、昕2、昞{炳}3、較[姣]4、發、卓[焯]、離[麗]、㶣5、晫{焯}、炤{照}6、燿7、囧8、烜9、晝、光、顯、耿、晃、僤{闡}10、晈{皎}、𢒞{爛}11、𣬈12、曉、曎{澤}[奕]13、𢘽14、視、晣15、昱16、曠、昭、晤17、旳18、旭19、徵、焞20、闓21、陽、杲、粲22、烓[炯]23、堂[昌]、彰、著{箸}、〔爽〕，明也。', '[音義-1]：斐，又普骨\n[音義-2]：許斤\n[音義-3]：丙\n[音義-4]：角\n[音義-5]：淫\n[音義-6]：照\n[音義-7]：耀\n[音義-8]：古丙\n[音義-9]：咺\n[音義-10]：達汗\n[音義-11]：落汗\n[音義-12]：邲夷\n[音義-13]：亦\n[音義-14]：曳\n[音義-15]：制\n[音義-16]：夷六\n[音義-17]：悮\n[音義-18]：的\n[音義-19]：朂，又忽老\n[音義-20]：他魂\n[音義-21]：看海\n[音義-22]：錯汗\n[音義-23]：烏攜、烏缺、圭恵、口井四音', '釋詁', '廣雅', '5;7;8;25;41;42', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1021, '滄;㵾;冷;泂;凊;巠;凍;卒;寒', '濢', '滄、㵾1、冷、泂2、凊、𠗊{巠}、凍、𠗚{卒}[濢]3，寒也。', '[音義-1]：錯定\n[音義-2]：乎茗\n[音義-3]：七碎', '釋詁', '廣雅', '8', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1022, '惟;圖;誧;議;慮;惲;計;聽;媒;謀', '', '惟、圖、誧1、議、慮、惲2、計、聽、媒，謀也。', '[音義-1]：普乎\n[音義-2]：於汶', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1023, '爰;緣;遵;躔;逡;㨉;循', '', '𡬳{爰}1、緣、遵、躔、逡2、㨉3，循〔也〕。', '[音義-1]：宣\n[音義-2]：七循\n[音義-3]：無巾', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1024, '襮;裔;方;外;旌;表', '㬥', '襮[㬥]1、裔、方、外、旌，表也。', '[音義-1]：博', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1025, '疆;繹;困;苦;終;竟;死;竆', '斁', '疆、繹[斁]、困、苦、終、竟、死，窮{竆}也。', '', '釋詁', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1026, '畸;餘;盈', '', '㱦{畸}1、餘，盈〔也〕。', '[音義-1]：邱知', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1027, '匪;勿;非', '非', '匪[非]、勿，非也。', '', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1028, '𧝹;裎;徒;裼;袒', '但', '𧝹1、裎2、徒、裼，袒[但]也。', '[音義-1]：力果\n[音義-2]：呈', '釋詁', '廣雅', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1029, '葬;薶;窖;窌;都;墊;伏;竄;扆;庰;宲;匿;音;揜;錯;摩;寑;奥;廫;祕;韜;薀;藏', '宁;蟄;揜;𦯈', '葬、薶、窖、窌1、都[宁]、墊[蟄]2、伏、竄、扆、庰3、宲4、匿、揞{音}[揜]5、揜6、錯、摩、寑[𦯈]、奥、寥{廫}7、〔祕〕、〔韜〕、〔韞{薀}〕，藏也。', '[音義-1]：溜，又普孝\n[音義-2]：多念\n[音義-3]：必整\n[音義-4]：保\n[音義-5]：阿感\n[音義-6]：弇\n[音義-7]：歷', '釋詁', '廣雅', '5;6;13;17', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1030, '𣀷;它;抴;閱;數', '䌳;揲', '𣀷1、紽{它}[䌳]2、抴[揲]3、閱，數也。', '[音義-1]：麗\n[音義-2]：大河\n[音義-3]：夷細', '釋詁', '廣雅', '2;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1031, '占;讖;撿;證;譣', '譣;徵', '占、讖1、撿[譣]、證[徵]，譣也2。', '[音義-1]：楚讃\n[音義-2]：魚殮反，又魚劒反。今人以馬旁驗字爲「證譣」，失之矣', '釋詁', '廣雅', '3;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1032, '締;縎;總;括;結', '', '締1、縎2、總、括，結也。', '[音義-1]：第\n[音義-2]：骨', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1033, '孂;赳;彖;僑;材', '趫', '孂1、〔赳〕2、彖、〔僑[趫]〕，材也。', '[音義-1]：撟\n[音義-2]：糾', '釋詁', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1034, '雙;耦;釐;匹;孿;息;日;貳;乘;𠈪;再;兩;二', '瘜;臸', '雙、耦、娌{釐}1、匹、㝈{孿}、息[瘜]、日[臸]、貳、乘、膡{𠈪}、再、兩，二也。', '[音義-1]：里', '釋詁', '廣雅', '6;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1035, '贈;襚;賻;賵;遺;齎;送', '', '贈、襚、賻、賵、遺1、齎，送也。', '[音義-1]：「遗與」之遺', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1036, '慮;展;奮;摛;初;禹;䨞;綏;舒', '舒;踽;踽', '攄{慮}[舒]1、展、奮、摛2、初、禹[踽]、䨞[踽]3、綏，舒也。', '[音義-1]：勑魚\n[音義-2]：勑離\n[音義-3]：芋', '釋詁', '廣雅', '1;6;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1037, '僭;兒;憲;擬', '', '僭、掜{兒}1、〔攇{憲}〕，擬也。', '[音義-1]：五禮', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1038, '獪;骨;獿;㺒;𢺕', '淈', '獪1、猾{骨}[淈]2、獿3、㺒4，𢺕也。', '[音義-1]：瓜邁\n[音義-2]：滑\n[音義-3]：奴牢\n[音義-4]：奴絞、乎絞', '釋詁', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1039, '㛼;脅;恇;夸;怯', '', '㛼1、愶{脅}2、恇3、恗{夸}4，怯也5。', '[音義-1]：初洽\n[音義-2]：脅\n[音義-3]：匡\n[音義-4]：看孤\n[音義-5]：去刼', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1040, '嬗;娙;娭;侮;獲;婢', '', '嬗1、娙2、娭3、侮、獲，婢也。', '[音義-1]：十扇\n[音義-2]：五丁\n[音義-3]：熙', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1041, '緜;䏈;䋰;綴;及;瑣;系;牽;連', '鎖', '緜、䏈、䋰1、綴2、及、瑣[鎖]、系、牽，連也。', '[音義-1]：己足\n[音義-2]：陟月', '釋詁', '廣雅', '6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1042, '掍;粹;兼;并;集;合;稽;醜;共;同', '棨;雔', '掍1、粹、兼、并、集、合、稽[棨]、醜[雔]、共，同也。', '[音義-1]：混', '釋詁', '廣雅', '7;8', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1043, '了;闋;已;訖', '憭', '了[憭]、闋、已，訖也。', '', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1044, '黮;尨;竊;姦;私', '', '黮1、䵨{尨}2、竊、姦，私也。', '[音義-1]：勑感、都甚\n[音義-2]：尨', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1045, '聰;聆;瞟;𥉻;冥;許;聽', '', '聰1、聆2、䏇{瞟}3、䏅{𥉻}4、䏃{冥}5、許，聽也。', '[音義-1]：錯公\n[音義-2]：郎丁\n[音義-3]：匹照\n[音義-4]：七祭\n[音義-5]：馬年', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1046, '內;揾;辱;擩', '擩', '抐{內}1、揾2、搙{辱}[擩]3，〔擩〕也4。', '[音義-1]：而袂\n[音義-2]：於粉\n[音義-3]：奴遘\n[音義-4]：而主', '釋詁', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1047, '䜁詬;羞;媿;𩕔;鄙;恥', '恧', '䜁詬1、羞[恧]、媿、𩕔、鄙，恥也。', '[音義-1]：乎啟、呼介', '釋詁', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1048, '諺;譯;膚;禪;傳', '嬗', '諺、譯、膚、禪[嬗]，傳也。', '', '釋詁', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1049, '誦;婞;語;議;話;詁;吪;曰;言', '𢙼;噅', '誦、䛭{婞}[𢙼]1、語、議、話、詁、吪[噅]2、曰，言也。', '[音義-1]：乎孟\n[音義-2]：吾禾', '釋詁', '廣雅', '2;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1050, '誧;証;譏;諍;諭;誶;諫', '', '誧1、証2、譏、諍、諭、誶，諫也。', '[音義-1]：普乎\n[音義-2]：征', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1051, '訓;誨;諷;誥;譔;校;勸;學;敎', '風', '訓、誨、諷[風]、誥、譔1、校、勸、學，敎也。', '[音義-1]：助轉', '釋詁', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1052, '崩;頓;偃;仆;觡;索;臥;僵', '', '崩、頓、偃、仆、䞦{觡}1、䞽{索}2、臥，僵也3。', '[音義-1]：戸格\n[音義-2]：山格\n[音義-3]：薑', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1053, '怳;㾁;瘨;姰;釣;𧽻;狾;獟;倀;狂', '', '怳1、㾁2、瘨3、姰4、瘹{釣}5、僪{𧽻}6、狾7、獟8、倀9，狂也。', '[音義-1]：吁請\n[音義-2]：恥律\n[音義-3]：丁田\n[音義-4]：旬音，又縣音\n[音義-5]：弔\n[音義-6]：巨出\n[音義-7]：古制\n[音義-8]：五校\n[音義-9]：長', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1054, '訂;平;圖;謀;慮;議', '', '訂1、評{平}、圖、謀、慮，議也。', '[音義-1]：田鼎', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1055, '否;弗;倗;秕;不', '', '否、弗、倗1、粃{秕}2，不也。', '[音義-1]：朋，又普等\n[音義-2]：彼、比，俱得', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1056, '姦;宄;竊;盜', '', '姦、宄、竊，盜也。', '', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1057, '懝;愼;忌;畏;恐', '', '䰯{懝}1、愼、忌、畏，恐也。', '[音義-1]：牛志', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1058, '䋰;完;繚;繞;綢繆;紿;絡;𦅾;纏', '綰', '䋰1、綄{完}[綰]2、繚3、繞、綢繆、紿4、絡、𦅾5，纏也。', '[音義-1]：俱緑\n[音義-2]：緩\n[音義-3]：了\n[音義-4]：待\n[音義-5]：酌', '釋詁', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1059, '駕;陵;載;乘', '夌', '駕、陵[夌]、載，乘也。', '', '釋詁', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1060, '惠;愛;恕;利;人;仁', '㤅', '惠、愛[㤅]、恕、利、人，仁也。', '', '釋詁', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1061, '邌;俆;舒;逋;訥;疏;鈍;遟', '', '邌1、俆、舒、逋、訥、疏、鈍，遟也。', '[音義-1]：禮兮', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1062, '冓;昔;闇;莫;夜', '', '㝤{冓}1、昔、闇、暮{莫}，夜也。', '[音義-1]：古候', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1063, '昒;眛;晻;鼆;冥', '', '昒1、昧{眛}、晻2、鼆，冥也。', '[音義-1]：勿\n[音義-2]：烏感', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1064, '學;㦌;寣;𡨂;梗;覺', '曶;亢', '學、㦌[曶]1、寣2、𡨂3、梗[亢]，覺也。', '[音義-1]：忽\n[音義-2]：忽\n[音義-3]：即寤字', '釋詁', '廣雅', '2;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1065, '倚;豎;建;封;殖;蒔;置;豈企;起;立', '蒔', '倚1、豎、建、封、殖[蒔]、蒔2、置、隑𠈮{豈企}3、起，立也。', '[音義-1]：於綺\n[音義-2]：時志\n[音義-3]：巨代。棄，即古文企字', '釋詁', '廣雅', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1066, '孛;怨;媁;㥟;㥒;忦;悔;吝;懟;感;很;恨', '乀;恨', '侼{孛}[乀]、怨、愇{媁}1、㥟2、㥒3、忦4、悔、吝、懟5、憾{感}6、很[恨]，恨也。', '[音義-1]：瑋\n[音義-2]：乎佳\n[音義-3]：采\n[音義-4]：介，又公八\n[音義-5]：直耒\n[音義-6]：乎淡', '釋詁', '廣雅', '1;11', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1067, '品;限;耕;侔;竱;等;稛;玉;岸;嫧;斷;足;洒;齊', '妍;妻', '品、限、耕、侔、竱1、等、㻒{稛}2、砡{玉}3、婩{岸}[妍]4、嫧5、斷、珿{足}6、洒[妻]7，齊也。', '[音義-1]：都奂，又端\n[音義-2]：巨殞\n[音義-3]：牛六\n[音義-4]：魚淺\n[音義-5]：楚革\n[音義-6]：楚角\n[音義-7]：思禮', '釋詁', '廣雅', '9;13', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1068, '稟;奉;粟;祿', '', '稟、奉、粟，祿也。', '', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1069, '諄憎;㑵;毒;病;㤥;患;勩;癉;苦', '', '諄憎1、𧪠{㑵}、毒、病、㤥2、患、勩3、癉4，苦也。', '[音義-1]：之閏\n[音義-2]：下代\n[音義-3]：曳\n[音義-4]：多賀', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1070, '獷;梗;鞅;丁;亢;姜;羌;强', '庚;怏;伉/剛;䕬;彊;彊', '礦{獷}1、梗[庚]、鞅[怏]2、丁、亢[伉/剛]、姜[䕬]、羌[彊]，强[彊]也。', '[音義-1]：孤猛\n[音義-2]：巨位', '釋詁', '廣雅', '2;3;5;6;7;8', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1071, '眷;顧;對;陽;面;首;卬;鄉', '偭', '眷、顧、對、陽、面[偭]、首、卬，嚮{鄉}也。', '', '釋詁', '廣雅', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1072, '恮;悈;忦;慤;質;謹', '制', '恮1、悈2、〔忦〕3、慤、質[制]，慬{謹}也4。', '[音義-1]：且全、子眷\n[音義-2]：居力\n[音義-3]：五介\n[音義-4]：謹', '釋詁', '廣雅', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1073, '券;劼;勃;骨;力;勑;勤', '費', '勬{券}1、劼2、勃[費]、䯇{骨}3、仂{力}4、〔勑〕，勤也。', '[音義-1]：眷\n[音義-2]：公八\n[音義-3]：苦沒\n[音義-4]：力，又勒', '釋詁', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1074, '䄟;禳;祰;禱;賕;謝', '', '䄟1、禳2、祰3、禱、賕4，謝也。', '[音義-1]：毳\n[音義-2]：而羊\n[音義-3]：公老、公篤\n[音義-4]：求', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1075, '抨;旁;宏;磕;𣪯;硠;分;殷;身;鎗;鍠;錚;玲瓏;曹;卉;聲', '䡩;喿;嘒', '砰{抨}1、磅{旁}2、𥐪{宏}3、礚{磕}4、𣪯5、硠6、砏{分}7、磤{殷}8、銵{身}[䡩]9、鎗10、鍠11、錚12、玲瓏13、嘈{曹}[喿]14、𠱥{卉}[嘒]15，聲也。', '[音義-1]：普耕\n[音義-2]：普行\n[音義-3]：宏\n[音義-4]：苦大\n[音義-5]：彤\n[音義-6]：力當、力蕩\n[音義-7]：普斤\n[音義-8]：隱\n[音義-9]：苦萌\n[音義-10]：測庚\n[音義-11]：横\n[音義-12]：楚耕\n[音義-13]：呂丁\n[音義-14]：曹\n[音義-15]：昨末', '釋詁', '廣雅', '9;14;15', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1076, '𩗬;䬑;飂;猋;豕;戌;𡛟;肅;尞;颸;𠷎;宓;風', '䬍;𩖶;飂;驟', '𩗬、䬑1、飂2、飇{猋}3、𩗛{豕}[䬍]4、䬄{戌}[𩖶]5、䬂{𡛟}6、𩘹{肅}7、飉{尞}[飂]8、颸9、𩘿{𠷎}[驟]10、䫾{宓}11，風也。', '[音義-1]：謂\n[音義-2]：流\n[音義-3]：必昭\n[音義-4]：忽\n[音義-5]：呼律\n[音義-6]：呼越\n[音義-7]：思六\n[音義-8]：遼\n[音義-9]：楚飢\n[音義-10]：逐留\n[音義-11]：步力', '釋詁', '廣雅', '5;6;9;11', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1077, '繕;緻;納;輓;靪;嗣;𦭮;搹;兌;𧞐;箸;補', '𠂤', '繕1、緻2、衲{納}3、輓4、靪5、𥿆{嗣}6、𦭮7、䩹{搹}8、𩊭{兌}[𠂤]9、𧞐10、〔著{箸}〕，補也。', '[音義-1]：膳\n[音義-2]：致\n[音義-3]：納\n[音義-4]：亡干\n[音義-5]：□珽\n[音義-6]：辭\n[音義-7]：丈例\n[音義-8]：五革\n[音義-9]：兌\n[音義-10]：卓', '釋詁', '廣雅', '9', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1078, '𢶈;盍;倚;放;寄;託;附;依', '㠀;坿', '𢶈[㠀]1、溘{盍}2、倚、放、寄、仛{託}3、附[坿]，依也。', '[音義-1]：擣\n[音義-2]：苦合\n[音義-3]：託', '釋詁', '廣雅', '1;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1079, '幾;尾;忽;秒;糸;麪;細;麽;微', '𢼸', '幾、尾、𦁕{忽}1、紗{秒}2、糸3、𥾝{麪}4、細、麽，微[𢼸]也。', '[音義-1]：忽\n[音義-2]：□少\n[音義-3]：覓\n[音義-4]：蔑', '釋詁', '廣雅', '9', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1080, '𩬙;䰎;采;髽;鷄斯;䯰;髻', '笄纚', '𩬙1、䰎2、䰂{采}3、髽4、鷄斯[笄纚]、䯰5，髻也。', '[音義-1]：付\n[音義-2]：邱位\n[音義-3]：且代\n[音義-4]：側瓜\n[音義-5]：案說文即籀文髻字也', '釋詁', '廣雅', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1081, '𢾝;軭;弧;紉;咈;紾;狼;很;盭', '軔', '𢾝1、軭2、弧3、紉[軔]、咈4、抮{紾}5、狼、很，盭也6。', '[音義-1]：韋\n[音義-2]：匡\n[音義-3]：乎\n[音義-4]：怫\n[音義-5]：顯\n[音義-6]：麗', '釋詁', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1082, '肖;似;類;鼎;象', '像', '肖、似、類、鼎，象[像]也。', '', '釋詁', '廣雅', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1083, '㺒;獿;狡;訬;毚;獪', '', '㺒1、獿2、狡3、訬4、毚5，獪也。', '[音義-1]：奴絞\n[音義-2]：遶\n[音義-3]：絞\n[音義-4]：士交\n[音義-5]：讒', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1084, '剖;辟;片;胖;半', '劈', '剖、辟[劈]1、片、胖2，半也。', '[音義-1]：浦壁\n[音義-2]：判', '釋詁', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1085, '㪺;妁;斟;酌', '', '㪺1、妁2、斟，酌也。', '[音義-1]：俱\n[音義-2]：酌', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1086, '曰;欥;惟;𩛥;每;雖;兮;者;其;各;而;烏;豈;也;乎;些;只;詞', '才;㒸', '曰、欥、惟、𩛥[才]、每、雖[㒸]、兮、者、其、各、而、烏、豈、也、乎、些1、只，詞〔也〕。', '[音義-1]：先計', '釋詁', '廣雅', '4;6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1087, '沫;旣;央;極;已', '𠬛', '沫[𠬛]、旣、央、極，已也。', '', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1088, '夷;吞;泯;絕;止;消;烕;滅', '𢓡', '夷[𢓡]、吞、泯、絕、止、消、烕1，滅也。', '[音義-1]：翾悅反', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1089, '恬;倓;憺;怕;占;㱳;𡧯;內;安;情;靜', '恬;㘝', '恬1、倓2、憺3、怕4、怗{占}[恬]5、㱳6、𡧯、㘨{內}[㘝]7、安、情，靜也。', '[音義-1]：大嫌\n[音義-2]：大濫，又達甘\n[音義-3]：徒敢、徒濫\n[音義-4]：普白\n[音義-5]：他頰、都簟\n[音義-6]：莫\n[音義-7]：乃頰', '釋詁', '廣雅', '5;8', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1090, '靈子;醫;龍;覡;巫', '', '靈子、醫、𪚠{龍}1、覡2，巫也。', '[音義-1]：力恭\n[音義-2]：乎旳', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1091, '攙;捈;剡;鑯;銳', '', '攙1、捈2、剡3、鑯4、銳也。', '[音義-1]：士銜\n[音義-2]：塗\n[音義-3]：琰音。今會稽有剡縣，音舌染反，未知此音出何文字\n[音義-4]：子廉', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1092, '拔;拂;榜;挾;甲;翼;輔', '弼;夾', '拔1、拂[弼]、榜2、挾、押{甲}[夾]、翼，輔也。', '[音義-1]：博末\n[音義-2]：彭', '釋詁', '廣雅', '2;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1093, '臿;䴾;巿;昜;糳;捶;擣;𣀔;䄟;䂿;舂', '臿', '臿1、䑘{䴾}2、䑔{巿}3、䑗{昜}4、糳5、捶6、𦦺{擣}7、𣀔、㯔{䄟}[臿]8、䂿9，舂也10。', '[音義-1]：初洽\n[音義-2]：祚何\n[音義-3]：敷穢\n[音義-4]：蕩\n[音義-5]：子洛\n[音義-6]：之橤\n[音義-7]：丁老\n[音義-8]：楚芮\n[音義-9]：沓\n[音義-10]：失鍾', '釋詁', '廣雅', '9', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1094, '毚嚴;岑崟;贊元;焦嶢;阢;嵬;嵯峩;顤䫨;遼巢;陗;𠩓;卲;亢;喬;厲;尊;極;競;弼;尙;崪;高', '磛碞;兀;陗;𡿋;峻;京', '巉巗{毚嚴}[磛碞]1、岑崟2、巑岏{贊元}3、嶕嶢{焦嶢}4、阢[兀]5、嵬6、嵯峩、顤䫨7、嶚𡻝{遼巢}8、陗9、𢮉{𠩓}[陗]10、卲、亢11、喬12、厲[𡿋]、尊[峻]、極、競[京]、弼、尙、崪13，高也。', '[音義-1]：士衫。五銜\n[音義-2]：吟\n[音義-3]：在丸\n[音義-4]：辭焦。堯\n[音義-5]：兀\n[音義-6]：牛迴、牛尾\n[音義-7]：堯。五高\n[音義-8]：遼巢\n[音義-9]：且咲\n[音義-10]：七消\n[音義-11]：苦浪\n[音義-12]：橋\n[音義-13]：子恤反', '釋詁', '廣雅', '1;5;11;15;16;18', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1095, '㕢;侑;儷;諧;耦', '臮', '㕢[臮]1、侑2、儷、諧，耦也。', '[音義-1]：下邁\n[音義-2]：又', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1096, '州;郡;縣;道;都;鄙;邦;域;邑;國', '', '州、郡、縣、道、都、鄙、邦、域、邑，國也。', '', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1097, '攜;挈;撣;提', '', '攜、挈、撣1，提也。', '[音義-1]：檀', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1098, '亞;刑;刻;剄', '㧖', '𠜲{亞}[㧖]1、刑、刻，剄2也。', '[音義-1]：乙牙\n[音義-2]：古鼎', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1099, '區;窬;剈;剜', '丑;丑', '剾{區}[丑]1、㓱{窬}[丑]2、剈3，剜也4。', '[音義-1]：烏侯\n[音義-2]：頭\n[音義-3]：淵\n[音義-4]：烏桓', '釋詁', '廣雅', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1100, '孕;重;妊;娠;身;媰;㑗', '', '孕、重、妊1、娠2、身、媰3，㑗也4。', '[音義-1]：任\n[音義-2]：振身\n[音義-3]：莊救\n[音義-4]：身', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1101, '偁;獎;繩;與;孝;譽', '偁;与', '偁1、獎2、譝{繩}[偁]3、與[与]4、孝，譽也。', '[音義-1]：稱之平聲\n[音義-2]：㢡\n[音義-3]：繩\n[音義-4]：輿', '釋詁', '廣雅', '3;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1102, '皃;奕;裕;心;形;容', '容', '皃1、奕、裕[容]、心、𢒈{形}，容也。', '[音義-1]：陌豹', '釋詁', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1103, '叜;蔽;潛;匿;恩;遁;隱', '縮', '廋{叜}[縮]1、蔽、潛、匿、恩、遁，隱也。', '[音義-1]：所留', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1104, '僭;忒;乖;降;跌;差', '胅', '僭、忒、乖、𡲣{降}1、〔跌[胅]〕，差也2。', '[音義-1]：古巷\n[音義-2]：楚儀反', '釋詁', '廣雅', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1105, '𩓠;圖;彫;刻;畫', '規', '𩓠[規]1、圖、彫、刻，畫也。', '[音義-1]：規', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1106, '歿;繹;結;冬;終', '斁', '歿1、繹[斁]、結、冬，終也。', '[音義-1]：沒', '釋詁', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1107, '揄;墮;剝;免;脫', '', '揄1、墮、剝、免，脫也。', '[音義-1]：以珠', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1108, '酺;醵;吸;渳;飲', '', '酺1、醵2、吸3、渳4，飲也。', '[音義-1]：薄乎、薄故\n[音義-2]：巨略\n[音義-3]：許急\n[音義-4]：弭', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1109, '師;尹;工;官', '', '師、尹、工，官也。', '', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1110, '日;室;絰;實', '', '日、室、絰，實也。', '', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1111, '貫;增;誄;絫', '毌;絫', '貫[毌]、增、誄[絫]，累{絫}也。', '', '釋詁', '廣雅', '1;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1112, '承;受;韶;繼', '紹', '承、受、韶[紹]，繼也。', '', '釋詁', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1113, '趠;殊;撥;𣨛;絕', '卓;乀', '趠[卓]1、殊、撥[乀]2、𣨛3，絶{絕}也。', '[音義-1]：卓\n[音義-2]：逋末\n[音義-3]：卒', '釋詁', '廣雅', '1;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1114, '護;戸;挾;護', '', '頀{護}1、戸、挾，護也。', '[音義-1]：䕶', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1115, '坤;儒;謹;犪;柔', '', '𡿦{坤}、儒、㹏{謹}1、犪、茹，柔也。', '[音義-1]：謹', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1116, '龍;甫;分;夾;穧', '墳', '䆍{龍}1、秿{甫}2、秎{分}[墳]3、𥞵{夾}，穧也4。', '[音義-1]：聾\n[音義-2]：輔\n[音義-3]：浮問\n[音義-4]：在細', '釋詁', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1117, '遘;擿;罰;伐', '', '䃓{遘}1、𥕐{擿}2、罰，伐也。', '[音義-1]：遘\n[音義-2]：旳', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1118, '䡣;般;旋;還', '', '䡣1、般2、旋，還也。', '[音義-1]：魂\n[音義-2]：班', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1119, '明;覺;赫;發', '', '明、覺、赫，發也。', '', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1120, '卒;長;弗;挾', '', '䚝{卒}1、長、㔗{弗}2，挾也。', '[音義-1]：才兀\n[音義-2]：步器', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1121, '巠;摹;屋;刑', '模', '䪫{巠}1、摹[模]2、剭{屋}3，刑也。', '[音義-1]：莖\n[音義-2]：莫乎\n[音義-3]：烏角', '釋詁', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1122, '糞;縕;瀀;饒', '薀', '糞、縕[薀]、瀀1，饒也。', '[音義-1]：憂', '釋詁', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1123, '縫;際;期;會', '', '綘{縫}、際、期，會也。', '', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1124, '宿;次;低;弛;舍', '邸', '宿、次、低[邸]1、㢮{弛}2，舍也。', '[音義-1]：都犂\n[音義-2]：失以反', '釋詁', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1125, '程;見;經;示', '桯;桱', '程[桯]、見、經[桱]，示也。', '', '釋詁', '廣雅', '1;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1126, '𨽸;申;來;引;伸', '𠭰', '𨽸、申、倈{來}[𠭰]1、〔引〕，伸也2。', '[音義-1]：來\n[音義-2]：申', '釋詁', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1127, '佻;抗;絓;縣', '䄪/到;挂', '佻[䄪/到]1、抗、絓[挂]2，縣也。', '[音義-1]：鳥\n[音義-2]：乎卦', '釋詁', '廣雅', '1;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1128, '薀;圍;裝;包;㥯;裹', '因', '韞{薀}1、圍、裝2、包、㡥{㥯}[因]3，裹也。', '[音義-1]：藴\n[音義-2]：莊\n[音義-3]：於問', '釋詁', '廣雅', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1129, '扜;真;對;揚', '', '扜、搷{真}1、對，揚也。', '[音義-1]：田', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1130, '奏;箋;𧘝;詔;笧;條;記;敕;標;𧧒;檄;書', '表', '奏、箋1、𧘝2、詔、笧、條、記、敕3、標[表]4、𧧒5、檄6，書也。', '[音義-1]：牋\n[音義-2]：表\n[音義-3]：勑\n[音義-4]：必饒\n[音義-5]：七賜\n[音義-6]：乎歷', '釋詁', '廣雅', '9', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1131, '元;良;孛;息;夭兆;堅;長', '兀;窈窕;引', '元[兀]、良、餑{孛}1、䭒{息}2、镺𨱵{夭兆}[窈窕]3、堅[引]，長也。', '[音義-1]：勃\n[音義-2]：息\n[音義-3]：烏老。道', '釋詁', '廣雅', '1;5;6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1132, '㓷;刵;割;算;髡;𢧵', '', '㓷1、刵2、割、㔍{算}、〔髡〕，截{𢧵}也。', '[音義-1]：魚既\n[音義-2]：耳志', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1133, '札;鱗;檢;甲', '', '札、鱗、檢1，甲也。', '[音義-1]：撿', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1134, '孝;僃;九;究', '𤰈', '孝、僃[𤰈]、九，究也。', '', '釋詁', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1135, '補;合;棺;丸;完', '', '補、合、棺、丸，完也。', '', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1136, '襲;倚;階;因', '', '襲、倚、〔階〕，因也。', '', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1137, '盈;滿;繹;充', '', '盈、滿、繹，充也。', '', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1138, '奸;夌;敢;犯', '', '奸、夌1、敢，犯也。', '[音義-1]：陵', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1139, '衄;㭰;展;衽;㥯;韏', '因', '衄1、㭰2、展、銋{衽}3、㡥{㥯}[因]4，韏也5。', '[音義-1]：女六\n[音義-2]：醉橤\n[音義-3]：壬\n[音義-4]：於問\n[音義-5]：卷', '釋詁', '廣雅', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1140, '慎;必;蕆;敕', '毖', '慎、必[毖]、蕆，敕也。', '', '釋詁', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1141, '粈;雜;錯;廁', '側', '粈1、雜、錯，廁[側]也。', '[音義-1]：女又', '釋詁', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1142, '廣;氾;巽;素;博', '', '廣、氾、撰{巽}、素，博也。', '', '釋詁', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1143, '踦;際;邊;厓;旁;隒;偏;脅;方', '方', '踦1、際、邊、厓、旁[方]、隒2、偏、脅，方也。', '[音義-1]：居綺\n[音義-2]：檢', '釋詁', '廣雅', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1144, '觸;冒;唐;棠;𧘂;堀;突', '唐', '觸、冒1、搪{唐}2、𢿵{棠}[唐]3、𧘂、〔堀〕，揬{突}也4。', '[音義-1]：墨\n[音義-2]：唐\n[音義-3]：長庚\n[音義-4]：突', '釋詁', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1145, '刻;竆;歉;㝌;貧', '克', '刻[克]、窮{竆}、歉1、㝌2，貧也。', '[音義-1]：口限\n[音義-2]：救', '釋詁', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1146, '災;炭;節;㶳;㷮;灺', '堲', '災、炭、㸅{節}[堲]1、㶳2、㷮3，灺也4。', '[音義-1]：子栗\n[音義-2]：燼\n[音義-3]：遭\n[音義-4]：囚者', '釋詁', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1147, '䥝;恩;煨;彖;熅', '𤇯', '𤏶{䥝}1、煾{恩}[𤇯]2、煨3、𤊺{彖}4，熅也5。', '[音義-1]：烏高\n[音義-2]：恩\n[音義-3]：烏回\n[音義-4]：呼勿\n[音義-5]：於云', '釋詁', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1148, '歕;辡;囷;哯;匀;有;㰶;歐;嗀;吐', '歐', '歕1、𡁈{辡}2、㖥{囷}3、哯4、呁{匀}5、哊{有}[歐]6、㰶7、歐8、嗀9，吐也。', '[音義-1]：普頓\n[音義-2]：孚萬\n[音義-3]：巨殞\n[音義-4]：乎典\n[音義-5]：鈞峻\n[音義-6]：有六\n[音義-7]：其表\n[音義-8]：於苟\n[音義-9]：許角', '釋詁', '廣雅', '6', 'null', 'null');
