INSERT INTO `t_han_nga` VALUES (1819, '𦆀𦆀;繟繟;仇仇;緩', '', '𦆀𦆀1、繟繟2、扏扏{仇仇}3，緩也。', '[音義-1]：囚淺、治善\n[音義-2]：闡\n[音義-3]：求', '釋訓', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1820, '區區;愉愉;焉焉;欣欣;忥忥;欯欯;言言;語語;𡠗𡠗;喜', '妟妟;愷愷', '嘔嘔{區區}1、喻喻{愉愉}、嘕嘕{焉焉}[妟妟]2、欣欣、忥忥[愷愷]3、欯欯4、言言、語語、𡠗𡠗5，喜也。', '[音義-1]：烏侯\n[音義-2]：許連\n[音義-3]：許氣\n[音義-4]：許一\n[音義-5]：至', '釋訓', '廣雅', '3;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1821, '唏唏;𠀀𠀀;𠀀𠀀;𠀀𠀀;𧥣𧥣;啞啞;笑', '', '唏唏1、㰤㰤{𠀀𠀀}2、㗿㗿{𠀀𠀀}3、呵呵{𠀀𠀀}4、𧥣𧥣5、啞啞6，笑也。', '[音義-1]：虛几、虛冀\n[音義-2]：乎可\n[音義-3]：火下\n[音義-4]：虛多\n[音義-5]：口\n[音義-6]：於百', '釋訓', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1822, '翼翼;衎衎;愉愉;和', '龢', '翼翼、衎衎、愉愉，和[龢]也。', '', '釋訓', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1823, '慼慼;慅慅;怮怮;愁愁;蟲蟲;栔栔;屈屈;烈烈;析析;怛怛;憂', '懆懆;忡忡;𢗊𢗊;忽忽;惕惕;𢝊', '慼慼、慅慅[懆懆]1、怮怮2、愁愁、𢥞𢥞{蟲蟲}[忡忡]3、栔栔[𢗊𢗊]4、啒啒{屈屈}[忽忽]5、㤠㤠{烈烈}、惁惁{析析}[惕惕]、怛怛6，憂[𢝊]也。', '[音義-1]：草\n[音義-2]：於柳、於流\n[音義-3]：彤\n[音義-4]：挈\n[音義-5]：古兀、呼兀二反\n[音義-6]：多達', '釋訓', '廣雅', '2;5;6;7;9;11', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1824, '巖巖;䡾䡾;峩峩;磛磛;阢阢;嵬嵬;岌岌;圪圪;高', '兀兀', '巖巖、䡾䡾1、峩峩、嶄嶄{磛磛}2、阢阢3、嵬嵬[兀兀]4、岌岌5、圪圪6，高也。', '[音義-1]：五葛反\n[音義-2]：讒\n[音義-3]：兀\n[音義-4]：牛回、牛尾二反\n[音義-5]：魚及\n[音義-6]：五乙', '釋訓', '廣雅', '6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1825, '雱雱;霏霏;雰雰;瀌瀌;雪', '𩰟𩰟', '䨦䨦{雱雱}1、霏霏、雰雰[𩰟𩰟]、瀌瀌2，雪也。', '[音義-1]：普光\n[音義-2]：彼苗', '釋訓', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1826, '霅霅;朁朁;夙夙;湒湒;𤄈𤄈;𩂣𩂣;立立;習習;濛濛;迪迪;雨', '淋淋', '霅霅1、𩅨𩅨{朁朁}2、洬洬{夙夙}3、湒湒4、𤄈𤄈[淋淋]5、𩂣𩂣6、雴雴{立立}7、霫霫[習習]8、靀靀{濛濛}9、䨤䨤{迪迪}10，雨也。', '[音義-1]：素合、徒甲二反\n[音義-2]：士林\n[音義-3]：小篤\n[音義-4]：子立\n[音義-5]：林\n[音義-6]：落\n[音義-7]：丑入\n[音義-8]：先入\n[音義-9]：蒙\n[音義-10]：狄', '釋訓', '廣雅', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1827, '䬃䬃;𣔱𣔱;瑟瑟;飂飂;尞尞;瀏瀏;風', '飂飂', '䬃䬃、颼颼{𣔱𣔱}1、飋飋{瑟瑟}、飂飂2、飉飉{尞尞}[飂飂]3、瀏瀏4，風也。', '[音義-1]：所留\n[音義-2]：留\n[音義-3]：遼\n[音義-4]：留', '釋訓', '廣雅', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1828, '瀼瀼;濃濃;湛湛;泥泥;露', '', '𩆶𩆶{瀼瀼}1、𩅽𩅽{濃濃}2、湛湛3、泥泥4，露也。', '[音義-1]：而羊\n[音義-2]：奴容、奴冬二反\n[音義-3]：直減、牒琰反\n[音義-4]：那禮。今人以此爲埿，那低，失之', '釋訓', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1829, '坦坦;漫漫;蕩蕩;平', '㒼㒼;愓愓', '坦坦、漫漫[㒼㒼]、蕩蕩[愓愓]，平也。', '', '釋訓', '廣雅', '2;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1830, '渾渾;汪汪;皋皋;詡詡;曠曠;大', '浩浩', '渾渾1、汪汪、䫧䫧{皋皋}[浩浩]2、詡詡、曠曠，大也。', '[音義-1]：魂\n[音義-2]：暠', '釋訓', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1831, '栠栠;嫋嫋;姌姌;弱', '', '栠栠1、嫋嫋2、姌姌3，弱也。', '[音義-1]：而審\n[音義-2]：那鳥\n[音義-3]：如琰，又乃點', '釋訓', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1832, '區區;稍稍;小', '', '區區、稍稍，小也。', '', '釋訓', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1833, '昭昭;晣晣;皎皎;晧晧;炳炳;灼灼;炫炫;赫赫;曠曠;翼翼;顯顯;明', '𠂆𠂆', '炤炤{昭昭}、晣晣、晈晈{皎皎}、晧晧、炳炳、灼灼、炫炫、赫赫、曠曠、翼翼[𠂆𠂆]、顯顯，明也。', '', '釋訓', '廣雅', '10', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1834, '詪詪;誾誾;詻詻;希希;㖾㖾;堯堯;䛁䛁;語', '詻詻', '詪詪1、訔訔{誾誾}2、詻詻3、䛥䛥{希希}4、諤諤{㖾㖾}[詻詻]、譊譊{堯堯}5、〔䛁䛁〕，語也。', '[音義-1]：古很\n[音義-2]：魚斤\n[音義-3]：頟\n[音義-4]：呼氣、呼几二反\n[音義-5]：女交', '釋訓', '廣雅', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1835, '愴愴;崔崔;良良;悽悽;哀哀;悲', '', '愴愴、慛慛{崔崔}1、悢悢{良良}、悽悽、哀哀，悲也。', '[音義-1]：才回', '釋訓', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1836, '暤暤;杲杲;霍霍;爵爵;景景;白', '㿥㿥;敫敫;暀暀', '暤暤1、杲杲、皬皬{霍霍}[㿥㿥]2、皭皭{爵爵}[敫敫]3、景景[暀暀]，白也。', '[音義-1]：昦\n[音義-2]：鵠\n[音義-3]：字爵', '釋訓', '廣雅', '3;4;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1837, '泓泓;淵淵;窱窱;窈窈;深', '', '泓泓、淵淵、窱窱1、窈窈，深也。', '[音義-1]：眺', '釋訓', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1838, '緜緜;曼曼;延延;遲遲;長', '宀宀;䜌䜌;徲徲', '緜緜[宀宀]、曼曼[䜌䜌]、延延、遲遲[徲徲]，長也。', '', '釋訓', '廣雅', '1;2;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1839, '痑痑;騑騑;㒍㒍;疲', '婓婓', '痑痑1、騑騑[婓婓]2、㒍㒍3，疲也。', '[音義-1]：吐安、吐案、吐佐三反\n[音義-2]：妃\n[音義-3]：力罪、力追二反', '釋訓', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1840, '㞕㞕;迹迹;塞塞;省省;耿耿;警警;不安', '', '㞕㞕、迹迹、塞塞、省省、耿耿、警警，不安也。', '', '釋訓', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1841, '孜孜;彶彶;惶惶;𠍧𠍧;勮', '遑遑;遑遑', '孜孜、彶彶1、惶惶[遑遑]、𠍧𠍧[遑遑]2，勮也3。', '[音義-1]：急\n[音義-2]：其往\n[音義-3]：其去', '釋訓', '廣雅', '3;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1842, '釁釁;牟牟;冉冉;進', '潣潣;冒冒;炎炎', '亹亹{釁釁}[潣潣]1、牟牟[冒冒]、冉冉[炎炎]，進也。', '[音義-1]：尾', '釋訓', '廣雅', '1;2;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1843, '拳拳;區區;款款;愛', '', '拳拳1、區區、款款，愛也。', '[音義-1]：卷權', '釋訓', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1844, '悾悾;愨愨;懇懇;口口;斷斷;誠', '款款;款款;嫥嫥', '悾悾[款款]1、愨愨2、懇懇3、叩叩{口口}[款款]、斷斷[嫥嫥]4，誠也。', '[音義-1]：控\n[音義-2]：苦角\n[音義-3]：苦很切\n[音義-4]：都玩', '釋訓', '廣雅', '1;4;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1845, '賓賓;厷厷;翩翩;薨薨;翽翽;煢煢;翾翾;翻翻;鶱鶱;漂漂;世世;肅肅;翼翼;分分;𦑩𦑩;宣宣;飛', '曳曳;𩰟𩰟;翾翾', '䎙䎙{賓賓}1、𦐌𦐌{厷厷}2、翩翩3、𦒃𦒃{薨薨}4、翽翽5、䎕䎕{煢煢}6、翾翾7、翻翻、鶱鶱、翲翲{漂漂}8、𦐞𦐞{世世}[曳曳]9、䎘䎘{肅肅}10、翼翼、𦐈𦐈{分分}[𩰟𩰟]11、𦑩𦑩12、翧翧{宣宣}[翾翾]13，飛也。', '[音義-1]：匹人\n[音義-2]：宏\n[音義-3]：匹延\n[音義-4]：火宏\n[音義-5]：火外\n[音義-6]：火宏\n[音義-7]：呼鞭\n[音義-8]：匹饒\n[音義-9]：曳\n[音義-10]：肅\n[音義-11]：紛\n[音義-12]：暉\n[音義-13]：火元', '釋訓', '廣雅', '11;14;16', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1846, '煌煌;胃胃;倏倏;炯炯;晃晃;熒熒;光', '儵儵', '煌煌1、煟煟{胃胃}2、倏倏[儵儵]3、炯炯4、晃晃、熒熒5，光也。', '[音義-1]：皇\n[音義-2]：謂\n[音義-3]：叔\n[音義-4]：公迥\n[音義-5]：乎扃', '釋訓', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1847, '蒙蒙;冥冥;昧昧;晻晻;暗', '冡冡', '蒙蒙[冡冡]、冥冥、昧昧、晻晻1，暗也。', '[音義-1]：烏感', '釋訓', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1848, '堂堂;娗娗;㦽㦽;嬴嬴;嬽嬽;渥渥;夭夭;申申;奕奕;儀儀;僷僷;娥娥;容', '昌昌;亭亭;義義', '堂堂[昌昌]、娗娗[亭亭]1、彧彧{㦽㦽}2、嬴嬴、嬽嬽3、媉媉{渥渥}4、夭夭5、申申、奕奕、儀儀[義義]、僷僷6、娥娥，容也。', '[音義-1]：大丁、唐鼎\n[音義-2]：於鞠\n[音義-3]：淵\n[音義-4]：渥\n[音義-5]：於苗\n[音義-6]：丑葉', '釋訓', '廣雅', '1;2;10', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1849, '伾伾;颿颿;驫驫;臩臩;并并;從從;蹡蹡;走', '抨抨;淙淙', '駓駓{伾伾}1、颿颿2、驫驫3、臩臩4、𧻓𧻓{并并}[抨抨]5、傱傱{從從}[淙淙]6、蹡蹡7，走也。', '[音義-1]：步悲\n[音義-2]：扶嚴、扶泛\n[音義-3]：香幽、必幽反\n[音義-4]：古永\n[音義-5]：方孟\n[音義-6]：先拱\n[音義-7]：七羊反', '釋訓', '廣雅', '5;6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1850, '馥馥;芬芬;孛孛;今今;兼兼;奄奄;犮犮;㡀㡀;非非;蔎蔎;香', '', '馥馥1、芬芬、馞馞{孛孛}2、𩠻𩠻{今今}、〔馦馦{兼兼}〕3、馣馣{奄奄}4、馛馛{犮犮}5、䭱䭱{㡀㡀}6、馡馡{非非}7、蔎蔎8，香也。', '[音義-1]：伏\n[音義-2]：步沒\n[音義-3]：呼縑\n[音義-4]：烏含\n[音義-5]：步葛\n[音義-6]：匹結\n[音義-7]：拂非\n[音義-8]：設', '釋訓', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1851, '正正;靡靡;踽踽;䞚䞚;摇摇;施施;奕奕;浮浮;趫趫;冉冉;𢓡𢓡;儦儦;趞趞;裔裔;趿趿;妾妾;憂憂;蹈蹈;衍衍;章章;𧘂𧘂;行', '暆暆;疌疌', '眐眐{正正}1、靡靡、踽踽、䞚䞚2、𧽎𧽎[摇摇]3、施施[暆暆]4、奕奕5、浮浮、趫趫6、冉冉、𢓡𢓡7、儦儦8、趞趞9、裔裔、趿趿10、踥踥{妾妾}[疌疌]11、憂憂、蹈蹈、衍衍、章章、𧘂𧘂，行也。', '[音義-1]：征\n[音義-2]：企，又巨支\n[音義-3]：遥\n[音義-4]：余□\n[音義-5]：亦\n[音義-6]：去遥\n[音義-7]：夷\n[音義-8]：必嬌\n[音義-9]：錯\n[音義-10]：且及\n[音義-11]：七葉', '釋訓', '廣雅', '6;16', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1852, '憧憧;媻媻;徲徲;營營;往來', '踵踵;般般;謍謍', '憧憧[踵踵]1、媻媻[般般]2、徲徲3、營營[謍謍]，往來也。', '[音義-1]：處鍾\n[音義-2]：柈\n[音義-3]：丈尸', '釋訓', '廣雅', '1;2;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1853, '腜腜;䑋䑋;𡙋𡙋;旨旨;濯濯;賢賢;肥', '每每;奚奚', '腜腜[每每]1、䑋䑋2、𡙋𡙋、㚛㚛{旨旨}[奚奚]3、濯濯、臔臔{賢賢}4，肥也。', '[音義-1]：梅\n[音義-2]：如掌\n[音義-3]：呼計\n[音義-4]：呼典', '釋訓', '廣雅', '1;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1854, '泡泡;匋匋;沸沸;洋洋;洹洹;湯湯;泱泱;湝湝;浩浩;潒潒;混混;𡿯𡿯;滂滂;沛沛;涓涓;決決;浪浪;油油;泧泧;淲淲;淈淈;流', '滔滔;潒潒;濊濊', '泡泡1、淘淘{匋匋}[滔滔]2、沸沸、〔洋洋〕3、洹洹4、湯湯[潒潒]5、泱泱6、湝湝7、浩浩、潒潒8、混混、𡿯𡿯9、滂滂、沛沛、涓涓、決決、浪浪10、油油11、泧泧[濊濊]12、滮滮{淲淲}13、〔淈淈〕，流也。', '[音義-1]：白交、普交\n[音義-2]：陶。政宇謹案：念孫謂當音滔\n[音義-3]：陽\n[音義-4]：丸\n[音義-5]：傷\n[音義-6]：於薑\n[音義-7]：諧\n[音義-8]：蕩\n[音義-9]：于密\n[音義-10]：郎\n[音義-11]：由\n[音義-12]：許活\n[音義-13]：蒲彪', '釋訓', '廣雅', '2;6;19', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (1855, '汎汎;氾氾;浮', '', '汎汎1、〔氾氾〕2，浮也。', '[音義-1]：扶弓\n[音義-2]：孚劒', '釋訓', '廣雅', '', 'null', 'null');
