INSERT INTO `t_han_nga` VALUES (2015, '臀;脽', '', '臀1謂之脽2。', '[音義-1]：屯\n[音義-2]：誰', '釋親', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2016, '腓;䏿;腨', '', '腓1、䏿2，腨也3。', '[音義-1]：肥\n[音義-2]：啟\n[音義-3]：時兗', '釋親', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2017, '股;腳;踦;胻;脛', '', '股、腳、踦1、胻2，脛也。', '[音義-1]：居綺\n[音義-2]：乎當', '釋親', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2018, '國;朏;曲腳', '詘', '膕{國}1、朏[詘]2，曲腳也。', '[音義-1]：古獲\n[音義-2]：篤骨', '釋親', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2019, '髖;尻;州;豖;㞓;臀', '鳥;鳥', '臗{髖}1、尻、州[鳥]、䐁{豖}[鳥]2、〔㞓〕，臀也3。', '[音義-1]：苦丸、苦魂\n[音義-2]：卓，又多鹿反\n[音義-3]：豚', '釋親', '廣雅', '3;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2020, '元;光良;䯏;髆;髖;可', '胯', '䯈{元}1、䯑䯖{光良}2、䯏3、䯙{髆}4、髖5，䯊{可}[胯]也6。', '[音義-1]：五丸\n[音義-2]：苦黄。力岡\n[音義-3]：括\n[音義-4]：甫\n[音義-5]：寬\n[音義-6]：苦亞', '釋親', '廣雅', '6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2021, '庌;廡;房;櫳;廬;庉;來;朿;廊;館;傳;奄;麻;屋;庫;府;廏;舍', '广', '庌1、廡、房、櫳2、廬、庉3、庲{來}4、㢀{朿}5、廊、館、傳、庵{奄}[广]6、䵇{麻}7、屋、庫、府、廏，舍也。', '[音義-1]：雅\n[音義-2]：籠\n[音義-3]：徒囷\n[音義-4]：來\n[音義-5]：七賜反\n[音義-6]：烏含\n[音義-7]：先見', '釋宮', '廣雅', '12', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2022, '堂隍;殿', '', '堂堭{堂隍}1，壂{殿}也2。', '[音義-1]：皇\n[音義-2]：殿', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2023, '反坫;序', '', '反坫1謂之垿{序}2。', '[音義-1]：多念\n[音義-2]：序', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2024, '屠穌;㢚;馬;粗;幕;易;剌;奄', '广', '廜㢝{屠穌}1、㢚2、𢉿{馬}3、粗4、幕、易、𢉨{剌}5，庵{奄}[广]也。', '[音義-1]：徒蘇\n[音義-2]：魯\n[音義-3]：罵\n[音義-4]：才祖\n[音義-5]：來達', '釋宮', '廣雅', '8', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2025, '竲;窠;巢', '', '橧{竲}1、窠，巢也。', '[音義-1]：似陵反，又音曾', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2026, '棚;棼;栽;棧;閣', '載;閤', '棚1、棼2、栽[載]3、棧，閣[閤]也。', '[音義-1]：步萌，又負宏\n[音義-2]：墳\n[音義-3]：才□', '釋宮', '廣雅', '3;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2027, '吾;竈;脣;陘;窻;突;突', '', '窹{吾}1謂之竈，其脣謂之陘，其窻2謂之堗{突}3，堗{突}下謂之□。', '[音義-1]：悟\n[音義-2]：悤\n[音義-3]：突', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2028, '甄;匋;窯', '', '甄1、匋2，窯也3。', '[音義-1]：只賔\n[音義-2]：桃\n[音義-3]：遥', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2029, '楣;檐;櫺;梠', '', '楣、檐1、櫺2，梠也。', '[音義-1]：簷\n[音義-2]：零', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2030, '榱;橑;桷;梀;掾', '椽', '榱1、橑2、桷3、梀4，掾[椽]也5。', '[音義-1]：楚悲\n[音義-2]：魯好\n[音義-3]：角\n[音義-4]：恥綠，又且足\n[音義-5]：直緣', '釋宮', '廣雅', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2031, '檼;棟', '', '檼1，棟也。', '[音義-1]：於靳', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2032, '甍;霤', '', '甍謂之㽌{霤}1。', '[音義-1]：溜', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2033, '欂;枅', '', '欂1謂之枅2。', '[音義-1]：步各、步革\n[音義-2]：雞，又古研。亦有本作𣓖，此一字耳', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2034, '曲枅;欒', '', '曲枅謂之欒1。', '[音義-1]：鸞', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2035, '㮞;笮', '', '㮞1謂之笮2。', '[音義-1]：節\n[音義-2]：俎格', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2036, '楹;柱', '', '楹謂之柱。', '', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2037, '礎;舄;鎮;礩', '', '礎1、〔磶{舄}2〕、磌{鎮}3，礩也4。', '[音義-1]：楚\n[音義-2]：石\n[音義-3]：真，又徒年\n[音義-4]：質', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2038, '窻;牖;䦳', '囪', '窻[囪]、牖，䦳也1。', '[音義-1]：虛亮', '釋宮', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2039, '丰;梯;階', '', '丰1、梯，階也。', '[音義-1]：蜂', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2040, '坻;除', '墀;涂', '坻[墀]1，除[涂]也。', '[音義-1]：除離', '釋宮', '廣雅', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2041, '𥥊;包;啻;元;𥨍;𡒈', '', '𥥊1、窇{包}2、𥧮{啻}3、𥤸{元}、𥨍4，窟{𡒈}也。', '[音義-1]：猛\n[音義-2]：步角\n[音義-3]：丈革\n[音義-4]：扶福', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2042, '京;庾;廩;鹿;廥;㔶;鮮;囷;倉', '', '京、庾、廩、廘{鹿}1、廥2、㔶3、廯{鮮}4、囷，倉也。', '[音義-1]：鹿\n[音義-2]：古外\n[音義-3]：貢\n[音義-4]：鮮踐', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2043, '州;郡;縣;府;廷;寺;學;校;庠;序;辟廱;泮宮;瞽宗;東膠;官', '', '州、郡、縣、府、廷、寺、學、校、庠、序、辟廱、頖宮{泮宮}、瞽宗、東膠，官也。', '', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2044, '番古;丁;治;甄;垒;𦣞;令適;甓;鹿專', '', '㽃瓳{番古}1、㼗{丁}2、治、甄3、𤮎{垒}4、㼢{𦣞}5、瓴甋{令適}6、甓7，㼾甎{鹿專}8也。', '[音義-1]：潘胡\n[音義-2]：亭\n[音義-3]：真\n[音義-4]：力隹\n[音義-5]：夷耳\n[音義-6]：零的\n[音義-7]：□壁\n[音義-8]：鹿專', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2045, '童;百;甃', '', '㼿{童}1、㼣{百}2，甃也3。', '[音義-1]：同\n[音義-2]：百\n[音義-3]：側溜', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2046, '欄;檻;㰍;梐;牢', '闌;櫳', '欄[闌]1、檻2、㰍[櫳]3、梐4，牢也。', '[音義-1]：蘭\n[音義-2]：乎減\n[音義-3]：籠\n[音義-4]：布犂', '釋宮', '廣雅', '1;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2047, '闥;門', '', '闥謂之門。', '', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2048, '䦏;扇;扉', '', '䦏1、扇，扉也。', '[音義-1]：乎計、乎介', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2049, '象巍;闕', '', '象巍，闕也。', '', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2050, '限;丞', '', '限謂之丞。', '', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2051, '失;巳;粦;切', '榍;榍', '柣{失}[榍]1、戺{巳}2、橉{粦}3，砌{切}[榍]也。', '[音義-1]：帙\n[音義-2]：仕巳，又音士\n[音義-3]：力忍', '釋宮', '廣雅', '1;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2052, '橜;機;闑;𣏔', '梱', '橜1、機、闑，𣏔[梱]也2。', '[音義-1]：巨月\n[音義-2]：苦木', '釋宮', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2053, '罦罳;屏', '罘罳', '罦罳[罘罳]1謂之屏。', '[音義-1]：浮思', '釋宮', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2054, '投;𨷲;鍵;笠;及;戶牡', '', '投謂之𨷲1；鍵2、笠、㧀{及}3，戶牡也。', '[音義-1]：藥\n[音義-2]：奇辨\n[音義-3]：及', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2055, '閣;庖;廚', '', '閣、庖，廚也。', '', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2056, '閻;巷', '', '閻謂之衖{巷}。', '', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2057, '闒;閭;閈;里', '', '闒1、閭、閈，里也。', '[音義-1]：大臘', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2058, '㙩;䧘;墉;院;廦;牆;垣', '', '㙩1、䧘2、墉、院3、廦4、牆，垣也。', '[音義-1]：力彫\n[音義-2]：篆\n[音義-3]：桓\n[音義-4]：壁。案即壁', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2059, '埤兒;𡑢;女牆', '俾倪', '埤堄{埤兒}[俾倪]1、堞{𡑢}，女牆也。', '[音義-1]：普計。五計', '釋宮', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2060, '豦;栫;藩;篳;羅;落;杝', '', '㯫{豦}1、栫2、藩、篳3、欏{羅}4、𥯛{落}5，杝也6。', '[音義-1]：巨於\n[音義-2]：在見\n[音義-3]：必\n[音義-4]：羅\n[音義-5]：洛\n[音義-6]：離', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2061, '柵;朔', '', '柵1謂之㮶{朔}2。', '[音義-1]：策\n[音義-2]：朔', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2062, '黝;堊;垷;墐;墀;塈;𢅼;㙙;咸;冥;培;封;塗', '涂', '黝1、堊2、垷3、墐、𡎰{墀}4、塈5、𢅼6、㙙7、𥻇{咸}8、㨠{冥}9、培10、封，塗[涂]也。', '[音義-1]：於糾、於久\n[音義-2]：惡，又烏故\n[音義-3]：峴音，乎典\n[音義-4]：遟\n[音義-5]：虛既\n[音義-6]：奴回\n[音義-7]：力奉\n[音義-8]：古湛\n[音義-9]：莫典\n[音義-10]：裴', '釋宮', '廣雅', '13', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2063, '段;橛;楬豬;牂柯;侗;柵;杙', '弋', '椴{段}1、橛2、楬櫫{楬豬}3、𢍿𢎄{牂柯}4、戙{侗}5、柵6，杙[弋]也7。', '[音義-1]：都館\n[音義-2]：居月，又巨月\n[音義-3]：竭豬\n[音義-4]：臧歌\n[音義-5]：洞\n[音義-6]：策\n[音義-7]：弋', '釋宮', '廣雅', '7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2064, '驛;軌;恒;巷;街;術;蹊;徑;闤;闠;羨;隊;邪;除;㽘;百;迒;千;道', '㕣;兌;除', '墿{驛}1、軌、堩{恒}2、衖{巷}、街、術、蹊、徑、闤、闠、羨[㕣]、隊[兌]、邪[除]、除、㽘3、陌{百}、迒4、𧮮{千}5，道也。', '[音義-1]：亦\n[音義-2]：古鄧\n[音義-3]：古朖\n[音義-4]：乎郎\n[音義-5]：千', '釋宮', '廣雅', '11;12;13', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2065, '駃;𩢾;驅;驟;馳;騖;騁;騰;趡;䞭;辵;奔', '快', '駃[快]1、𩢾2、驅、驟、馳、騖、騁、騰、趡3、䞭4、辵5，犇{奔}也。', '[音義-1]：决\n[音義-2]：例\n[音義-3]：子肖\n[音義-4]：千繡\n[音義-5]：勑略', '釋宮', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2066, '塍;埒;保;𡑏;唐;𨹸;防;芓;隄', '', '塍1、埒2、堢{保}3、𡑏4、䧜{唐}5、𨹸6、防、芓，隄也7。', '[音義-1]：視陵\n[音義-2]：力闋\n[音義-3]：保\n[音義-4]：多老\n[音義-5]：唐\n[音義-6]：音照，之曜\n[音義-7]：低，一音度兮', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2067, '柤;㳻;匽', '', '柤1、㳻2，隁{匽}也3。', '[音義-1]：士家\n[音義-2]：倉故\n[音義-3]：於建', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2068, '榷;勺;獨梁', '', '榷1、彴{勺}2，獨梁也。', '[音義-1]：角\n[音義-2]：灼', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2069, '徛;步橋', '', '徛1，步橋也。', '[音義-1]：居義，音寄', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2070, '廟;黝堊;蒼;主;蒼;靈府;文祖;黃;神斗;白;顯紀;黑;玄巨', '', '廟，天子五，諸侯四，卿、大夫三，士二。天子、諸侯廟黝堊，卿、大夫蒼，士黈{主}1。五帝廟，蒼曰靈府，赤曰文祖，黃曰神斗，白曰顯紀，黑曰玄矩{玄巨}。', '[音義-1]：土斗', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2071, '獄;犴;夏臺;羑里;囹圉', '', '獄，犴也。夏曰夏臺，殷曰羑里，周曰囹圉。', '', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2072, '杽;梏;械;桎', '', '杽謂之梏，械謂之桎。', '', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2073, '淸;圂;庰;廁', '', '圊{淸}、圂、庰，廁也。', '', '釋宮', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2074, '盎;盆', '', '盎1謂之盆。', '[音義-1]：烏浪', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2075, '瓿禺;罏;缶', '䍌禺', '瓿㼴{瓿禺}[䍌禺]1、罏2，缶也。', '[音義-1]：部偶\n[音義-2]：盧', '釋器', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2076, '是;甌;甂', '榹', '㼵{是}[榹]1、甌2，甂也3。', '[音義-1]：弟\n[音義-2]：一侯\n[音義-3]：邊', '釋器', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2077, '東;甈;毚', '', '㼯{東}1、甈2，𤮭{毚}也3。', '[音義-1]：棟\n[音義-2]：去滯\n[音義-3]：初鑑', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2078, '瓽;土;鑑', '', '瓽1、𤬪{土}2，㽉{鑑}也3。', '[音義-1]：多朖\n[音義-2]：杜\n[音義-3]：乎暫', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2079, '從;疑;奠;㼸;亢;冘;瓿婁;䍃;𦉈;廡;瓮;罌;詹;朱;俞;長;幸省;瓬;䍇;𦉥;斯;㼰;罃;瓨;𦉢;㓞;瓶', '䍌婁;臾;臾', '㼻{從}1、㽈{疑}2、㽀{奠}3、㼸4、㼚{亢}5、瓭{冘}6、瓿甊{瓿婁}[䍌婁]7、䍃8、甀{𦉈}9、𤮢{廡}10、瓮11、罌12、甔{詹}13、㼡{朱}[臾]14、㼶{俞}[臾]15、瓺{長}16、㼬㼳{幸省}17、瓬18、䍇19、𦉨{𦉥}20、𤮓{斯}21、㼰22、罃23、瓨24、𦉢25、㼤{㓞}26，瓶也。', '[音義-1]：士江\n[音義-2]：牛志\n[音義-3]：鄭\n[音義-4]：容\n[音義-5]：剛\n[音義-6]：多感\n[音義-7]：部。來後\n[音義-8]：由\n[音義-9]：直類\n[音義-10]：廡\n[音義-11]：一洞\n[音義-12]：一正\n[音義-13]：多甘\n[音義-14]：殊\n[音義-15]：臾\n[音義-16]：腸，又音悵\n[音義-17]：所猛\n[音義-18]：方往\n[音義-19]：他臘\n[音義-20]：於龍\n[音義-21]：斯\n[音義-22]：步美\n[音義-23]：烏行\n[音義-24]：下江\n[音義-25]：霝\n[音義-26]：苦計', '釋器', '廣雅', '7;14;15', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2080, '錪;䰙;鏤;鬲;鍑;䥝;鐪;鍪;鬹;𧇼;錡;鬴;鐈;𩰬;鬷;釡', '', '錪1、鉼2、䰙3、鏤4、鬲5、鍑6、䥝7、鐪、鍪8、鬹9、𧇼10、錡11、鬴12、鐈13、𩰬、鬷14，釡也。', '[音義-1]：土典\n[音義-2]：必整\n[音義-3]：蟻\n[音義-4]：盧后\n[音義-5]：歷\n[音義-6]：富\n[音義-7]：烏高\n[音義-8]：茂\n[音義-9]：矩皮\n[音義-10]：昦\n[音義-11]：奇綺\n[音義-12]：扶宇\n[音義-13]：橋\n[音義-14]：子工', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2081, '鋗;銚', '', '鋗1謂之銚2。', '[音義-1]：呼元\n[音義-2]：遥。今人多作大弔反', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2082, '烏育;銼𨰠', '䥝', '鎢錥{烏育}[䥝]1謂之銼𨰠2。', '[音義-1]：烏育\n[音義-2]：坐戈。力戈', '釋器', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2083, '案;寫', '', '案謂之𣞐{寫}。', '', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2084, '干;槃', '', '㿻{干}謂之槃。', '', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2085, '扁榼;椑', '', '匾榼{扁榼}1謂之椑2。', '[音義-1]：布典。苦臘\n[音義-2]：步兮', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2086, '敦;盡;案殘;銚銳;柯;櫂;全;肙夬;喬;卷;盌;盂', '閜;銚', '𥂦{敦}1、㯸{盡}2、案𥂫{案殘}3、銚銳4、柯[閜]、櫂[銚]5、栓{全}6、梋㭈{肙夬}7、䀉{喬}8、𥁠{卷}9、椀{盌}，盂也。', '[音義-1]：敦\n[音義-2]：牋典\n[音義-3]：安殘\n[音義-4]：遥\n[音義-5]：直皃\n[音義-6]：七緣\n[音義-7]：決\n[音義-8]：橋\n[音義-9]：拳，又眷', '釋器', '廣雅', '5;6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2087, '楊;㔶;麻;椷;疋;閜;盞;氾;桮', '㔶;雅', '𥂸{楊}1、㔶、𥂓{麻}2、椷[㔶]3、㿿{疋}[雅]4、閜5、盞6、䀀{氾}7，杯{桮}也。', '[音義-1]：又章\n[音義-2]：摩\n[音義-3]：古咸\n[音義-4]：雅\n[音義-5]：呼雅\n[音義-6]：側限\n[音義-7]：凡', '釋器', '廣雅', '4;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2088, '斝;醆;爵', '', '斝1、醆2，爵也。', '[音義-1]：古馬\n[音義-2]：側眼', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2089, '𦓙;觛;巵', '', '𦓙1、觛2，巵也3。', '[音義-1]：拙兗\n[音義-2]：多旦\n[音義-3]：支', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2090, '瓠;蠡;𧯷;鬳;瓢', '', '瓠1、蠡、𧯷2、𤬝{鬳}3，瓢也。', '[音義-1]：回故\n[音義-2]：居隱\n[音義-3]：魚偃', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2091, '䇨;𥴧;桮落', '桮笿', '䇨1、豆、𥴧2，杯落{桮落}[桮笿]也。', '[音義-1]：乎江\n[音義-2]：舉', '釋器', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2092, '籯;䈰;桶蔥;籫;箸筩', '', '籝{籯}1、筲{䈰}2、桶𣞷{桶蔥}3、籫4，箸筩也5。', '[音義-1]：盈\n[音義-2]：所交\n[音義-3]：上天孔，下思□\n[音義-4]：作管\n[音義-5]：馳慮', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2093, '柶;匙;匕', '', '柶1、匙2，匕也。', '[音義-1]：四\n[音義-2]：是支', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2094, '梜;箸', '', '筴{梜}1謂之箸。', '[音義-1]：夾', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2095, '龍;疏;蒲;枓;杓', '', '龍、疏、蒲、枓1，杓也。', '[音義-1]：主', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2096, '户斗;𦣞', '', '𣶉斗{户斗}謂之𣐵{𦣞}1。', '[音義-1]：頤', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2097, '焅;眉', '', '焅1謂之煝{眉}2。', '[音義-1]：苦篤\n[音義-2]：媚', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2098, '奚夬;䈰;旅', '筥', '𤳤𤱾{奚夬}1、筲{䈰}2，𥰠{旅}[筥]也3。', '[音義-1]：溪桂\n[音義-2]：所交\n[音義-3]：呂', '釋器', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2099, '籓;羅;箕', '', '籓1、籮{羅}，箕也。', '[音義-1]：甫袁', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2100, '扶;庶;𠤼;𤳊;畚', '𤲑', '𤱽{扶}1、𤳯{庶}[𤲑]2、𠤼3、𤳊4，畚也5。', '[音義-1]：扶\n[音義-2]：諸庶\n[音義-3]：徒弔\n[音義-4]：步丁\n[音義-5]：本', '釋器', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2101, '斫;䉴;叜;㕣;䉛', '籔;匴', '𥯩{斫}1、䉴2、𥰞{叜}[籔]3、㔯{㕣}[匴]4，䉛也5。', '[音義-1]：斫\n[音義-2]：攘\n[音義-3]：蘇苟\n[音義-4]：泉，正音旋\n[音義-5]：於鞠', '釋器', '廣雅', '3;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2102, '䈰;先', '', '䈰謂之〔筅{先}〕1。', '[音義-1]：素典', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2103, '䈀;弁;匰;笥', '簞', '䈀1、匥{弁}2、匰[簞]3，笥也。', '[音義-1]：素管\n[音義-2]：弁\n[音義-3]：丹', '釋器', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2104, '匱;匵', '', '匱1謂之匵。', '[音義-1]：巨位', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2105, '匧;椷', '', '匧謂之椷1。', '[音義-1]：咸、緘二音', '釋器', '廣雅', '', 'null', 'null');
