INSERT INTO `t_han_nga` VALUES (2107, '櫡;钁', '', '𣛰{櫡}1謂之钁2。', '[音義-1]：張略\n[音義-2]：九縛', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2108, '錍;銛', '', '錍1謂之銛2。', '[音義-1]：方支\n[音義-2]：他點', '釋器', '廣雅', '', 'null', 'null');
