INSERT INTO `t_han_nga` VALUES (2110, '曲梁;罶', '', '曲梁謂之𦊑{罶}1。', '[音義-1]：柳', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2111, '爵;籗;棠;罩', '', '𥷮{爵}1、籗2、䉎{棠}3，䈇{罩}也4。', '[音義-1]：捉\n[音義-2]：苦郭\n[音義-3]：堂\n[音義-4]：珍教', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2112, '瀀;涔;栫', '罧', '瀀、涔[罧]1，栫也2。', '[音義-1]：字廉\n[音義-2]：才見', '釋器', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2113, '罔;罟', '', '罔謂之罟。', '', '釋器', '廣雅', '', 'null', 'null');
