INSERT INTO `t_han_nga` VALUES (2115, '畢;䍐;㘝;㘝;率', '罨', '罼{畢}1、䍐、㘝2、𣃳{㘝}[罨]3，率也。', '[音義-1]：畢\n[音義-2]：女洽\n[音義-3]：於劫，又於檢', '釋器', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2116, '𦊂;𦊾;罠;兔罟', '', '𦊂1、𦊾2、〔罠〕，兔罟也。', '[音義-1]：互\n[音義-2]：肥無', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2117, '䍙;雉罟', '', '〔䍙〕1，〔雉罟也〕。', '[音義-1]：某', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2118, '肙;欚', '𦌾;羅', '罥{肙}[𦌾]1謂之欚[羅]2。', '[音義-1]：泫\n[音義-2]：禮', '釋器', '廣雅', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2119, '軥;輗', '', '軥1謂之輗2。', '[音義-1]：衢\n[音義-2]：兒', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2120, '兆;棓;牒;牘;牑;牏;版', '', '𤕷{兆}1、𤗏{棓}2、牒、牘、牑3、牏4，版也。', '[音義-1]：兆\n[音義-2]：裴\n[音義-3]：鞭\n[音義-4]：之句、徒侯二反', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2121, '泰;山;罍;箸;犧;象;尊', '', '泰、〔山〕罍、著{箸}1、〔犧〕、〔象〕，罇{尊}也。', '[音義-1]：直藥', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2122, '敄;𦇎;鮮支;縠;絹', '鮮𠨗', '䋷{敄}1、𦇎2、鮮支[鮮𠨗]、縠，絹也。', '[音義-1]：苦侯、苦茂二反\n[音義-2]：蔥，又摠', '釋器', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2123, '繰;縑', '', '繰1謂之縑。', '[音義-1]：早', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2124, '紈;𦆾;素', '', '紈、𦆾1，素也。', '[音義-1]：力出反', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2125, '純;續;絲', '', '純、續1，絲也。', '[音義-1]：辭足', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2126, '紨;兌;䌳;絓;𠯑;紬', '', '紨1、綐{兌}2、䌳3、絓4、𦧠{𠯑}5，紬也。', '[音義-1]：敷\n[音義-2]：徒外\n[音義-3]：式支、赤移二反\n[音義-4]：乖，又空淮反\n[音義-5]：刮', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2127, '䵈;絡;綃', '', '䵈1、絡，綃也2。', '[音義-1]：苦木反\n[音義-2]：悉遥', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2128, '阿;縞;緻;䋤;練', '', '䋪{阿}1、縞、緻2、䋤3，練也。', '[音義-1]：阿\n[音義-2]：直異\n[音義-3]：藥', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2129, '襺;緭;絖', '', '襺1、緭，絖〔也〕2。', '[音義-1]：古典\n[音義-2]：曠', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2130, '編緖;意;紃;絛', '扁緒', '編緖[扁緒]1、繶{意}2、紃3，絛也4。', '[音義-1]：必延\n[音義-2]：憶\n[音義-3]：循\n[音義-4]：滔', '釋器', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2131, '春草;鷄翹;蒸栗;鬱金;鬼幃;𥶶𪋻;綠綟;紫綟;無渠;綦綺;留黃;采', '', '春草、鷄翹、蒸𦃊{蒸栗}1、鬱金、𢄊幃{鬼幃}2、麴塵{𥶶𪋻}3、綠綟4、紫綟、無𦂘{無渠}5、綦綺、留黃，綵{采}也。', '[音義-1]：音栗\n[音義-2]：鬼韋\n[音義-3]：去菊\n[音義-4]：麗\n[音義-5]：渠', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2132, '衣;隱', '', '衣，隱也。', '', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2133, '無追;章甫;委皃;收;吁;皮弁;通天;遠游;進賢;高山;方山;惠文;建華;卻非;解豸;冠', '彰甫;解𢊁', '無追1、章甫[彰甫]、委皃、收、𦀒{吁}2、皮弁、通天、遠游、進賢、高山、方山、惠文、建華、卻非、解豸[解𢊁]，冠也。', '[音義-1]：多回\n[音義-2]：況羽', '釋器', '廣雅', '2;15', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2134, '雚;介;幘', '絭', '䌯{雚}[絭]1、㠹{介}2，幘也。', '[音義-1]：邱拳\n[音義-2]：介', '釋器', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2135, '假結;副', '假䯰', '假結[假䯰]謂之𩭺{副}1。', '[音義-1]：副', '釋器', '廣雅', '1', 'null', 'null');
