INSERT INTO `t_han_nga` VALUES (2137, '䢅;辯;逗;宬;多', '', '䢅1、辯、逗、宬，㡅{多}也2。', '[音義-1]：辰\n[音義-2]：乃可', '釋器', '廣雅', '', 'null', 'null');
