INSERT INTO `t_han_nga` VALUES (2142, '佰頭;𣦼;䰎帶;采帶;絡頭;幧頭', '帴;落頭', '帞頭{佰頭}1、𢂺{𣦼}[帴]2、䰎帶3、䰂帶{采帶}4、絡頭[落頭]，幧頭也5。', '[音義-1]：陌\n[音義-2]：七見，又七年\n[音義-3]：去位\n[音義-4]：采\n[音義-5]：七消', '釋器', '廣雅', '2;5', 'null', 'null');
