INSERT INTO `t_han_nga` VALUES (2261, '飦;匊;䊀;尾;粖;鬻;孚;糜;毇;監;饘', '𩱍;粖', '飦1、𩛺{匊}2、䊀[𩱍]3、䊊{尾}[粖]4、粖5、粥{鬻}、粰{孚}6、糜、毇7、糮{監}8，饘也。', '[音義-1]：居言\n[音義-2]：居六\n[音義-3]：乎\n[音義-4]：媚，又未\n[音義-5]：亡逹、亡結\n[音義-6]：浮\n[音義-7]：毀\n[音義-8]：艦', '釋器', '廣雅', '3;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2262, '湩;乳', '', '湩1謂之乳。', '[音義-1]：竹用，又棟', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2263, '清酌;清英;醴;醪;醍;瀝;㳶;酎;酏;酴;酒', '籭;醹', '清酌、清英、醴、醪1、醍2、瀝[籭]3、㳶[醹]4、醝5、酎6、酏7、酴8，酒也。', '[音義-1]：牢\n[音義-2]：體\n[音義-3]：歷\n[音義-4]：乃口\n[音義-5]：才何\n[音義-6]：治九\n[音義-7]：移\n[音義-8]：塗', '釋器', '廣雅', '6;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2264, '酪;酨;䣼;漿', '', '酪1、酨2、䣼3，漿也。', '[音義-1]：洛\n[音義-2]：昨再、祖戴二反\n[音義-3]：良', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2265, '參;䤘;醶;兮;酸;同;樂;酢', '𨣓', '醦{參}1、䤘2、醶3、䤈{兮}[𨣓]、酸、酮{同}4、〔䤕{樂}〕，酢也。', '[音義-1]：所艦\n[音義-2]：且冉\n[音義-3]：初艦\n[音義-4]：動、同二音', '釋器', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2266, '醖;佴;釀;投', '', '醖1、䤊{佴}2、釀3，酘{投}也4。', '[音義-1]：藴\n[音義-2]：汝吏\n[音義-3]：尼尙\n[音義-4]：豆', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2267, '𦯈;闇;豉', '', '䜷{𦯈}1謂之䜾{闇}2。{豉}', '[音義-1]：且林\n[音義-2]：音', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2268, '寑;䤁;鬱;辟;幽', '𦯈', '寑[𦯈]1、䤁2、鬱、𠪮{辟}3，幽也。', '[音義-1]：寢\n[音義-2]：才心\n[音義-3]：匹亦', '釋器', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2269, '䴭;䴳;卑;麰;𪍠;𨢊;𥶶', '', '䴭1、䴳2、䴽{卑}3、麰4、𪍠5、䴿{𨢊}6，麴{𥶶}也。', '[音義-1]：疾災\n[音義-2]：滑\n[音義-3]：卑\n[音義-4]：牟\n[音義-5]：苦木\n[音義-6]：蒙', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2270, '銷;奏;最;𥁕褱;扁;鹽', '', '䴛{銷}1、𪉮{奏}2、䴝{最}3、𪉸〔𪊉〕{𥁕褱}4、𪉱{扁}5，鹽也。', '[音義-1]：消\n[音義-2]：且豆\n[音義-3]：楚快\n[音義-4]：於昆\n[音義-5]：步典', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2271, '䤉;齊;𨡭䤅;最;𧖺;醢;䤎;涼;醬', '𨢡', '䤉[𨢡]1、𨣧{齊}2、𨡭䤅3、〔𨣅{最}〕、醓{𧖺}4、醢、䤎5、䣼{涼}6，醬也。', '[音義-1]：蜜\n[音義-2]：在細\n[音義-3]：莫候。頭\n[音義-4]：他感\n[音義-5]：巨出\n[音義-6]：涼', '釋器', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2272, '䪠;𩐌;䖆;䔯;烝;淹;蘫;𥁼;菹', '', '䪠1、𩐌2、䖆3、䔯4、䕄{烝}5、醃{淹}6、〔蘫〕7、〔𦽘{𥁼}〕，𦯓{菹}也8。', '[音義-1]：子兮\n[音義-2]：達內\n[音義-3]：攘\n[音義-4]：庫\n[音義-5]：旨升\n[音義-6]：於炎\n[音義-7]：藍\n[音義-8]：緇疏', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2273, '甛;代;㽑;甘', '', '甛1、甙{代}2、㽑3，甘也。', '[音義-1]：大嫌\n[音義-2]：代\n[音義-3]：大紺，又大含', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2274, '穅;䅥', '', '穅1謂之䅥2。', '[音義-1]：康\n[音義-2]：居列、居曷', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2275, '泔;潘;瀾', '灡', '泔1、潘2，瀾[灡]也。', '[音義-1]：甘\n[音義-2]：孚袁', '釋器', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2276, '稍;濯;滫', '', '潲{稍}1、濯2，滫也3。', '[音義-1]：稍\n[音義-2]：直皃\n[音義-3]：息朽', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2277, '澱;滓', '', '澱1謂之滓2。', '[音義-1]：殿\n[音義-2]：俎使', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2278, '鮏;鱢;鬱;菸;腐;㱙;折;𣨙;羶;曷;邑;饖;焦;煙;戠;臭', '餀;薉;殖;殠', '鯹{鮏}、鱢、鬱、菸1、腐、㱙、䭁{折}2、鯘{𣨙}3、羶4、𦤦{曷}[餀]5、䭂{邑}6、饖[薉]7、焦8、煙、膱{戠}[殖]9，臭[殠]也。', '[音義-1]：依譽\n[音義-2]：之舌，又之世反\n[音義-3]：乃每\n[音義-4]：書延\n[音義-5]：許戒\n[音義-6]：於劫\n[音義-7]：穢\n[音義-8]：蕉\n[音義-9]：織', '釋器', '廣雅', '10;12;15;16', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2279, '芳;奄;苾孛;堯;溓;含;薌;薰;馨;猋;坺;蕡昷;香', '蒿;香', '芳、馣{奄}1、馝〔馞〕{苾孛}2、膮{堯}[蒿]3、馦{溓}4、馠{含}5、膷{薌}[香]6、臐{薰}7、馨、䔸{猋}8、馛{坺}9、〔馩馧〕{蕡昷}，香也。', '[音義-1]：烏含\n[音義-2]：匕節，邲\n[音義-3]：許堯\n[音義-4]：虛縑\n[音義-5]：呼含\n[音義-6]：香\n[音義-7]：詡云\n[音義-8]：必昭\n[音義-9]：步曷反', '釋器', '廣雅', '4;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2280, '鼐;鼒;鑴;鏏;辱;鼎', '鬹', '鼐1、鼒2、鑴[鬹]3、鏏4、𩱜{辱}5，鼎也。', '[音義-1]：乃代\n[音義-2]：資\n[音義-3]：攜，又呼規\n[音義-4]：衞\n[音義-5]：辱', '釋器', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2281, '鬵;䰝', '', '鬵1謂之䰝2。', '[音義-1]：潛\n[音義-2]：咨應', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2282, '斄;氂;鬣;毳;髦;毛', '', '斄1、氂2、鬣、毳、髦，毛也。', '[音義-1]：貍\n[音義-2]：毛', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2283, '㲦;豪', '', '㲦1謂之毫{豪}。', '[音義-1]：汗', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2284, '尃;姌;甲;翭;惠;風;狄;羽', '彗;翟', '䎔{尃}、䎃{姌}1、翈{甲}2、翭3、𦒎{惠}[彗]4、風、狄[翟]，羽也。', '[音義-1]：奴感\n[音義-2]：狎\n[音義-3]：侯\n[音義-4]：惠', '釋器', '廣雅', '5;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2285, '𦑜;𦐊;翼', '', '𦑜1、𦐊2，翼也。', '[音義-1]：革\n[音義-2]：翅', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2286, '唐毦;並;褐;賁;豆;從氍;粟䩸;辛支;摟;罽', '𦇧', '㲥毦{唐毦}1、𣮧{並}2、毼{褐}3、𣯻{賁}4、毭{豆}5、𣯨氍{從氍}6、𣯼㲨{粟䩸}7、㲔㲍{辛支}8、氀{摟}9，罽[𦇧]也。', '[音義-1]：唐二\n[音義-2]：布莽\n[音義-3]：曷\n[音義-4]：方文\n[音義-5]：豆\n[音義-6]：足凶反。衢\n[音義-7]：粟。而恭\n[音義-8]：鮮支\n[音義-9]：力于', '釋器', '廣雅', '10', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2287, '金;鍇;鐵', '', '金、鍇，鐵也。', '', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2288, '鋈', '', '白銅謂之鋈1。', '[音義-1]：沃', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2289, '錫', '', '赤銅謂之錫。', '', '釋器', '廣雅', '', 'null', 'null');
