INSERT INTO `t_han_nga` VALUES (2291, '磺', '', '鐵朴謂之礦{磺}1。', '[音義-1]：正謂之□，音雖無，疑即礦也', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2292, '鉛磺;鏈', '', '鉛礦{鉛磺}謂之鏈1。', '[音義-1]：連', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2293, '脩;貝;佀;合;蔑;牒;鋌', '', '鏅{脩}1、鋇{貝}2、鈻{佀}3、鉿{合}4、〔鑖{蔑}〕、〔䥡{牒}〕，鋌也。', '[音義-1]：脩\n[音義-2]：貝音\n[音義-3]：似\n[音義-4]：工納、口帀', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2294, '戉;戚;斧', '', '戉1、戚，斧也。', '[音義-1]：曰', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2295, '鏦;斨', '', '鏦1謂之斨2。', '[音義-1]：初江\n[音義-2]：千羊', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2296, '鑱;鈹', '', '鑱1謂之鈹2。', '[音義-1]：讒\n[音義-2]：披', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2297, '鐫;鏨', '', '鐫1謂之鏨2。', '[音義-1]：醉全、子兗\n[音義-2]：慙，又才敢，又漸', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2298, '銍;攻', '', '銍1謂之㓚{攻}2。', '[音義-1]：誅失\n[音義-2]：工', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2299, '戈;鉊;𠛎;鍥;鏺;鎌', '', '划{戈}1、鉊2、𠛎3、鍥4、鏺5，鎌也6。', '[音義-1]：工臥\n[音義-2]：昭\n[音義-3]：鉤\n[音義-4]：結\n[音義-5]：撥\n[音義-6]：廉', '釋器', '廣雅', '', 'null', 'null');
