INSERT INTO `t_han_nga` VALUES (2301, '牒;鋂;夢;環', '疊;鋂', '䥡{牒}[疊]1、鋂2、𨮒{夢}[鋂]3，鐶{環}也4。', '[音義-1]：牒\n[音義-2]：梅\n[音義-3]：夢\n[音義-4]：環', '釋器', '廣雅', '1;3', 'null', 'null');
