INSERT INTO `t_han_nga` VALUES (2304, '籤;鏟', '', '籖{籤}1謂之鏟2。', '[音義-1]：且廉\n[音義-2]：叉展', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2305, '全;暨;釘', '丁', '栓{全}1、櫭{暨}2，釘[丁]也。', '[音義-1]：所權\n[音義-2]：巨例', '釋器', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2306, '鍤;鉥;忌;鍼', '綦', '鍤1、鉥2、䋟{忌}[綦]3，鍼也。', '[音義-1]：測夾\n[音義-2]：音述\n[音義-3]：忌', '釋器', '廣雅', '3', 'null', 'null');
