INSERT INTO `t_han_nga` VALUES (2314, '礱;碫;監諸;從氍;䃺;砥;磏;肅;礪', '厱諸', '礱、碫1、礛䃴{監諸}[厱諸]2、磫𥗫{從氍}3、磨{䃺}、砥4、磏5、〔䃤{肅}〕，礪也。', '[音義-1]：都玩\n[音義-2]：力廿。諸\n[音義-3]：足恭。衢\n[音義-4]：砥細於礪\n[音義-5]：廉', '釋器', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2315, '鈐𨬍;鉵', '', '鋡𨬍{鈐𨬍}1謂之𨰍{鉵}2。', '[音義-1]：含\n[音義-2]：彤', '釋器', '廣雅', '', 'null', 'null');
