INSERT INTO `t_han_nga` VALUES (2344, '元;櫍;甚', '砧', '杬{元}1、櫍，椹{甚}[砧]也2。', '[音義-1]：五丸\n[音義-2]：知今反。今人以爲「桑葚」，失之', '釋器', '廣雅', '3', 'null', 'null');
