INSERT INTO `t_han_nga` VALUES (2381, '戭;孑;鏝胡;孑;戛;戈;㦸;鏠;敖;孑;槈', '豪;丑', '鏔{戭}1、孑2、鏝胡3、𨥂{孑}4、戛5、戈，㦸也，其鋒{鏠}謂之𢧴{敖}[豪]6，其孑謂之㦺{槈}[丑]7。', '[音義-1]：寅\n[音義-2]：雞節\n[音義-3]：莫干\n[音義-4]：孑\n[音義-5]：古八\n[音義-6]：遨\n[音義-7]：辱', '釋器', '廣雅', '9;11', 'null', 'null');
