INSERT INTO `t_han_nga` VALUES (2386, '兜鞪;冑', '兜鍪', '兜鞪[兜鍪]1謂之冑。', '[音義-1]：牟', '釋器', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2387, '錏鍜;區后', '', '錏鍜1謂之鏂銗{區后}2。', '[音義-1]：烏牙。乎加\n[音義-2]：烏侯。侯', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2388, '機;牙', '', '機謂之牙。', '', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2389, '和;鑾;鐲;鐸;鉦;鐃;鍾;鑮;鈴', '龢;鐘', '和[龢]、鑾、鐲、鐸、鉦1、鐃、鍾[鐘]、鑮2，鈴也。', '[音義-1]：征\n[音義-2]：步各', '釋器', '廣雅', '1;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2390, '印;璽;鈕;鼻', '', '印謂之璽，鈕1謂之鼻。', '[音義-1]：尼手', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2391, '綸;組;紱;綬', '', '綸1、組、紱2，綬也。', '[音義-1]：古頑\n[音義-2]：不勿', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2392, '荼;珽;笏', '', '瑹{荼}1、珽2，笏也。', '[音義-1]：書\n[音義-2]：他冷', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2393, '録;録;㒼爰;篰', '', '箓{録}1、籙{録}2、𥲈䈠{㒼爰}3，篰也4。', '[音義-1]：禄\n[音義-2]：鹿\n[音義-3]：滿緩\n[音義-4]：部', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2394, '梡;果;橛;具;房;止;𧇽;桯;椸;俎;几', '梡;㮐;㮐', '梡1、棵{果}[梡]2、橛3、〔椇{具}〕、房、杫{止}[㮐]4、𧇽5、桯6、𤖻{椸}[㮐]7、俎，几也。', '[音義-1]：苦緩\n[音義-2]：口卵\n[音義-3]：劌\n[音義-4]：賜\n[音義-5]：巨音。今人虍下作兵，失之\n[音義-6]：餘征、餘經二音，又呈\n[音義-7]：尸賜', '釋器', '廣雅', '2;6;9', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2395, '棲;牀', '', '棲謂之牀。', '', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2396, '浴牀;柖', '銚', '浴牀謂之柖[銚]1。', '[音義-1]：紹', '釋器', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2397, '簀;笫;棧', '', '簀1，笫2，〔棧也〕。', '[音義-1]：責\n[音義-2]：側里', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2398, '樹;桃', '趙;杠', '樹、𤕷{桃}[趙]，杠也1。', '[音義-1]：江', '釋器', '廣雅', '2;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2399, '廣平;榻;枰', '', '廣平、榻1，枰也2。', '[音義-1]：他臘\n[音義-2]：平', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2400, '䟸;賁;梂;柎', '𢌳;本', '䟸[𢌳]1、橨{賁}[本]2、梂3，柎也4。', '[音義-1]：逵\n[音義-2]：墳\n[音義-3]：巨鳩、巨菊反\n[音義-4]：付于', '釋器', '廣雅', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2401, '蓐;菆', '', '蓐謂之菆1。', '[音義-1]：側求', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2402, '椸;枷', '', '箷{椸}1謂之枷2。', '[音義-1]：移\n[音義-2]：嫁', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2403, '軖;䇘', '', '軖1謂之䇘2。', '[音義-1]：狂\n[音義-2]：護', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2404, '蒸;爟;熜;苣', '', '蒸、爟1、𤑢{熜}2，炬{苣}也。', '[音義-1]：灌\n[音義-2]：青工，又摠', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2405, '龠;合;升;梪;區;釜;鍾;斞;秉;筥;稯;秅', '豆', '龠二曰合，合十曰升，升四曰梪[豆]，梪四曰區，區四曰釜，釜十曰鍾，鍾十曰斞1，斞十曰秉，秉四曰筥2，筥十曰稯3，稯十曰秅4。', '[音義-1]：庾\n[音義-2]：舉\n[音義-3]：子公\n[音義-4]：妬', '釋器', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2406, '爵;觚;觶;角;散', '', '一升曰爵，二升曰觚1，三升曰觶2，四升曰角，五升曰散3。', '[音義-1]：孤\n[音義-2]：之豉\n[音義-3]：素但', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2407, '綃;絹', '', '綃1謂之絹。', '[音義-1]：消', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2408, '縓;紅', '', '縓1謂之紅。', '[音義-1]：請絹', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2409, '纁;絳', '', '纁謂之絳。', '', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2410, '緇;早', '草', '緇謂之早[草]。', '', '釋器', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2411, '碧;縹;紺;繰;綠;緅;總;蒼;青', '𦇎', '碧、縹1、紺、繰2、𢅞{綠}3、緅4、總[𦇎]5、蒼，青也。', '[音義-1]：匹紹\n[音義-2]：早\n[音義-3]：緑\n[音義-4]：側留\n[音義-5]：采公', '釋器', '廣雅', '7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2412, '丹;彤;朱;赩;纁;絳;䞓;㙚;赫;緹;赤;赭;赤', '', '丹、彤、朱、赩1、纁、絳、䞓2、㷣{㙚}3、赫、緹4、焃{赤}5、赭6，赤也。', '[音義-1]：虛力\n[音義-2]：恥京\n[音義-3]：小營\n[音義-4]：他禮\n[音義-5]：呼狄\n[音義-6]：者', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2413, '斗;黊;翏;單;䵎;黇;𪑙/頷;黗;充;䵋;黃', '主;主', '斢{斗}[主]1、黊2、䵏{翏}3、䵐{單}4、䵎5、黇6、黅{𪑙/頷}7、𪎶{黗}8、𪎽{充}[主]9、䵋10，黃也。', '[音義-1]：他口\n[音義-2]：乎馬、乎卦\n[音義-3]：老\n[音義-4]：齒善\n[音義-5]：他丸\n[音義-6]：他廉\n[音義-7]：今\n[音義-8]：屯\n[音義-9]：統音。亦有本作𪎵，口浪\n[音義-10]：下悔，又于鄙', '釋器', '廣雅', '1;10', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2414, '䮗;皛;晳;皢;爵;靃;皚;旳;并曷;皤;皎;翯;潔;白', '敫;翯;艵曷', '皔{䮗}1、皛2、晳3、皢4、皭{爵}[敫]5、皬{靃}[翯]6、皚7、的{旳}、皏㿣{并曷}[艵曷]8、皤9、皎10、翯11、潔，白也。', '[音義-1]：汗\n[音義-2]：乎了，又乎灼反\n[音義-3]：制\n[音義-4]：呼了\n[音義-5]：在爵\n[音義-6]：乎俈\n[音義-7]：牛哀\n[音義-8]：普幸。呼曷\n[音義-9]：布何、步何\n[音義-10]：古了\n[音義-11]：學', '釋器', '廣雅', '5;6;9', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2415, '黝;宛;黯;黶;默;䵤;弋;早;𦎣;涅;玄;儵;緇;墨;黸;黮;蕉;黎;黔;蠅;黴;墨;䵳;黚;鬒;黳;黗;黲;黟;乙;黑', '𪑲;墨;草;焦/䩌;驪;薶', '黝1、黦{宛}[𪑲]2、黯3、黶4、默[墨]5、䵤6、黓{弋}7、早[草]8、𦎣9、涅10、玄、儵、緇11、墨、黸12、黮13、蕉[焦/䩌]14、黎[驪]、黔15、䵴{蠅}16、黴17、䆀{墨}[薶]18、䵳19、黚20、縝{鬒}21、黳22、黗23、黲24、黟25、〔䵝{乙}〕，黑也。', '[音義-1]：於糾、於柳\n[音義-2]：於物\n[音義-3]：烏減\n[音義-4]：烏點\n[音義-5]：墨\n[音義-6]：工典\n[音義-7]：弋\n[音義-8]：徂早\n[音義-9]：於閒、於真\n[音義-10]：乃結\n[音義-11]：淄\n[音義-12]：力胡\n[音義-13]：勑感、都甚二反\n[音義-14]：焦\n[音義-15]：琴、巨廉\n[音義-16]：已證\n[音義-17]：明飢\n[音義-18]：亡再\n[音義-19]：烏外\n[音義-20]：古闇\n[音義-21]：之忍\n[音義-22]：於兮\n[音義-23]：他孫\n[音義-24]：七敢\n[音義-25]：伊', '釋器', '廣雅', '2;5;8;17;18;22', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2416, '槥;櫝;櫬;𣚑;柩;棺;當;和', '䘟;裹', '槥1、櫝2、櫬3、𣚑[䘟]4、柩，棺也，其當謂之𤖱{和}[裹]5。', '[音義-1]：衞\n[音義-2]：讀\n[音義-3]：楚覲\n[音義-4]：導\n[音義-5]：禾', '釋器', '廣雅', '4;8', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2417, '昆屯;餅', '𣤿屯', '〔餛飩{昆屯}[𣤿屯]，餅也。〕', '', '釋器', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2418, '䋣弱;鉅黍;弓', '歫翥', '〔繁弱{䋣弱}、鉅黍[歫翥]。弓也。〕', '', '釋器', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2419, '谿子;弩', '', '〔谿子，弩也。〕', '', '釋器', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2420, '休流;扶持;下謀;雲門;六莖;五英;大章;簫韶;大夏;大護;大武;勺;大予', '酌', '休流、扶持、下謀、雲門、六䪫{六莖}1、五韺{五英}2、大章3、簫韶4、〔大夏〕5、大頀{大護}6、大武7、勺[酌]8、大予9。', '[音義-1]：莖。顓頊樂\n[音義-2]：英。帝俈樂\n[音義-3]：堯樂\n[音義-4]：舜樂\n[音義-5]：禹樂\n[音義-6]：湯樂\n[音義-7]：武王樂\n[音義-8]：只藥。周公樂也，斟酌文 武之道\n[音義-9]：漢明帝 永平三年秋八月戊辰，改大樂爲大予樂', '釋樂', '廣雅', '12', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2421, '足鼓;植鼓;縣鼓;雷鼓;靈鼓;路鼓;鼖鼓;鼛鼓;晉鼓;𧒕鼓;鼙鼓;鞀鼓;應;朄;搏拊', '皋鼓', '足鼓1、植鼓2、縣鼓3、雷鼓4、靈鼓5、路鼓6、鼖鼓7、鼛鼓[皋鼓]8、晉鼓9、鼜鼓{𧒕鼓}10、鼙鼓11、鞀鼓12、應、朄13、搏拊14。', '[音義-1]：夏后氏鼓\n[音義-2]：見禮明堂記。詩「植我鞉鼓」\n[音義-3]：禮記曰「周縣鼓」，鄭注云「縣於栒虡也」\n[音義-4]：周禮「雷鼓，鼓神祀」，鄭注曰「雷鼓八面」\n[音義-5]：周禮「靈鼓，鼓社祭」，鄭注曰「靈鼓六面也」\n[音義-6]：周禮「路鼓,鼓鬼享」，鄭注「路鼓四面」\n[音義-7]：周禮「鼖鼓，鼓軍事」，鄭注「大鼓也，長八尺」\n[音義-8]：周禮「鼛鼓，鼓役事」，考工記「長尋有四尺也」\n[音義-9]：周禮「晉鼓，鼓金奏」，鄭注「長六尺六寸也」\n[音義-10]：周禮「凡軍旅，夜鼓鼜」，鄭云「夜戒守鼓」。音「造次」之次\n[音義-11]：周禮「旅帥執鼙」\n[音義-12]：周禮「小師之職掌鼓鼗」。釋名云「鞀，導也」\n[音義-13]：詩云「應朄縣鼓」\n[音義-14]：禮記「拊搏」，鄭注「以韋爲之，充之以糠，形如小鼓，以節樂」', '釋樂', '廣雅', '8', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2422, '琴;鳴廉;脩營;藍脅;號鍾;空中;自鳴;焦尾', '攸況;濫協;號鐘', '神農氏琴長三尺六寸六分，上有五弦，曰宮商角徵羽。文王增二弦，曰少宮、〔少〕商。鳴廉、脩營[攸況]。藍脅[濫協]、號鍾[號鐘]、空中、自鳴、焦尾。', '', '釋樂', '廣雅', '3;4;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2423, '瑟', '', '伏羲氏瑟長七尺二寸，上有〔二十七〕弦1。', '[音義-1]：見世本', '釋樂', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2424, '柷', '', '柷，象桶1，方三尺五寸，深尺八寸，四角有陞{升}[登]鼠2。', '[音義-1]：動\n[音義-2]：升', '釋樂', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2425, '敔', '', '敔1，象伏虎，背上有二十七刻。', '[音義-1]：魚呂', '釋樂', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2426, '鍾', '鐘', '倕[垂]氏鍾[鐘]十六枚1。', '[音義-1]：世本「倕造鍾」。倕，舜臣', '釋樂', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2427, '磬', '', '毋句氏磬十六枚1。', '[音義-1]：世本「毋句作磬」。毋句，堯臣也', '釋樂', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2428, '員', '壎', '塤{員}[壎]1，象稱錘，以土爲之，有六孔2。', '[音義-1]：許圓\n[音義-2]：古史考曰：「有塤尙矣。周幽王時，暴辛公善塤」', '釋樂', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2429, '䶵', '', '䶵1，以竹爲之，長尺四寸，有八孔，〔一孔上出寸三分〕2。', '[音義-1]：池\n[音義-2]：前有一孔，上有三孔，後有四孔，頭有一孔', '釋樂', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2430, '籟;簫', '', '籟1謂之簫，大者二十四管，小者十六管，有底。', '[音義-1]：賴', '釋樂', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2431, '笙', '', '笙，以瓠爲之，十三管，宮管在左方。', '', '釋樂', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2432, '竽', '', '竽，象笙，三十六管，宮管在中央。', '', '釋樂', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2433, '龠;笛', '', '龠謂之笛，有七孔。', '', '釋樂', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2434, '管', '', '管，象䶵1，長尺圍寸，〔有〕六孔，無底。', '[音義-1]：池', '釋樂', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2435, '佾', '䏌', '{佾}[䏌]天子樂八佾，諸公六佾，諸侯四佾。', '', '釋樂', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2436, '慟;歈;謳;詠;吟;歌', '', '㗢{慟}1、歈2、謳、詠、吟，歌也。', '[音義-1]：洞\n[音義-2]：頭', '釋樂', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2437, '大初;大始;大素;九頭;五龍;攝提;合雒;連通;序命;循蜚;因提;禪通;疏訖', '合洛;循飛', '太初{大初}，氣之始也，生於酉仲1，清濁未分也。太始{大始}，形之始也，生於戌仲，清者爲精、濁者爲形也。太素{大素}，質之始也，生於亥仲，已有素朴而未散也。三氣相接，至於子仲，剖判分離，輕清者上爲天，重濁者下爲地，中和爲萬物2。天地辟設人皇以來，至魯哀公十有四年，積二百七十六萬歲，分爲十紀，曰九頭、五龍、攝提、合雒[合洛]，連通、序命、循蜚[循飛]、因提、禪通、疏訖3。', '[音義-1]：八月酉仲，號爲太初，屬雄；九月戌仲，號爲太始，屬雌\n[音義-2]：詩緯曰：「陽本爲雄，陰本爲雌，物本爲魂。雄雌俱行三節，而雄合物魂，號曰太素也。三氣未分别，號曰渾淪」\n[音義-3]：帝王世紀：「自天地闢設人皇以來，迄魏 咸熙二年，凡二百七十二代，積二百七十六萬七百四十五年，分爲十紀，一曰九頭，至十曰疏訖」', '釋天', '廣雅', '7;10', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2438, '昦天;陽天;赤天;朱天;成天;幽天;玄天;變天;鈞天', '', '東方昦天、東南陽天、南方赤天、西南朱天、西方成天、西北幽天、北方玄天、東北變天、中央鈞天。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2439, '天度', '', '{天度}天圜廣南北二億三萬三千五百里七十五步，東西短減四步，周六億十萬七百里二十五步。從地至天，一億一萬六千七百八十七里〔半〕，下度地之厚，與天高等。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2440, '七宿度', '', '{七宿度}東方七宿，七十五度；南方七宿，百一十二度；西方七宿，八十度；北方七宿，九十八度四分度之一。四方凡三百六十五度四分度之一。一度二千九百三十二里，二十八宿閒相距積一百七萬九百一十三里，徑三十五萬六千九百七十〔一〕里。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2441, '條風;明庶風;清明風;景風;涼風;閶闔風;不周風;廣莫風', '調風/融風', '東北條風[調風/融風]、東方明庶風、東南清明風、南方景風、西南涼風、西方閶闔風、西北不周風、北方廣莫風。', '', '釋天', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2442, '昌光;握譽;可錯;持勝;履予', '', '昌光、握譽、可錯、持勝、履予。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2443, '格擇;旬始;天狗;枉矢;氛;祲;倍;譎;冠;珥', '格澤;背;鐍/璚/穴', '格擇[格澤]1、旬始、天狗、枉矢、氛、祲2、倍[背]、譎[鐍/璚/穴]、冠、珥。', '[音義-1]：乎格。宅\n[音義-2]：子枕', '釋天', '廣雅', '1;7;8;', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2444, '赤霄;濛澒;朝霞;正陽;淪陰;沆瀣;列缺;倒景', '厖鴻;陯陰', '赤霄、濛澒[厖鴻]1、朝霞、正陽、淪陰[陯陰]2、沆瀣3、列缺、倒景。', '[音義-1]：莫孔。乎孔\n[音義-2]：倫\n[音義-3]：乎朗。乎戒', '釋天', '廣雅', '2;5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2445, '歉;饑;饉;㱂;大侵', '荒', '一穀不升曰歉1。二穀不升曰饑。三穀不升曰饉。四穀不升曰㱂[荒]2。五穀不升曰大侵。', '[音義-1]：苦簟反\n[音義-2]：康', '釋天', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2446, '靈威仰;赤熛怒;含樞紐;白招歫;叶光紀', '', '蒼曰靈威仰。赤曰赤熛怒。黃曰含樞紐。白曰白招矩{白招歫}。黑曰叶光紀。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2447, '青道;黃道;赤道;白道;黑道', '', '立春、春分，東從青道二出黃道東，交於房二度中；立夏、夏至，南從赤道二出黃道南，交於七星四度中；立秋、秋分，西從白道二出黃道西，交於胃十二度中；立冬、冬至，北從黑道二出黃道北，交於虛二度中。四季之月，還從黃道。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2448, '月𧘂', '', '{月𧘂}正月不溫，七月不涼。二月不風，八月雷不藏。三月風不衰，九月無降霜。四月雷不見，十月蟄蟲行。五月陽暑不蒸，十一月不合凍。六月浮雲不布，十二月草不喪。七月白露不降，正月有微霜。八月浮雲不歸，二月雷不行。九月物不凋1，三月草木傷。十月流火不定，四月䖵蟲不育。十一月寒不降，五月雨雹。十二月萌類不見，六月五穀不實。', '[音義-1]：彫', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2449, '營室;東壁;奎;婁;胃;昴;畢;觜觿;參;東井;輿鬼;柳;七星;張;翼;軫;角;亢;貫氐;房;心;尾;箕;斗;牽牛;須女;虛;危', '嬃女', '日月五星行黃道，始營室、東壁、奎、婁、胃之陽，入昴、畢閒，行觜觿、參之陰，度東井、輿鬼，行柳、七星、張、翼、軫之陰，入角、〔亢〕閒，貫氐、房，出心、尾、箕之陰，入斗、牽牛閒，行須女[嬃女]、虛、危之陽，復至營室。', '', '釋天', '廣雅', '26', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2450, '离;馮夷;奇相;鬽;賁羊;罔象;畢方;游光;清明', '馮遲;羒羊;必方', '山神謂之离1。河伯謂之馮夷[馮遲]。江神謂之奇相。物神謂之鬽。土神謂之羵羊{賁羊}[羒羊]2。水神謂之冈象{罔象}。木神謂之畢方[必方]。火神謂之游光。金神謂之清明。', '[音義-1]：勑支\n[音義-2]：墳', '釋天', '廣雅', '2;5;7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2451, '朱明;燿靈;東君;日', '', '朱明、曜靈{燿靈}、東君，日也。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2452, '夜光;月', '', '夜光謂之月。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2453, '天河;天漢', '', '天河謂之天漢。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2454, '震;霣;追;并;雷', '啍;旁', '震、霣1、䨨{追}[啍]2、𩂦{并}[旁]，雷也。', '[音義-1]：于慜\n[音義-2]：追', '釋天', '廣雅', '3;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2455, '雲;運;雨;榘', '秬', '〔雲〕，運也；雨，榘[秬]也1。', '[音義-1]：俱雨反', '釋天', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2456, '晷;柱;景', '', '晷、柱，景也。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2457, '飛廉;荓翳;豐隆', '蜚螊', '風師謂之飛廉[蜚螊]。雨師謂之荓翳1。雲師謂之豐隆。', '[音義-1]：蒲形', '釋天', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2458, '羲和;望舒', '朢朔', '日御謂之羲和。月御謂之望舒[朢朔]。', '', '釋天', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2459, '青龍;天一;大侌;大歲', '', '青龍、天一、太陰{大侌}，太歲{大歲}也。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2460, '榦枝', '', '{榦枝}甲乙爲榦。榦者，日之神也。寅卯爲枝。枝〔者〕，月之靈也。甲剛乙柔、丙剛丁柔、戊剛己柔、庚剛辛柔、壬剛癸柔。甲齊、乙東夷、丙楚、丁南夷、戊魏、己韓、庚秦、辛西夷、壬衛、癸北夷、子周、丑狄、寅楚、卯鄭、辰晉、巳衞、午秦、未宋、申齊、酉魯、戌趙、亥燕。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2461, '星宿', '', '{星宿}角、亢，鄭；氐、房、心，宋；尾、箕，燕；斗、牽牛、嬃女，吳〔越〕；虛、危，齊；營室、東壁，衞；奎、婁，魯；胃、昴、畢，趙；觜〔觿〕、參，魏；東井、輿鬼，秦；柳、七星、張，周；翼、軫，楚。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2462, '樞;旋;機;權;衡;開陽;爲揺光', '', '北斗七星：一爲樞、二爲旋、三爲機、四爲權、五爲衡、六爲開陽、七爲揺光。樞爲雍州，旋爲冀州，機爲青、兖州，權爲徐、揚州，衡爲荆州，開陽爲梁州，揺光爲豫州。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2463, '歲星;重華;應星', '', '歲星謂之重華，或謂之應星1。', '[音義-1]：木宿也', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2464, '營惑;罰星;執法', '䁝惑', '營惑[䁝惑]謂之罰星，或謂之執法1。', '[音義-1]：火宿也', '釋天', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2465, '鎭星;地侯', '', '鎭星謂之地侯1。', '[音義-1]：土宿也', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2466, '大白;長庚;大囂', '', '太白{大白}謂之長庚，或謂之大囂1。', '[音義-1]：金宿也。晨見東方爲啟明，昏見西方爲長庚', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2467, '辰星;爨星;兔星;鉤星', '', '辰星謂之爨星，〔或謂之〕兔星，或謂之鉤星1。', '[音義-1]：水宿也', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2468, '大角;棟星', '', '大角謂之棟星。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2469, '天宮;紫宮', '', '天宮謂之紫宮。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2470, '參旗;天弓', '', '參旗〔謂之天弓〕。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2471, '參伐;大辰', '', '參伐謂之大辰。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2472, '大微;天廷', '', '太微{大微}〔謂之天廷〕。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2473, '房;明堂', '', '房謂之明堂。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2474, '嬃女;婺女', '', '嬃女謂之婺女。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2475, '參;實沈', '', '參謂之實沈。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2476, '昴;旄頭', '', '昴謂之旄頭。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2477, '東井;𨿡首;張;𨿡尾', '', '東井謂之鶉首{𨿡首}，張謂之鶉尾{𨿡尾}。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2478, '軫;烏帑', '', '軫謂之鳥孥{烏帑}。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2479, '營室;豕韋', '', '營室謂之豕韋。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2480, '北辰;燿魄', '', '北辰謂之曜魄{燿魄}。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2481, '妃星;大當', '', '妃星謂之大當。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2482, '天淵;三淵;紐茲', '', '天淵謂之三淵。天淵謂之紐兹{紐茲}。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2483, '軒轅;路寢', '路寑', '軒轅謂之路寢[路寑]。', '', '釋天', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2484, '輿鬼;天廟', '', '輿鬼謂之天廟。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2485, '圓丘;大壇', '', '圓丘、大壇，祭天也。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2486, '方澤;大折', '', '方澤、大折，祭地也。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2487, '大昭', '', '大昭，祭四時也。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2488, '坎壇', '', '坎壇，祭寒暑也。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2489, '王宮', '', '王宮，祭日也。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2490, '夜明', '', '夜明，祭月也。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2491, '幽禜', '', '幽禜，祭星也。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2492, '雩禜', '', '雩禜，祭水旱也。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2493, '四坎壇', '', '四坎壇，祭四方也。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2494, '廟;祧;壇;場;鬼', '', '廟、祧、壇、場、鬼，祭先祖也。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2495, '昔;曹;卒;䬽;婁;臘;祓;絜;餟;祼;軷;䄟;𥛻;夌;禖;禪;祧;醮;禬;卷;望;𩴪;祥;禫;禱;禜;禳;祭', '', '䄍{昔}1、䄚{曹}2、祽{卒}3、祱{䬽}4、䄛{婁}5、臘、祓、禊{絜}6、餟7、祼8、軷9、䄟10、𥛻11、祾{夌}12、禖13、禪、祧14、醮15、禬16、飬{卷}、望、禨{𩴪}17、祥、禫、禱18、禜、禳，祭也。', '[音義-1]：士駕反\n[音義-2]：曹\n[音義-3]：七外\n[音義-4]：税\n[音義-5]：力侯切\n[音義-6]：乎計\n[音義-7]：加税\n[音義-8]：古奐反\n[音義-9]：步末\n[音義-10]：毳\n[音義-11]：布庚\n[音義-12]：陵，又力登\n[音義-13]：梅\n[音義-14]：他聊\n[音義-15]：子咲反\n[音義-16]：古外\n[音義-17]：巨衣\n[音義-18]：倒', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2496, '臘;獵/接;昔;索;清祀;嘉平;大昔;臘', '', '臘，〔□{獵/接}也〕。〔䄍{昔}〕，索也。夏曰清祀1，殷曰嘉平2，周曰大䄍{大昔}，秦曰臘。', '[音義-1]：以清潔而祭祀\n[音義-2]：嘉，善也；平，成也。以歲終萬物善成，就而報其功', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2497, '鬯;薰;茝蘭;蕭;艾', '', '天子祭以鬯，諸侯以薰，卿、大夫以茝蘭，士以蕭，庶人〔以〕艾。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2498, '肆兵', '肄兵', '{肆兵}[肄兵]王者以四時畋，以奉宗廟，因簡戎事。刈草爲防，敺1而射之，不題禽，不垝[恑]遇2，不捷草，越防不追。天子取三十焉，一爲乾梪，二爲賓客，三曰充君之庖，其餘以與士。', '[音義-1]：欺于\n[音義-2]：車美', '釋天', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2499, '旞;旌;旗', '', '全羽曰旞。析羽曰旌。熊虎曰旗。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2500, '杠', '', '天子杠高九仞。諸侯七仞。〔卿〕大夫五仞。〔士三仞〕。', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2501, '游', '', '{游}天子十二斿，至地。諸侯九斿，至軫。卿大夫七斿，至軹1。士三斿，至肩。', '[音義-1]：紙', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2502, '年;稔;秋;穀熟', '', '〔年、稔、秋，穀熟也。〕', '', '釋天', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2503, '四海九州', '', '{四海九州}神農度四海內，東西九十萬里，南北八十一萬里。帝堯所治九州，地二千四百三十萬八千二十四頃，其墾者九百一十萬八千二十四頃。夏禹所治四海內，地東西二萬八千里、南北二萬六千里，出水者八千里，受水者八千里。', '', '釋地', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2504, '湖;藪;陂;塘;都;㽘;斥澤;埏;衍;皋;沼;池', '唐;沆;㚖', '湖、藪、陂、塘[唐]、都、㽘[沆]1、斥澤、埏2、衍、皋[㚖]3、沼，池也。', '[音義-1]：古朗\n[音義-2]：延\n[音義-3]：古豪', '釋地', '廣雅', '4;6;10', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2505, '都野;孟豬;彭蠡;少原;振澤;諸毗;沛澤;雷澤;幽都', '孟都/望諸', '都野、孟豬[孟都/望諸]、彭蠡、少原、振澤、諸毗1、沛澤2、雷澤、幽都。', '[音義-1]：符夷\n[音義-2]：盃妹', '釋地', '廣雅', '2;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2506, '瓊支;瑾瑜;昭華;白珩;琁;璜;弁和;璵璠;垂棘;碧黸;藍田;琜𧶠;琬;琰;璐;唐;璑;囷;赤瑕', '苕華', '瓊支、瑾瑜、昭華[苕華]、白珩1、璇{琁}2、璜、弁和、璵璠、垂棘、碧瓐{碧黸}、藍田、琜瓄{琜𧶠}3、琬、琰、璐4、瑭{唐}5、璑、㻒{囷}6、赤瑕。', '[音義-1]：衡\n[音義-2]：旋\n[音義-3]：來瀆\n[音義-4]：音路\n[音義-5]：唐\n[音義-6]：渠慜', '釋地', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2507, '水精;石英;𤥗離;珊瑚;玟瑰;夜光;隨侯;虎魄;金精;璣', '石瑛', '水精謂之石英[石瑛]。瑠璃{𤥗離}、珊瑚、玟瑰1、夜光、隋侯{隨侯}2、虎魄、金精、璣。', '[音義-1]：梅。古回\n[音義-2]：隋侯見虵傷治之，後虵銜珠以報', '釋地', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2508, '蜀石;碝;玟;車渠;馬匘;武夫;琨吾;珉石;咸力;珂', '玪𤨙', '蜀石、碝1、玟2、硨磲{車渠}3、碼碯{馬匘}4、武夫、琨珸{琨吾}5、瑉石{珉石}、瑊玏{咸力}[玪𤨙]6、珂。', '[音義-1]：而兗\n[音義-2]：忙巾\n[音義-3]：車渠\n[音義-4]：馬。奴道\n[音義-5]：昆吾\n[音義-6]：古咸，又咸。勒', '釋地', '廣雅', '9', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2509, '合;敝付;玃如;相繇;化虵', '', '東方有魚焉，如鯉、六足、鳥尾，其名曰鮯{合}1。南方有鳥焉，三首、六目、六足、三翼，其名曰鷩𩿧{敝付}2。西方有獸焉，如鹿、白尾、馬足、人手、四角，其名曰玃如3。北方有民焉，九首、虵身，其名曰相繇4。中央有虵焉，人面、豺身、鳥翼、虵行，其名曰化虵。此五方之異物也。', '[音義-1]：古合\n[音義-2]：必舌。付于反\n[音義-3]：九縳\n[音義-4]：由', '釋地', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2510, '鄰;朋;里;邑;都;師', '', '八家爲鄰，三鄰爲朋，三朋爲里，五里爲邑，十邑爲都，十都爲師，州十有二師焉1。', '[音義-1]：見尙書', '釋地', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2511, '㽥;𤲬;堅;甄;埴;塿;㙚;壚;墳;陚;田;地;土', '堅;肥', '㽥1、𤲬2、堅、甄[堅]3、埴4、塿5、㙚6、壚7、墳[肥]、陚8、田、地，土也。', '[音義-1]：柔\n[音義-2]：奴戈\n[音義-3]：古賢\n[音義-4]：時識\n[音義-5]：樓\n[音義-6]：息營\n[音義-7]：來乎\n[音義-8]：付', '釋地', '廣雅', '4;9', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2512, '耦;㹃;鈂;講;異;突;葘;穮;披;合;䥯;掊;局;暵;𤛿;營;墾;𦓯;包;耕', '鎣;掊', '耦、㹃1、𣜣{鈂}2、耩{講}3、𦔜{異}4、𦔅{突}5、䎩{葘}6、藨{穮}7、耚{披}8、耠{合}9、䥯10、䎧{掊}11、䎤{局}12、䎯{暵}13、犁{𤛿}、營[鎣]、墾、𦓯、〔𡂟{包}[掊]〕，耕也。', '[音義-1]：沸\n[音義-2]：才心\n[音義-3]：講\n[音義-4]：弋\n[音義-5]：突\n[音義-6]：側基\n[音義-7]：布苗\n[音義-8]：披\n[音義-9]：乎荅\n[音義-10]：碑\n[音義-11]：步侯\n[音義-12]：局\n[音義-13]：漢', '釋地', '廣雅', '16;19', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2513, '肖;曼;堫;啻;奄;責;埶;植;樹;耆;㵺;投;蒔;種', '', '𦓴{肖}1、𦔔{曼}2、䎫{堫}3、䎮{啻}4、䎨{奄}5、耫{責}6、埶7、植、樹、𦔌{耆}8、㵺9、投、蒔10，種也11。', '[音義-1]：所交反\n[音義-2]：亡旦\n[音義-3]：叉江\n[音義-4]：他戾\n[音義-5]：一劫\n[音義-6]：壯責\n[音義-7]：魚世\n[音義-8]：祇\n[音義-9]：派\n[音義-10]：時志\n[音義-11]：之用', '釋地', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2514, '原;端;大鹵;大原', '', '原，端也。大鹵，大原也。', '', '釋地', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2515, '柲邱', '', '邱上有木爲柲邱1。', '[音義-1]：祕', '釋邱', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2516, '邱', '', '小陵曰邱。', '', '釋邱', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2517, '𨸏', '', '無石曰峊{𨸏}。', '', '釋邱', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2518, '陵;京;阿', '', '四隤1曰陵。四起曰京。曲京曰阿。', '[音義-1]：大迴反', '釋邱', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2519, '𨸏;細', '', '峊{𨸏}，細也。', '', '釋邱', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2520, '藏;壙', '', '藏謂之壙。', '', '釋邱', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2521, '墳;俞;采;番;良;壟;培塿;邱;陵;墓;封;冢', '宰;墳;附婁;丘', '墳、堬{俞}1、埰{采}[宰]2、墦{番}[墳]3、埌{良}4、壟、培塿[附婁]5、邱[丘]、陵、墓、封，冢也。', '[音義-1]：以珠\n[音義-2]：采\n[音義-3]：煩\n[音義-4]：浪\n[音義-5]：步苟。來苟', '釋邱', '廣雅', '3;4;7;8', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2522, '宅;垗;塋;域;葬地', '', '宅、垗1、塋2、域，葬地也。', '[音義-1]：兆\n[音義-2]：營', '釋邱', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2523, '威夷;阻;陂;阤;險', '倭遟', '隇䧅{威夷}[倭遟]1、阻、陂、阤，險也。', '[音義-1]：威夷', '釋邱', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2524, '隒;澳;辱;厈;浦;潯;賓;潨;湄;埒;汜;墳;漘;卑;涘;垠;厓', '瀕;坋;瀕', '隒1、澳2、辱、厈、浦、潯、濱{賓}[瀕]、潨3、湄、浖{埒}4、汜、墳[坋]、漘5、陴{卑}[瀕]、涘、垠6，厓也。', '[音義-1]：檢、斂二音\n[音義-2]：於六\n[音義-3]：藂\n[音義-4]：劣\n[音義-5]：脣\n[音義-6]：吳根', '釋邱', '廣雅', '7;12;14', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2525, '叜;尻;陬;隅;隈', '陬', '廋{叜}[陬]1、㘲{尻}2、陬、隅，隈也。', '[音義-1]：所流\n[音義-2]：菊', '釋邱', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2526, '茮邱', '就邱', '土高四墮曰椒邱{茮邱}[就邱]。', '', '釋邱', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2527, '岱宗;泰山', '大山', '岱宗謂之泰山[大山]。', '', '釋山', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2528, '天柱;靃山', '', '天柱謂之霍山{靃山}。', '', '釋山', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2529, '華山;大華', '崋山;大崋', '華山[崋山]謂之太華{大華}[大崋]。', '', '釋山', '廣雅', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2530, '常山;恆山', '', '常山謂之恆山。', '', '釋山', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2531, '外方;嵩高', '', '外〔方〕謂之嵩〔高〕。', '', '釋山', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2532, '句婁;衡山', '', '岣嶁{句婁}1謂之衡山。', '[音義-1]：古候。力候', '釋山', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2533, '蜀山;𡼐山', '', '蜀山謂之㟭山{𡼐山}。', '', '釋山', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2534, '吳山;開山', '', '吳山謂之開山。', '', '釋山', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2535, '薄落;开頭', '欂櫨', '薄落[欂櫨]謂之开頭1。', '[音義-1]：牽', '釋山', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2536, '山;產;石;䄷', '碩', '土高有石，山。山，產也。石，䄷[碩]也1。', '[音義-1]：石', '釋山', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2537, '冢;腫', '', '冢，腫也。', '', '釋山', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2538, '嶽;确', '獄', '嶽[獄]，确也1。', '[音義-1]：學', '釋山', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2539, '山數', '', '{山數}凡天下名山，五千二百七十。出銅之山，四百六十有七。出鐵之山，三千六百有九。', '', '釋山', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2540, '崐崘虛;閬風;版桐;玄圃', '', '崐崘虛有三山：閬風、板桐{版桐}、玄圃，其高萬一千一百一十里一十四步二尺六寸。', '', '釋山', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2541, '𣶒;畎;𨼬;豀;谷', '', '𣶒1、畎2、嶰{𨼬}3、豀，谷〔也〕。', '[音義-1]：烏元\n[音義-2]：古犬\n[音義-3]：乎買', '釋山', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2542, '濆泉;直泉;涌泉', '噴泉', '濆泉[噴泉]1，直泉也。直泉，涌泉也。', '[音義-1]：墳', '釋水', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2543, '州;居', '凥', '州，居[凥]也。', '', '釋水', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2544, '陼;處', '', '陼，處也。', '', '釋水', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2545, '沚;止', '', '沚，止也。', '', '釋水', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2546, '𣹡;至', '', '𣹡1，至也。', '[音義-1]：直尸', '釋水', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2547, '海;晦', '', '海，晦也。', '', '釋水', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2548, '江;貢', '', '江，貢也。', '', '釋水', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2549, '河;何', '', '河，何也。', '', '釋水', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2550, '淮;均', '', '淮，均也。', '', '釋水', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2551, '濟;濟', '', '濟，濟也。', '', '釋水', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2552, '伊;因', '', '伊，因也。', '', '釋水', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2553, '洛;繹', '', '洛，繹也。', '', '釋水', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2554, '廛;理', '', '瀍{廛}，理也。', '', '釋水', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2555, '澗;閒', '', '澗，閒也。', '', '釋水', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2556, '漢;達', '', '漢，達也。', '', '釋水', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2557, '渭;渭', '', '渭，𢔥{渭}也1。', '[音義-1]：謂', '釋水', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2558, '汝;汝', '', '汝，汝也。', '', '釋水', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2559, '涇;徑', '', '涇，徑也。', '', '釋水', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2560, '湍;瀨', '', '湍，瀨也。', '', '釋水', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2561, '磯;磧', '', '磯1，磧也2。', '[音義-1]：機\n[音義-2]：七旳', '釋水', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2562, '洪;洫;畎;遂;肙;埂;溝;渠;川;瀆;欿;窞;科;臽;阬', '𨺅;臽;窠', '䧆{洪}1、洫、畎、㴚{遂}[𨺅]2、䧎{肙}、埂3、溝、渠、川、瀆、欿[臽]、窞4、科[窠]、臽5，坑{阬}也。', '[音義-1]：洪\n[音義-2]：遂\n[音義-3]：古杏反\n[音義-4]：徒感\n[音義-5]：陷', '釋水', '廣雅', '4;11;13', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2563, '湋;潭;淵', '', '湋、潭，淵〔也〕。自三仞以上，二億三萬三千五百五十有九。', '', '釋水', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2564, '清滌;浮箸;水', '', '清滌、浮著{浮箸}，水也。', '', '釋水', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2565, '陽侯;𣾭;汏;波', '', '陽侯、𣾭1、汏2，波也。', '[音義-1]：大高\n[音義-2]：太', '釋水', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2566, '舟;舫;榜;船', '舫', '舟、舫、榜[舫]，船也。', '', '釋水', '廣雅', '3', 'null', 'null');
