INSERT INTO `t_han_nga` VALUES (2735, '豐;蕘;蕪菁', '', '蘴{豐}、蕘1，蕪〔菁〕也2。', '[音義-1]：上豐，又嵩。下女交反，世人以此爲「芻蕘」之蕘，未知孰是\n[音義-2]：精', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2736, '匏;瓠', '', '匏，瓠也。', '', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2737, '冬瓜;立', '', '冬瓜，𦶍{立}也1。', '[音義-1]：及', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2738, '水芝;瓜;兼', '', '水芝，瓜也，其子謂之𤬓{兼}1。', '[音義-1]：力占', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2739, '龍蹏;虎掌;羊骹;兔頭;桂支;蜜筩;𥁕屯;貍頭;白扁;無餘;縑;瓜', '', '龍蹏、虎掌、羊骹、兔頭、桂支、蜜筩、㼔㼊{𥁕屯}1、貍頭、白㼐{白扁}2、無餘、縑，瓜屬也。', '[音義-1]：温。徒昆\n[音義-2]：步田', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2740, '狗蝨;鉅勝;縢宏;胡麻', '', '狗蝨、鉅勝、藤宏{縢宏}，胡麻也。', '', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2741, '芥蒩;水蘇', '', '芥蒩，水蘇也。', '', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2742, '當道;馬舄;芣苢', '', '當道，馬舄也。{芣苢}', '', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2743, '朝菌;朝生', '', '朝菌，朝生也。', '', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2744, '徐長卿;鬼督郵', '', '徐長卿1，鬼督郵也。', '[音義-1]：丁丈反', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2745, '丁父;附支;通艸', '', '〔丁父〕、附支，蓪草{通艸}也。', '', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2746, '鬼箭;神箭', '', '鬼箭，神箭也。', '', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2747, '缺盆;陸英;苺', '', '蒛盆{缺盆}、陸英，苺也。', '', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2748, '海羅;海藻', '', '海羅，海藻也。', '', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2749, '地葵;地膚', '', '地葵，地𧀴{地膚}也。', '', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2750, '續毒;狼毒', '', '〔續毒〕，狼毒也。', '', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2751, '恐;苹;閬碭', '', '𦶐{恐}1、苹2，䕞𦿆{閬碭}也3。', '[音義-1]：去用，又去拱\n[音義-2]：平\n[音義-3]：浪宕', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2752, '艮;鉤吻', '', '茛{艮}1，鉤吻也。', '[音義-1]：古恨', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2753, '昔邪;烏韭;垣衣', '', '昔邪，烏韭也。在屋曰昔邪，在牆曰垣衣。', '', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2754, '馬䪥;荔', '', '馬䪥，荔也。', '', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2755, '水衣;菭', '', '水衣，菭也。', '', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2756, '夌菜;藻', '', '夌菜，藻也。', '', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2757, '蘘荷;尃苴', '葍蒩', '蘘荷，蒪苴{尃苴}[葍蒩]也1。', '[音義-1]：普各。子魚', '釋草', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2758, '藨;鹿藿', '', '藨，鹿藿也。', '', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2759, '弋尾;烏萐;射干', '', '鳶尾{弋尾}1、烏萐2，射干也。', '[音義-1]：悦專\n[音義-2]：所夾', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2760, '木實;酸木;狐桃', '', '木實、酸木，狐桃也。', '', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2761, '烏麮;葍', '', '烏麮1，葍也2。', '[音義-1]：可與\n[音義-2]：腹', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2762, '白立;仇;薋', '', '白苙{白立}、𦬖{仇}，薋也。', '', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2763, '馬帚;屈;馬第', '䓛', '馬帚、屈[䓛]，馬第也。', '', '釋草', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2764, '蔥蒲;莞', '', '蔥蒲，莞也1。', '[音義-1]：丸', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2765, '矜;禽', '', '矜，禽也。', '', '釋草', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2766, '楚;荆', '', '楚，荆也。', '', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2767, '牡荆;曼荆', '', '牡荆，曼荆也。', '', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2768, '榖;楮', '', '榖，楮也。', '', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2769, '栝;柏', '檜', '栝[檜]1，柏也。', '[音義-1]：古末', '釋木', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2770, '道梓;松', '', '道梓，松也。', '', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2771, '梬棗;睪', '', '梬棗，檡{睪}〔也〕1。', '[音義-1]：宅', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2772, '栟櫚;椶', '', '栟櫚，椶也。', '', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2773, '若留;石留;柰', '石留', '楉榴{若留}[石留]、〔石榴{石留}〕，柰也。', '', '釋木', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2774, '末;𣓌', '', '枺{末}1，𣓌也。', '[音義-1]：武蓋', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2775, '含桃;櫻桃', '', '含桃，櫻桃也。', '', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2776, '山李;爵某;爵李;鬱;栘', '', '山李、〔爵〕某1、爵〔李〕，〔鬱〕也。{栘}', '[音義-1]：雀', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2777, '𣐊;樧;黨;越茮;茱萸', '樛', '𣐊[樛]1、樧、欓{黨}、越𣐹{越茮}，茱萸也。', '[音義-1]：考', '釋木', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2778, '朵;株', '', '𣑫{朵}1，株也。', '[音義-1]：丁戈', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2779, '梡;支', '', '梡1，支也。', '[音義-1]：緩', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2780, '枚;棨;條', '', '枚、棨，條也。', '', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2781, '梢;校;棷;柴', '棷;蕘', '梢[棷]1、校[蕘]、棷2，柴也。', '[音義-1]：稍交\n[音義-2]：叉苟', '釋木', '廣雅', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2782, '樵;薪', '', '藮{樵}，薪也。', '', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2783, '茄;枳;叉;股;枝', '枝;杈;箇', '笳{茄}、枳[枝]、叉[杈]、股[箇]，枝也。', '', '釋木', '廣雅', '2;3;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2784, '柯;莖', '', '柯，莖也。', '', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2785, '本;榦', '', '本，榦也。', '', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2786, '肄;𣡌', '', '肄，枿{𣡌}也。', '', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2787, '善;奄;蓲;柰', '殄;氿;歺', '𣜆{善}[殄]1、㭺{奄}、櫙{蓲}[氿]，㮏{柰}[歺]也。', '[音義-1]：之善', '釋木', '廣雅', '1;3;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2788, '僕;蘀;落', '剥', '𦿍{僕}[剥]1、蘀，落也。', '[音義-1]：浦莫', '釋木', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2789, '榛', '', '木藂生曰榛。', '', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2790, '樝;亭;棃', '', '樝、楟{亭}，梨{棃}也。', '', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2791, '𣐽;栗', '', '𣐽，栗也。', '', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2792, '象;柔', '樣', '橡{象}[樣]1，柔也2。', '[音義-1]：象\n[音義-2]：常與', '釋木', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2793, '柚;奏', '柚', '柚，楱{奏}[柚]也1。', '[音義-1]：七候', '釋木', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2794, '雨師;檉;責', '赤', '雨〔師〕、檉1，樍{責}[赤]也2。', '[音義-1]：恥京\n[音義-2]：子狄', '釋木', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2795, '干;柘', '榦', '杆{干}[榦]1，柘也。', '[音義-1]：古旦', '釋木', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2796, '杜仲;曼榆', '緜榆', '杜仲，曼榆[緜榆]也。', '', '釋木', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2797, '重皮;厚朴', '', '重皮，厚朴也。', '', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2798, '木欄;桂欄', '', '木欄，桂欄也。', '', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2799, '益智;龍眼', '', '益智，龍眼也。', '', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2800, '山榆;毋古;柘榆;梗榆;梗', '', '山榆，毋估{毋古}也。柘榆，梗榆也。{梗}', '', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2801, '梔子;肴桃', '', '梔子1，㮁桃{肴桃}也2。', '[音義-1]：支\n[音義-2]：爻', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2802, '宛童;蔦', '', '宛童，寄生樢{蔦}也1。', '[音義-1]：鳥', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2803, '秀龍;巢', '', '秀龍，巢也。', '', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2804, '庳㯕', '', '下支謂之㯅㯕{庳㯕}1。', '[音義-1]：扶支。西', '釋木', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2805, '奇;吉;蟬', '', '䗁{奇}1、蛣{吉}2，蟬也。', '[音義-1]：伎\n[音義-2]：去吉', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2806, '闇蜩;應', '', '闇蜩，𧕄{應}也1。', '[音義-1]：譍', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2807, '勞;蝒;馬蜩;札', '', '蟧{勞}1、蝒2，馬蜩也。蚻{札}。', '[音義-1]：遼\n[音義-2]：緜', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2808, '多蚗;蟪蛄;蛉蛄;帝勞;蛁尞;螇', '', '蛥蚗{多蚗}1，蟪蛄、蛉蛄、𧍝蟧{帝勞}2，蛁蟟{蛁尞}也3。{螇}', '[音義-1]：折穴\n[音義-2]：帝\n[音義-3]：彫', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2809, '蛾蛘;玄蚼;蚼象;敝蜉;螘', '蚍蜉', '蛾蛘1、玄蚼、〔蚼〕蟓{蚼象}、蟞蜉{敝蜉}[蚍蜉]2，螘也3。', '[音義-1]：五何。羊掌\n[音義-2]：匹結。浮\n[音義-3]：五綺', '釋蟲', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2810, '笄;蛾', '', '䗗{笄}1，蛾也。', '[音義-1]：鷄', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2811, '地膽;虵要;青蝥;青蠵;螌蝥;妟青', '', '地膽、虵要1、青𧓿{青蝥}2，青蠵也3。螌𧓿{螌蝥}4，妟青也。', '[音義-1]：蛇\n[音義-2]：茅\n[音義-3]：擕\n[音義-4]：班茅', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2812, '杜伯;刺;𧍣;蚔;䖯;歇', '', '杜伯、𧑖{刺}1、蠆{𧍣}2、〔蚔〕、〔䖯〕，蠍{歇}也3。', '[音義-1]：七漬\n[音義-2]：丑介\n[音義-3]：歇', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2813, '景天;熒火;粦', '', '景天、螢火{熒火}，䗲{粦}也1。', '[音義-1]：力刃', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2814, '蛭各;卷屬;地蠶;蠹;賁;資𧖤', '𧓉𧕐', '蛭蛒{蛭各}1、䖭蠾{卷屬}2、地蠶3、蠹4、蟦{賁}5，蠀螬{資𧖤}[𧓉𧕐]〔也〕6。', '[音義-1]：質。胡格\n[音義-2]：眷\n[音義-3]：雜含反。世人作蠶字，或蝅，或蚕，如此，並失之矣\n[音義-4]：妬\n[音義-5]：浮沸，又肥\n[音義-6]：疾資。曹', '釋蟲', '廣雅', '6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2815, '長麗;衂怩;蚨于;由延', '恧怩', '䗅𧕯{長麗}1、䖡蚭{衂怩}[恧怩]2、蚨虶{蚨于}3，蚰蜒{由延}也4。', '[音義-1]：膓。力支\n[音義-2]：女六。尼\n[音義-3]：鳬紆\n[音義-4]：由延', '釋蟲', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2816, '蛛蝥;网工;屬臾;毒余', '屬蝓', '蛛蝥1、冈工{网工}、蠾𧍳{屬臾}[屬蝓]2，蝳蜍{毒余}也3。', '[音義-1]：牟\n[音義-2]：燭臾\n[音義-3]：毒餘', '釋蟲', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2817, '蛺蜨;敝失', '', '蛺蜨1，蟞蛈{敝失}也2。', '[音義-1]：夾。山頰\n[音義-2]：㬱', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2818, '共;促織;王孫;蜻𧊿', '', '蛬{共}1、趗織{促織}2、蚟孫{王孫}，蜻𧊿也3。', '[音義-1]：恭勇\n[音義-2]：促\n[音義-3]：精', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2819, '炙鼠;津姑;螻蜮;象蛉;𠯑螻;螻姑', '鼫鼠;螻蛄', '炙鼠[鼫鼠]、津姑、螻蜮1、蟓蛉{象蛉}、蛞螻{𠯑螻}，螻姑[螻蛄]也。', '[音義-1]：樓。古麥', '釋蟲', '廣雅', '1;6', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2820, '且渠;馬逐;馬玄;馬戔;𢧵且', '馬蠲', '蛆蟝{且渠}1、馬𧏿{馬逐}2，馬蚿{馬玄}[馬蠲]也3。馬䗃{馬戔}4，䘁蛆{𢧵且}也5。', '[音義-1]：子魚。渠\n[音義-2]：逐\n[音義-3]：弦\n[音義-4]：士板\n[音義-5]：節', '釋蟲', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2821, '蠓螉;范;蠭', '', '蠓螉1、〔𧍙{范}〕，蜂{蠭}也。', '[音義-1]：蒙翁', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2822, '医;意;幼蛻;土蠭;翳螉;𧒘', '', '𧏽{医}1，䗷{意}也2。蚴蛻{幼蛻}3、土蜂{土蠭}，蠮螉{翳螉}也4。{𧒘}', '[音義-1]：一結\n[音義-2]：憶\n[音義-3]：幽悦\n[音義-4]：烏結。翁', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2823, '尺蠖;資就', '', '尺蠖，蠀𧑙{資就}也1。', '[音義-1]：即。酒六', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2824, '芈芈;齕肬;唐蜋', '堂蜋', '芈芈、齕肬1，螗蜋{唐蜋}[堂蜋]也。', '[音義-1]：痕之', '釋蟲', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2825, '尃焦;鳥洟;冒焦;票蛸', '𧓎蛸', '䗚蟭{尃焦}1、鳥洟2、冒焦，螵蛸{票蛸}[𧓎蛸]也3。', '[音義-1]：博焦\n[音義-2]：他帝\n[音義-3]：婢消。消', '釋蟲', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2826, '蟅莽;𧎢;螽;蝗', '', '蟅蟒{蟅莽}1，𧊇{𧎢}也2。螽3，蝗〔也〕4。', '[音義-1]：柘猛\n[音義-2]：他則\n[音義-3]：之戎反\n[音義-4]：皇，又華孟', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2827, '𧌻蝑;春黍', '', '𧌻蝑1，蠢𧒁{春黍}也2。', '[音義-1]：粟容。胥，又思呂反\n[音義-2]：舂黍', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2828, '即且;吳公', '', '蝍蛆{即且}1，吳公也。', '[音義-1]：即。子餘', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2829, '蜻蛉;即蛉;倉螘', '桑根', '蜻蛉、蝍蛉{即蛉}，倉螘[桑根]也。', '', '釋蟲', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2830, '蛷叜;務蛷', '', '蛷螋{蛷叜}1，𧐙蛷{務蛷}也2。', '[音義-1]：求。所留\n[音義-2]：霧求', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2831, '匿;能;蝱', '齧;齧', '䘌{匿}[齧]1、䘅{能}[齧]2，蝱也。', '[音義-1]：女陟\n[音義-2]：乃得', '釋蟲', '廣雅', '1;2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2832, '刺覓;蜰;蜚蟅;蜚螊', '', '𧌐𧐎{刺覓}，蜰也1。飛蟅{蜚蟅}，飛蠊{蜚螊}也2。', '[音義-1]：肥\n[音義-2]：廉', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2833, '朝秀;孳母', '朝菌', '朝蜏{朝秀}[朝菌]1，孳母也2。', '[音義-1]：秀\n[音義-2]：兹', '釋蟲', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2834, '孑孓;蜎', '', '孑孓，蜎也1。', '[音義-1]：烏泫', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2835, '丘蚓;夗蟺;䗇;衍', '曲蚓;曲;蚓', '蚯蚓{丘蚓}[曲蚓]1、蜿蟺{夗蟺}2、〔䗇[曲]〕，〔𧍢{衍}[蚓]〕也3。', '[音義-1]：邱引\n[音義-2]：宛。時湎\n[音義-3]：引典', '釋蟲', '廣雅', '1;3;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2836, '負蠜;蟅', '婦蟠', '負蠜{婦蟠}1，蟅也2。', '[音義-1]：煩\n[音義-2]：之夜', '釋蟲', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2837, '虎王;蝟', '', '虎王，蝟也1。', '[音義-1]：謂', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2838, '沙蝨;便旋', '', '沙蝨，𧍲䗠{便旋}也1。', '[音義-1]：便旋', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2839, '天社;羌蜋', '𧍕蜋', '天社，蜣蜋{羌蜋}[𧍕蜋]也。', '', '釋蟲', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2840, '白魚;丙魚;蟫', '', '白魚，蛃魚{丙魚}也1。{蟫}', '[音義-1]：步幸', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2841, '土蛹;蠁蟲', '', '土蛹1，蠁蟲也2。', '[音義-1]：勇\n[音義-2]：許兩', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2842, '樗鳩;樗鷄', '', '樗鳩，樗鷄也。', '', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2843, '蝮育;蛻', '', '蝮蜟{蝮育}1，蛻也2。', '[音義-1]：扶福。育\n[音義-2]：始悅、始芮', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2844, '無禺;魚伯;青蚨', '', '蟱𧍪{無禺}1、魚伯，青蚨也2。', '[音義-1]：無。牛俱\n[音義-2]：附于', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2845, '平;維;盍沓;蛘', '', '蚲{平}1、䗽{維}2、䗘𧌏{盍沓}3，蛘也4。', '[音義-1]：平音\n[音義-2]：羊悸\n[音義-3]：古臘反。大臘\n[音義-4]：羊掌', '釋蟲', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2846, '鯸𦣞;可', '鯸鮐', '鯸䱌{鯸𦣞}[鯸鮐]1，魺{可}〔也〕2。', '[音義-1]：侯頤\n[音義-2]：河', '釋魚', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2847, '氐;魧;唐;魠', '鱨', '𩶅{氐}1、魧2、𩹶{唐}[鱨]3，魠也4。', '[音義-1]：齒之\n[音義-2]：航\n[音義-3]：唐\n[音義-4]：託', '釋魚', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2848, '鮷;是;鮎', '鮷', '鮷1、鯷{是}[鮷]2，鮎也3。', '[音義-1]：啼\n[音義-2]：締\n[音義-3]：那縑', '釋魚', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2849, '鱺;陽;鮦', '𩽵', '鱺[𩽵]1、鰑{陽}2，鮦也3。', '[音義-1]：離，又力兮\n[音義-2]：陽\n[音義-3]：重', '釋魚', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2850, '責;鮒', '𩺀', '鰿{責}[𩺀]1，鮒也2。', '[音義-1]：積\n[音義-2]：附', '釋魚', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2851, '鰱;鱮', '', '鰱1，鱮也2。', '[音義-1]：力延\n[音義-2]：嶼', '釋魚', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2852, '共;昆', '鰥', '䱋{共}1，鯤{昆}[鰥]也。', '[音義-1]：居冢', '釋魚', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2853, '鮊;喬;鯫', '杲', '鮊1，鱎{喬}[杲]也2。{鯫}', '[音義-1]：音白\n[音義-2]：奇兆', '釋魚', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2854, '后;𩸄;虔', '', '鮜{后}1，𩸄也2。大𩸄謂之鰬{虔}3。', '[音義-1]：乎豆\n[音義-2]：乎寡\n[音義-3]：虔', '釋魚', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2855, '溥浮;䱡', '', '𩹲䱐{溥浮}1，䱡也2。', '[音義-1]：普姑。副周\n[音義-2]：菊', '釋魚', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2856, '石首;㚇;鮸', '', '石首，鯼{㚇}也1。{鮸}', '[音義-1]：子公', '釋魚', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2857, '𩹾;鯢', '', '魶{𩹾}1，鯢也2。', '[音義-1]：那臘\n[音義-2]：五兮', '釋魚', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2858, '竹頭;爭', '青', '竹頭，䱢{爭}[青]也1。', '[音義-1]：側耕', '釋魚', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2859, '鬲;鰅', '鱳', '𩹺{鬲}[鱳]1，鰅〔也〕2。', '[音義-1]：來旳\n[音義-2]：魚恭', '釋魚', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2860, '亭;𠄌', '', '𩹇{亭}1，䰲{𠄌}也2。', '[音義-1]：亭\n[音義-2]：於八', '釋魚', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2861, '黑鯉;卑', '', '黑鯉謂之䱝{卑}1。', '[音義-1]：步佳', '釋魚', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2862, '羞;䱂;奧;鰌', '鰌;䱂', '鱃{羞}[鰌]1、䱂2、𩼈{奧}[䱂]3，鰌也。', '[音義-1]：秋\n[音義-2]：要\n[音義-3]：奧', '釋魚', '廣雅', '1;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2863, '夌;鯉', '', '鯪{夌}1，鯉也。', '[音義-1]：陵', '釋魚', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2864, '蛤解;盧廛;可蠪;蜤易', '', '〔蛤〕解、蠦𧔊{盧廛}1、蚵蠪{可蠪}2，蜤蜴{蜤易}也3。', '[音義-1]：力乎。廛\n[音義-2]：何龍\n[音義-3]：析', '釋魚', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2865, '虺;奎', '虫', '虺[虫]，蝰{奎}也1。', '[音義-1]：口圭', '釋魚', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2866, '蛟龍;應龍;秋龍;它龍', '虯龍;螭龍', '有鱗曰蛟龍，有翼曰應龍，有角曰𪓔龍{秋龍}[虯龍]1，無角曰𡖟龍{它龍}[螭龍]2。龍能高能下、能小能巨、能幽能明、能短能長，淵深是藏，𢾭和其光。', '[音義-1]：巨彪\n[音義-2]：恥支', '釋魚', '廣雅', '3;4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2867, '爪;龜', '', '爪，龜也。', '', '釋魚', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2868, '鼃;蟈;長股', '', '鼃1、蟈2，長股也。', '[音義-1]：獲叉\n[音義-2]：古獲', '釋魚', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2869, '去父;苦蠪;胡蜢;鼃;蝦蟆', '胡黽', '〔去〕蚥{去父}1、苦蠪、胡蜢[胡黽]2、鼃，蝦蟆也3。', '[音義-1]：甫\n[音義-2]：孟\n[音義-3]：霞麻', '釋魚', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2870, '捕;蟹;蛫;良豈;博帶', '', '蜅{捕}1、蟹2，蛫也3。其雄曰𩷕䱺{良豈}4，其雌曰博帶。', '[音義-1]：甫\n[音義-2]：乎買\n[音義-3]：古彼\n[音義-4]：郎。下哀', '釋魚', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2871, '陛;𧊧;薄盧;螷;蜾', '', '蜌{陛}1、𧊧2，薄盧也。{螷}、{蜾}', '[音義-1]：陛\n[音義-2]：閤', '釋魚', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2872, '蠡蠃;蝸牛;虒蝓', '', '蠡蠃1、蝸牛2，螔蝓{虒蝓}也3。', '[音義-1]：力兮。洛戈\n[音義-2]：瓜\n[音義-3]：移瑜', '釋魚', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2873, '猝;鯈', '', '䱣{猝}1，鯈也2。', '[音義-1]：子律\n[音義-2]：條', '釋魚', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2874, '射工;短狐;蜮', '短弧', '射工、短狐[短弧]，蜮也1。', '[音義-1]：域', '釋魚', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2875, '魾;𥝤', '', '〔魾，鯬{𥝤}也。〕', '', '釋魚', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2876, '玄鳥;朱鳥;燕', '', '玄鳥、朱鳥，燕也。', '', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2877, '單圭;買危;子規', '子巂', '鷤䳏{單圭}1、鷶𪀗{買危}2，子鳺{子規}[子巂]也3。', '[音義-1]：弟，又啼。古惠、古二\n[音義-2]：買。古彼\n[音義-3]：規', '釋鳥', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2878, '擊穀;秸𪈓;布穀', '', '擊穀、鴶𪈓{秸𪈓}1，布穀也。', '[音義-1]：古八、居一反。菊', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2879, '𪆃;鶚;斬;鷲;雕', '', '𪆃1、鶚2、䳻{斬}3、鷲4，鵰{雕}也5。', '[音義-1]：團\n[音義-2]：五名\n[音義-3]：慙\n[音義-4]：就\n[音義-5]：彫', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2880, '肥鵂;鴟鵂;怪鴟', '', '肥鵂1、鴟鵂2，怪鴟也。', '[音義-1]：休\n[音義-2]：齒之', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2881, '鵂鶹;茅鴟;尨', '', '〔鵂鶹〕1、鶜鴟{茅鴟}2，𪁪{尨}〔也〕3。', '[音義-1]：盧休\n[音義-2]：茅\n[音義-3]：莫講', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2882, '鷳;鴟;老兔', '', '鷳1、鴟，老鵵{老兔}也2。', '[音義-1]：閒\n[音義-2]：兔', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2883, '背竈;草帔;雚雀', '', '背竈、皁帔{草帔}，雚雀也。', '', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2884, '末;鶩;匹;龍;鳧;鶩;邑', '鴨', '𩿣{末}[鶩]1、鴄{匹}2、鸗{龍}3、鳬{鳧}、鶩，𪁨{邑}[鴨]也4。', '[音義-1]：末\n[音義-2]：匹\n[音義-3]：龍\n[音義-4]：於甲', '釋鳥', '廣雅', '7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2885, '𪀉鵝;倉𪀉;鴈', '', '𪀉鵝1、倉𪀉，鳫{鴈}2也。', '[音義-1]：加\n[音義-2]：五諫。案：雁字亦如此，又鴈字', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2886, '鵻;鷻', '', '〔鵻〕1，鶉{鷻}也。', '[音義-1]：隹', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2887, '鴑;䨄', '', '鴽{鴑}1，䳺{䨄}也2。', '[音義-1]：如\n[音義-2]：烏含', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2888, '良皋;鳩;鶻鵃;頒鳩;役鳩;癸鳩;鸊皋;孚鳩;匊鳩', '', '𪁜鷎{良皋}1，鳩也。鶻鵃2，𪂽鳩{頒鳩}也3。𪁛鳩{役鳩}4、䳫鳩{癸鳩}5、鸊鷱{鸊皋}、䳕鳩{孚鳩}6，鵴鳩{匊鳩}也7。', '[音義-1]：郎高\n[音義-2]：滑骨。鵰，又竹交\n[音義-3]：瓫\n[音義-4]：役\n[音義-5]：葵\n[音義-6]：浮\n[音義-7]：菊', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2889, '帝肩;鷸子;籠脫;鷂', '', '鶙鵳{帝肩}1、鷸子2、籠脫，鷂也3。', '[音義-1]：弟、啼二音\n[音義-2]：述\n[音義-3]：筵照', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2890, '戴鳻;戴任;畐丕;澤虞;或畐;尸鳩;戴勝', '', '戴鳻、戴絍{戴任}、鶝鴀{畐丕}1、澤虞、𪂉鶝{或畐}、尸鳩，戴勝也。', '[音義-1]：福。不尤', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2891, '鷦𪃦;寧鴂;蜾蠃;桑飛;女匠;工雀', '', '鷦𪃦1、鸋鴂{寧鴂}2、果鸁{蜾蠃}3、桑飛、女𪀘{女匠}4，工雀也。', '[音義-1]：焦。弭沼\n[音義-2]：乃定。决\n[音義-3]：力果\n[音義-4]：匠', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2892, '城旦;倒縣;渴鴠;定甲;獨舂;旱鴠', '', '城旦、倒縣、鶡鴠{渴鴠}1、定甲、獨舂、䳚鴠{旱鴠}也2。', '[音義-1]：曷旦\n[音義-2]：苦汗。旦', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2893, '石鳥;精列;雝𪆫;雃', '', '䲽鳥{石鳥}1、精列、𪇉𪆂{雝𪆫}2，雃也3。', '[音義-1]：石\n[音義-2]：邕渠\n[音義-3]：邱莖', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2894, '慈鳥;烏', '', '慈鳥，烏也。', '', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2895, '秋子;𦎦;鷇;雛', '', '䨂子{秋子}1、䨁{𦎦}2、𩀠{鷇}3，雛也。', '[音義-1]：子幽\n[音義-2]：務\n[音義-3]：苦候', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2896, '干鵠;䧿', '雗鷽', '䧲鵠{干鵠}[雗鷽]1，䧿也。', '[音義-1]：古篤', '釋鳥', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2897, '野鷄;雉', '', '野鷄，鴙{雉}也。', '', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2898, '伏翼;飛鼠;仙鼠;式墨', '戠墨', '伏翼、飛鼠、仙鼠，𧊖䘃{式墨}[戠墨]也1。', '[音義-1]：尸墨。墨', '釋鳥', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2899, '丣中;飛鸓', '', '𪆱𩿀{丣中}1，飛鸓也2。', '[音義-1]：留仲\n[音義-2]：力追', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2900, '鸊鷉;鶻鷉', '', '鸊鷉1，鶻鷉也。', '[音義-1]：布獲反。梯', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2901, '鴆鳥;運日;陰諧', '', '鴆鳥1，其雄謂之運日，其雌謂之陰諧。', '[音義-1]：沈之去聲', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2902, '鳳皇', '', '鳳皇，鷄頭、燕頷、虵頸、鴻身、魚尾、骿翼。五色以文：〔首文〕曰德、翼文曰順、背文曰義、腹文曰信、膺文曰仁。雄鳴曰卽卽，雌鳴曰足足，昏鳴曰固常，晨鳴曰發明，晝鳴曰保長，舉鳴曰上翔，集鳴曰歸昌。', '', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2903, '翳鳥;鸞鳥;鷫鷞;鸑鷟;鴰筩;鵕䴊;廣昌;鷦明;鳳皇', '', '翳鳥、鸞鳥、鷫鷞、鸑鷟、鴰筩1、鵕䴊、廣昌、鷦明，鳳皇屬也。', '[音義-1]：古活。動', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2904, '妻賏;炎離;延居;巠雀', '', '鶈鸎{妻賏}1、𪂈離{炎離}2、延居、鵛雀{巠雀}，怪鳥屬也。', '[音義-1]：妻\n[音義-2]：餘占反', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2905, '鷦;禽', '', '鷦，禽也。', '', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2906, '車搹;鵻札', '', '車搹1，鵻札也。', '[音義-1]：隔', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2907, '䋣烏;鴞', '', '𪄴鳥{䋣烏}1，鴞也。', '[音義-1]：煩', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2908, '伯趙;鶪', '', '伯趙，鶪也。', '', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2909, '白鷢;鷹', '', '〔白鷢，鷹也。〕', '', '釋鳥', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2910, '於䖘;李耳;虎', '', '於𧇢{於䖘}1、李耳，虎也。', '[音義-1]：烏塗', '釋獸', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2911, '貔;貍;貓', '', '貔1、貍，貓也。', '[音義-1]：毗', '釋獸', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2912, '丕;貍', '', '豾{丕}1，貍也。', '[音義-1]：丕', '釋獸', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2913, '貒;貛', '', '貒1，貛也2。', '[音義-1]：湍\n[音義-2]：歡', '釋獸', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2914, '柔;狙;尔猴;爲', '夒;母猴', '猱{柔}[夒]、狙1，猕猴{尔猴}[母猴]也。{爲}', '[音義-1]：七餘', '釋獸', '廣雅', '1;3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2915, '吏;𮙩', '', '𧳅{吏}1，𮙩也。', '[音義-1]：山吏', '釋獸', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2916, '𣬎;央', '', '𣬎1，𧲱{央}也2。', '[音義-1]：決\n[音義-2]：烏郎', '釋獸', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2917, '豨;豠;豭;彘;豕', '', '豨、豠1、豭、彘，豕也。', '[音義-1]：才胡', '釋獸', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2918, '豯;冥;豰;𢄉', '', '豯1、𧱴{冥}2、豰3，𢄉也4。', '[音義-1]：奚\n[音義-2]：瞑\n[音義-3]：乎谷\n[音義-4]：屯', '釋獸', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2919, '穴;蜼', '蜼', '狖{穴}[蜼]1，蜼也2。', '[音義-1]：柚\n[音義-2]：誄', '釋獸', '廣雅', '1', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2920, '艾豭;豕牡', '', '𧰿豭{艾豭}1，〔豕牡〕也。', '[音義-1]：艾', '釋獸', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2921, '箑;鯫;豕牝', '', '𧲌{箑}1、䝒{鯫}2，豕牝也。', '[音義-1]：山甲\n[音義-2]：仕禹', '釋獸', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2922, '竲;圈', '', '橧{竲}1，圈也2。', '[音義-1]：繒\n[音義-2]：奇勉', '釋獸', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2923, '麇;麞', '', '麇，麞也。', '', '釋獸', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2924, '麛;需', '𪋐', '麛1，𪋯{需}[𪋐]也2。', '[音義-1]：迷\n[音義-2]：奴侯', '釋獸', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2925, '元;婏;孺;兔子', '', '𠒢{元}1、婏2、䨲{孺}3，兔子也。', '[音義-1]：五丸\n[音義-2]：匹萬\n[音義-3]：乃侯', '釋獸', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2926, '㹪;狼', '', '㹪1，狼也。', '[音義-1]：所姦', '釋獸', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2927, '獱;獺', '', '獱1，獺也2。', '[音義-1]：頻\n[音義-2]：勑轄，又闥', '釋獸', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2928, '蹏;蹢', '蹏', '蹏1、蹢[蹏]2、（', '[音義-1]：啼\n[音義-2]：旳', '釋獸', '廣雅', '2', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2929, '騭;牡;啻;特;羝;豭;咅;雄', '', '騭、牡、㹍{啻}1、特、羝、豭2、犃{咅}3，雄也。', '[音義-1]：狄\n[音義-2]：加\n[音義-3]：部', '釋獸', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2930, '舍;字;牝;雌', '', '𤙱{舍}1、牸{字}、牝，雌也。', '[音義-1]：舍', '釋獸', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2931, '騬;犗;羯;𣎵;豶;猗;孱;攻;羯', '鏟', '騬1、犗、羯、䍨{𣎵}2、豶3、猗4、𠟉{孱}[鏟]5、攻，㹇{羯}6也。', '[音義-1]：酬陵、似陵二反\n[音義-2]：鉢\n[音義-3]：墳\n[音義-4]：於宜\n[音義-5]：叉進\n[音義-6]：居言', '釋獸', '廣雅', '7', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2932, '𪊺', '', '𪊺，狼題肉角，含仁懷義，音中鐘呂，行步中規，折還中榘，遊必擇土，翔必後處，不履生蟲，不折生草，不羣居，不旅行，不入陷穽，不羅罘罔，文章彬彬。', '', '釋獸', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2933, '隹鼠;䶂鼠;鼫鼠;偃鼠;鼢鼠;鼠狼;鼬;陽鼠;𪕎鼠;䶄鼠;𪕶鼠;韱𪕱;尃唐;冋令;白𪖇;㱿;業攴;夋鼠;耳鼠;鼲鼠;䶃鼠;𪕚鼠', '斬𪕱', '𪕪鼠{隹鼠}1。䶂鼠2。鼫鼠。鼴鼠{偃鼠}，鼢鼠3。鼠狼，鼬4。陽鼠。𪕎鼠5。䶄鼠6。𪕶鼠7。𪖎𪕱{韱𪕱}[斬𪕱]8。䶈𪕹{尃唐}9。𪕍𪕌{冋令}10。白𪖇11。𪕷{㱿}12。𪖊𪔿{業攴}13。𪕞鼠{夋鼠}14。𪕔〔鼠〕{耳鼠}15。鼲鼠16。𪕛鼠{䶃鼠}17。𪕚鼠18。', '[音義-1]：隹\n[音義-2]：爵\n[音義-3]：墳\n[音義-4]：由溜\n[音義-5]：如勇\n[音義-6]：瓶\n[音義-7]：於革\n[音義-8]：讒乎\n[音義-9]：博唐\n[音義-10]：古熒。零\n[音義-11]：煩\n[音義-12]：谷\n[音義-13]：卜攴\n[音義-14]：音俊\n[音義-15]：耳\n[音義-16]：古門\n[音義-17]：胡貪\n[音義-18]：柳', '釋獸', '廣雅', '12', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2934, '豵;豝;肩;特', '豜', '獸一歲爲豵，二歲爲豝，三歲爲肩[豜]，四歲爲特。', '', '釋獸', '廣雅', '3', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2935, '貀;豹', '', '〔貀，豹也。〕', '', '釋獸', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2936, '驙;馼;飛黃;騶吾;吉量;朱駮;飛兔;金喙;要褭;走狐;駃騠;飛鴻;野麋;腹丹;騏驥;緑耳;華駵;北𤛿;汗血;驒騱;巨虛;騀鹿', '', '白馬黑脊，驙1。白馬朱鬛，馼。飛黃。騶吾。吉𣊹{吉量}。朱駮。飛兔。金喙、騕褭{要褭}。走狐。駃騠2。飛鴻。野麋。腹丹。騏驥。騄駬{緑耳}。驊騮{華駵}。駣𩥴{北𤛿}3。汗血。驒騱4。巨虛。騀鹿。', '[音義-1]：大安、知連\n[音義-2]：決啼\n[音義-3]：力兮\n[音義-4]：顛', '釋嘼', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2937, '郭丩;丁犖', '', '𨞥㸨{郭丩}。丁犖。', '', '釋嘼', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2938, '牡䍮;羝;字䍮;牂', '', '吳羊牡一歲曰牡䍮，三歲曰羝；其牝一歲曰牸䍮{字䍮}，三歳曰牂。', '', '釋嘼', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2939, '尃;羯', '', '吳羊犗1曰䍸{尃}2，羖3羊犗曰羯。', '[音義-1]：古轄\n[音義-2]：博\n[音義-3]：古', '釋嘼', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2940, '羍;𦎦;羜;巽;羔;羔皮;泠角', '跧', '羍1、𦎦2、羜、䍻{巽}[跧]3，羔也。羔皮。泠角4。', '[音義-1]：撻\n[音義-2]：務\n[音義-3]：辛兗\n[音義-4]：零', '釋嘼', '廣雅', '4', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2941, '頓丘;梁聶;重顱;豲', '', '頓丘。梁䝕{梁聶}1。重顱2。豲3。', '[音義-1]：之涉\n[音義-2]：盧\n[音義-3]：原', '釋嘼', '廣雅', '', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2942, '殷虞;晉獒;楚黃;韓黸;宋足;狼狐;㹥;賁', '宋䧿', '殷虞。晉獒。楚黃1。韓獹{韓黸}。宋㹱{宋足}[宋䧿]2。狼狐。㹥3。獖{賁}4。', '[音義-1]：楚有犬名女黃\n[音義-2]：七勺反\n[音義-3]：霔\n[音義-4]：扶粉', '釋嘼', '廣雅', '5', 'null', 'null');
INSERT INTO `t_han_nga` VALUES (2943, '辟氏;鷄;杜艾;季蜀', '', '辟𨾛{辟氏}1，鷄也。杜艾。季蜀。', '[音義-1]：避。渠夷', '釋嘼', '廣雅', '', 'null', 'null');
